var book = {
	"name": "ၥ စၫမုၫအ့လၭ",
	"numChapters": 31,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> တၭၦလဂၩအီၪဝ့ၫလၧရၫမၭၥံၫ့ဇိဖံၫ့အဖၧၩ့ လၧခိၪ လီၩ့အံဖြံၫ့အလီၩ့နီၪ, အမံၩ့မွဲစအ့လကၫနၫ, စယ့ၫရိ ဟၫ့အဖိၪခွၫ, စအံၫလဲဟုၫအဖိၪခွၫ, စတိဟုၫအဖိၪ",
			"2": "<sup>2</sup> ခွၫ,စဇုၭအဖိၪခွၫ, ၦအ့ဖၭဖိၪလဂၩလီၫ.- တၭအဝ့ၫ ဒၪနီၪအီၪလၧအမၫ နံၫဂၩလီၫ. အလဂၩ အမံၩ့မွဲနး ဟၫ့နၫတၭ, အဝ့ၫလဂၩအမံၩ့မွဲနးပနဲနၫလီၫ. တၭနး ပနဲနၫနီၪအီၪလၧအဖိၪလဖၪ အ့ၪမွဲနးဟၫ့နၫလဂၩအ ဖိၪအီၪအ့ၬ.",
			"3": "<sup>3</sup> တၭၦလဂၩနီၪစဲၪ့ထၪ့ခွံၬလၧအဒိၩ့ဖၧၩ့ လနံၪ့ဘၪ လနံၪ့ဘဲၫၥိၭအမိဘိၪ့ဆၧဘၩဆၧ ဒဲလုထၪ့ဆၧလၧၥုၭ မုခမျၧးၥံၪအယဟိဝၩအဂး, လၧၡဲလိၫအဖၧၩ့လီၫ.စ အံလဲၫအဖိၪခွၫနံၫဂၩ, စဟီၭဖနံၫ, ဒဲစဖံနအၭ, ယဟိ",
			"4": "<sup>4</sup> ဝၩအၡၩလုဆၧလဖၪအီၪဝ့ၫထီးနီၪလီၫ.- မုလနံၩလၧ စအ့လကၫနၫလုထၪ့ဆၧနီၪ, မွဲအဖ့ၪလၫ့အမၫနးပနဲ နၫ,ဒဲအဖိၪခွၫ, ဒဲအဖိၪမုၪထီးအလူၬ လၧဆၧအဂးလ",
			"5": "<sup>5</sup> ဖၪလီၫ.- အ့ၪမွဲနးဟၫ့နၫနီၪ, ဖ့ၪလၫ့ဝ့ၫလၧဆၧအဂး လၩ့မဲၩဒၪဆၧနီၪ, မွဲလၧအအဲၪနးဟၫ့နၫအကၠီၩ့လီၫ. မွဲလါနၫ့ ယဟိဝၩကၭဘံၭထၬယူၭ အဒၧၩ့လးလီၫ.",
			"6": "<sup>6</sup> တၭအဆၧၡၪ့ဆၧနၭ မၩခိမၩဝီၩဝ့ၫ, ဒဲမၩဆၫအၥၭ နၭနၭလ့ၬလၧယဟိဝၩ ကၭဘံၭထၬအဒၧၩ့လးအကၠီၩ့",
			"7": "<sup>7</sup> လီၫ.- ဆၧမၩအၥၭဘဲၫနီၪလနံၪ့ဘၪလနံၪ့ ထီးအလ့ၩ ထၪ့လၧယဟိဝၩအဂံၪ့တၭ, ဆၧမၩခိမၩဝီၩအၥၭ ဘဲၫနီၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, အမ့ၬထံၫလၩ့တၭ,",
			"8": "<sup>8</sup> အၪ့ဆၧအ့ၬ.- တၭအဝၩစအ့လကၫနၫစံၭအဝ့ၫ, နး ဟၫ့နၫဧ့, နမ့ၬထံၫလၩ့နီၪမွဲဘၪလဲၪ. နလအၪ့ဘၪဆၧ နီၪမွဲအဂဲးဘဲၫၥ့ၪလဲၪ. တၭနၥၭဆၫနီၪမွဲဘၪလဲၪ. ယ ဝ့ၫဒၪယီၩ ယဂ့ၩနဲၪ့ဖိၪခွၫဆံၫဂၩလၧနဂး, မွဲအ့ၬဧၪ.",
			"9": "<sup>9</sup> တၭအဝ့ၫၥံၪအၪ့ဆၧ ဒဲအီၩဆၧလၧၡဲလိၫအလးခဲၫ့ နီၪနးဟၫ့နၫဂဲထုၪ့ဝ့ၫလီၫ. (ၦလုဆၧစအံလဲၫလဂၩနီၪ ဆၧၫ့နၩ့ဝ့ၫလၧလးဆၧၫ့နၩ့ဖၫ့ခိၪ လၧယဟိဝၩအဆၧ",
			"10": "<sup>10</sup> လုဂံၪ့အထုၪ့အနဲၩ့ထံၭတၭ,)- ၦမုၪနီၪအၥၭဆၫနၭ နၭလ့ၬတၭ, ဘၩဆိၪဖၪယဟိဝၩနီၪ, အမ့ၬထံၫလၩ့နၭ",
			"11": "<sup>11</sup> မၬလီၫ.- အဝ့ၫဒၪဆိၪလၩ့အၥၭတၭ, စံၭဝ့ၫဒၪ,ဆၧၥုၭ မုခမျၧးအယဟိဝၩဧ့, နအ့ၪယိလၩ့တၡါနဎီးမုၪအ ဆၧနၭဆၧၡၪ့တၭ, နၪ့ထၪ့ထဲၩ့ယၧၩဒဲလၥၭနၪ့ဘၪနဎီး မုၪ,အ့ၪမွဲဖ့ၪလၫ့နဎီးမုၪလၧအဖိၪခွၫတၭ, ယမိဖ့ၪလၫ့ အဝ့ၫလၧယဟိဝၩ လဆိၩဒၪအၥၭတၭ မိလိၩ့ဘၪအ ခိၪလၧဒီၩဆ့အ့ၬ.",
			"12": "<sup>12</sup> ဆၧမၩအၥၭလၧအဘၩဆိၪဖၪအၪအၪလ့ၬ လၧယ",
			"13": "<sup>13</sup> ဟိဝၩအမ့ၬယၫတၭ, စအံလဲၫယိနဲၪ့အနိၭလီၫ.- တၭ နးဟၫ့နၫချဲၩ့ဆၧလၧအၥၭဖၧၩ့တၭ, ဂဲၩန့ၫအနိၭဖျံၩ နီၪ,အ့ၪမွဲအလူနီၪဂၧၫ့ထၪ့အ့ၬ. မၩအၥၭဘဲၫနီၪတၭ,",
			"14": "<sup>14</sup> စအံလဲၫဆီၫ့မီၪ့ဝ့ၫလၧအအီၩမၧၩ့အၥၭလီၫ.- တၭစအံ လဲၫစံၭအဝ့ၫ, နမိအီၩမၧၩ့နၥၭဆံၭယံၬလဲၪ. အီၪက့ၪ",
			"15": "<sup>15</sup> ခွံၬနစဘံၭထံၫလၧနအီၪဘီၪ.- တၭနးဟၫ့နၫစံၭဆၧၫ့ ဝ့ၫဒၪ,မွဲအ့ၬ, ကဆါဧ့,ယမွဲၦမုၪ လၧအၥၭအုၭဝ့ၫလ ဂၩတၭ,စဘံၭထံၫမွဲဂ့ၩ, ၥံၭထံၫဂၬထံၫမွဲဂ့ၩ, ယအီၩ ဘၪဆ့အ့ၬ. အ့ၪမွဲယလူၫလၩ့ယၥၭ လၧယဟိဝၩအ",
			"16": "<sup>16</sup> မ့ၬယၫလီၫ.- အီၪက့ၪနခ့ၫနၡၩမုၪ လၧဘၫအလၭအ ဖိၪမုၪလဂ့ၩ. အဂဲးဘဲၫယီၩလၧယဆီၫ့မီၪ့ဆၧအၪတၭ ယၥၭအုၭဆၧဖၭဒိၪအကၠီၩ့နီၪ ယချဲၩ့ဆၧခီးဘိၩ့နဲၪ့",
			"17": "<sup>17</sup> ယီၩလီၫ.- စအံလဲၫချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ,လ့ၩ ဆၧမုၬမုၬဘီၪး တၭမွဲအံၫစရ့လၭအယွၩဖ့ၪလၫ့ဆၧ",
			"18": "<sup>18</sup> အၪ့ကံၩ့လၧနအၪ့ကံၩ့လၧအဝ့ၫဒၪဆံၭ.- တၭၦမုၪစံၭ ဝ့ၫဒၪ,မွဲနခ့ၫနၡၩမုၪဒၪန့ဆၧအခိးအတၩ လၧနမ့ၬယၫ ဆံၭ.တၭၦမုၪနီၪလ့ၩဆၧဒဲအၪ့ဆၧတၭ, အမ့ၬၥံၫယူၭ လၧၩ့အ့ၬ.",
			"19": "<sup>19</sup> ဆၧဖၩ့ထၪ့နီၪ အဝ့ၫၥံၪဂဲထုၪ့ဂီၩဂီၩတၭ, ဘိၪ့ထၪ့ ဘၩထၪ့ဆၧလၧယဟိဝၩအမ့ၬယၫတၭ, ထဲၩ့ထဲၩ့ဝ့ၫ လၧအဂံၪ့လၧရၫမၫနီၪလီၫ. စအ့လကၫနၫၥ့ၪယၫအ",
			"20": "<sup>20</sup> မၫနးဟၫ့နၫတၭ, ယဟိဝၩနၪ့ထၪ့ထဲၩ့ဝ့ၫလီၫ.- တၭ လၧမုနံၩလဖၪနီၪ ထီးအဆၧၫ့အထီဘၪ လၧနးဟၫ့နၫ ဒၧၩ့ထၪ့အလးခဲၫ့နီၪ, အီၪဖျဲၪန့အဖိၪခွၫတၭ, ဖျိၬဝ့ၫအ မံၩ့လၧစစၫမုၫအ့လၭလီၫ. စံၭဝ့ၫဒၪ, အဂဲးဘဲၫယီၩ ယအၪ့ကံၩ့န့အဝ့ၫလၧယဟိဝၩလီၫ.",
			"21": "<sup>21</sup> တၭၦၡၩစအ့လကၫနၫ, ဒဲအၡၩဂံၪ့ဖိၪထီးအလူၬနီၪ လ့ၩထၪ့ဘဲၫၥိၭ အမိလုထၪ့ဆၧလၧယဟိဝၩလနံၪ့အ ဂးလနံၪ့အဂးနီၪ, ဒဲမၩဘိၪ့ဘၪဆဲၫ့လၧအဆိၪလၩ့အ",
			"22": "<sup>22</sup> ၥၭလီၫ.- အ့ၪမွဲနးဟၫ့နၫနီၪလ့ၩထၪ့ဝ့ၫအ့ၬ. အဂဲးဘဲၫ ယီၩစံၭအဝၩ, ဖိၪၥၪလချႃၭလၩ့ၡၪလၧနူဒံၭဘၪတၭ, ယလ့ၩထၪ့ဘၪအ့ၬး ယမိလ့ၩဆိၬဝ့ၫဘဲၫအမိအီၪဖျီၪ လၧယဟိဝၩအမ့ၬယၫ, ဒဲအီၪထီးနီၪ အဆိၩဆိၩအ",
			"23": "<sup>23</sup> ကၠၪကၠၪလီၫ.- တၭအဝၩ စအ့လကၫနၫစံၭဝ့ၫ, မၩ ထီးအဘၪနၥၭဘီၪ. အီၪထီးနမၩလၩ့ၡၪလၧနူနီၪဘီၪ. မွဲန့ၫယဟိဝၩမၩဂုးမၩခၧၫ့လါအလူနီၪဆံၭ. ၦမုၪနီၪ အီၪဝ့ၫတၭ, ဒုၭအၪ့နူအဖိၪထီၩ့လၩ့လၧအမၩလၩ့ၡၪ ဝ့ၫလၧနူနီၪလီၫ.",
			"24": "<sup>24</sup> ထီးအမၩလၩ့ၡၪဝ့ၫလၧအနူနီၪဂီၩ့တၭ, လ့ၩဆိၬ ထၪ့ဎုၬဝ့ၫလၧအၥိၭ, ဒဲချီဖၫဖိၪၥၧၫ့ဒုၩ, ဒဲကိၪမုၬလအ့ ဖၭ,ဒဲစဘံၭထံၫအထိၪ့ဆၧဖံၭလဖျိၪ့တၭ, ဂဲၫဆိၬအ ဝ့ၫလၧယဟိဝၩအအီၪ လၧၡဲလိၫအဖၧၩ့တၭ, ဖိၪၥၪ",
			"25": "<sup>25</sup> အၥၭဘၪ့လီၫ.- အဝ့ၫၥံၪမၩၥံၫချီဖၫလဒုၩတၭ, ဂဲၫဆိၬ",
			"26": "<sup>26</sup> ဖိၪၥၪနီၪလၧစအံလဲၫအအီၪလီၫ.- တၭၦမုၪနီၪစံၭအ ဝ့ၫဒၪ,အိၩ, ယကဆါဧ့, နၥၭမၧၫ့ဝ့ၫ,ယကဆါဧ့,ယမွဲ ၦမုၪလဂၩလၧအဆၧၫ့ထုၪ့ ဘၩဆိၪဖၪလၧယဟိဝၩ",
			"27": "<sup>27</sup> လၧနနဲၩ့ထံၭထီးယီၩလီၫ.- ယဘၩဆိၪဖၪလၧဖိၪၥၪ လဂၩယီၩအဂးတၭ, ယဟိဝၩဖ့ၪလၫ့ဆၧလၧယအၪ့",
			"28": "<sup>28</sup> ကံၩ့ဝ့ၫလီၫ.- တၭယဖ့ၪလၫ့ထဲၩ့ယူၭအဝ့ၫ လၧယဟိ ဝၩ,လဆိၩဒၪအၥၭ မိဘၪဆၧဖ့ၪလၫ့ထဲၩ့ဝ့ၫလၧယ ဟိဝၩလီၫ. တၭအဝ့ၫၥံၪ ဘိၪ့ထၪ့ဘၩထၪ့ယဟိဝၩ ထီးနီၪလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> နးဟၫ့နၫဘၩဆိၪဖၪဆၧတၭ, စံၭဝ့ၫဒၪ, ယၥုၪ့ဎွံၫၥၭယီၫလၧယဟိဝၩအဖၧၩ့, ယနိၩ့ဘၪဆၧအီၪက့ၪထၪ့ထီၫလၧယဟိဝၩအဖၧၩ့, ယနိၭလဲထၪ့လၧယဒုၪယဒၩအဖၫ့ခိၪး မွဲယၥၭထိၬလၧနဆၧထိးထဲၩ့တၩ့ထဲၩ့အဖၧၩ့လီၫ.",
			"2": "<sup>2</sup> ၦဆံၫ့ဎံၪဘဲၫယဟိဝၩအၥိၭအီၪနးဂၩအ့ၬ. အဂဲးဘဲၫယီၩလၧနၧၩအမ့ၬယၫဆၧအီၪအ့ၬ, လိးၥံၪလဲၫ့ၥံၪဘဲၫပယွၩအၥိၭနီၪအီၪအ့ၬ.",
			"3": "<sup>3</sup> ချဲၩ့လၧၩ့လၧနအီၪက့ၪထၪ့ထီၫနၥၭထီၫထီၫလ့ၬနီၪ လဂ့ၩ, မွဲဆၧချဲၩ့ဖိၫလိၫအထီးထၪ့ဖျ့ၭလၧနၥံၪအနိၭလဂ့ၩး အဂဲးဘဲၫယီၩယဟိဝၩမွဲဆၧၥ့ၪယၫအယွၩတၭ, အဝ့ၫဒၪခံၫ့န့ဆၧမၩလဖၪလီၫ.",
			"4": "<sup>4</sup> ၦအဆီၪ့အချံၪလဖၪခါယူၭဝ့ၫယူၭ, တၭၦအဂဲးဆါ အဘၭဆါနီၪ အယးဒံၩ့ခဲးထူၬအၥၭ လၧဆၧဂဲးဆၧဘၭလီၫ.",
			"5": "<sup>5</sup> ၦလၧအအၪ့ဘျဲၩအၪ့လဖၪနီၪ ဒိၭအၪ့လံၩ့လၩ့အ ၥၭလၧကိၪအဂးလီၫ. တၭၦလၧအၥၭဝံအၥၭနီၪထုၬဝ့ၫဒၪလီၫ. အနီၪတၭ, ၦထူၬဖိၪဆီၫ့အီၪန့ၦနွ့ၫဂၩ, ၦလၧအဖိၪအီၪအၪဂၩနီၪအဂဲးလၩ့ဆါဝ့ၫလီၫ.",
			"6": "<sup>6</sup> ယဟိဝၩမၩၥံၫဆၧ, ဒဲမၩမၧၫ့ဆၧး ဒုၭလ့ၩလၩ့ဝ့ၫလၧဆၧၥွၪခိၪဒဲဒုၭဂဲထုၪ့ထၪ့ထဲၩ့.",
			"7": "<sup>7</sup> ယဟိဝၩမၩၡၪ့မၩယၬဒဲဒုၭကဲၪဒိၪကဲၪၡါ, ဆၪ့လၩ့ဝ့ၫဒဲအီၪက့ၪထၪ့ထီၫဝ့ၫလီၫ.",
			"8": "<sup>8</sup> ဒုၭဂဲၫထၪ့ခွံၬၦၡၪ့ဖိၪလၧဂၪ့ခိၪအမုၬအဖၧၩ့, ဒဲဂဲၫဆိၬထၪ့ခွံၬၦအၪ့ကံၩ့ဆၧဘံၪၥိၭပိၩ့အဖၫ့ခိၪ, ဘဲၫၥိၭအမိအီၪက့ၪဝ့ၫလၧၦဒိၪဖၭဒိၪအကျၩ, ဒဲဒုၭန့ၥၫဝ့ၫလၧလးဆီၩ့ဆီအကယးကဖးလီၫ. အဂဲးဘဲၫယီၩဂၪ့ခိၪအထုၪ့လဖၪမွဲယဟိဝၩအဆၧ, တၭအီၪက့ၪယူၭဂၪ့ခိၪလၧအဝ့ၫၥံၪအဖၫ့ခိၪလီၫ.",
			"9": "<sup>9</sup> အဝ့ၫဒၪခိၭထၬအၡၩဆံၫ့ဎံၪလဖၪအခၪ့, အ့ၪမွဲၦအအၧၩ့အၥၫ့ မိဘၪအီၪလၩ့မါပံၭလၧဆၧခံၭ ကျၩ, မွဲၦၡၩလမၩစၪဘၪဆၧလၧအဂဲးအဘၭအကၠီၩ့.",
			"10": "<sup>10</sup> ၦလၧအထၫ့ဒုၪဒၩယဟိဝၩမိလၩ့ဘျ့ၭဝ့ၫဒၪတၭး လၫ့မိဎွံၩ့လၩ့လၧမူၭခိၪလၧအဝ့ၫၥံၪအလီၩ့, ယဟိဝၩမိစ့ၩရၫ့ဂၪ့ခိၪအထုၬလဖၪ, တၭမိဖ့ၪဆၧအဂဲးအဘၭလၧအစဎွၩ, ဒဲအီၪက့ၪထၪ့ထီၫအၡၩဒိၭဂုၪအၥၭလဂၩအနိၩ့လီၫ.",
			"11": "<sup>11</sup> စအ့လကၫနၫနီၪထဲၩ့ထဲၩ့လၧရၫမၫ လၧအဂံၪ့တၭ, ဖိၪၥၪလဂၩနီၪမၩလၧယဟိဝၩအခ့ၫအၡၩအဆၧလၧ ၦလုဆၧစအံလဲၫအမ့ၬယၫလီၫ.",
			"12": "<sup>12</sup> စအံလဲၫအဖိၪခွၫလဖၪမွဲၦဘၫအလၭဖိၪတၭ, အဝ့ၫ",
			"13": "<sup>13</sup> ၥံၪၥ့ၪယၫယဟိဝၩအ့ၬ.- တၭအယီၩမွဲၦလုဆၧအထူၫ အရူၫဘၪဆဲၫ့လၧၦခမျၧး, ထီးၦလဂၩလုထၪ့ဆၧလု တၭ,ၦလုဆၧအခ့ၫအၡၩဂဲၫဝ့ၫ လၧဆၧယၪဘၪဆၧ အၪ့ဎွံဝ့ၫအဘိၩ့ဘၭနီၪ, အီၪလၧနိၪပုၭယၪအထဲၩ့ၥၧၫ့",
			"14": "<sup>14</sup> ထဲၩ့လၧအစူၪဖၧၩ့,- ဆ့ၭလၩ့ဝ့ၫလၧဖၧၩ့မ့ၩအဖၧၩ့မွဲ ဂ့ၩ,ဖၧၩ့အၪ့ဎွံဆၧအဖၧၩ့မွဲဂ့ၩ, ဖၧၩ့လူၫဆၧအဖၧၩ့မွဲ ဂ့ၩ,ဖၧၩ့လၬထၪ့အဖၧၩ့မွဲဂ့ၩ, ကယဲဆၧလၧအဘုၭ ထၬလၧနိၪပုၭယၪထီးအလူၬနီၪ ၦလုဆၧမၩန့လၧအ ဂးဒၪဝ့ၫလီၫ. အဝ့ၫၥံၪမၩဝ့ၫဘဲၫနီၪ လၧၡဲလိၫအဖၧၩ့ လၧကယဲၦအံၫစရ့လၭဖိၪလၧအလ့ၩဆၧထီးနီၪလီၫ.",
			"15": "<sup>15</sup> လၧအလချႃၭဆူၭထၪ့ခွံၬဒံၭဘၪ ဆၧယၪအၥိၭနီၪ, ၦ လုဆၧအခ့ၫအၡၩဂဲၫဆ့တၭ, စံၭၦလၧအလုထၪ့ဆၧ နီၪ,ဖ့ၪလၫ့ဆၧယၪဘဲၫၥိၭပမိအၪ့ကၪလၧၦလုဆၧအ ဂးဘီၪ. မွဲအမိမၩန့ဆၧယၪ လၧအအၪ့ဎွံယူၭဝ့ၫလၧ",
			"16": "<sup>16</sup> နစူၪဖၧၩ့အ့ၬ, အ့ၪမွဲအၥံၫ့ဆ့ၬလီၫ.- တၭၦလဂၩအ့ၪ စံၭအဝ့ၫ, မွဲၦဆူၭခဲၩခွံၬဒၪခလူၬ ဆၧယၪအၥိၪဆံၭ. တၭမၩန့ထီးအဘၪနၥၭနီၪတၭ, ထီးနီၪလဖၧၫ့အဝ့ၫ ဒၪမိစံၭဆၧၫ့အဝ့ၫ, မွဲမၬနမိဘၪဖ့ၪလၫ့ဘိၩ့နဲၪ့ယီၩ,",
			"17": "<sup>17</sup> အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, ယမိမၩန့ဆီၪ့လီၫ.- အခိးမွဲၦ ဖိၪၥၪခွၫလဖၪနီၪ အဆၧဒဲၩဘၭဒိၪဝ့ၫ လၧယဟိဝၩ အမ့ၬယၫဒိၪမၬလီၫ. အဂဲးဘဲၫယီၩ ၦၡၩၥံၪအီၪက့ၪ ၥၭလိၪဆၧမၩဘိၪ့ယဟိဝၩလီၫ.",
			"18": "<sup>18</sup> တၭစစၫမုၫအ့လၭနီၪ မၩဆၧအခ့ၫအၡၩအဆၧမၩ လၧယဟိဝၩအမ့ၬယၫလီၫ. မွဲၦဖိၪၥၪလၧအယးဒံၩ့ ခဲးထူၬအၥၭလၧအ့ဖိၭဘွၩဖျ့ၫလံၭကံၭလဘံၪ့လီၫ.",
			"19": "<sup>19</sup> အမိဆၭန့အဆဲၫ့ဖိၪလဘံၪ့တၭ, ထီးအဂဲၫထၪ့လၧအ ဝၩအၥိၭဘဲၫၥိၭအမိလုထၪ့ဆၧလုလနံၪ့အဂး လနံၪ့ အဂးတၭဂဲၫဆိၬဝ့ၫလၧအအီၪ လနံၪ့ဘၪလနံၪ့လီၫ.",
			"20": "<sup>20</sup> တၭစအံလဲၫဆိၪဂ့ၩ စအ့လကၫနၫဒဲအမၫတၭ, စံၭဝ့ၫ ဒၪ,မွဲယဟိဝၩဖ့ၪလၫ့နချံၫနၥၪ လၧၦမုၪယီၩလၧအ အၪ့ကံၩ့ဆၧလၧယဟိဝၩအလးနီၪဆံၭ. တၭအဝ့ၫထဲၩ့ ထဲၩ့ဝ့ၫလၧအဂံၪ့ဒၪဝ့ၫနီၪလီၫ.",
			"21": "<sup>21</sup> အနီၪတၭယဟိဝၩအီၪၡီၩ့နးဟၫ့နၫတၭ, အဝ့ၫဒၧၩ့ ထၪ့တၭ, အီၪဖျဲၪန့အဖိၪခွၫၥၧၫ့ဂၩ, ဒဲအဖိၪမုၪနံၫဂၩ လီၫ. တၭဖိၪၥၪစစၫမုၫအ့လၭနီၪဒိၪထၪ့ဝ့ၫလၧယဟိ ဝၩအမ့ၬယၫလီၫ.",
			"22": "<sup>22</sup> တၭစအံလဲၫနီၪအၥၭၡါက့ၭယူၭလီၫ. တၭနါဂၧၫ့ ဝ့ၫလၧကယဲဆၧလၧအဖိၪခွၫလဖၪမၩဝ့ၫ လၧအံၫစရ့ လၭထီးအလူၬအကျၩး ဒဲလၧအမံၫဎုၬလၧၦမုၪလဖၪ လၧအမၩဆၧလၧဆၧအီၪကီၪ့အတဲၩအတရၫ့နီၪလီၫ.",
			"23": "<sup>23</sup> တၭအဆၧစံၭအဝ့ၫၥံၪ, နၥံၪမၩဆၧနီၪလဖၪမွဲဘၪ လဲၪ.အဂဲးဘဲၫယီၩ ယနါဂၧၫ့နၥံၪမၩဆၧအၧၩ့လဖၪ",
			"24": "<sup>24</sup> လၧၦခမျၧးယီၩထီးအလူၬလီၫ.- မၩလဂ့ၩယဖိၪခွၫ ၥံၪဧ့,အဂဲးဘဲၫယီၩ ဆၧအပရၧၫ့လၧယနါဂၧၫ့နီၪ, မွဲ ဆၧအဂ့ၩအ့ၬ. နၥံၪအၪ့မၧၫ့ယဟိဝၩ အၡၩခမျၧး",
			"25": "<sup>25</sup> လၨၪခၫ့ဖၬဆၧလီၫ. ၦၡၩအ့ၪမၩမၪဘၪၦၡၩတၭ,ၦ စ့ၩရၫ့ဆၧမိစ့ၩရၫ့အခွးလီၫ. အ့ၪမွဲၦၡၩအ့ၪမၩမၪဘၪ ယဟိဝၩတၭ, မွဲပလၫမိချဲၩ့ခွးလၧအဂးလဂၩလဲၪ.မွဲ လါနၫ့အဝ့ၫၥံၪခိၭနၪအဖါအလူအ့ၬ. မၩအၥၭဘဲၫနီၪ တၭ,ယဟိဝၩအၥၭအီၪလၧအမိမၩၥံၫအဝ့ၫၥံၪလီၫ.",
			"26": "<sup>26</sup> ဖိၪၥၪစစၫမုၫအ့လၭ ဒိၪထၪ့ဒံၭတၭ, ဂ့ၩဝ့ၫလၧယ ဟိဝၩဒဲလၧၦၡၩၥံၪအမ့ၬယၫဆ့လီၫ.",
			"27": "<sup>27</sup> တၭယွၩအၡၩလဂၩ ဂဲၫလၧစအံလဲၫအအီၪတၭ, စံၭဝ့ၫဒၪ,ယဟိဝၩစံၭဘဲၫယီၩ, ယနဲၪဖျီၪထၪ့ယၥၭ လၧနဖါအၡၩဂံၪ့ဖိၪအမ့ၬယၫ လၧအအီၪလၧအံဇံၭ",
			"28": "<sup>28</sup> လၧဖၫရိၫအဂံၪ့ဖၧၩ့နီၪဧၪ.- တၭယရွံန့ဝ့ၫလၧအံၫစရ့ လၭအဒီၪ့ထီးအလူၬအကျၩ, ဘဲၫၥိၭအမိကဲၪထၪ့ယ ၡၩလုဆၧလၧအမိလုထၪ့ ဆၧလၧယဆၧလုလးအဖၫ့ ခိၪ,လၧအမိဆူၭခဲၩဆၧနၧၫ့မၧၫ့, လၧအမိၥိၭအ့ဖိၭလ ဘံၪ့လၧယမ့ၬယၫနီၪဧၪ. တၭယဖ့ၪလၫ့နဖါအၡၩဂံၪ့ ဖိၪလၧကယဲၦအံၫစရ့လၭဖိၪ အဆၧလုလၧမ့ၪနီၪဧၪး",
			"29": "<sup>29</sup> နၥံၪထၧၫ့ဘၪယဆၧလုဒဲယဆၧမၩဘိၪ့ယၧၩ လၧယ မၪလူၬလၧယအီၪအလးဖၧၩ့တၭ, မၩလၩဖၩ့နဖိၪခွၫ လဖၪလၧယဖၫ့ခိၪ, ဘဲၫၥိၭနၥံၪမိမၩဘီၪ့ထၪ့နၥံၪအၥၭ လၧယၡၩခမျၧးအံၫစရ့လၭအဆၧမၩဘိၪ့အဂ့ၩထုၬ",
			"30": "<sup>30</sup> လဖၪနီၪ,မွဲဘၪလဲၪ.- မၩအၥၭဘဲၫနီၪတၭယဟိဝၩ အံၫစရ့လၭအယွၩစံၭဝ့ၫ, မွဲမၬယစံၭယူၭ,လၧနၡၩဂံၪ့ ဖိၪမိလ့ၩဆၧလၧယမ့ၬယၫ လၩ့ဆိၩလၩ့ကၠၪလီၫ.အ့ၪ မွဲဘိၩ့နဲၪ့ယီၩ ယဟိဝၩစံၭဝ့ၫဒၪ, မွဲဆၧထီးမၩအၥၭ ဘဲၫနီၪလၧယၧၩလဂ့ၩ, အဂဲးဘဲၫယီၩၦလၧအမၩလၩ ဖၩ့ယၧၩနီၪ, ယမိမၩလၩဖၩ့အဝ့ၫတၭ, ၦလၧအမၩ ကြၩ့ထမးယၧၩနီၪ ဆၧမိမၩကြၩ့ထမးအဝ့ၫဒၪလီၫ.",
			"31": "<sup>31</sup> ယိခွါ,မုနံၩလဖၪမိဂဲၫ လၧယမိဖ့ၬထ့ၬနစူၪဒူၪ,ဒဲန ဖါအၡၩဂံၪ့ဖိၪအစူၪဒူၪတၭ, ၦၥၭၡါအီၪဘၪလၧၩ့လၧ",
			"32": "<sup>32</sup> နၡၩဂံၪ့ဖိၪအကျၩအ့ၬ.- တၭနမိဒၪဘၪဆၧအီၪအလး အဆၧနၭဆၧၡၪ့ လၧကယဲဆၧလၧယွၩမိမၩဂ့ၩအံၫစ ရ့လၭအလးတၭ, ၦၥၭၡါမိအီၪဘၪလၧနဂံၪ့ဖိၪအကျၩ",
			"33": "<sup>33</sup> နးဆိၭအ့ၬ.- တၭၦၡၩဘၪဆဲၫ့လၧနၧၩ လၧယလဖ့ၬ ထ့ၬဘၪလၧယဆၧလုလးလဂၩနီၪ မိအီၪလၧအမိမၩ လူၬနမ့ၬၥၪ, ဒဲမၩဆၫနၥၭတၭ, နၡၩဂံၪ့ဖိၪလၧအအၪ",
			"34": "<sup>34</sup> ထၪ့ထီးအလူၬနီၪမိၥံၫလၧအၥၭဘၪ့လီၫ.- တၭအယီၩ မိကဲၪထၪ့ဆၧမၩနဲၪ့လၧနဂး, လၧအမိဂဲၫဘၪနဖိၪခွၫ စဟီၭဖနံၫ, ဒဲစဖံနအၭနံၫဂၩနီၪမိၥံၫဝ့ၫနံၫဂၩလူၬမုလ",
			"35": "<sup>35</sup> နံၩဎးလီၫ.- တၭယမိဒုၭဂဲထုၪ့ၦလုဆၧအလူတီၩလၧ ယဂးနးဂၩ, လၧအမိမၩဆၧကယဲဆၧလၧအဘၪယ ၥၭလၧအအီၪလၧယၥၭခံဖၧၩ့အၥိၭနီၪတၭ, ယမိမၩ ထၪ့န့ဝ့ၫလၧအဂံၪ့ခၧၫ့တၭ, အဝ့ၫဒၪမိလ့ၩဆၧလၧယ ၡၩဒိၭဂုၪအၥၭအမ့ၬယၫကိၭမုနံၩမုနၩဒ့ၭလီၫ.",
			"36": "<sup>36</sup> တၭဆၧမိမၩအၥၭ လၧကယဲၦၡၩလၧအအီၪလၩ့ ထးလၧနၡၩဂံၪ့ဖိၪအကျၩလဂၩလါလါနီၪ, မိဂဲၫထွံၩ လၩ့လၧအမ့ၬယၫဘဲၫၥိၭအမိန့ဘၪစ့ၩလဘံၪ့, ဒဲကိၪ လလီၪ့တၭး မိစံၭ, အီၪက့ၪလၩ့လါယၧၩလၧၦလုဆၧ အလးလစီၪ့စီၪ့ဘဲၫၥိၭယမိအၪ့ကိၪနးလီၪ့ဘီၪ."
		},
		"3": {
			"1": "<sup>1</sup> တၭဖိၪၥၪစစၫမုၫအ့လၭ မၩယဟိဝၩအခ့ၫအၡၩ အဆၧလၧစအံလဲၫအမ့ၬယၫလီၫ. တၭဆၧလၧမုနံၩ လဖၪနီၪယဟိဝၩအလူအထၫနီၪ မွဲဆၧလူဒိၪဎွ့ၩဒိၪ လီၫ.ဆၧဒၪဆၧလၧယၫလခီၫအၪအ့ၬ.",
			"2": "<sup>2</sup> ဆၧလၧမုလနံၩနီၪ စအံလဲၫမံၫနၩ့လၧအလးဒၪဝ့ၫ",
			"3": "<sup>3</sup> အဖၧၩ့တၭ, အမ့ၬခံၭထၪ့ၥၫ့တၭဒၪဆၧၥ့ၪအ့ၬ.- တၭ ယွၩအမ့ၪဒိၩ့လချႃၭလၩ့ဖံၬခွံၬဒံၭဘၪ လၧယဟိဝၩ အနီးဖၧၩ့ထီးယွၩအတလၫအီၪနီၪတၭ, စစၫမုၫအ့လၭ",
			"4": "<sup>4</sup> မံၫနၩ့ဝ့ၫတၭ,- ယဟိဝၩကိၭစစၫမုၫအ့လၭတၭး အ ဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ, ယိခွါ,ယၧၩလီၫ.",
			"5": "<sup>5</sup> မွဲအလ့ၩစဲၪ့ဝ့ၫလၧစအံလဲၫအအီၪတၭ, စံၭဝ့ၫဒၪ, ယိခွါ,ယၧၩလီၫ. အဂဲးဘဲၫယီၩနကိၭယၧၩလီၫ. တၭ အဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ, ယကိၭအ့ၬ, မံၫနၩ့ဒီၭဘီၪ. အဝ့ၫ",
			"6": "<sup>6</sup> ဒၪထဲၩ့တၭမံၫနၩ့ဝ့ၫလီၫ.- တၭယဟိဝၩကိၭဒီၭလဖၧၫ့ ဒီၭ,စစၫမုၫအ့လၭဧ့, တၭစစၫမုၫအ့လၭဂဲထုၪ့လ့ၩဝ့ၫ လၧစအံလဲၫအအီၪနီၪ, စံၭဝ့ၫဒၪ, ယိခွါ, ယၧၩလီၫ. အဂဲးဘဲၫယီၩ နကိၭယၧၩလီၫ. တၭအဝ့ၫဒၪစံၭဆၧၫ့",
			"7": "<sup>7</sup> ဝ့ၫ,ယကိၭအ့ၬ, ယဖိၪခွၫဧ့,မံၫနၩ့ဒီၭဘီၪ.- တၭစစၫမုၫ အ့လၭၥ့ၪယၫဒံၭယဟိဝၩဒံၭအ့ၬ. တၭဆၧနဲၪဖျီၪယ",
			"8": "<sup>8</sup> ဟိဝၩအလူအထၫလၧအဝ့ၫနီၪဒံၭအ့ၬ.- ယဟိဝၩ ကိၭထၪ့ဒီၭစစၫမုၫအ့လၭ ၥၧၫ့ဖၧၫ့လဖၧၫ့တၭ, အဝ့ၫ ဒၪဂဲထုၪ့လ့ၩဝ့ၫလၧစအံလဲၫအအီၪတၭ, စံၭဝ့ၫဒၪ,ယိ ခွါ,ယၧၩလီၫ. အဂဲးဘဲၫယီၩ နကိၭယၧၩလီၫ. တၭ",
			"9": "<sup>9</sup> စအံလဲၫနၪၥ့ၪလၧယဟိဝၩကိၭယူၭဖိၪၥၪနီၪလီၫ.- မၩ အၥၭဘဲၫနီၪတၭ, စအံလဲၫစံၭစစၫမုၫအ့လၭ, ထဲၩ့မံၫ နၩ့ဘီၪ.ဆၧအ့ၪကိၭနၧၩတၭ, နမိဘၪစံၭ, ချဲၩ့ဆံၭ, ယဟိဝၩဧ့, အဂဲးဘဲၫယီၩ နခ့ၫနၡၩနါဂၧၫ့ဆၧလီၫ. တၭစစၫမုၫအ့လၭထဲၩ့မံၫနၩ့လၧ အလးဒၪဝ့ၫလီၫ.",
			"10": "<sup>10</sup> ယဟိဝၩဂဲၫထဲၩ့, ဒဲဆၧၫ့ထုၪ့တၭ, ကိၭဆၧဘဲၫလၧ အၥၫ့အၥိၭနီၪ, စစၫမုၫအ့လၭဧ့, စစၫမုၫအ့လၭဧ့, တၭစစၫမုၫအ့လၭ စံၭဆၧၫ့ဆၧ, ချဲၩ့ဆံၭး အဂဲးဘဲၫ ယီၩ,နခ့ၫနၡၩနါဂၧၫ့ဆၧလီၫ.",
			"11": "<sup>11</sup> တၭယဟိဝၩစံၭစစၫမုၫအ့လၭ, ယိခွါ,ယမိမၩဆၧ လမံၩ့လၧအံၫစရ့လၭအကျၩ လၧအမိဒုၭၥီၫထၪ့ကယဲ",
			"12": "<sup>12</sup> ၦလၧအနါဂၧၫ့ဝ့ၫလဖၪအနါနံၫခီၫလူၬလီၫ.- ဆၧလၧ မုလနံၩနီၪ ယမိဒုၭအီၪထၪ့ထၫ့ဒၩ စအံလဲၫလၧကယဲ ဆၧလၧယချဲၩ့ယူၭဆၧလၧအၡၩဂံၪ့ဖိၪ အဂဲးအကၠီၪ့",
			"13": "<sup>13</sup> လီၫ.ယမိမၩထၪ့ၥၫ့ဒဲယမိမၩထီးအထုၬလီၫ.- တၭ ယဒုၭနဲၪယူၭ လၧယမိစ့ၩရၫ့ အၡၩဂံၪ့ဖိၪလၩ့ဆိၩ လၩ့ကၠၪလၧဆၧအၧၩ့ လၧအၥ့ၪယၫဝ့ၫ အကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩအဖိၪခွၫလဖၪ မၩလၩ့အၥၭလၧဆၧဆိၪ",
			"14": "<sup>14</sup> အၧၩ့အလးလါနၫ့တၭ, အဝ့ၫဒၪပဒၩ့အ့ၬ.- မၩအၥၭ ဘဲၫနီၪတၭယဆိၪလၩ့ယၥၭ လၧစအံလဲၫအၡၩဂံၪ့ဖိၪ ၥံၪ,လၧစအံလဲၫအၡၩဂံၪ့ဖိၪ အဆၧအၧၩ့နီၪ, ဆၧလ မၩဖီၩ့ဖျ့ၭဘၪလၧဆၧလုမွဲဂ့ၩ ဆၧမၩဘိၪ့မွဲဂ့ၩလၩ့ ဆိၩလၩ့ကၠၪလီၫ.",
			"15": "<sup>15</sup> စစၫမုၫအ့လၭနီၪ မံၫနၩ့ထီးမုဆဲၪ့ထၪ့တၭ, ဝဲထၪ့ ယဟိဝၩအဂံၪ့အတရၫ့တၭ, စစၫမုၫအ့လၭဒုၭနဲၪစ အံလဲၫလၧဆၧနဲၪဖျီၪဘုၪ့အ့ၬ.",
			"16": "<sup>16</sup> စအံလဲၫကိၭန့စစၫမုၫအ့လၭတၭ, စံၭဝ့ၫဒၪ,စစၫမုၫ အ့လၭ,ယဖိၪခွၫဧ့, တၭအဝ့ၫဒၪချဲၩ့ဆၧၫ့ဝ့ၫ, ယိခွါ",
			"17": "<sup>17</sup> ယၧၩလီၫ.- တၭအဝ့ၫဒၪစံၭဝ့ၫ, ဆၧလၧယဟိဝၩစံၭ နၧၩလမံၩ့နီၪ, မွဲဆၧနီၪလမံၩ့လဲၪ. အီၪက့ၪၥူၪခွံၬလၧ ယၧၩလဂ့ၩ, လၧကယဲဆၧလၧအစံၭနၧၩအကျၩနီၪန အ့ၪအီၪက့ၪၥူၪဆၧလမံၩ့မံၩ့တၭ, မွဲယွၩမၩနၧၩဘဲၫ",
			"18": "<sup>18</sup> နီၪ,ဒဲအၪနဲၪ့အနီၪဆံၭ.- စစၫမုၫအ့လၭဒုၭနဲၪဝ့ၫလၧ ဆၧလဖၪနီၪထီးအလူၬတၭ, အီၪက့ၪၥူၪဝ့ၫနးမံၩ့အ့ၬ. တၭအဝ့ၫဒၪစံၭဝ့ၫ, အနီၪမွဲယဟိဝၩလီၫ. မွဲအမၩဝ့ၫ ထီးဒၪအၥၭဆိၫ့ဆၧဆံၭ.",
			"19": "<sup>19</sup> စစၫမုၫအ့လၭဒိၪထၪ့ဒဲယဟိဝၩ အီၪလၧအၥိၭတၭ,",
			"20": "<sup>20</sup> ဖ့ၪလၫ့အဝ့ၫဒၪအဆၧချဲၩ့ဂၭဂီၩ့နးထံၪအ့ၬ.- တၭအံၫ စရ့လၭထီးအလူၬ လၧဒၫ့ထီၩ့လၧဘံအၧၫၡံၫဘၫနီၪ ၥ့ၪယၫဝ့ၫလၧစစၫမုၫအ့လၭ မွဲယဟိဝၩ အမီၪလၧအ",
			"21": "<sup>21</sup> မွဲအတီၩလီၫ.- တၭယဟိဝၩနဲၪဖျီၪထၪ့ဒီၭအၥၭလၧ ၡဲလိၫအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩယဟိဝၩ နဲၪဖျီၪထၪ့ အၥၭလၧစစၫမုၫအ့လၭအမ့ၬယၫ လၧယဟိဝၩအလူ အကၠီၩ့လၧၡဲလိၫအဖၧၩ့လီၫ."
		},
		"4": {
			"1": "<sup>1</sup> တၭစစၫမုၫအ့လၭ အလူလၩ့ဘၪ လၧအံၫစရ့လၭ ထီးအလူၬလီၫ. တၭအံၫစရ့လၭ လ့ၩထၫ့ဒၩၦဖလံ ၡၫဖိၪဘဲၫၥိၭအမိဒုၭဆၧလၧအဝ့ၫၥံၪတၭ, ၥုၪ့အတဲၩ ထီးအ့ၭဘနံဇၧၫအနဲၩ့ထံၭတၭ, ၦဖလံၡၫဖိၪ ၥုၪ့အ",
			"2": "<sup>2</sup> တဲၩလၧအၫဖ့ၭအဖၧၩ့လီၫ.- တၭၦဖလံၡၫဖိၪတဲၩ့ဝဲၩ အၥၭဘဲၫၥိၭ အမိလ့ၩထၪ့ထၫ့ဒၩ အံၫစရ့လၭတၭ, ထီးအဒုၭၥုၭနီၪအံၫစရ့လၭ ဘၪဆၧဖ့ၬခွံၬဝ့ၫလၧၦဖ လံၡၫဖိၪအမ့ၬယၫတၭ, အဝ့ၫၥံၪဖ့ၬခွံၬဝ့ၫၦၡၩလံထီၫ့ ကၪယူၭလၧၦၥုၭမုအကျၩ လၧဆၧပျၩ့ဖၧၩ့လီၫ.",
			"3": "<sup>3</sup> ထီးၦခမျၧးဂဲၫနုၬ လၧၦၥုၪ့တဲၩအလးဖၧၩ့တၭ, အံၫစရ့လၭအၡၩၥုၪ့က့ၭၥၭၡါလဖၪ စံၭဝ့ၫဒၪ, ဆၧ လၧမုဆၫလနံၩယီၩ, ယဟိဝၩဖ့ၬခွံၬပၧၩ လၧၦဖလံ ၡၫဖိၪအမ့ၬယၫနီၪ မွဲအဘၪဆၧနီၪလဲၪ. မွဲပမၩန့ၡီၩ့ ယဟိဝၩအဆၧအုၩ့လၩ့အတလၫ လၧပဂးလၧၡဲလိၫ အဖၧၩ့ဆံၭ. ထီးအဂဲၫနုၬဝ့ၫ လၧပကျၩတၭ, မိမၩ",
			"4": "<sup>4</sup> ဖီၩ့မၩဖျ့ၭပၧၩ လၧပဒုၪပဒၩအစူၪဖၧၩ့လီၫ.- တၭၦခ မျၧးအၪ့မၧၫ့လၩ့ဆၧလၧ ၡဲလိၫဘဲၫၥိၭအမိဂဲၫထဲၩ့ဆိၬ ဆၧၥုၭမုခမျၧး အယဟိဝၩ အဆၧအုၩ့လၩ့အတလၫ လၧအအီၪလၧခ့ၫရူၬလဖၪနီၪလီၫ. တၭစအံလဲၫအဖိၪ ခွၫနံၫဂၩစဟီၭဖနံၫ, ဒဲစဖံနအၭအီၪဝ့ၫထီးနီၪအီၪလၧ ယွၩအဆၧအုၩ့လၩ့အတလၫနီၪလီၫ.",
			"5": "<sup>5</sup> ထီးယဟိဝၩအဆၧအုၩ့လၩ့ အတလၫဂဲၫနုၬလၧၦ ၥုၪ့တဲၩအလးဖၧၩ့တၭ, ဆၧမၩအၥၭလၧအံၫစရ့လၭ ထီးအလူၬကိၭၡၭထၪ့ဖၭဒိၪ, ထီးဂၪ့ခိၪၥီၫထၪ့လီၫ.",
			"6": "<sup>6</sup> ၦဖလံၡၫဖိၪနါဂၧၫ့ ဆၧကိၭၡၭထၪ့အၥီၫတၭ, စံၭဝ့ၫ ဒၪ,ဆၧကိၭၡၭထၪ့ဖၭဒိၪ လၧၦဟံဘြူၫဖိၪၥုၪ့တဲၩအ လးဖၧၩ့နီၪ, မွဲဆၧနီၪလမံၩ့လဲၪ. တၭအဝ့ၫၥံၪၥ့ၪယၫ ဝ့ၫလၧယဟိဝၩအတလၫနီၪ ဂဲၫနုၬယူၭလၧဆၧၥုၪ့တဲၩ",
			"7": "<sup>7</sup> အလးဖၧၩ့ယူၭလီၫ.- တၭၦဖလံၡၫဖိၪၥၭမဲၪဝ့ၫ, အ ဂဲးဘဲၫယီၩစံၭဝ့ၫဒၪ, ယွၩအတလၫ ဂဲၫနုၬယူၭလၧၦ ၥုၪ့တဲၩအလးဖၧၩ့ယူၭလီၫ. တၭအဝ့ၫၥံၪစံၭ, ပဝ့ၫဒၪ ယီၩပဘၪအၡၪ့လီၫ. အဂဲးဘဲၫယီၩ ဆၧနီၪလမံၩ့လၧ",
			"8": "<sup>8</sup> အဝံခိၪအီၪအ့ၬ.- ပဘၪအၡၪ့ဖီၩၬ မွဲပလၫ မိမၩဖီၩ့ ဖျ့ၭပၧၩလၧယွၩဆီၪ့လဖၪနီၪ အစူၪဖၧၩ့လဲၪ. အဝ့ၫၥံၪ နီၪမွဲယွၩလၧအဖ့ၬခွံၬ ၦအံဇံၭဖိၪ လၧဆၧဒိၪထီးအ",
			"9": "<sup>9</sup> လူၬလၧၡါမုနၧၫ့ဖၫနီၪလီၫ.- အီၪက့ၪဆီၪ့နၥံၪအဂဲးအ ဘၭတၭ, အီၪဘဲၫၦခွၫအၥိၭနီၪဘီၪ, ၦဖလံၡၫဖိၪၥံၪ ဧ့,နၥံၪမိကဲၪထၪ့ဘၪခိၬၦဟံဘြူၫဖိၪအဎီးအၡၩ,ဘဲၫ အဝ့ၫၥံၪကဲၪယူၭ နၥံၪအဎီးအၡၩ အၥိၭနီၪလီၫ. အီၪ ဘဲၫၦခွၫအၥိၭနီၪတၭ, ဒုၭၥုၭဘီၪၬ",
			"10": "<sup>10</sup> ၦဖလံၡၫဖိၪဒုၭဆၧတၭ, အံၫစရ့လၭဘၪဆၧဖ့ၬခွံၬ ဝ့ၫတၭ, စဲၪ့ဖျိၭဝ့ၫလဂၩလၧအတဲၩဒၪဝ့ၫ, လဂၩလၧ အတဲၩဒၪဝ့ၫတၭ, ဆၧဖ့ၬၥံၫခွံၬနီၪ အီၪဝ့ၫဒိၪဒိၪလ့ၬ လီၫ.တၭၦခၪ့ၥုၭဖိၪလၩ့ထံၩဖါဝ့ၫ လၧအံၫစရ့လၭအ",
			"11": "<sup>11</sup> ကျၩၥၧၫ့လၬလီၫ.- တၭယွၩအတလၫနီၪဘၪဆၧဖီၪ့ န့ဝ့ၫတၭ စအံလဲၫအဖိၪခွၫ စဟီၭဖနံၫ, ဒဲစဖံနအၭနီၪ ဘၪဆၧမၩၥံၫဝ့ၫနံၫဂၩလူၬလီၫ.",
			"12": "<sup>12</sup> ၦဘံၪ့ယမံၫ့ဖိၪလဂၩစဲၪ့ထၪ့ခွံၬ လၧၦၥုၭမုအကျၩ တၭ, ထီၩ့လၧၡဲလိၫမုလနံၩဎး အီၪလၧအကီၩ့အၥိၭ ယၬခွံၬတၭ, ဂၪ့ခိၪအမုၬအီၪလၧ အခိၪဎွံၪ အဖၫ့ခိၪ",
			"13": "<sup>13</sup> လီၫ.- ထီးအဂဲၫဝ့ၫတၭ, ယိခွါ, စအံလဲၫဆၧၫ့နၩ့ဝ့ၫ လၧလးဆၧၫ့နၩ့အဖၫ့ခိၪ လၧဖၧၩ့ၥၭအနဲၩ့ထံၭနီၪခိၭ ယိဆၧလီၫ. အဂဲးဘဲၫယီၩ အၥၭဝၭထိၬဝ့ၫလၧယွၩအ တလၫအကၠီၩ့လီၫ. ထီးၦလဂၩနီၪ ဂဲၫနုၬဒုၭနဲၪဆၧ လၧဒိၩ့ဖၧၩ့တၭ, ၦဒိၩ့ဖိၪထီးအလူၬကိၭၡၭထၪ့လီၫ.",
			"14": "<sup>14</sup> ထီးစအံလဲၫနါဂၧၫ့ ဆၧကိၭၡၭအၥီၫတၭ, စံၭဝ့ၫဒၪ, ဆၧတုၩ့ထၪ့တုၩ့လၩ့အၥီၫနီၪ မွဲဆၧနီၪလမံၩ့လဲၪ. ၦ",
			"15": "<sup>15</sup> လဂၩနီၪဂဲၫချဲၫ့ချဲၫ့တၭ, လီၩဘၪစအံလဲၫလီၫ.- စအံ လဲၫအၥၭၡါယူၭခွံၫဆံၫဎိၭနံၪ့တၭ, အမ့ၬခံၭတၭ, ဒၪ",
			"16": "<sup>16</sup> ဆၧၥ့ၪအ့ၬ.- ၦလဂၩနီၪစံၭစအံလဲၫ, ယမွဲၦလၧအဂဲၫ ထဲၩ့လၧၦၥုၭမုအကျၩတၭ, လၧမုဆၫလနံၩယီၩယ စဲၪ့ထၪ့ခွံၬလၧၦၥုၭမုအကျၩလီၫ. တၭအဝ့ၫဒၪအၪ့",
			"17": "<sup>17</sup> စၪ့,ဆၧမၩအၥၭဘဲၫၥ့ၪလဲၪ, ယဖိၪခွၫဧ့,- ၦအၥီၫ့လ ဂၩနီၪ,လီၩဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, အံၫစရ့လၭစဲၪ့ ယူၭလၧၦဖလံၡၫဖိၪအမ့ၬယၫတၭ, ဆၧဖ့ၬခွံၬဖၭဒိၪ အီၪယူၭလၧၦခမျၧးအကျၩတၭ, နဖိၪခွၫစဟီၭဖနံၫ,ဒဲ စဖံနအၭနံၫဂၩနီၪ, ၥံၫဆ့ယူၭတၭ, ဆၧမၩန့ယူၭယွၩ",
			"18": "<sup>18</sup> အတလၫယူၭလီၫ.- ထီးအစံၭယွၩအတလၫနီၪတၭ, ဆၧမၩအၥၭလၧအဝ့ၫဒၪလၩ့ထ့ၬခွံၬ လၧလးဆၧၫ့နၩ့ လၧအချိၫ့လခီၫထီးတရၫ့အနဲၩ့တၭ, အခိၬခါတၭ,ၥံၫ ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ အၥၭၡါယူၭတၭဎၧၫ့ဝ့ၫလီၫ. တၭအဝ့ၫဒၪစ့ၩရၫ့ယူၭ အံၫစရ့လၭအနံၪ့လံဆံၫလီၫ.",
			"19": "<sup>19</sup> အဒဲၪစဖံနအၭအမၫလဂၩနီၪဒၧၩ့ထၪ့တၭ, အမုအ လၩလၩ့ဘူၭယူၭလီၫ. တၭထီးအနါဂၧၫ့ဆၧအပရၧၫ့ လဖၪလၧယွၩအတလၫ ဘၪဆၧအၪ့ဂူၬန့ဝ့ၫ, ဒဲအမံၩ့ ၡါခွၫ,ဒဲအဝၩၥံၫဝ့ၫတၭ, အဝ့ၫဒၪချံၭလၩ့အခၪ့တၭ, အီၪဖျဲၪဆၧလီၫ. အဂဲးဘဲၫယီၩ ဘၪဆၧဂူၭဆၫလီၫ.",
			"20": "<sup>20</sup> လၩ့ဘူၭလၧအမိၥံၫနီၪ, ၦမုၪလဖၪလၧအဆၧၫ့ထုၪ့လၧ အနဲၩ့ထံၭနီၪ, စံၭအဝ့ၫ, ၥၭမဲၪလဂ့ၩ, အဂဲးဘဲၫယီၩ နအီၪဖျဲၪန့ယူၭ နဖိၪခွၫလဂၩလီၫ. မွဲလါနၫ့ အဝ့ၫချဲၩ့",
			"21": "<sup>21</sup> ဆၧၫ့ဆၧအ့ၬး အီၪက့ၪဝ့ၫလၧအၥၭအ့ၬ.- တၭဖျိၬဝ့ၫ အမံၩ့လၧစအံၭကဘၧၭတၭ, စံၭဝ့ၫဒၪ,ဆၧလၩဖၩ့စဲၪ့ ဒၪယူၭအံၫစရ့လၭယူၭ, လၧဆၧမၩန့ယွၩအတလၫ",
			"22": "<sup>22</sup> အကၠီၩ့,ဒဲလၧအမံၩ့ၡါခွၫ ဒဲအဝၩအကၠီၩ့လီၫ.- တၭ စံၭဝ့ၫဒၪ,ဆၧလၩဖၩ့စဲၪ့ဒၪယူၭ အံၫစရ့လၭယူၭ,ဆၧ အၪ့ဂူၬန့ယူၭယွၩအတလၫ အကၠီၩ့ယူၭလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> တၭၦဖလံၡၫဖိၪမၩန့ခွံၬ ယွၩအတလၫလၧအ့ၭဘ နံဇၧၫအဖၧၩ့နီၪ, ဆိၬထၪ့ဝ့ၫဖိးလၧအၭၡဒီၭနီၪလီၫ.",
			"2": "<sup>2</sup> ထီးၦဖလံၡၫဖိၪ မၩန့ယွၩအတလၫနီၪ မွဲအဂဲၫဆိၬဝ့ၫ လၧဒၫဂၫ့အဂံၪ့တၭ, အီၪက့ၪဝ့ၫလၧဒၫဂၫ့ အနဲၩ့ထံၭ",
			"3": "<sup>3</sup> လီၫ.- ထီးၦအၭၡဒီၭဖိၪ ဂဲထုၪ့လၧမုဆဲၪ့ထၪ့လနံၩ လၧဂီၩနၪခုၬတၭ, ယိခွါ, ဒၫဂၫ့လၩ့ထံၩဖါချႃၬလၩ့ ယူၭလၧဂၪ့ခိၪလၧယဟိဝၩ အတလၫအမ့ၬယၫယူၭ. ၦၡၩမၩန့ဒၫဂၫ့တၭ, အီၪက့ၪဒီၭဝ့ၫလၧအလးနီၪလီၫ.",
			"4": "<sup>4</sup> ထီးအဝ့ၫၥံၪဂဲထုၪ့ လၧမုဆဲၪ့ထၪ့ဒီၭလနံၩလၧဂီၩနၪခုၬ တၭ,ဒၫဂၫ့လၩ့ထံၩဖါချႃၬလၩ့ယူၭ လၧဂၪ့ခိၪ,လၧ ယွၩအတလၫ အမ့ၬယၫတၭ, ဒၫဂၪ့အခိၪဎွံၪ ဒဲအစူၪ ယၫၥၭနံၫခီၫလူၬထူၬခွံၬ လၧတလၫအခၧၪ့ အဖၫ့ခိၪ",
			"5": "<sup>5</sup> လီၫ. အီၪလၩ့ထး န့ၫယၪလကုၭနီၪလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, ဒၫဂၫ့အၡၩလုဆၧမွဲဂ့ၩ, ၦလ့ၩနုၬလၧဒၫ ဂၫ့အဂံၪ့ဖၧၩ့မွဲဂ့ၩ, လယဲးဘၪ ဒၫဂၫ့အတရၫ့ခၧၪ့လၧ",
			"6": "<sup>6</sup> အၭၡဒီၭအဖၧၩ့ ထီးမုဆၫလနံၩယီၩလီၫ.- အ့ၪမွဲယ ဟိဝၩအစူၪအီၪဎၧၫ့ဝ့ၫလၧ ၦအၭၡဒီၭဖိၪအလီၩ့တၭ, မၩဂၭဂီၩ့အဝ့ၫၥံၪတၭ, ဖ့ၬခွံၬဝ့ၫလၧဆၧဆၫၥိၫလၩ့,",
			"7": "<sup>7</sup> ၦအၭၡဒီၭဖိၪ, ဒဲၦအီၪလၧအနဲၩ့ထံၭလဖၪလီၫ.- ထီး အၭၡဒီၭအၦၡၩဒၪဘၪဝ့ၫလၧ ဆၧမွဲဘဲၫနီၪတၭ,စံၭဝ့ၫ ဒၪ,အံၫစရ့လၭအယွၩ အတလၫနီၪထီးအီၪလၧပကျၩ လဂ့ၩ. အဂဲးဘဲၫယီၩ အစူၪဆီၪ့လၧပဖၫ့ခိၪဒဲလၧဒၫ",
			"8": "<sup>8</sup> ဂၫ့ပယွၩအဖၫ့ခိၪဆ့လီၫ.- တၭအဝ့ၫၥံၪအၪ့မၧၫ့လၩ့ ဆၧ,ဒုၭအီၪကိၩ့အီၪကီၪ့ ၦဖလံၡၫဖိၪ အၦဒိၪဖၭဒိၪ လၧအအီၪတၭ, စံၭဝ့ၫဒၪ, ပမိမၩအံၫစရ့လၭအယွၩ အတလၫနီၪဘဲၫၥ့ၪလဲၪ. တၭအဝ့ၫၥံၪချဲၩ့ဆၧၫ့ဆၧ တၭ,စံၭဝ့ၫဒၪ, မွဲၦဆိၬဝံၩ့ဝၩ့အံၫစရ့လၭအယွၩအတ လၫနီၪထီၩ့လၧဂၫၥၭနီၪဘီၪ. တၭအဝ့ၫၥံၪဆိၬဝံၩ့ဝၩ့",
			"9": "<sup>9</sup> အံၫစရ့လၭအယွၩအတလၫထီၩ့ထီးနီၪလီၫ.- ဆၧမၩ အၥၭလၧအဆိၬဝံၩ့ဝၩ့ဝ့ၫအလးခဲၫ့နီၪ ယဟိဝၩအစူၪ ထၫ့ဒုၪဒၩဒိၩ့နီၪ အီၪဝ့ၫလၧဆၧမၩဂၭဂီၩ့ဖၭဒိၪတၭ, ဖ့ၬခွံၬဒိၩ့ဖိၪအဒိၪအဆံၭတၭ, အဝ့ၫၥံၪအီၪဝ့ၫလၧဆၧ ဆၫၥိၫလၩ့နီၪလီၫ.",
			"10": "<sup>10</sup> မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪအၪ့မၧၫ့ၦဆိၬယွၩအ တလၫနီၪ ထီၩ့လၧအ့ၭကြၧၫ့လီၫ. တၭထီးယွၩအတ လၫနီၪဂဲၫထီၩ့လၧအ့ၭကြၧၫ့တၭ, ဆၧမၩအၥၭလၧၦ အ့ၭကြၧၫ့ဖိၪ ကိၭၡၭထၪ့တၭ, စံၭဝ့ၫဒၪ, ၦဂဲၫဆိၬဝံၩ့ ဝၩ့အံၫစရ့လၭအယွၩ အတလၫနီၪထီၩ့လၧပအီၪဘဲၫ",
			"11": "<sup>11</sup> ၥိၭအမိမၩၥံၫပၧၩ, ဒဲၦခမျၧးဆ့လီၫ.- အခိးမွဲအဝ့ၫၥံၪ အၪ့မၧၫ့လၩ့ဆၧတၭ, ဒုၭအီၪကီၪ့ၦဖလံၡၫဖိၪအၦဒိၪ ဖၭဒိၪထီးအလူၬတၭ, စံၭဝ့ၫဒၪ, အၪ့မၧၫ့လၩ့အံၫစရ့ လၭအယွၩအတလၫနီၪတၭ, ဒုၭထဲၩ့ထဲၩ့လၧအလး ဒၪဝ့ၫဘီၪ, ဘဲၫၥိၭအထီးမၩၥံၫပၧၩ, ဒဲၦခမျၧးလဂ့ၩ လီၫ.အဂဲးဘဲၫယီၩ ဆၧမၩၥံၫအဆၧဂၭဂီၩ့နီၪ အီၪဝ့ၫ လၧဒိၩ့ထၧၫ့ဖျိၪ့ယၫအဖၧၩ့လီၫ. ယွၩအစူၪအီၪဝ့ၫထီး",
			"12": "<sup>12</sup> နီၪဎၧၫ့မၬလီၫ.- တၭၦလၧအလၥံၫဘၪလဖၪနီၪဘၪ ဆၧဖ့ၬဝ့ၫလၧဆၧဆၫၥိၫလၩ့ဝ့ၫတၭ, ၦဒိၩ့ဖိၪအဆၧ ဂၪ့ကိၭဂၪ့ၡၭနီၪ လ့ၩထၪ့လၧမူၭခိၪလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> တၭယဟိဝၩအတလၫနီၪ အီၪဝ့ၫလၧၦဖလံၡၫဖိၪ",
			"2": "<sup>2</sup> အခးဖၧၩ့လၩနွ့ၫဘံၪ့လီၫ.- တၭၦဖလံၡၫဖိၪကိၭန့ၦ လုဆၧဒဲၦအၪ့ဖၩ့ဆၧတၭ, စံၭဝ့ၫဒၪ, မွဲပမိမၩယဟိ ဝၩအတလၫနီၪဘဲၫၥ့ၪလဲၪ. ဒုၭၥ့ၪယၫပၧၩ လၧပမိ ဖ့ၪယူဝ့ၫလၧအလးဒၪဝ့ၫနီၪ လၧဆၧနီၪလမံၩ့လဲၪနီၪ",
			"3": "<sup>3</sup> ဘီၪ.- အဝ့ၫၥံၪစံၭ, နၥံၪအ့ၪဖ့ၪယူအံၫစရ့လၭအယွၩ အတလၫတၭ, ဖ့ၪယူပျီၩပျီၩလဂ့ၩ. ဖ့ၪယူလၧဆၧလု မၪဘၪဆၧတၡါဆံၭ. ထီးနီၪလဖၧၫ့နၥံၪမိဘျၪထဲၩ့,ဒဲ အစူၪလၥုၭခွံၬဘၪအၥၭ လၧနၥံၪအလီၩ့အဂဲးနီၪ,န",
			"4": "<sup>4</sup> ၥံၪမိၥ့ၪယၫလီၫ.- တၭအဝ့ၫၥံၪစံၭဝ့ၫဒၪ, ဆၧလုမၪ ဘၪဆၧလၧပမိဘၪဖ့ၪယူနီၪ, မွဲဆၧနီၪလမံၩ့လဲၪး တၭ အဝ့ၫၥံၪစံၭဆၧၫ့ဝ့ၫဒၪ, ဆၧဆၫၥိၫလၩ့အဂၩ့ထီၫ့ယဲ ဖျိၪ့,ဒဲယူထီၫ့ယဲဘီၩ့ဘဲၫၦဖလံၡၫဖိၪအၦဒိၪဖၭဒိၪအ ဆၧဝံထၪ့နၬထၪ့အၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩဆၧထး လမံၩ့ဎးအီၪဝ့ၫလၧနၥံၪအလီၩ့ကိၭဂၩဒ့ၭ, ဒဲလၧနၥံၪ အၦဒိၪဖၭဒိၪအလီၩ့ဆ့လီၫ.",
			"5": "<sup>5</sup> တၭနၥံၪမိဘၪတဲၩ့ နၥံၪအဆၧဆၫၥိၫလၩ့အဂၩ့,ဒဲ ယူအဂၩ့လၧအမၩဂၭဂီၩ့ထံၫၥံၪခးၥံၪတၭ, နၥံၪမိဘၪ ဖ့ၪလၩဖၩ့လၧအံၫစရ့လၭအယွၩလီၫ. တၭဘၪလဘၪ အဝ့ၫဒၪမိမၩဎွံၫထၪ့အစူၪ လၧနၥံၪအလီၩ့,ဒဲနၥံၪအ ယွၩလဖၪအလီၩ့, ဒဲလၧနၥံၪအထံၫအခး အဖၫ့ခိၪနီၪ",
			"6": "<sup>6</sup> လီၫ.- တၭနၥံၪမၩနီၩ့နၥံၪအၥၭဘဲၫၦအံဇံၭဖိၪ, ဒဲဘဲၫ ဖၫရိၫမၩနီၩ့အၥၭအၥိၭနီၪ,မွဲဘၪလဲၪ. ထီးအမၩဆၧ လၩ့လၭလၧအကျၩတၭ, အဝ့ၫၥံၪနီၪဖျါခွံၬၦခမျၧး",
			"7": "<sup>7</sup> တၭ,အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬနီၪမွဲအ့ၬဧၪ.- ဘိၩ့နဲၪ့ယီၩမၩ လဲၪ့အၥၫ့လခိၪတၭ, မၩန့ချီမိအီၪလၧအဖိၪဆံၭ,လၧ ၦလအီၪက့ၪဒံၭဘၪ ပမၫဖုၫလၧအလီၩ့ နးနံၫဒုၩတၭ, ကျီၩထၬလၧလဲၪ့တၭ, ဒုၭထဲၩ့ထဲၩ့အဖိၪလၧအလး",
			"8": "<sup>8</sup> တၭ,- မၩန့ယဟိဝၩအတလၫနီၪ, အီၪက့ၪလၧလဲၪ့ ဖၧၩ့တၭ, အီၪက့ၪအကယၧၩ့ထီၫ့ လၧနၥံၪဖ့ၪယူဝ့ၫ လၧဆၧလုမၪဘၪဆၧအဂး လၧတလၫဖိၪအဖၧၩ့လၧ အနဲၩ့ထံၭတၭ, ဖျါလၩ့အဝ့ၫၥံၪနီၪ, ဒုၭစဲၪ့ထၪ့ခွံၬ",
			"9": "<sup>9</sup> ဘီၪ.- တၭယိခွါ, အ့ၪလ့ၩထၪ့လၧဖၧၩ့ၥၭလၧအခး ဒၪဝ့ၫအနဲၩ့ထံၭ, လၧဘ့ၭၥၡ့မ့ၭနီၪ, မွဲအမၩပၧၩလၧ ဆၧအၧၩ့ဖၭဒိၪယီၩလီၫ. အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, ပ မိၥ့ၪယၫလၧအလမွဲဘၪအစူၪဒိၪပၧၩတၭ, မွဲဆၧဘၪ ဒၪပၧၩထမၫထမၫလီၫ.",
			"10": "<sup>10</sup> ၦၡၩလဖၪနီၪမၩဝ့ၫဘဲၫနီၪတၭ, မၩန့ချီမိအီၪလၧအ ဖိၪဆံၭနံၫဒုၩတၭ, ၦကျီၩထၬဝ့ၫလၧလဲၪ့တၭ, ဒုၭထၬ",
			"11": "<sup>11</sup> ဝ့ၫအဖိၪလၧအလးလီၫ.- တၭအဝ့ၫၥံၪအီၪက့ၪယဟိ ဝၩအတလၫနီၪ လၧလဲၪ့ဖၧၩ့, ဒဲတလၫဖိၪအီၪလၧယူ ထီၫ့ဒဲဆၧဆၫၥိၫလၩ့အဂၩ့လီၫ.",
			"12": "<sup>12</sup> တၭချီနီၪ လ့ၩဆုးလီၩ့လၧဘ့ၭၥၡ့မ့ၭ အဖၧၩ့ၥၭ, ဖိၬဝ့ၫလၧဖၧၩ့ၥၭမုနီၪ, ဂၪ့ကိၭၡၭထၪ့ဝ့ၫတၭလ့ၩဆၧ နီၪ,လၧစူၪထွ့ၪမွဲဂ့ၩ, စူၪစ့ၪမွဲဂ့ၩ, ကၠၪအၥၭအ့ၬ. တၭ ၦဖလံၡၫဖိၪအၦဒိၪဖၭဒိၪလဖၪ ဖိၬအခဲၫ့ထီၩ့လၧဘ့ၭ",
			"13": "<sup>13</sup> ၥၡ့မ့ၭအနဲၩ့ထံၭလီၫ.- ၦဘ့ၭၥၡ့မ့ၭဖိၪ ကူၭအဘုၪ ကၠိၩ့လၧဆၧဒၩဖၧၩ့တၭ, ကျဲၪ့ထၪ့အမ့ၬတၭ, ဒၪဘၪ",
			"14": "<sup>14</sup> တလၫနီၪ, ၥၭထိၬလၧအဒၪဝ့ၫအကၠီၩ့နီၪလီၫ.- လဲၪ့ လ့ၩနုၬလၧၦဘ့ၭၥၡ့မ့ၭဖိၪ စယီရှုၫအ့ၫအဆံၬဖၧၩ့တၭ, အီၪပထုၬထီးနီၪ, ထီးလိးဖၭဒိၪလဖျိၪ့ အအီၪလီၫ. တၭၦဖ့ၬဘျ့ၭခွံၬလဲၪ့တၭ, လုထၪ့ချီမိလဖၪလၧဆၧလု",
			"15": "<sup>15</sup> မ့ၪလၧယဟိဝၩအဂးလီၫ.- ၦလံဝဲၫဖိၪမၩန့ယဟိဝၩ အတလၫနီၪ, ဒဲတလၫဖိၪ အီၪလၧကယၧၩ့ထီၫ့အီၪ လၧအဖၧၩ့တၭ, အီၪက့ၪဝ့ၫလၧလိးဖၭဒိၪလဖျိၪ့အဖၫ့ ခိၪနီၪလီၫ. ဘ့ၭၥၡ့မ့ၭ အၦၡၩလုထၪ့ဆၧလုမ့ၪတၭ,",
			"16": "<sup>16</sup> လုထၪ့ဆၧလုလၧယဟိဝၩ လၧမုလနံၩနီၪလီၫ.- ထီး ၦဖလံၡၫဖိၪ အၦဒိၪဖၭဒိၪ ယဲဂၩနီၪ ဒၪဘၪဝ့ၫတၭ,",
			"17": "<sup>17</sup> ထဲၩ့ထဲၩ့ဝ့ၫလၧအ့ၭကြၧၫ့ လၧမုလနံၩဎးနီၪလီၫ.- တၭ အယီၩမွဲဆၧဆၫၥိၫလၩ့အဂၩ့ထီၫ့ လၧၦဖလံၡၫဖိၪ ဖ့ၪယူယဟိဝၩအဆၧလုမၪဘၪဆၧနီၪ, လၧအၭၡဒီၭ အဂးလဖျိၪ့, လၧဂၫဇၫအဂးလဖျိၪ့,လၧအၭၡကံၫလၫ့ အဂးလဖျိၪ့, လၧဂၫၥၭအဂးလဖျိၪ့, ဒဲလၧအ့ၭကြၧၫ့",
			"18": "<sup>18</sup> အဂးလဖျိၪ့လီၫ.- တၭယူထီၫ့ဎွ့ၩဎီၩ့ဒဲကယဲၦဖလံၡၫ ဖိၪအဒိၩ့လၧအဘၪဆဲၫ့လၧ ၦဒိၪဖၭဒိၪယဲဂၩ,ဒိၩ့အီၪ လၧအခိၪဒၧၩ့လဖၪ, ဒဲအတဝၫ့လဖၪဖိးလၧလိးဖၭဒိၪ အၫဘလၭထီးအအီၪက့ၪလၩ့ ယဟိဝၩအတလၫလၧ အလီၩ့နီၪလီၫ. လိးလဖျိၪ့နီၪအီၪဝ့ၫ ထီးမုဆၫလနံၩ ယီၩလၧၦဘ့ၭၥၡ့မ့ၭဖိၪ စယီရှုၫအ့ၫအဆံၬဖၧၩ့လီၫ.",
			"19": "<sup>19</sup> တၭဆၧဖ့ၬခွံၬ ဘ့ၭၥၡ့မ့ၭအၡၩနီၪ, အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪယိဝ့ၫ လၧယဟိဝၩ အတလၫ အဖၧၩ့လီၫ. တၭမွဲအဖ့ၬခွံၬ ၦယဲလၬ ဒဲနွ့ၫဆံၫလၧၦခမျၧးအကျၩ တၭ,ၦခမျၧးၥၭအုၭဝ့ၫလီၫ. အဂဲးဘဲၫယီၩယွၩဖ့ၬခွံၬ ယူၭဆၧဖ့ၬခွံၬဖၭဒိၪ လၧၦခမျၧးအကျၩလီၫ.",
			"20": "<sup>20</sup> ဘ့ၭၥၡ့မ့ၭအၡၩစံၭဝ့ၫဒၪ, မွဲပလၫဆၧၫ့ထုၪ့လၧ ယဟိဝၩယွၩ ဆံၫ့ဎံၪလဂၩယီၩ အမ့ၬယၫၥ့ၪလဂၩလဲၪ. တၭမိစဲၪ့ ထၪ့ခွံၬလၧပအီၪ ထီၩ့လၧပလၫလဂၩ",
			"21": "<sup>21</sup> အအီၪလဲၪ.- အဝ့ၫၥံၪအၪ့မၧၫ့အၥီၫ့လဖၪ လ့ၩလၧၦ အီၪဝ့ၫလၧကၧယၭယ့အရံၫ့အဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, ၦ ဖလံၡၫဖိၪဂဲၫ ထဲၩ့ဆိၬယူၭယဟိဝၩ အတလၫနီၪယူၭ, ဂဲၫလၩ့,ထဲၩ့ဆိၬထၪ့ထဲၩ့လၧနၥံၪအအီၪဘီၪ."
		},
		"7": {
			"1": "<sup>1</sup> ကၧယၭယ့အရံၫ့အၡၩနီၪဂဲၫတၭ, ထဲၩ့ဆိၬထၪ့ယ ဟိဝၩအတလၫနီၪတၭ, ဆိၬနုၬဝ့ၫလၧစအဘံနဒၭအ ဂံၪ့ဖၧၩ့အီၪလၧဆၧစီၩ့ခိၪတၭ, အီၪက့ၪဆံၫ့ဎံၪအဖိၪ ခွၫစအံၫလအ့ဇၧၫဘဲၫၥိၭအမိပၧၩ့ ယဟိဝၩအတလၫ နီၪလီၫ.",
			"2": "<sup>2</sup> တၭဆၧမၩအၥၭလၧတလၫနီၪ အီၪဝ့ၫလၧကၧယၭ ယ့အရံၫ့အဖၧၩ့အဘိၩ့ဘၭနီၪ, အဆၧၫ့အထီယံၬမၬး အဂဲးဘဲၫယီၩ မွဲဝ့ၫအနံၪ့နံၫဆံၫလီၫ. တၭအံၫစရ့လၭ အၡၩဂံၪ့ဖိၪ ထီးအလူၬမီၪ့ဘၪၥၭယူယဟိဝၩလီၫ.",
			"3": "<sup>3</sup> စစၫမုၫအ့လၭ ချဲၩ့ထၪ့ဆၧလၧအံၫစရ့လၭ အၡၩဂံၪ့ ဖိၪထီးအလူၬတၭ,စံၭဝ့ၫဒၪ, နၥံၪအ့ၪဂဲၫထဲၩ့ထဲၩ့လၧ ယဟိဝၩအအီၪလၧနၥံၪအၥၭ ထၧၫ့ဖျိၪ့ယၫတၭ,အီၪ က့ၪခွံၬၦလခီၫဘၩ့မုးဖိၪအယွၩလဖၪ, ဒဲအၭၡတြီၭ လၧနၥံၪအကျၩဆံၭ. တဲၩ့ဝဲၩနၥံၪအၥၭလၧယဟိဝၩ အဂးတၭ, မၩန့ၫအဝ့ၫလဂၩနီၪအဆၧဆံၭ. တၭမွဲအ မိမၩဖီၩ့မၩဖျ့ၭနၥံၪ လၧၦဖလံၡၫဖိၪအစူၪဖၧၩ့လီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့ၦအံၫစရ့လၭဖိၪ အီၪက့ၪခွံၬဘၫအလၭ လဖၪ,ဒဲအၭၡတြီၭတၭ မၩန့ၫယဟိဝၩအဆၧလီၫ.",
			"5": "<sup>5</sup> တၭစစၫမုၫအ့လၭစံၭဝ့ၫဒၪ, ဒုၭအီၪကိၩ့အီၪကီၪ့ အံၫစရ့လၭထီးအလူၬ လၧမံဇပၫနီၪဆံၭ. တၭယမိ",
			"6": "<sup>6</sup> ဘၩဆိၪဖၪန့နၥံၪအဂး လၧယဟိဝၩလီၫ.- အဝ့ၫၥံၪ အီၪကိၩ့အီၪကီၪ့လၧမံဇပၫတၭ, ဒုၪ့ထၪ့ထံၫ,လူၫလၩ့ ဝ့ၫလၧယဟိဝၩအမ့ၬယၫတၭ, ဒုၪဆၧအၪ့ဆၧအီၩ လၧမုလနံၩနီၪတၭ, စံၭဝ့ၫထီးနီၪ ပမၩမၪဘၪယူၭယ ဟိဝၩယူၭ. တၭစစၫမုၫအ့လၭ စ့ၩရၫ့ၦအံၫစရ့လၭ ဖိၪလၧမံဇပၫအဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> ၦဖလံၡၫဖိၪနါဂၧၫ့ဝ့ၫ လၧအံၫစရ့လၭဖိၪ အီၪကိၩ့ အီၪကီၪ့လၧမံဇပၫတၭ, ၦဖလံၡၫဖိၪအၦဒိၪဖၭဒိၪၥံၪ လ့ၩထၪ့ထၫ့ဒၩ ၦအံၫစရ့လၭဖိၪလီၫ. ၦအံၫစရ့လၭ",
			"8": "<sup>8</sup> ဖိၪနါဂၧၫ့ဝ့ၫတၭ, ၥၭမဲၪၦဖလံၡၫဖိၪနီၪလီၫ.- ၦအံၫစ ရ့လၭဖိၪစံၭစစၫမုၫအ့လၭ, ကိၭထၪ့ယဟိဝၩပယွၩ လၧပဂးတၭ,အီၪပထုၬလဂ့ၩ, ဘဲၫၥိၭအမိမၩဖီၩ့မၩ",
			"9": "<sup>9</sup> ဖျ့ၭပၧၩလၧၦဖလံၡၫဖိၪအစူၪဖၧၩ့နီၪအဂဲးလီၫ.- စစၫ မုၫအ့လၭမၩန့ၥိၪဖိၪလၧအအၪ့နူလဒုၩတၭ, လုထၪ့ ဝ့ၫလၧဆၧလုမ့ၪထၧၫ့ဒုၩယၫ လၧယဟိဝၩအဂးလီၫ. တၭစစၫမုၫအ့လၭ ကိၭထၪ့ယဟိဝၩ လၧအံၫစရ့လၭ အဂးတၭ, ယဟိဝၩခိၭနၪအလူလီၫ.",
			"10": "<sup>10</sup> တၭစစၫမုၫအ့လၭလုထၪ့ဆၧလုမ့ၪ အဘိၩ့ဘၭနီၪ, ဆၧမၩအၥၭလၧၦဖလံၡၫဖိၪ ၥုၭဘူၭအၥၭဘဲၫၥိၭအ မိဒုၭဆၧလၧအံၫစရ့လၭလီၫ. တၭဆၧလၧမုလနံၩနီၪ ယဟိဝၩမိဒုၭဎွံၩ့လၫ့ လၧဆၧၥီၫဖၭဒိၪ လၧၦဖလံၡၫ ဖိၪအလီၩ့တၭ, မၩစၪဝ့ၫနီၪဘၪဆၧဖ့ၬခွံၬဝ့ၫ လၧအံၫ",
			"11": "<sup>11</sup> စရ့လၭအမ့ၬယၫလီၫ.- အံၫစရ့လၭအၡၩစဲၪ့ထၪ့ခွံၬ လၧမံဇပၫတၭ, လီၩ့ဆီးၦဖလံၡၫဖိၪတၭ, ဖ့ၬခွံၬအဝ့ၫ",
			"12": "<sup>12</sup> ၥံၪဖိးလၧဘ့ၭၥကၫအဖၫ့လၬလီၫ.- စစၫမုၫအ့လၭမၩ န့လိးလဖျိၪ့တၭ, အီၪက့ၪဝ့ၫလၧမံဇပၫ ဒဲၡံၫ့အဘိၩ့ ဆၧၩ့တၭ,ဖျိၬဝ့ၫအမံၩ့လၧ အ့ၭဘနံဇၧၫတၭ,စံၭ, ယ ဟိဝၩမၩဆၧၩ့ယူၭပၧၩ လၧအခီၫခီးဘိၩ့နဲၪ့ယီၩလီၫ.",
			"13": "<sup>13</sup> ၦဖလံၡၫဖိၪစၪဝ့ၫတၭ, ဂဲၫလၧအံၫစရ့လၭ အခးနဲၩ့ ထံၭလၧၩ့အ့ၬ. တၭယဟိဝၩအစူၪအီၪဝ့ၫလၧၦဖလံၡၫ ဖိၪအလီၩ့,လၧစစၫမုၫအ့လၭ အမုနံၩထီးအလူၬလီၫ.",
			"14": "<sup>14</sup> ဆၧလၧဒိၩ့လဖၪလၧၦဖလံၡၫဖိၪ မၩန့ယူၭဝ့ၫလၧအံၫ စရ့လၭအစူၪဖၧၩ့နီၪ, ဘၪဆၧဖ့ၪထဲၩ့ဝ့ၫလၧအံၫစရ့ လၭ,လၧအ့ၭကြၧၫ့နီၪထီၩ့လၧဂၫၥၭး ဒဲအခးနဲၩ့ထံၭ လဖၪနီၪအံၫစရ့လၭမၩဖီၩ့ဖျ့ၭဝ့ၫ လၧၦဖလံၡၫဖိၪအ စူၪဖၧၩ့လီၫ. တၭၦအံၫစရ့လၭ ဒဲၦအၫမိၫဖိၪအီၪဘၪ လိၬအၥၭလီၫ.",
			"15": "<sup>15</sup> တၭစစၫမုၫအ့လၭ စ့ၩရၫ့အံၫစရ့လၭလဆိၩဒၪအ",
			"16": "<sup>16</sup> ၥၭလီၫ.- တၭလ့ၩဎဲၪ့လၧလနံၪ့ဘၪလနံၪ့လၧဘ့ၥလၭ, ဒဲလၧဂံလဂၫလၭ, ဒဲမံဇပၫတၭ, စ့ၩရၫ့အံၫစရ့လၭလၧ",
			"17": "<sup>17</sup> အလးလဖၪနီၪထီးအလူၬလီၫ.- အ့ၪမွဲအဂဲၫထဲၩ့ထဲၩ့ လခီၫနီၪမွဲလၧရၫမၫလီၫ. အဂဲးဘဲၫယီၩအဂံၪ့အီၪထီး နီၪတၭ,စ့ၩရၫ့အံၫစရ့လၭထီးနီၪ, ဒဲမၩထၪ့ဆၧလုလး လၧယဟိဝၩအဂးထီးနီၪလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> ထီးစစၫမုၫအ့လၭအၥၭၡါယူၭတၭ, ဆၧမၩအၥၭ လၧအအီၪက့ၪအဖိၪခွၫလဖၪ လၧၦစ့ၩရၫ့ဆၧလၧအံၫ",
			"2": "<sup>2</sup> စရ့လၭအဂးလီၫ.- တၭအဖိၪဝဲၡါအမံၩ့နီၪမွဲစယိၫအ့ လၭ,နံၫဂၩလဂၩအမံၩ့မွဲစအဘဲအၫလီၫ. မွဲဝ့ၫလၧၦ",
			"3": "<sup>3</sup> စ့ၩရၫ့ခွးလၧဘံအၧၫၡံၫဘၫအဖၧၩ့လီၫ.- တၭအဖိၪ ခွၫလဖၪနီၪလ့ၩလၧအဝ့ၫဒၪအဖၧၩ့ၥၭ ၥံၪအဖၧၩ့အ့ၬ. အ့ၪမွဲကၠၪအၥၭလၧဆၧၥၭကွံၩဆၧတၭ, မၩန့လၬဆီၪ့ ၥံၪတၭ,ဘိၭကၠၪမၪဆၧစ့ၩရၫ့လီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့အံၫစရ့လၭ အၥုၪ့က့ၭၥၭၡါအီၪကိၩ့ အီၪကီၪ့ထီးအလူၬတၭ, ဂဲၫဝ့ၫလၧစစၫမုၫအ့လၭအ",
			"5": "<sup>5</sup> အီၪထီးရၫမၫအဖၧၩ့,- တၭစံၭဝ့ၫဒၪ,ယိခွါ, နၥၭၡါ ယူၭ,နဖိၪခွၫလဖၪလ့ၩလၧနဖၧၩ့ၥၭအ့ၬ, တၭအီၪက့ၪ န့ပၧၩလၧစဎွၩနးဂၩ လၧအမိစ့ၩရၫ့ပၧၩ ဘဲၫကယဲၦ ဆၨၩလဖၪထီးအလူၬအၥိၭနီၪဆံၭ.",
			"6": "<sup>6</sup> လၧအစံၭဖ့ၪလၫ့န့ပၧၩလၧ စဎွၩနးဂၩလၧအမိစ့ၩရၫ့ န့ပၧၩနီၪလဘၪဘၪစစၫမုၫအ့လၭအၥၭတၭ, အဝ့ၫဒၪ",
			"7": "<sup>7</sup> ဘၩဆိၪဖၪယဟိဝၩလီၫ.- တၭယဟိဝၩစံၭစစၫမုၫအ့ လၭလၧကယဲဆၧလၧၦခမျၧးစံၭနၧၩ လမံၩ့လါလါ နီၪ,ခိၭနၪအလူဆံၭ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪခွံၬၡိၭယူၭ နၧၩအ့ၬ,မွဲအခွံၬၡိၭယၧၩ, ဘဲၫၥိၭယထီးကဲၪစဎွၩလၧ",
			"8": "<sup>8</sup> အဖၫ့ခိၪလဂ့ၩလီၫ.- ဘဲၫကယဲဆၧမၩလၧအမၩဝ့ၫခီၫ လၧမုနံၩလၧယဒုၭစဲၪ့ထၪ့ခွံၬ အဝ့ၫၥံၪလၧအံဇံၭခီးမု ဆၫလနံၩယီၩတၭ, အဝ့ၫၥံၪစဲၪ့ဒၪယၧၩ, ဒဲမၩယွၩအ ဂူၫဂၩၥံၪအဆၧမၩနီၪ, အဝ့ၫၥံၪမၩနၧၩဘဲၫနီၪအၥိၭ",
			"9": "<sup>9</sup> ဆ့လီၫ.-တၭဘိၩ့နဲၪ့ယီၩ ခိၭနၪအဝ့ၫၥံၪအလူဆံၭ. မွဲလါနၫ့တၭ, ထိးနၥၭလၧအမ့ၬယၫတၡါၡါတၭ,ဒုၭ နဲၪအဝ့ၫၥံၪလၧစဎွၩ လၧအမိကဲၪစဎွၩ လၧအဖၫ့ခိၪ နီၪအဆၧစ့ၩရၫ့အဂဲးအကၠီၪ့ဆံၭ.",
			"10": "<sup>10</sup> ၦခမျၧးလၧအအၪ့ကံၩ့န့စဎွၩ လၧအဝ့ၫဒၪနီၪ,စစၫ မုၫအ့လၭလီၩဘၪဝ့ၫလၧယဟိဝၩ အဆၧချဲၩ့လဖၪထီး",
			"11": "<sup>11</sup> အလူၬလီၫ.- တၭစံၭဝ့ၫဒၪ, အယီၩမွဲစဎွၩလၧအမိကဲၪ စဎွၩလၧနၥံၪအဖၫ့ခိၪ အဆၧစ့ၩရၫ့ အဂဲးအကၠီၩ့နီၪ, အဝ့ၫဒၪမိမၩန့နၥံၪအဖိၪခွၫလဖၪတၭ, မိအီၪက့ၪလၧ အဂးဒၪဝ့ၫ,ဒဲလၧအလဲၪ့ၥုၭအဂး, ဒဲလၧအၡၩထူၬက ၥ့ၪအဂးတၭ, အဝ့ၫၥံၪမိစဲၪ့ထၪ့လၧအလဲၪ့ၥုၭ အမ့ၬ",
			"12": "<sup>12</sup> ယၫလီၫ.- တၭလၧအလးဒၪဝ့ၫနီၪမိအီၪက့ၪလၩ့ၦအ ထီၫ့ၥံၪအခိၪ, ၦယဲဆံၫၥံၪအခိၪတၭး မိအီၪက့ၪဝ့ၫဘဲၫ ၥိၭအမိထဲၫအဂၪ့ခိၪ, ဒဲကူၭအဘုၪ, ဒဲနဲၫ့အၡၩၥုၭဖိၪ",
			"13": "<sup>13</sup> အစူၪဝဲၩ, ဒဲအလဲၪ့အဎၧၩ့အဎီလီၫ.- တၭမိမၩန့နၥံၪ အဖိၪမုၪလဖၪတၭ, မိဒုၭကဲၪထၪ့ဝ့ၫလၧၦလဲၩဎုၬဆၧ",
			"14": "<sup>14</sup> နၧၫ့မၧၫ့,ဒဲၦအၪ့ဖီၫ့မ့ၩ, ဒဲၦမၩကိၪလီၫ.- တၭမိမၩန့ နၥံၪအဆံၬအနၩ, ဒဲနၥံၪအစဘံၭမုအလး, ဒဲနၥံၪအ လဲအိၫ့အကျိၭအဂ့ၩထုၬလဖၪတၭ, ဖ့ၪလၫ့ဝ့ၫလၧအ",
			"15": "<sup>15</sup> ခ့ၫအၡၩလီၫ.- တၭနၥံၪအချံၫအၥၪ, ဒဲအစဘံၭမုအ လးနီၪမိမၩန့ဝ့ၫဆံၫပိၩ့လပိၩ့တၭဖ့ၪလၫ့ဝ့ၫ လၧၦအ",
			"16": "<sup>16</sup> ဒိၪလဖၪ,ဒဲလၧအခ့ၫအၡၩလဖၪလီၫ.- တၭအဝ့ၫဒၪမိ မၩန့နၥံၪအခ့ၫအၡၩခွၫ, ဒဲနၥံၪအခ့ၫအၡၩမုၪ, ဒဲနၥံၪ အဖိၪၥၪခွၫလၧအဂ့ၩ, ဒဲနၥံၪအကၥ့ၪယီၩ့တၭ, ဒုၭမၩ",
			"17": "<sup>17</sup> လၧအဆၧမၩဒၪဝ့ၫလီၫ.- တၭမိမၩန့နၥံၪအၥိၪဒဲဘ့ၪ",
			"18": "<sup>18</sup> ဆံၫဒီၪ့လဒီၪ့တၭ,နၥံၪမိကဲၪထၪ့အဎီးအၡၩလီၫ.- တၭ ဆၧလၧမုလနံၩနီၪနၥံၪမိကိၭၡၭထၪ့ လၧနၥံၪရွံန့ဝ့ၫလ ဂၩအကၠီၩ့တၭ, ဆၧလၧမုလနံၩနီၪ ယဟိဝၩခိၭနၪန ၥံၪအလူအ့ၬ.",
			"19": "<sup>19</sup> မွဲလါနၫ့ၦၡၩၥံၪခိၭနၪ စစၫမုၫအ့လၭအလူအ့ၬး တၭအဝ့ၫၥံၪစံၭဝ့ၫ,မွဲအ့ၬ, မွဲပမိအီၪလၧစဎွၩလၧပဖၫ့",
			"20": "<sup>20</sup> ခိၪလဂၩလီၫ.- တၭပမိအီၪဆ့ဘဲၫၦဆၨၩလဖၪထီးအ လူၬအၥိၭနီၪတၭ, ပစဎွၩမိစ့ၩရၫ့ပၧၩတၭ, လ့ၩဆၧ လၧပမ့ၬယၫတၭ, ဒုၭဆၧဒုၭၥုၭလၧပဂးလီၫ.",
			"21": "<sup>21</sup> တၭစစၫမုၫအ့လၭနါဂၧၫ့ၦခမျၧး အဆၧချဲၩ့ထီးအ လူၬတၭ, လီၩလၩ့ဝ့ၫလၧယဟိဝၩအနါဖၧၩ့လီၫ.",
			"22": "<sup>22</sup> ယဟိဝၩစံၭစစၫမုၫအ့လၭ, ခိၭနၪအဝ့ၫၥံၪအလူတၭ, ဒုၭအီၪထၪ့အဝ့ၫၥံၪ လၧအစဎွၩဆံၭ, တၭစစၫမုၫအ့ လၭစံၭအံၫစရ့လၭအၡၩ, ထဲၩ့ထဲၩ့လၧလဂၩအဒိၩ့ ဒၪဝ့ၫလဂၩအဒိၩ့ဒၪဝ့ၫဆံၭ."
		},
		"9": {
			"1": "<sup>1</sup> ၦလၧဘံၪ့ယမံၫ့ဖိၪအကျၩနီၪ အီၪဝ့ၫလဂၩတၭ,အ မံၩ့မွဲစကံၭ, စအဘဲၫအ့လၭအဖိၪခွၫစဇံရီၫအဖိၪခွၫ, စဘခိရၭအဖိၪခွၫ,စအၭဖၠၫအဖိၪခွၫ, ၦဘံၪ့ယမံၫ့ဖိၪ",
			"2": "<sup>2</sup> တၭ,မွဲဝ့ၫလၧၦကဲၪဒိၪအဂဲးဆီၪ့လီၫ.- အဝ့ၫအီၪလၧ အဖိၪခွၫလဂၩတၭ, အမံၩ့မွဲစစီလူၫ, ၦဖိၪၥၪခွၫလၧအဂ့ၩတၭ, ၦဂ့ၩနဲၪ့အဝ့ၫဒၪ လၧအံၫစရ့လၭဖိၪအကျၩ အီၪအ့ၬ. လၧအခိၬထံၭခိၪအဖၫ့ခိၪနီၪထီၫနဲၪ့ၦခမျၧး လဂၩလါလါကိၭဂၩဒ့ၭလီၫ.",
			"3": "<sup>3</sup> တၭစစီလူၫအဖါ စကံၭအကၥ့ၪယီၩ့လဖၪလၩ့မါ တၭ,စကံၭစံၭအဖိၪခွၫစစီလူၫနီၪ, မၩန့ဖိၪၥၪခွၫလဂၩ တၭ,ဂဲထုၪ့လ့ၩအၪ့ဎၬန့ထဲၩ့ ကၥ့ၪယီၩ့လဖၪနီၪဘီၪ.",
			"4": "<sup>4</sup> အဝ့ၫလ့ၩခၫ့ဂၬခိၪလီၩ့အံဖြံၫ့တၭ, ခၫ့ဂၬခးၡလံၡၫ နီၪဒၪန့ဝ့ၫအ့ၬ. ထီးနီၪလဖၧၫ့ခၫ့ဂၬခးၡၫအလံၫ့နီၪ,အီၪ အ့ၬ.တၭခၫ့ဂၬၦဘံၪ့ယမံၫ့ဖိၪ အခးလါနၫ့တၭ,ဒၪန့",
			"5": "<sup>5</sup> ဝ့ၫအ့ၬ.- ထီးအလ့ၩနုၬလၧခးဇုၭတၭ, စစီလူၫစံၭဖိၪ ၥၪခွၫလၧအအီၪလၧအၥိၭ, ဂဲၫ,ပထဲၩ့ၡီၩ့ဘီၪ. ယဖါ လအၪ့ယိၪလၧၩ့ဘၪ လၧကၥ့ၪယီၩ့အဂးတၭ, မိအၪ့",
			"6": "<sup>6</sup> ယိၪဘၪခိၬလၧပဂးလီၫ.- အဝ့ၫဒၪစံၭဝ့ၫ,ယိခွါ,ယွၩ အၡၩလဂၩအီၪဝ့ၫလၧဒိၩ့လဖျိၪ့ယီၩအဖၧၩ့တၭ, မွဲၦ ၡၩအီၪလၧအလၩအဖၩ့လဂၩတၭ, ကယဲဆၧလၧအ ချဲၩ့ဝ့ၫနီၪမၩအၥၭလၩ့ထံးလၩ့ဆ့ၭလီၫ. ဘိၩ့နဲၪ့ယီၩ, မွဲပလ့ၩၡီၩ့ထီးနီၪဘီၪ. ဘၪလဘၪမိဒုၭနဲၪပၧၩလၧ",
			"7": "<sup>7</sup> ဖၧၩ့ၥၭလၧပကြၨၭလ့ၩဖိၬလီၫ.- ထီးနီၪလဖၧၫ့စစီလူၫ စံၭအၡၩဖိၪၥၪခွၫနီၪ, ယိခွါ,ပမိလ့ၩဆိၬန့ၦလဂၩနီၪ လၧဆၧနီၪလမံၩ့လဲၪ. အဂဲးဘဲၫယီၩ ပကိၪလူၬယူၭ လၧပဆၧဖိၪဆၧလံၩအကျၩတၭ, လၬဆီၪ့လၧပမိဆိၬ လၧယွၩအၡၩအဂးအီၪအ့ၬ. မွဲဆၧနီၪလၫအီၪလၧပ",
			"8": "<sup>8</sup> စူၪဖၧၩ့လမံၩ့လဲၪ.- အၡၩဖိၪၥၪခွၫနီၪ စံၭဆၧၫ့ဒီၭစစီ လူၫတၭ,စံၭဝ့ၫဒၪ, ယိခွါ, စ့ၩၡက့လၭလၥံၭအီၪဝ့ၫ လၧယစူၪဖၧၩ့တၭ, ယမိဖ့ၪလၫ့ယွၩအၡၩဘဲၫၥိၭအမိ",
			"9": "<sup>9</sup> ဒုၭနဲၪပၧၩလၧပဖၧၩ့ၥၭလီၫ.- (လၧဖျိၩ့လၧအခၪ့ထံၭ လၧအံၫစရ့လၭအကျၩနီၪ ၦအ့ၪလ့ၩအၪ့စၪ့ ဆၧလၧ ယွၩတၭ,ချဲၩ့ဝ့ၫဘဲၫယီၩ, ဂဲၫဘီၪ,မွဲပလ့ၩၡီၩ့လၧၦဒၪ ဆၧလၧယၫအအီၪဆံၭ. အဂဲးဘဲၫယီၩၦလၧၦကိၭဝ့ၫ ဘိၩ့နဲၪ့ယီၩလၧမီၪနီၪ, လၧဖျိၩ့လၧအခၪ့ထံၭ, ၦကိၭ",
			"10": "<sup>10</sup> ဝ့ၫလၧၦဒၪဆၧလၧယၫလီၫ.)- တၭစစီလူၫစံၭအၡၩ ဖိၪၥၪခွၫနီၪနချဲၩ့ဆၧဂ့ၩယူၭ, ဂဲၫဘီၪ,မွဲပလ့ၩၡီၩ့ဆံၭ. တၭအဝ့ၫၥံၪလ့ၩဝ့ၫလၧဒိၩ့ဖၧၩ့ ထီးယွၩအၡၩအီၪဝ့ၫ လီၫ.",
			"11": "<sup>11</sup> အဝ့ၫၥံၪလ့ၩထၪ့လၧဆၧစီၩ့ခိၪလၧဒိၩ့ဖၧၩ့တၭ, ဒၪ ဘၪဝ့ၫလၧဖိၪၥၪမုၪလဖၪ စဲၪ့ထၪ့အၪ့ဒုၪ့ထံၫတၭ,စံၭ အဝ့ၫၥံၪ, ၦဒၪဆၧလၧယၫလဂၩနီၪ အီၪထီးယီၩဧၪ.",
			"12": "<sup>12</sup> အဝ့ၫၥံၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, အီၪဝ့ၫတကၨ, ယိခွါ,အီၪဝ့ၫလၧနၥံၪအမ့ၬယၫ, မၩချဲၫ့ချဲၫ့ဘီၪ,အဂဲး ဘဲၫယီၩလၧမုဆၫလနံၩယီၩ, ၦခမျၧးလုထၪ့ဆၧလၧ",
			"13": "<sup>13</sup> အလးထၪ့ထီၫနီၪလီၫ.- ထီးနၥံၪလ့ၩနုၬလၧဒိၩ့ဖၧၩ့ နီၪ,ဘိၩ့အဝ့ၫဒၪလချႃၭလ့ၩဒံၭဘၪလၧဆၧအလးထၪ့ ထီၫဘဲၫၥိၭအမိအၪ့ဆၧတၭ, နၥံၪမိဒၪန့ဝ့ၫဘဲၫနီၪလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫဒၪလချႃၭ ဂဲၫဒံၭဘၪတၭ, ၦခမျၧး အၪ့ဝ့ၫအ့ၬ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪဆိၪဂ့ၩဆၧလုနီၪ လီၫ.ဆၧမၩအၥၭဘဲၫနီၪ အလးခဲၫ့နီၪ ၦလၧအဘၪ ဆၧကိၭဝ့ၫလဖၪအၪ့ဝ့ၫလီၫ. တၭလ့ၩထၪ့ဘိၩ့နဲၪ့ယီၩ ဘီၪးအဂဲးဘဲၫယီၩ နၥံၪမိဒၪန့ဝ့ၫဘူၭကၪ လၧအထီ",
			"14": "<sup>14</sup> ယီၩလီၫ.- တၭအဝ့ၫၥံၪလ့ၩထၪ့ဝ့ၫလၧဒိၩ့ဖၧၩ့လီၫ. ထီးအဂဲၫဝ့ၫလၧဒိၩ့အၥၭကျၩတၭ, ယိခွါ, စစၫမုၫအ့ လၭဂဲၫဘၪခီၩ့ အဝ့ၫၥံၪလၧအမိလ့ၩထၪ့ လၧဆၧအ လးထၪ့ထီၫနီၪလီၫ.",
			"15": "<sup>15</sup> မုလနံၩလၧစစီလူၫလချႃၭဂဲၫထီၩ့ဒံၭဘၪနီၪယဟိ",
			"16": "<sup>16</sup> ဝၩလီၩဘၪယူၭစစၫမုၫအ့လၭတၭ, စံၭဝ့ၫဒၪ,- ကဲဂီၩ ခိၬလၧအခၫယီၩယမိအၪ့မၧၫ့လၩ့ ၦလဂၩလၧဘံၪ့ယ မံၫ့အဖၧၩ့လၧနအီၪတၭ, နမိဘၪဂုၪဝ့ၫဘဲၫၥိၭအမိကဲၪ ထၪ့ယၡၩခမျၧးအံၫစရ့လၭအခိၪ, ဘဲၫၥိၭအမိမၩဖီၩ့ မၩဖျ့ၭယၡၩခမျၧးလၧၦဖလံၡၫဖိၪအစူၪဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ယယိလၩ့ ယၡၩခမျၧးတၭ, အဝ့ၫၥံၪအ",
			"17": "<sup>17</sup> ဆၧကိၭၡၭထၪ့ဂဲၫထၪ့ဘၭယူၭ လၧယအီၪယူၭ.- တၭ ထီးစစၫမုၫအ့လၭ, ဒၪဘၪစစီလူၫနီၪ, ယဟိဝၩစံၭဝ့ၫ, ယိခွါ, ၦလဂၩလၧယလီၩဘၪနၧၩအဂဲး, ၦလဂၩယီၩ",
			"18": "<sup>18</sup> မိပၧၩ့ယၡၩခမျၧးလီၫ.- တၭစစီလူၫလ့ၩဘူၭလၧစစၫ မုၫအ့လၭလၧတရၫ့ဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, ၦဒၪဆၧလၧ ယၫလဂၩနီၪ,အဂံၪ့အီၪခီၫခီၫလဲၪ, ဒုၭနဲၪယၧၩဘီၪ.",
			"19": "<sup>19</sup> တၭစစၫမုၫအ့လၭ စံၭဆၧၫ့စစီလူၫ ယမွဲၦဒၪဆၧလၧ ယၫလဂၩနီၪလီၫ. လ့ၩထၪ့လၧယမ့ၬယၫလၧဆၧအ လးထၪ့ထီၫနီၪဘီၪ. တၭမုဆၫလနံၩယီၩ, နၥံၪမိအၪ့ ဆၧလၧယၥိၭတၭး ကဲဂီၩခိၬယမိဖျါနၧၩ, ဒဲဒုၭနဲၪနၧၩ",
			"20": "<sup>20</sup> လၧကယဲဆၧလၧအအီၪဝ့ၫလၧနၥၭခံဖၧၩ့လီၫ.- တၭ ဆၧလၧနကၥ့ၪယီၩ့လဖၪ လၧအလၩ့မါယူၭၥၧၫ့နံၩနီၪ အီၪက့ၪနၥၭလၧအဝ့ၫၥံၪလဂ့ၩ, အဂဲးဘဲၫယီၩဆၧဒၪ န့ယူၭဝ့ၫယူၭတၭ, ကယဲဆၧလၧၦဆိၫ့န့ဘၪဝ့ၫဘၪဆဲၫ့ လၧအံၫစရ့လၭနီၪ, မွဲအအီၪလၧပလၫလဂၩလဲၪ. အီၪ လၧနၧၩ, ဒဲလၧနဖါအၡၩဂံၪ့ဖိၪ ထီးအလူၬမွဲအ့ၬဧၪ.",
			"21": "<sup>21</sup> စစီလူၫစံၭဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪယမွဲၦဘံၪ့ယမံၫ့ဖိၪ, ၦဒီၪ့ဆံၭထုၬ လၧအံၫစရ့လၭအကျၩမွဲအ့ၬဧၪ. တၭ ယဂံၪ့ဒီၪ့မွဲအဆံၭထုၬ လၧဘံၪ့ယမံၫ့အဒီၪ့ထီးအလူၬ အကျၩလမွဲဘၪဧၪ. နမိချဲၩ့ဆၧလၧယၧၩလၧဆၧချဲၩ့ ဘဲၫနီၪလဖၪမွဲအဂဲးဘဲၫၥ့ၪလဲၪ.",
			"22": "<sup>22</sup> စစၫမုၫအ့လၭမၩန့စစီလူၫ ဒဲအၡၩဖိၪၥၪခွၫနီၪ, ဒုၭလ့ၩနုၬဝ့ၫလၧဒူၭဖၧၩ့တၭ, ဒုၭဆၧၫ့နၩ့ဝ့ၫ လၧအလး ဂ့ၩထုၬလၧၦဘၪဆၧကိၭဝ့ၫအကျၩတၭ, အဝ့ၫၥံၪနီၪမွဲ",
			"23": "<sup>23</sup> ၦၥၧၫ့ဆံၫကၪယူၭလီၫ.- တၭစစၫမုၫအ့လၭ စံၭၦအၪ့ ဖီၫ့ဆၧလဂၩ, ဆၧအဂး လၧယဖ့ၪလၫ့နၧၩတၭ,စံၭ",
			"24": "<sup>24</sup> နၧၩအီၪက့ၪလစီၪ့ဒၪနီၪ, ဂဲၫန့ဘီၪ.- ၦအၪ့ဖီၫ့ဆၧလ ဂၩနီၪမၩန့ထၪ့ဆၧအခိၬထံၭခိၪ, ဒဲဆၧအီၪလၧအဖၫ့ ခိၪတၭ, အီၪက့ၪဝ့ၫလၧစစီလူၫအမ့ၬယၫလီၫ. တၭစ စၫမုၫအ့လၭစံၭဝ့ၫဒၪ,ယိခွါ, ဆၧလၧအဘၪအီၪက့ၪ ထၬဝ့ၫနီၪဆၧအီၪက့ၪလၧနမ့ၬယၫ, အၪ့ဆၧဘီၪး အဂဲး ဘဲၫယီၩအခီၫလၧယစံၭယကိၭထဲၩ့ ၦခမျၧးယူၭနီၪ, ထီးအဆၧၫ့အထီယီၩ ဘၪဆၧအီၪက့ၪထၬဝ့ၫလၧနဂး လီၫ.ဆၧလၧမုလနံၩနီၪ စစီလူၫအၪ့ဆၧလၧစစၫမုၫ အ့လၭအၥိၭလီၫ.",
			"25": "<sup>25</sup> ထီးအဝ့ၫၥံၪဂဲၫထဲၩ့လၩ့ လၧဆၧအလးထၪ့ထီၫနီၪ လၧဒိၩ့ဖၧၩ့တၭ, စစၫမုၫအ့လၭချဲၩ့ဒုၪ့ စစီလူၫလၧအ ဂံၪ့ခိၪလီၫ.",
			"26": "<sup>26</sup> အဝ့ၫၥံၪဂဲထုၪ့ဂီၩဂီၩတၭ, ဘူၭကၪလၧမုဆဲၪ့ထၪ့, ဆၧမၩအၥၭလၧစစၫမုၫအ့လၭ ကိၭထၪ့စစီလူၫလၧဂံၪ့ ခိၪတၭ, စံၭဝ့ၫဒၪဂဲထုၪ့ဘီၪး ယမိဖျါခွံၬနၧၩလီၫ. တၭစစီလူၫဂဲထုၪ့း တၭအဝ့ၫၥံၪနံၫဂၩလူၬ, အဝ့ၫဒၪ, ဒဲစစၫမုၫအ့လၭစဲၪ့ထၪ့ဝ့ၫလၧခီၫ့လီၫ.",
			"27": "<sup>27</sup> အဝ့ၫၥံၪလ့ၩလၩ့လၧဒိၩ့အထုၬ အဘိၩ့ဘၭနီၪ,စစၫ မုၫအ့လၭစံၭ စစီလူၫအၪ့မၧၫ့ ၦဖိၪၥၪခွၫ လ့ၩလၩ့လၧ ယၫလခီၫဘီၪ. (တၭအဆၧလ့ၩဝ့ၫလီၫ.) အ့ၪမွဲနဝ့ၫ ဒၪယီၩ,ဆၧၫ့ထုၪ့အီၪနးဆိတၭ, ယမိဒုၭၥ့ၪယၫနၧၩ လၧယွၩအလူအထၫလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့စစၫမုၫအ့လၭ မၩန့ၥိၪလပလၫ့တၭ, လူၫလၩ့ဝ့ၫလၧစစီလူၫအခိၪဎွံၪတၭ, အဲၪဂါဝ့ၫ,စံၭဝ့ၫ ဒၪ,မွဲယဟိဝၩဂုၪနၧၩ ဘဲၫၥိၭနမိကဲၪထၪ့အဆၧန့ၥၫ",
			"2": "<sup>2</sup> အခိၪနီၪ,လမွဲဘၪဧၪ.- ထီးနစဲၪ့ထၪ့ခွံၬလၧယအီၪမု ဆၫလနံၩယီၩတၭ, နမိဒၪန့ၦနံၫဂၩအီၪဝ့ၫလၧနးရၫခ့ လၭအၥွၪခိၪအနဲၩ့, လၧဘံၪ့ယမံၫ့အခးနဲၩ့ထံၭထီး ဇ့လဇၫနီၪ,အဝ့ၫၥံၪမိစံၭနၧၩ, ကၥ့ၪယီၩ့လၧနလ့ၩအၪ့ ဎၬဝ့ၫလဖၪနီၪဆၧဒၪန့ယူၭဝ့ၫယူၭး တၭယိခွါ, နဖါ အၪ့ယိၪလၧၩ့လၧကၥ့ၪယီၩ့အဂးအ့ၬ, တၭအၪ့ယိၪ ဝ့ၫလၧနၥံၪအဂးတၭ, စံၭဝ့ၫဒၪ, ယမိမၩလၧယဖိၪခွၫ",
			"3": "<sup>3</sup> အဂးဘဲၫၥ့ၪလဲၪ.- ထီးနီၪလဖၧၫ့နမိစဲၪ့ထၪ့ထီးနီၪလ့ၩ လၧယၫတၭ, နမိထီၩ့လၧၥံၪ့ထိၭဖၫတၫဘီၫတၭ,နမိ ဘၪခီၩ့လၧၦၡၩၥၧၫ့ဂၩ ထီးနီၪလၧအလ့ၩထၪ့လၧ ယွၩအအီၪလၧဘ့ၥလၭတၭ, လဂၩဆိၬဘ့ၪဖိၪၥၧၫ့ ဒုၩ,ဒဲအလဂၩဒၪဆိၬကိၪၥၧၫ့လီၪ့, ဒဲအလဂၩဒၪဆိၬ",
			"4": "<sup>4</sup> စဘံၭထံၫအထိၪ့ဆၧဖံၭလဖျိၪ့.- အဝ့ၫၥံၪနီၪမိချဲၩ့ဒုၪ့ နၧၩတၭ,ဖ့ၪလၫ့နၧၩလၧကိၪနးနံၫလီၪ့တၭး နမိဘၪ",
			"5": "<sup>5</sup> ဒိၭန့ဝ့ၫလၧအဝ့ၫၥံၪအစူၪဖၧၩ့လီၫ.- လၧခဲၫ့တၭမိထီၩ့ လၧယွၩအဆၧစီၩ့ခိၪထီးၦဖလံၡၫဖိၪ အထိၬအီၪတၭ, ထီးနဂဲၫနုၬလၧဒိၩ့ဖၧၩ့ထီးနီၪတၭ, ဆၧမိမၩအၥၭလၧ နမိဘၪခီၩ့လၧမီၪလဒီၪ့ဂဲၫလၩ့လၧ ဆၧအလးထၪ့ထီၫ အီၪလၧၥၫ့ထီးဒဲဒိၩ့,ဒဲပံၩ, ဒဲနါဒံၩ့လၧအမ့ၬယၫတၭ,",
			"6": "<sup>6</sup> မိချဲၩ့ဝ့ၫလၧမီၪအချိၬလီၫ.- တၭယွၩအၥၭမိဂဲၫလၩ့ ဘၪလၧနလီၩ့တၭ, နမိချဲၩ့ဆၧလၧမီၪအချိၬလၧအၥိၭ တၭ,နမိဘၪဆၧအၪ့လဲၩထဲၩ့နၥၭတၭ, ကဲၪထၪ့ၦလ",
			"7": "<sup>7</sup> ဂၩဒၪလီၫ.- ထီးဆၧမၩနဲၪ့လဖၪနီၪဂဲၫဘၪနၧၩတၭ, ဆၧမိမၩအၥၭ လၧနမိဘၪမၩဆၧဘဲၫအလးအီၪဝ့ၫအ ၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩ ယွၩအီၪလၧနၥိၭလီၫ.",
			"8": "<sup>8</sup> တၭနမိဘၪလ့ၩလၩ့လၧယမ့ၬယၫ လၧဂံလဂၫလၭ တၭ,ယိခွါ,ယမိဂဲၫလၩ့လၧနအီၪ, ဘဲၫၥိၭယမိလုထၪ့ ဆၧလုမ့ၪ, ဒဲလုထၪ့ဆၧလုမၩဘၪလိၬအိၭလိၬလီၫ.န မိဘၪအီၪနွ့ၫနံၩထီးယဂဲၫလၧနအီၪ, ဒဲဒုၭၥ့ၪယၫနၧၩ လၧဆၧလၧနမိဘၪမၩလီၫ.",
			"9": "<sup>9</sup> ထီးအကၠၪဒိၭချိၫ့အၥၭ, ဘဲၫၥိၭအမိစဲၪ့ထၪ့ခွံၬလၧ စစၫမုၫအ့လၭအအီၪတၭ, ဆၧမၩအၥၭလၧယွၩဖ့ၪ လၫ့ဝ့ၫအၥၭဂူၫဂၩလဖျိၪ့း ဒဲဆၧမၩနဲၪ့ထီးအလူၬနီၪ",
			"10": "<sup>10</sup> မၩအၥၭလၧမုလနံၩနီၪလီၫ.- ထီးအဝ့ၫၥံၪဂဲၫထီၩ့လၧ ဆၧစီၩ့ခိၪနီၪ, ယိခွါ,မီၪလဒီၪ့ဂဲၫဘၪခီၩ့ဝ့ၫတၭ, ယွၩ အၥၭဂဲၫလၩ့လၧအလီၩ့, ချဲၩ့ဝ့ၫလၧမီၪအချိၬလၧအ",
			"11": "<sup>11</sup> ဝ့ၫၥံၪအကျၩလီၫ.- တၭထီးၦလၧအၥ့ၪယၫအဝ့ၫလၧ ထံၭလၧမီခိၬ ထီးအလူၬဒၪဘၪဝ့ၫတၭ, ယိခွါ, မွဲအ ချဲၩ့ဆၧလၧမီၪအချိၬ လၧမီၪလဖၪ အကျၩတၭ,ဆၧ မၩအၥၭလၧၦခမျၧး ချဲၩ့လိၬအၥၭလဂၩ ဒဲလဂၩနီၪ ဆၧမၩအၥၭလၧစကံၭအဖိၪခွၫနီၪ, မွဲဆၧနီၪလမံၩ့လဲၪ.",
			"12": "<sup>12</sup> စစီလူၫအီၪလၧမီၪၥံၪအကျၩနီၪဆ့ဧၪ.- တၭၦထီးနီၪ လဂၩချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ,အဖါမွဲပလၫလဂၩ လဲၪးမၩအၥၭဘဲၫနီၪတၭ, စစီလူၫအီၪဝ့ၫလၧမီၪလဖၪ အကျၩနီၪဆ့ဧၪး ကဲၪထၪ့ဝ့ၫလၧဆၧချဲၩ့ဒီၩ့လီၫ.",
			"13": "<sup>13</sup> ထီးအချဲၩ့ဝ့ၫလၧမီၪအချိၬထုၬတၭ, ဂဲၫဝ့ၫထီၩ့လၧဆၧ အလးထၪ့ထီၫနီၪလီၫ.",
			"14": "<sup>14</sup> စစီလူၫအမၩ့လဂၩစံၭအဝ့ၫ ဒဲအၡၩဖိၪၥၪခွၫလဂၩ နီၪ,မွဲနၥံၪလ့ၩခီၫခီၫလဲၪ. တၭအဝ့ၫဒၪစံၭဝ့ၫ, ပလ့ၩ အၪ့ဎၬန့ကၥ့ၪယီၩ့လဖၪနီၪ ထီးပလဒၪဘၪဝ့ၫနးစီၪ့",
			"15": "<sup>15</sup> တၭ,ပလ့ၩလၧစစၫမုၫအ့လၭအအီၪလီၫ.- တၭစစီ လူၫအမၩ့နီၪစံၭဝ့ၫဒၪ, စစၫမုၫအ့လၭစံၭနၥံၪလၧဆၧ",
			"16": "<sup>16</sup> နီၪလမံၩ့လဲၪနီၪး ဒုၭနဲၪလါယၧၩဘီၪး- တၭစစီလူၫ စံၭအမၩ့,အဝ့ၫဒၪလီၩဘၪပၧၩ တီၩတီၩလၧဆၧဒၪန့ ယူၭကၥ့ၪယီၩ့ယူၭ, အ့ၪမွဲဆၧဘၪဆဲၫ့လၧဘၩ့မုးလၧ စစၫမုၫအ့လၭချဲၩ့ဝ့ၫနီၪလီၩဘၪဝ့ၫအ့ၬ.",
			"17": "<sup>17</sup> တၭစစၫမုၫအ့လၭဒုၭအီၪကိၩ့အီၪကီၪ့ ၦခမျၧးလၧ",
			"18": "<sup>18</sup> ယဟိဝၩအအီၪထီးမံဇပၫနီၪလီၫ.- တၭစံၭၦအံၫစရ့ လၭဖိၪ,ယဟိဝၩအံၫစရ့လၭအယွၩ စံၭဝ့ၫဘဲၫယီၩ, ယဒုၭဂဲၫထၪ့ခွံၬ အံၫစရ့လၭလၧအံဇံၭအဖၧၩ့တၭ, မၩဖီၩ့မၩဖျ့ၭနၥံၪ လၧၦအံဇံၭဖိၪအစူၪဖၧၩ့, ဒဲကယဲ ဘၩ့မုးဖိၪထီးအလူၬအစူၪဖၧၩ့, ဒဲကယဲၦလၧအမၩ",
			"19": "<sup>19</sup> အၧၩ့နၥံၪနီၪလီၫ.- တၭဆၧလၧမုဆၫလနံၩယီၩနၥံၪ ခွံၬၡိၭခွံၬ နၥံၪအယွၩ လၧအမၩဖီၩ့မၩဖျ့ၭနၥံၪလၧန ၥံၪအဆၧနၭဆၧၡၪ့, ဒဲနၥံၪအဆၧခိဆၧဝီၩထီးအလူၬ, မွဲအဝ့ၫအနၫ့ဆါဒၪဝ့ၫတၭး နၥံၪစံၭယူၭအဝ့ၫ,မွဲလါ နၫ့ဘိၩအီၪက့ၪစဎွၩ လၧပဖၫ့ခိၪဆံၭ. တၭဘိၩ့နဲၪ့ ယီၩ,ဒုၭနဲၪနၥံၪအၥၭလၧနၥံၪအဒီၪ့လဖၪ, ဒဲလၧနၥံၪ အၡၩအထီၫ့လဖၪလၧယဟိဝၩအမ့ၬယၫဆံၭ.",
			"20": "<sup>20</sup> ထီးစစၫမုၫအ့လၭဒုၭၥုၭဘူၭ အံၫစရ့လၭအဒီၪ့ထီး",
			"21": "<sup>21</sup> အလူၬတၭ, ဆၧမၩန့ဘံၪ့ယမံၫ့အဒီၪ့လီၫ.- တၭထီး အဒုၭၥုၭဘူၭ ဘံၪ့ယမံၫ့အဒီၪ့နီၪ လၧအဂံၪ့ဒီၪ့လဖၪ တၭးဆၧမၩန့စမၫတြဲၫအဂံၪ့ဒီၪ့တၭ, စကံၭအဖိၪခွၫ စစီလူၫဘၪဆၧမၩန့ဝ့ၫလီၫ. ထီးၦအၪ့ဎၬအဝ့ၫတၭ, ဒၪန့ဝ့ၫအ့ၬ.",
			"22": "<sup>22</sup> မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪအၪ့စၪ့ဒီၭယဟိဝၩ, ၦလဂၩနီၪမိဂဲၫဒံၭထီးယီၩဆ့ဧၪး တၭယဟိဝၩစံၭ ဆၧၫ့ဝ့ၫဒၪ,ယိခွါ, မွဲအအီၪက့ၪၥူၪအၥၭလၧဆၧဖိၪ",
			"23": "<sup>23</sup> ဆၧလံၩအကျၩလီၫ.- ၦလ့ၩစဲၪ့တလဲးမၩန့ဝ့ၫထီးနီၪ တၭ,ထီးအဆၧၫ့ထုၪ့ဝ့ၫလၧၦခမျၧးအကျၩနီၪ, မွဲအ ဂၩ့ထီၫနဲၪ့ၦခမျၧးလဂၩလါလါ ထီးအလူၬလၧအခိၬ ထံၭခိၪဒဲလၧအဖၫ့ခိၪလီၫ.",
			"24": "<sup>24</sup> တၭစစၫမုၫအ့လၭစံၭၦခမျၧးထီးအလူၬ, ယိၦလၧ ယဟိဝၩရွံန့ဝ့ၫလဂၩနီၪဘီၪး အဂဲးဘဲၫယီၩၦဘဲၫအ ဝ့ၫဒၪအၥိၭနီၪ အီၪလၧၦခမျၧးအကျၩ နးဂၩအ့ၬ. ၦ ခမျၧးထီးအလူၬ ကိၭၡၭထၪ့တၭ, စံၭဝ့ၫဒၪ, မွဲစဎွၩ မၧၫ့ဝ့ၫဘီၪ.",
			"25": "<sup>25</sup> ထီးနီၪလဖၧၫ့ စစၫမုၫအ့လၭလီၩဘၪ ၦခမျၧးလၧ ဘၩ့မုးအဂဲးအကၠီၪ့ လဖၪတၭ, ကွ့ၭဝ့ၫလၧလံၬဖၧၩ့ တၭ,အီၪက့ၪထၬဝ့ၫလၧ ယဟိဝၩအမ့ၬယၫလီၫ. တၭ စစၫမုၫအ့လၭဖျါခွံၬ ၦခမျၧးထီးအလူၬ, လဂၩလၧအ ဂံၪ့ဒၪဝ့ၫ, လဂၩလၧအဂံၪ့ဒၪဝ့ၫနီၪလီၫ.",
			"26": "<sup>26</sup> စစီလူၫထဲၩ့ထဲၩ့ဝ့ၫဆ့လၧအဂံၪ့, လၧဂံၭဘအၫအ ဖၧၩ့တၭ, ၦလဒီၪ့လၧယွၩထိၪဂဲၩအၥၭနီၪ လ့ၩဝ့ၫလၧ",
			"27": "<sup>27</sup> အၥိၭလီၫ.- အ့ၪမွဲၦဘၫအလၭဖိၪၥံၪစံၭဝ့ၫဒၪ, ၦလဂၩ ယီၩမိမၩဖီၩ့မၩဖျ့ၭပၧၩ ဘဲၫၥ့ၪလဲၪ. အဝ့ၫၥံၪအီၪက့ၪ ဝ့ၫလၧဆၧနးမံၩ့အ့ၬ, ဂဲၫဆိၬန့ဝ့ၫလၧဆၧဖ့ၪလၫ့ဆ့ အ့ၬ.မွဲလါနၫ့ဘိၩ အဝ့ၫဒၪအီၪလၩ့မါပံၭလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ၦအၫမၧၫ့ဖိၪ စနၫဟၭဂဲၫထၪ့ၥုၪ့တဲၩ ထၫ့ဒၩယၫဘ့ၭဂံလအၭတၭး ယၫဘ့ၭအၡၩ ထီးအ လူၬစံၭစနၫဟၭ, အုၩ့လၩ့ဆၧအုၩ့လၩ့လၧပၥိၭတၭ,",
			"2": "<sup>2</sup> ပမိမၩနဆၧလီၫ.- တၭၦအၫမၧၫ့ဖိၪ စနၫဟၭနီၪစံၭ ဆၧၫ့ဝ့ၫ,လၧဆၧယီၩလမံၩ့အကၠီၩ့တၭ, ယမိအုၩ့လၩ့ လၧနၥံၪအၥိၭယမိအီၩ့ခွ့ၬထၪ့ခွံၬ နၥံၪအမ့ၬၥၪအထွ့ၪ လခီၫထီးအလူၬတၭ, အီၪက့ၪဝ့ၫလၧဆၧဒုၪဒွ့ၪလၧ အံၫစရ့ၭလၭထီးအလူၬအလီၩ့လီၫ.",
			"3": "<sup>3</sup> တၭယၫဘ့ၭအၡၩ ၥုၪ့က့ၭၥၭၡါ စံၭအဝ့ၫဒၪ, ဖ့ၪ လၫ့ဒၪခလူၬပၧၩ နွ့ၫနံၩဘီၪ. တၭပမိအၪ့မၧၫ့လၩ့အ ၥီၫ့လဖၪလၧအံၫစရ့လၭအခးနဲၩ့ထံၭ ထီးအလူၬတၭ, ဆၧမၩဖီၩ့မၩဖျ့ၭပၧၩ အ့ၪလအီၪဘၪတၭ, ပမိဂဲၫထၪ့",
			"4": "<sup>4</sup> လၧနအီၪလီၫ.- ထီးနီၪလဖၧၫ့ အၥီၫ့ၥံၪဂဲၫလၧဂံၭဘ အၫစီလူၫအအီၪတၭ, ချဲၩ့ဆၧနီၪလဖၪလၧၦခမျၧးအ နါဖၧၩ့တၭ,ၦခမျၧးထီးအလူၬ ထုၭထၪ့အလူတၭဂၪ့",
			"5": "<sup>5</sup> ဝ့ၫလီၫ.- တၭယိခွါ, စစီလူၫဂဲၫဖိၬချီလဒီၪ့အခဲၫ့လၧ အဂဲၫထၪ့ခွံၬလၧမံၩ့လၬကျၩတၭ, စစီလူၫစံၭဝ့ၫဒၪ,ၦ ခမျၧးနီၪ,မွဲဘၪနီၫလၧအဂၪ့ဝ့ၫဘဲၫနီၪလဲၪ. တၭၦလီၩ",
			"6": "<sup>6</sup> ဘၪဝ့ၫလၧယၫဘ့ၭအၡၩ အဆၧပရၧၫ့လဖၪလီၫ.- ထီး စစီလူၫနါဂၧၫ့ဆၧလဖၪနီၪတၭ, ယွၩအၥၭဂဲၫလၩ့ဘၪ လၧအလီၩ့တၭ အၥၭထၪ့ခဲၩထၪ့ဝ့ၫဒိၪဒိၪလ့ၬလီၫ.",
			"7": "<sup>7</sup> အဝ့ၫဒၪမၩန့ချီဖၫလခိၪ, ဖ့ၬထ့ၬဝ့ၫလကုၭလကုၭတၭ, ဖ့ၪယူဝ့ၫလၧအံၫစရ့လၭအခးထီးအလူၬ လၧအၥီၫ့လ ဖၪအစူၪဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, ၦလၧအလဂဲၫဖိၬဘၪစစီ လူၫအခဲၫ့ဒဲစစၫမုၫအ့လၭအခဲၫ့နီၪ, ဆၧမိမၩအချီဖၫ ဘဲၫနီၪအၥိၭလီၫ. တၭဆၧၥၭမဲၪ ယဟိဝၩလၩ့ဘၪ လၧၦခမျၧးအလီၩ့တၭ, အဝ့ၫၥံၪဂဲၫဝ့ၫ ဘဲၫၦလဂၩဎး အၥိၭနီၪလီၫ.",
			"8": "<sup>8</sup> အဝ့ၫဒၪဝံထၪ့နၬထၪ့ဝ့ၫ လၧဘံဇ့ၭအဖၧၩ့တၭ,ၦ အံၫစရ့လၭဖိၪအီၪဝ့ၫၥၧၫ့ကုၬ, ဒဲၦယုဒၫအၡၩအီၪဝ့ၫ",
			"9": "<sup>9</sup> ၥၧၫ့လၬလီၫ.- တၭအဝ့ၫၥံၪနီၪစံၭအၥီၫ့လဖၪလၧအဂဲၫ ဝ့ၫနီၪ,နမိဘၪစံၭယၫဘ့ၭဂံလအၭအၡၩဘဲၫယီၩ, ကဲ ဂီၩခိၬထီးမုခိလၩ့တၭ, နၥံၪမိအီၪလၧဆၧမၩဖီၩ့မၩ ဖျ့ၭဆၧလီၫ. တၭအၥီၫ့လဖၪနီၪ ဂဲၫထဲၩ့ဝ့ၫတၭ, ဒုၭ နဲၪဝ့ၫလၧယၫဘ့ၭအၡၩတၭ, အဝ့ၫၥံၪၥုၪ့ထိၬၥၭထိၬ",
			"10": "<sup>10</sup> ဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယၫဘ့ၭအၡၩ စံၭဝ့ၫ ဒၪ,ကဲဂီၩခိၬပမိဂဲၫထၪ့လၧနၥံၪအအီၪတၭ, နၥံၪမိမၩ",
			"11": "<sup>11</sup> ပၧၩဘဲၫအဘၪနၥံၪအၥၭအၥိၭလီၫ.- တၭဆၧဖၩ့ထၪ့ လနံၩနီၪ, ဆၧမၩအၥၭလၧစစီလူၫအီၪက့ၪၦခမျၧးၥၧၫ့ ဒီၪ့တၭ, လၧၦခိၭဆၧလၧမုဂီၩအထီနီၪ အဝ့ၫၥံၪလ့ၩ နုၬလၧၦၥုၭမုအကျၩတၭ, ဖ့ၬခွံၬၦအၫမၧၫ့ဖိၪၥံၪထီး ဆၧခိထၪ့တၭ, ၦလၧအအီၪလၩ့ထးနီၪ လၩ့ပံၩလၩ့ ပၩတၭ,ၦအအီၪလၩ့ထးဝ့ၫနံၫဂၩ လစီၪ့ဎးနးစီၪ့အ့ၬ.",
			"12": "<sup>12</sup> တၭၦခမျၧးစံၭစစၫမုၫအ့လၭ, ၦလၧအစံၭ,မွဲစစီ လူၫမိကဲၪစဎွၩလၧပဖၫ့ခိၪဆ့ဧၪနီၪ, မွဲပလၫလဂၩလဲၪ. ဖ့ၪလၫ့ပၧၩလၧၦလဖၪနီၪတၭ, ပမိမၩၥံၫအဝ့ၫၥံၪလီၫ.",
			"13": "<sup>13</sup> တၭစစီလူၫစံၭဝ့ၫဒၪ, ဆၧလၧမုဆၫလနံၩယီၩ,ၦမိ ဘၪဆၧမၩၥံၫဝ့ၫနးဂၩအ့ၬ အဂဲးဘဲၫယီၩ လၧမုဆၫ လနံၩယီၩယဟိဝၩမၩဖီၩ့မၩဖျ့ၭ ဆၧလၧအံၫစရ့လၭ အဖၧၩ့လီၫ.",
			"14": "<sup>14</sup> စစၫမုၫအ့လၭစံၭၦခမျၧး, ဂဲၫဘီၪ,လ့ၩၡီၩ့လၧဂံလ ဂၫလၭတၭ, မၩၥၫ့ထၪ့ၡီၩ့ဘၩ့ၥံၪမုးၥံၪထီးနီၪဆံၭ.",
			"15": "<sup>15</sup> ၦခမျၧးၥံၪထီးအလူၬ လ့ၩဝ့ၫလၧဂံလဂၫလၭတၭ,အီၪ က့ၪစစီလူၫလၧစဎွၩထီးနီၪ လၧယဟိဝၩအမ့ၬယၫ, လၧဂံလဂၫလၭအဖၧၩ့တၭ, အဝ့ၫၥံၪလုထၪ့ဆၧလုမၩ ဘၪလိၬအိၭလိၬထီးနီၪ လၧယဟိဝၩ အမ့ၬယၫတၭ, စစီလူၫဒဲအံၫစရ့လၭ အၡၩထီးအလူၬၥုၪ့ထိၬၥၭထိၬ ထီးနီၪဒိၪမၬလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> တၭစစၫမုၫအ့လၭ စံၭအံၫစရ့လၭထီးအလူၬ,ယိ ခွါ,ကယဲနၥံၪစံၭယၧၩ ထီးအလူၬနီၪယခိၭနၪယူၭနၥံၪ အလူယူၭတၭ ယအီၪက့ၪယူၭစဎွၩ လၧနၥံၪအဖၫ့ခိၪ",
			"2": "<sup>2</sup> ယူၭ.- ဘိၩ့နဲၪ့ယီၩ,ယိခွါ, စဎွၩလဂၩနီၪလ့ၩဆၧလၧ နၥံၪအမ့ၬယၫတၭ, ယဝ့ၫဒၪယီၩ, ယၥၭၡါယူၭ,ဒဲယ ခိၪဘွၩယူၭတၭ, ယိခွါ,ယဖိၪခွၫၥံၪအီၪလၧနၥံၪအၥိၭ တၭ,အခီၫလၧယဖိၪၥၪနီၪ ခီးမုလနံၩယီၩယလ့ၩဆၧ",
			"3": "<sup>3</sup> လၧနၥံၪအမ့ၬယၫလီၫ.- တၭယိခွါ, ယၧၩလီၫ.ထိးန ၥံၪအၥၭထၫ့ဒုၪဒၩယၧၩလၧ ယဟိဝၩအမ့ၬယၫ,ဒဲလၧ ၦဒိၭဂုၪအၥၭလဂၩအမ့ၬယၫဆံၭ. ယမၩန့ပလၫလ ဂၩအချီဖၫလဲၪး တၭယမၩန့ ပလၫလဂၩ အကၥ့ၪ ယီၩ့လဲၪး တၭယအၪ့လီၫဆၧ မၩန့ပလၫအဆၧလဲၪ. တၭယမၩန့ဆီၪ့ပလၫလဂၩအဆၧလဲၪး တၭဘဲၫၥိၭ အမိမၩဘျီၪယမ့ၬၥၪနီၪ, မွဲယမၩန့လၬဆီၪ့လၧပလၫ",
			"4": "<sup>4</sup> အစူၪဖၧၩ့လဂၩလဲၪ. တၭယမိဖ့ၪထဲၩ့နၥံၪလီၫ.- တၭ အဝ့ၫၥံၪစံၭဝ့ၫဒၪ, နအၪ့လီၫန့ဆၧအ့ၬ. နမၩန့ဆီၪ့ပ ဆၧအ့ၬ.တၭနမၩန့ခွံၬ ဆၧလမံၩ့မံၩ့လၧ ၦအစူၪဖၧၩ့",
			"5": "<sup>5</sup> နးဂၩဆ့အ့ၬ.- တၭအဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ, ယဟိဝၩမွဲ ဆၧထိးအၥၭထၫ့ဒၩနၥံၪ, ဒဲအၡၩဒိၭဂုၪအၥၭလဂၩ နီၪ,မွဲဆၧထိးအၥၭလၧမုလနံၩယီၩ, လၧနၥံၪဒၪန့ဆၧ လၧယစူၪဖၧၩ့နးမံၩ့အ့ၬ. တၭအဝ့ၫၥံၪစံၭဝ့ၫဒၪ,မွဲဆၧ ထိးအၥၭလီၫ.",
			"6": "<sup>6</sup> တၭစစၫမုၫအ့လၭစံၭၦခမျၧး, ယဟိဝၩမွဲၦလၧအ အီၪက့ၪထၪ့ထီၫစမိစ့ၭ, ဒဲစအၫရၧၫ့တၭ,ဒုၭဂဲၫထၪ့ခွံၬ",
			"7": "<sup>7</sup> နၥံၪအဖါ လၧခးအံဇံၭအဖၧၩ့နီၪလီၫ.- တၭဘိၩ့နဲၪ့ ယီၩအီၪဆၧၫ့ထုၪ့ ဘဲၫၥိၭယမိစ့ၩရၫ့ နၥံၪလၧယဟိ ဝၩအမ့ၬယၫလၧယဟိဝၩအဆၧမၩ အတီၩအလီၩ့အ ဂဲးအကၠီၪ့လၧအမၩနၥံၪ, ဒဲနၥံၪအဖါလဖၪနီၪဆံၭ.",
			"8": "<sup>8</sup> ထီးစယၫကူၭလ့ၩနုၬ လၧအံဇံၭအဖၧၩ့တၭ နၥံၪအ ဖါလဖၪကိၭထၪ့ယဟိဝၩနီၪ, ထီးနီၪလဖၧၫ့ ယဟိ ဝၩအၪ့မၧၫ့လၩ့စမိစ့ၭ, ဒဲစအၫရၧၫ့လၧအဒုၭစဲၪ့ထၪ့ ခွံၬနၥံၪအဖါၥံၪလၧအံဇံၭ, ဒဲဒုၭအီၪဝ့ၫလၧဆၧအလး",
			"9": "<sup>9</sup> ထီးယီၩလီၫ.- တၭထီးအဝ့ၫၥံၪၥၭနၪ့ခွံၬယဟိဝၩအ ဝ့ၫၥံၪအယွၩတၭ, မွဲအအၪ့ဆၫခွံၬ အဝ့ၫၥံၪလၧစဟၫ ဇီၫအၡၩၥုၭမုအခိၪစံစရၫအစူၪဖၧၩ့, ဒဲလၧၦဖလံၡၫ ဖိၪအစူၪဖၧၩ့, ဒဲမိအၭအစဎွၩအစူၪဖၧၩ့တၭ, ၦလဖၪ",
			"10": "<sup>10</sup> နီၪဒုၭၥုၭလၧအဝ့ၫၥံၪလီၫ.- အဝ့ၫၥံၪကိၭထၪ့ယဟိ ဝၩတၭ,စံၭဝ့ၫဒၪ, ပမၩမၪဘၪယူၭဆၧယူၭ. အဂဲးဘဲၫ ယီၩပလ့ၩဒၪယူၭယဟိဝၩယူၭ တၭပမၩဘၪယူၭဘၫ အလၭၥံၪ, ဒဲအၭၡတြီၭအဆၧယူၭတၭ, ဘိၩ့နဲၪ့ယီၩ မၩဖီၩ့မၩဖျ့ၭပၧၩလၧပဒုၪပဒၩ အစူၪဖၧၩ့ဆံၭ, တၭပ",
			"11": "<sup>11</sup> မိမၩနဆၧလီၫ.- တၭယဟိဝၩအၪ့မၧၫ့လၩ့စယရၧၭ ဘ့ၫအ့လၭ,ဒဲစဘံဒၫ့, ဒဲစယ့ၭဖၥၫ,ဒဲစစၫမုၫအ့လၭ,ဒဲ မၩဖီၩ့မၩဖျ့ၭနၥံၪ လၧနၥံၪအဒုၪအဒၩအီၪဝၬဖီၩ့နၥံၪ",
			"12": "<sup>12</sup> တၭ,နၥံၪအီၪဂုးခၧၫ့ယူၭလီၫ.- ထီးနၥံၪဒၪဘၪၦအၫ မၧၫ့ဖိၪအစဎွၩနၫဟၭလဂၩ ဂဲၫထၫ့ဒၩနၥံၪတၭ,ယ ဟိဝၩနၥံၪအယွၩမွဲလါနၫ့ နၥံၪအစဎွၩတၭ, နၥံၪစံၭ ယၧၩ,မွဲအ့ၬ, မွဲစဎွၩလဂၩ မိကဲၪစဎွၩ လၧပဖၫ့ခိၪ",
			"13": "<sup>13</sup> လီၫ.- တၭဘိၩ့နဲၪ့ယီၩ,ယိခွါ, နၥံၪအစဎွၩလဂၩလၧ နၥံၪရွံန့ဝ့ၫ, ဒဲနၥံၪအၪ့ကံၩ့ဝ့ၫနီၪဆံၭ. တၭယိခွါ,ယ",
			"14": "<sup>14</sup> ဟိဝၩဖ့ၪလၫ့စဎွၩလဂၩ လၧနၥံၪအဖၫ့ခိၪလီၫ.- တၭ နၥံၪအ့ၪၥၭမဲၪယဟိဝၩ ဒဲမၩအဆၧဒဲခိၭနၪအလူဒဲလ ပိၩ့ထၪ့ဘၪယဟိဝၩအဆၧမၪလူၬတၭ, ထီးနီၪလဖၧၫ့ နၥံၪဝ့ၫ ဒဲစဎွၩဆ့လၧအကဲၪစဎွၩ လၧနၥံၪအဖၫ့ခိၪမိ",
			"15": "<sup>15</sup> လီၩ့ယဟိဝၩ နၥံၪအယွၩထူထူလီၫ.- အ့ၪမွဲနၥံၪအ့ၪ လခိၭနၪဘၪယဟိဝၩအလူတၭ, အ့ၪပိၩ့ထၪ့ယဟိ ဝၩအဆၧမၪလူၬ, ယဟိဝၩအစူၪမိအီၪလၧနၥံၪအ လီၩ့ဘဲၫအအီၪလၧနၥံၪအဖါ ၥံၪအလီၩ့အၥိၭနီၪလီၫ.",
			"16": "<sup>16</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩဆၧၫ့ထုၪ့တၭ, ဒၪ ဘၪလါဆၧဖၭဒိၪလမံၩ့ယီၩ လၧယဟိဝၩမိမၩလၧန",
			"17": "<sup>17</sup> ၥံၪအမ့ၬယၫဆံၭ.- ဆၧလၧမုဆၫလနံၩယီၩ, မွဲကူၭ ဘုၪကၠိၩ့အခံၫ့မွဲအ့ၬဧၪ. ယမိကိၭထၪ့ယဟိဝၩတၭ, အဝ့ၫဒၪမိဒုၭဎွံၩ့လၫ့, ဒဲဆၧမိဆၧၩ့လၩ့တၭ, မွဲဘဲၫၥိၭ လၧနၥံၪအၪ့ကံၩ့စဎွၩအကၠီၩ့နီၪ, နၥံၪမိၥ့ၪယၫ,ဒဲဒၪ ဘၪလၧနၥံၪမၩဆၧအၧၩ့အဒိၪအယိၬ လၧယဟိဝၩ အမ့ၬယၫလီၫ.",
			"18": "<sup>18</sup> စစၫမုၫအ့လၭကိၭထၪ့ယဟိဝၩတၭ, ဆၧလၧမုဆၫ လနံၩနီၪယဟိဝၩဒုၭဎွံၩ့လၫ့, ဒဲဒုၭဆၧၩ့လၩ့ဆၧလီၫ. တၭၦခမျၧးထီးအလူၬ ၥၭမဲၪယဟိဝၩ, ဒဲစစၫမုၫအ့",
			"19": "<sup>19</sup> လၭဒိၪမၬလီၫ.- တၭၦခမျၧးထီးအလူၬစံၭစစၫမုၫအ့ လၭ,ဘၩဆိၪဖၪန့နခ့ၫနၡၩအဂး လၧယဟိဝၩနယွၩ ဆံၭ,ဘဲၫၥိၭပထီးၥံၫလဂ့ၩး လၧပအၪ့ကံၩ့စဎွၩအ ကၠီၩ့နီၪ, ပအီၪက့ၪအၪထၪ့ယူၭဆၧအၧၩ့လမံၩ့လၧပ",
			"20": "<sup>20</sup> ဆၧဒဲၩဘၭထီးအလူၬ အဖၫ့ခိၪလီၫ.- တၭစစၫမုၫအ့ လၭစံၭၦခမျၧးထီးအလူၬနီၪ, ၥၭမဲၪဆၧလဂ့ၩ. နၥံၪ မၩဆၧအၧၩ့ထီးအလူၬနီၪလါနၫ့တၭ, ကၠၪပဲၩခွံၬလၧ ဆၧလီၩ့ယဟိဝၩအၥၭလဂ့ၩး အ့ၪမွဲမၩယဟိဝၩအ",
			"21": "<sup>21</sup> ဆၧလၧနၥံၪအၥၭထၧၫ့ဖျိၪ့ယၫဆံၭ.- ကၠၪပဲၩခွံၬတၭ ဖိၬဆၧပျီၩပျီၩလၧအလန့ကဲၩ့န့ကၩဘၪဆၧမွဲဂ့ၩ, လၧ အမၩဖီၩ့မၩဖျ့ၭဆၧ လၥ့ၪဘၪမွဲဂ့ၩနီၪလဂ့ၩ အဂဲး",
			"22": "<sup>22</sup> ဘဲၫယီၩမွဲဝ့ၫလၧဆၧပျီၩပျီၩလီၫ. အဂဲးဘဲၫယီၩယ ဟိဝၩအမံၩ့ဖၭဒိၪဝ့ၫအကၠီၩ့နီၪ, မွဲအမိစဲၪ့ဒၪအၡၩခ မျၧးလဖၪအ့ၬ. မွဲအဘၪယဟိဝၩအၥၭ လၧအမိအီၪ",
			"23": "<sup>23</sup> က့ၪနၥံၪလၧအၡၩခမျၧးအဂဲးလီၫ.- အ့ၪမွဲယဝ့ၫဒၪ ယီၩယဘၩဆိၪဖၪန့နၥံၪအဂးနီၪ မွဲယထီးအီၪပထုၬ တၭမၩမၪဘၪယွၩလဂ့ၩ. တၭယမိၥီၪ့လိၪနၥံၪလၧ",
			"24": "<sup>24</sup> ဖၧၩ့ၥၭအဂ့ၩအဘွၩ, ဒဲအတီၩအလီၩ့လီၫ.- အ့ၪမွဲၥၭ မဲၩယဟိဝၩတၭ မၩအဆၧလၧဆၧမွဲဆၧတီၩလၧနၥံၪ အၥၭထၧၫ့ဖျိၪ့ယၫဆံၭ. အဂဲးဘဲၫယီၩယိဆီၫ့မီၪ့ဆၧ",
			"25": "<sup>25</sup> ဖၭဒိၪလဖၪလၧအမၩယူၭလၧနၥံၪအဂးဆံၭ.- အ့ၪမွဲ နၥံၪအ့ၪမၩဒံၭဆၧအၧၩ့တၭ နၥံၪဝ့ၫမွဲဂ့ၩ, နၥံၪအစ ဎွၩမွဲဂ့ၩ,မိထီၩ့လၧဆၧဂၭဂီၩ့ဂၭစၪလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> စစီလူၫကဲၪစဎွၩလနံၪ့တၭ, ထီးအကဲၪစဎွၩလၧ",
			"2": "<sup>2</sup> အံၫစရ့လၭအဖၫ့ခိၪနံၫနံၪ့နီၪ,- စစီလူၫရွံန့ၦၥၧၫ့ထီၫ့လၧ အံၫစရ့လၭအကျၩလီၫ. ၦနံၫထီၫ့အီၪဝ့ၫလၧစစီလူၫ အၥိၭလၧမံၭမၭ, ဒဲလၧခိၪလီၩ့ဘ့ၥလၭအလီၩ့း တၭ ၦလထီၫ့အီၪဝ့ၫလၧစစၪ့နၥၧၫ့အၥိၭ လၧဂံၭဘအၫဘံၪ့ ယမံၫ့အဖၧၩ့တၭ, ၦအီၪလၩ့ထး လၧၦခမျၧးအကျၩ နီၪဖျါလၩ့ခွံၬဝ့ၫလဂၩ လၧအတဲၩဒၪဝ့ၫ, လဂၩလၧအ တဲၩဒၪဝ့ၫဆုၬဆုၬလီၫ.",
			"3": "<sup>3</sup> စစၪ့နၥၧၫ့ဖ့ၬခွံၬၦဖလံၡၫဖိၪ လၧအခိၭဆၧလဆၫ့ လၧဂ့ဘၫအဖၧၩ့တၭ, ၦဖလံၡၫဖိၪနါဂၧၫ့ဝ့ၫလီၫ. တၭ စစီလူၫအူၪထၪ့ခွ့ၩ လၧခးထၧၫ့ဘံၪ့ယၫအဖၧၩ့တၭ,",
			"4": "<sup>4</sup> စံၭဝ့ၫဒၪ,မွဲၦဟံဘြူၫဖိၪနါဂၧၫ့ဆံၭ.- တၭအံၫစရ့လၭ ထီးအလူၬနါဂၧၫ့ဝ့ၫ လၧၦစံၭလၧစစီလူၫဖ့ၬခွံၬယူၭၦ ဖလံၡၫဖိၪလၧအခိၭဆၧလဆၫ့, ဒဲလၧအံၫစရ့လၭကဲၪ ထၪ့ဆၧၥၭလိၪ လၧၦဖလံၡၫဖိၪအမ့ၬယၫလီၫ. တၭ ၦခမျၧးဘၪဆၧကိၭကီၪ့ဖိၬထွ့ၫ စစီလူၫအခဲၫ့လၧဂံလ",
			"5": "<sup>5</sup> ဂၫလၭလီၫ.- တၭၦဖလံၡၫဖိၪအီၪကိၩ့အီၪကီၪ့ဘဲၫ ၥိၭအမိဒုၭၥုၭ လၧအံၫစရ့လၭလီၫ. လဲၪ့ၥုၭအီၪၥၧၫ့ လၬ,ဒဲၦကၥ့ၪၥုၭဖိၪအီၪဎူၫထီၫ့တၭ, ၦခမျၧးအီၪအၪ အၪဘဲၫမ့ၭၥံၪဂၪ့ၥံၪ လၧမၫဆမံၭနဲၩ့ အၥိၭနီၪလီၫ. အဝ့ၫၥံၪဂဲၫထၪ့တၭ, ၥုၪ့အတဲၩလၧမံၭမၭအဖၧၩ့အီၪ ဝ့ၫလၧဘ့ၭၥအၫဝံၫ့လၧမုထၪ့လခီၫလီၫ.",
			"6": "<sup>6</sup> တၭအံၫစရ့လၭ အၡၩဒၪဘၪဝ့ၫ လၧအဘၪဆၧခိ ဆၧဝီၩနီၪ, (အဂဲးဘဲၫယီၩၦခမျၧးနီၪ အၥုၪ့အုၭအၥၭ အုၭလီၫ.) တၭမွဲအအီၪက့ၪၥူၪအၥၭ လၧဆၧအိၩဖၧၩ့ လဖၪ,လၧၡိၬကျၩ, ဒဲလၧလဲၫ့ဖၧၩ့, ဒဲလၧဆၧထၪ့ထီၫ",
			"7": "<sup>7</sup> ဖၧၩ့ဒဲလၧဆၧဖၧၩ့လဖၪအဖၧၩ့လီၫ.- ၦဟံဘြူၫဖိၪလ့ၩ ခၫ့ဂၬယီၫဒၫ့ထီၩ့လၧဂၭ, ဒဲဂံလအၭအခးလီၫ. တၭ စစီလူၫအီၪဒံၭဝ့ၫလၧဂံလဂၫလၭတၭ, ၦခမျၧးထီးအ",
			"8": "<sup>8</sup> လူၬဝၭထိၬဝ့ၫတၭ, ဖိၬအခဲၫ့လီၫ.- အဝ့ၫအီၪဝ့ၫနွ့ၫနံၩ ဘဲၫစစၫမုၫအ့လၭဖၭဝ့ၫ အဆၧၫ့အထီအၥိၭနီၪ, အ့ၪ မွဲစစၫမုၫအ့လၭဂဲၫထီၩ့ဒံၭလၧ ဂံလဂၫလၭဒံၭအ့ၬတၭ,",
			"9": "<sup>9</sup> ၦခမျၧးလၩ့ပြံၩလၩ့ပၩခွံၬလၧအအီၪလီၫ.- တၭစစီ လူၫစံၭဝ့ၫဒၪ,ဂဲၫဆိၬန့ယၧၩလၧဆၧလုမ့ၪ, ဒဲဆၧလုမၩ ဘၪလိၬအိၭလိၬၥံၪဆံၭ. တၭအဝ့ၫဒၪ လုထၪ့ဆၧလု မ့ၪလီၫ.",
			"10": "<sup>10</sup> ထီးအလုထၪ့ဆၧလုမ့ၪဂီၩ့တၭ, ယိခွါ,ဆၧမၩအ ၥၭလၧစစၫမုၫအ့လၭဂဲၫဝ့ၫတၭ, စစီလူၫလ့ၩထၪ့အၪ့",
			"11": "<sup>11</sup> ဂၬဝ့ၫလၧအမိချဲၩ့ဒုၪ့ဝ့ၫအဂးလီၫ.- တၭစစၫမုၫအ့လၭ စံၭဝ့ၫဒၪ,မွဲနမၩယူၭဆၧနီၪလမံၩ့လဲၪ. စစီလူၫစံၭဝ့ၫ ဒၪ,အဂဲးဘဲၫယီၩ ယဒၪဘၪၦခမျၧးလၩ့ပြံၩလၩ့ပၩ ခွံၬလၧယအီၪတၭ, လၧဖၭနံၩဖၭၥၫ့နီၪ နဂဲၫထီၩ့အ့ၬ.",
			"12": "<sup>12</sup> တၭၦဖလံၡၫဖိၪအီၪကီၪ့ထီးမံၭမၭနီၪလီၫ.- တၭယ စံၭ,ဘိၩ့နဲၪ့ယီၩၦဖလံၡၫဖိၪ မိဂဲၫလၩ့ဘၪယဖၫ့ခိၪလၧ ဂံလဂၫလၭတၭ, ယအၪ့ကံၩ့ယဟိဝၩဒံၭအ့ၬ. ယမၩ",
			"13": "<sup>13</sup> ဆီၪ့ယၥၭတၭ, ယလုထၪ့ဆၧလုမ့ၪလီၫ.- တၭစစၫမုၫ အ့လၭစံၭစစီလူၫ နမၩယူၭဘဲၫၦအဂီၩ့အၥိၭယူၭ. န ထီးန့ယဟိဝၩနယွၩ အဆၧမၪလူၬလၧအမၪလူၬနၧၩ အ့ၬ.အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩယဟိဝၩ မိဒုၭအီၪဂုးအီၪခၧၫ့နဘၩ့နမုး လၧအံၫစရ့လၭအဖၫ့ခိၪ",
			"14": "<sup>14</sup> အဆိၩဆိၩအကၠၪကၠၪလီၫ.- အ့ၪမွဲဘိၩ့နဲၪ့ယီၩနဘၩ့ နမုးအီၪဂုးအီၪခၧၫ့ဘၪအ့ၬ. ယဟိဝၩမိအၪ့ဎၬၦဘဲၫ အၥၭဒၪဝ့ၫအၥိၭလဂၩတၭ, ယဟိဝၩမၪလူၬယူၭလၧ အမိကဲၪထၪ့ၦခမျၧးအခိၪယူၭး အဂဲးဘဲၫယီၩနထီးန့ ဆၧလၧယဟိဝၩမၪလူၬနၧၩအ့ၬ.",
			"15": "<sup>15</sup> စစၫမုၫအ့လၭဂဲထုၪ့တၭ, စဲၪ့ထၪ့ခွံၬလၧဂံလဂၫလၭ ထီၩ့လၧဂံၭဘအၫဘံၪ့ယမံၫ့လီၫ. တၭစစီလူၫဝံထၪ့နၬ ထၪ့ၦလၧအဒၪန့ဝ့ၫလၧအၥိၭ, ၦဎူၫယၩကၪယူၭလီၫ.",
			"16": "<sup>16</sup> တၭစစီလူၫဒဲအဖိၪခွၫစစၪ့နၥၧၫ့, ဒဲၦခမျၧးလၧအအီၪ လၧအၥိၭလဖၪနီၪ အီၪဝ့ၫလၧဂံၭဘအၫ ဘံၪ့ယမံၫ့ လီၫ.တၭၦဖလံၡၫဖိၪ ၥုၪ့အတဲၩလၧမံၭမၭလီၫ.",
			"17": "<sup>17</sup> တၭၦမၩဂၭဂီၩ့ ဆၧလဖၪဂဲၫထၪ့လၧၦဖလံၡၫဖိၪ ၥုၪ့တဲၩအလးၥၧၫ့ဒီၪ့လီၫ. အလဒီၪ့ကၠၪအၥၭလၧအီၭ",
			"18": "<sup>18</sup> ဖၫအဖၧၩ့ၥၭလၧအလ့ၩဖိးလၧခးရှုအလၭလီၫ.- တၭ အလဒီၪ့ဒၪကၠၪအၥၭ လၧဘ့ၭၥဟိရၫ့အဖၧၩ့ၥၭတၭ, အလဒီၪ့ဒၪကၠၪအၥၭလၧခးနဲၩ့ထံၭ, လၧအယိဝ့ၫလၧ ခိၪလီၩ့ဆူၭဇဘိအံၫ့လၧၡါမုနၧၫ့ဖၫလခီၫလီၫ.",
			"19": "<sup>19</sup> လၧအံၫစရ့လၭအခးထၧၫ့ဘံၪ့ယၫနီၪ ၦထမၬဖိၪ အီၪနးဂၩအ့ၬ. (အဂဲးဘဲၫယီၩ ၦဖလံၡၫဖိၪစံၭဝ့ၫဒၪ,",
			"20": "<sup>20</sup> ၦဟံဘြူၫဖိၪမိနဲၫ့ဘၪခိၬနၭၥံၪ, ဖၩ့ၥံၪလီၫ.)- တၭအံၫ စရ့လၭဖိၪထီးအလူၬလ့ၩလၩ့လၧ ၦဖလံၡၫဖိၪအအီၪ ဘဲၫၥိၭအမိကျဲၩ့လဂၩအထဲၫနါ, ဒဲလဂၩအစူၪဝဲၩ,",
			"21": "<sup>21</sup> လဂၩအကွၩ, လဂၩအဎ့ၬချီၩ့လီၫ.- မွဲလါနၫ့အီၪဝ့ၫ လၧထၭကျဲၩ့လၧဎ့ၬချီၩ့အဂး, ဒဲလၧစူၪဝဲၩအဂး,ဒဲဖျဲၩ့ ၥၧၫ့ထါအဂး, ဒဲလၧကွၩအဂး, ဒဲဘဲၫၥိၭအမိကျဲၩ့ထၭ",
			"22": "<sup>22</sup> ဆ့ၭချီၥံၪနီၪလီၫ.- တၭဒုၭၥုၭလၧမုလနံၩနီၪဆၧမၩအ ၥၭလၧနၭမွဲဂ့ၩ, ဖၩ့မွဲဂ့ၩ, အီၪလၧၦခမျၧးအစူၪဖၧၩ့ လၧအအီၪလၧစစီလူၫ, ဒဲစစၪ့နၥၧၫ့အၥိၭနီၪနးဂၩအ့ၬ. အီၪဝ့ၫန့ၫလၧစစီလူၫ, ဒဲစစၪ့နၥၧၫ့နီၪလီၫ.",
			"23": "<sup>23</sup> တၭၦဖလံၡၫဖိၪလၧအခိၭဆၧလဆၫ့နီၪ စဲၪ့ထၪ့ဝ့ၫ လၧဆၧခၫ့ဂၬ ဆၧလၧမံၭမၭနီၪလီၫ."
		},
		"14": {
			"1": "<sup>1</sup> တၭလၧမုလနံၩနီၪဆၧမၩအၥၭ လၧစစီလူၫအဖိၪ ခွၫစစၪ့နၥၧၫ့စံၭၦဖိၪၥၪခွၫ လၧအဆိၬအစူၪဝဲၩ, ဂဲၫ ဘီၪးမွဲပလ့ၩၡီၩ့လၧၦဖလံၡၫဖိၪ ခိၭဆၧအလးအီၪ လၧဝါလခီၫနီၪဘီၪ. မွဲလါနၫ့ဘိၩ,လီၩဘၪအဖါအ့ၬ.",
			"2": "<sup>2</sup> တၭစစီလူၫအီၪဝ့ၫလၧဂံၭဘအၫအထုၬ လၧၥံၪ့ၥလဲၩ အဖၫ့လၬလၧအအီၪဝ့ၫလၧမံဂၧၫ့အဖၧၩ့, ၦခမျၧးလၧ",
			"3": "<sup>3</sup> အအီၪလၧအၥိၭနီၪအီၪဝ့ၫဖိၭဘိၭဎူၫယၩလီၫ.- တၭ စအဟဲအၫ, စအဟံၭတၧၭ အဖိၪခွၫစအံၭခဘၧၭအ ထၧၫ့ဖုဝဲစဖံနဟၭအဖိၪခွၫ, စအံလဲၫအဖိၪခွၫ, ယဟိ ဝၩအၡၩလုဆၧ လၧၡဲလိၫအဖၧၩ့လဂၩနီၪ ၥိၭဝ့ၫလၧ အ့ဖိၭနီၪလီၫ. တၭလၧစစၪ့နၥၧၫ့လ့ၩထၪ့ဝ့ၫနီၪၦခမျၧး",
			"4": "<sup>4</sup> ၥ့ၪယၫဝ့ၫအ့ၬ.- တၭလၧခၫ့ဂၬဆၧလဖၪ အဘိၩ့ဆၧၩ့ လၧစစၪ့နၥၧၫ့အၪ့ဎၬခၫ့ဂၬ လၧၦဖလံၡၫဖိၪအၥုၭဖိၪ အအီၪနီၪလိးခိၪစူၩအီၪဝ့ၫလၧ ယီၩလခီၫလဖျိၪ့ ဒဲလၧ နီၪလခီၫလဖျိၪ့လီၫ. အလဖျိၪ့အမံၩ့မွဲဘိဇ့ၭ, အနီၪလ",
			"5": "<sup>5</sup> ဖျိၪ့အမံၩ့မွဲစံၫန့ၫလီၫ.- အလဖျိၪ့အမ့ၬလီၩ့လၧမုဖၩ လခီၫဎၩ့လၧမံၭမၭတၭ, အနီၪလဖျိၪ့လၧမုခံၫ့လခီၫ",
			"6": "<sup>6</sup> ဎၩ့လၧဂံၭဘအၫလီၫ.- တၭစစၪ့နၥၧၫ့စံၭ ၦဖိၪၥၪခွၫ လၧအဆိၬအစူၪဝဲၩလဂၩ, ဂဲၫဘီၪ, မွဲပလ့ၩခၫ့ဂၬၡီၩ့ ဆၧလၧၦလဒိၭဘၪ ဆၧကူၭတရံၭလဖၪယီၩ ခိၭဆၧ အလးအအီၪနီၪဘီၪ. ဘၪလဘၪ ယဟိဝၩမိမၩဆၧ လၧပဂးလီၫ. အဂဲးဘဲၫယီၩ မၩဖီၩ့မၩဖျ့ၭ ဆၧလၧၦ အၪအကၠီၩ့မွဲဂ့ၩ. အၡၩအကၠီၩ့မွဲဂ့ၩ, ဆၧပဒၩ့ယဟိ",
			"7": "<sup>7</sup> ဝၩအီၪအ့ၬ.- တၭၦဆိၬအစူၪဝဲၩနီၪစံၭဝ့ၫ, မၩကယဲ ဆၧလၧအအီၪလၧနၥၭခံဖၧၩ့ဘီၪ. ကၠၪနၥၭ,ယိခွါ,ယ",
			"8": "<sup>8</sup> မိအီၪလၧနၥိၭထီးဒၪနၥၭလီၫ.- စစၪ့နၥၧၫ့စံၭဝ့ၫဒၪ, ယိခွါ,ပမိလ့ၩခၫ့ဂၬဆၧလၧၦလဖၪနီၪအအီၪတၭ,ပ",
			"9": "<sup>9</sup> မိဒုၭနဲၪပၥၭလၧအမ့ၬယၫလီၫ.- တၭအဝ့ၫၥံၪအ့ၪစံၭ ပၧၩဘဲၫယီၩ,အီၪခိၭဒၪခလူၬ ထီးပဂဲၫလၧနၥံၪအအီၪ နီၪဘီၪးပမိအီၪဆၧၫ့ထုၪ့ဒၪဆၧလၧပလးတၭ, ပလ့ၩ",
			"10": "<sup>10</sup> ထၪ့လၧအအီၪအ့ၬ.- အ့ၪမွဲအဝ့ၫၥံၪအ့ၪစံၭပၧၩဘဲၫ ယီၩ,ဂဲၫထၪ့ဘီၪနီၪ, တၭပမိလ့ၩထၪ့လီၫ. အဂဲးဘဲၫ ယီၩယဟိဝၩဖ့ၪလၫ့ယူၭဝ့ၫ လၧပစူၪဖၧၩ့ယူၭ. တၭ ဆၧနီၪမိကဲၪထၪ့ဆၧမၩနဲၪ့လၧပဂးလီၫ.",
			"11": "<sup>11</sup> တၭၦဒုၭနဲၪအၥၭနံၫဂၩလူၬ လၧၦဖလံၡၫအၥုၭဖိၪ အမ့ၬယၫတၭ, ၦဖလံၡၫဖိၪစံၭဝ့ၫဒၪ,ယိခွါ, ၦဟံဘြူၫ ဖိၪဂဲၫထၪ့ယူၭလၧဆၧအိၩဖၧၩ့ ထီးအအီၪက့ၪၥူၪအ",
			"12": "<sup>12</sup> ၥၭအလးနီၪယူၭ.- တၭထိၬအၥုၭဖိၪၥံၪစံၭဆၧၫ့စစၪ့ နၥၧၫ့ဒဲၦလၧအဆိၬအစူၪဝဲၩတၭ, စံၭဝ့ၫဒၪ, ဂဲၫထၪ့ လၧပအီၪယီၩဘီၪ. တၭပမိဒုၭနဲၪနၥံၪ လၧဆၧလမံၩ့ လီၫ.တၭစစၪ့နၥၧၫ့စံၭၦဆိၬအစူၪဝဲၩလဂၩနီၪ, ဂဲၫဖိၬ ယခဲၫ့ဘီၪ. အဂဲးဘဲၫယီၩ ယဟိဝၩဖ့ၪလၫ့ယူၭအဝ့ၫ",
			"13": "<sup>13</sup> ၥံၪလၧအံၫစရ့လၭအစူၪဖၧၩ့ယူၭ.- တၭစစၪ့နၥၧၫ့လ့ၩ ဖုၭဖးထၪ့ဝ့ၫတၭ, ၦဆိၬအစူၪဝဲၩလဂၩနီၪ ဖိၬအခဲၫ့ လီၫ.တၭအဝ့ၫၥံၪနီၪလၩ့ထံၩဖါ လၧစစၪ့နၥၧၫ့အမ့ၬ ယၫတၭ, ၦဆိၬအစူၪဝဲၩလဂၩနီၪ မၩၥံၫဖိၬအခဲၫ့လီၫ.",
			"14": "<sup>14</sup> တၭဆၧမၩၥံၫအခၪ့ထံၭ လၧစစၪ့နၥၧၫ့, ဒဲၦဆိၬအစူၪ ဝဲၩမၩဝ့ၫနီၪမွဲၦဖိၭဘိၭနံၫဆံၫ, လၧဆၧအကၠီၪ့ဖၧၩ့ဘဲၫ လၧချီဖၫလခိၪကၠူၭခရါလၧဆံၬဖၧၩ့ ဎလၧလနံၩအထး ဖၧၩ့ၭ မိၥ့ၪအၥိၭနီၪလီၫ.",
			"15": "<sup>15</sup> တၭဆၧဝၭထိၬအီၪဝ့ၫလၧၦၥုၭမုအကျၩ, လၧဆၧ ပျၩ့ဖၧၩ့, ဒဲလၧၦခမျၧးထီးအလူၬအကျၩ, ဒဲလၧထိၬ ဖၧၩ့,ဒဲၦလၧအအၪ့ဂူၬန့ဆီၪ့ဆၧဝၭထိၬဆ့တၭ, ဂၪ့ခိၪ ဝၭတၭ, မွဲအဝၭထိၬဖၭဒိၪလီၫ.",
			"16": "<sup>16</sup> စစီလူၫအၡၩ ခိၭဆၧလၧဂံဘအၫဘံၪ့ယမံၫ့လဖၪ နီၪယိဝ့ၫတၭ,ယိခွါ, ၦခမျၧးဖံၪထၪ့ခွံၬဝ့ၫတၭ,လ့ၩဆၧ",
			"17": "<sup>17</sup> ထီးအံၩထီးအိၩလီၫ.- ထီးနီၪလဖၧၫ့ စစီလူၫစံၭၦ ခမျၧးလၧအအီၪလၧအၥိၭ, ဝံဆၧနၬဆၧတၭ, မွဲပလၫ လအီၪဘၪလၧပၥိၭလဲၪ, ယိဘီၪ,အဝ့ၫၥံၪဝံထၪ့ဝ့ၫဂီၩ့ တၭ,ယိခွါ, စစၪ့နၥၧၫ့, ဒဲၦဆိၬအစူၪဝဲၩလဂၩနီၪ,အီၪ",
			"18": "<sup>18</sup> အ့ၬ.- စစီလူၫစံၭစအဟဲအၫ,ဂဲၫဆိၬယွၩအတလၫထီး ယီၩဆံၭ. (အဂဲးဘဲၫယီၩ ဆၧလၧမုလနံၩနီၪ ယွၩအ",
			"19": "<sup>19</sup> တလၫအီၪဝ့ၫ လၧၦအံၫစရ့လၭဖိၪအၥိၭလီၫ.)- တၭ စစီလူၫချဲၩ့ဆၧလၧၦလုဆၧအဘိၩ့ဘၭနီၪ, ဆၧမၩအ ၥၭလၧဆၧအၥီၫအီၪ လၧၦဖလံၡၫဖိၪအၥုၭမုအကျၩ အၪထၪ့တၭ,ၥူၭဝ့ၫနီၪ, စစီလူၫစံၭၦလုဆၧနီၪ,ထုၭထၪ့",
			"20": "<sup>20</sup> ထဲၩ့နစူၪဘီၪ.- စစီလူၫဒဲၦခမျၧးလၧအအီၪလၧအၥိၭ ထီးအလူၬအီၪကိၩ့အီၪကီၪ့တၭ, အဝ့ၫၥံၪလ့ၩဒုၭဆၧ လီၫ.ယိခွါ, လဂၩအနၭထၫ့ဒၩဝ့ၫလၧအလိၬဖၪ့ဆုၬ",
			"21": "<sup>21</sup> ဆုၬတၭ, ဆၧမၩစၪဖၭဒိၪအီၪဝ့ၫလီၫ.- တၭၦဟံဘြူၫ ဖိၪလၧအအီၪဝ့ၫ လၧၦဖလံၡၫဖိၪအၥိၭလၧအခၪ့ထံၭ နီၪလၧအလ့ၩဆၧလၧအၥိၭ လစီၪ့လါလါလၧၥုၭဖိၪ အၥိၭနီၪ,အီၪထဲၩ့ဝ့ၫလၧအံၫစရ့လၭ အၥိၭလၧစစီလူၫ,",
			"22": "<sup>22</sup> ဒဲစစၪ့နၥၧၫ့အအီၪလီၫ.- တၭကယဲအံၫစရ့လၭအၡၩ လၧအအီၪက့ၪၥူၪအၥၭ လၧခိၪလီၩ့အံဖြံၫ့ထီးအလူၬ ထီးအနါဂၧၫ့လၧၦဖလံၡၫဖိၪစဲၪ့ဖျိၭတၭ, အဝ့ၫၥံၪဒၪ",
			"23": "<sup>23</sup> လ့ၬလီၩ့ဆီးဆ့လၧဆၧဒုၭနီၪလီၫ.- တၭဆၧလၧမုလ နံၩနီၪယဟိဝၩမၩဖီၩ့မၩဖျ့ၭအံၫစရ့လၭတၭ, ဒုၭၥုၭ နီၪခၫ့ဂၬဆၧလၧဘ့ၭၥအ့ဝံၫ့နီၪလီၫ.",
			"24": "<sup>24</sup> တၭအံၫစရ့လၭအၡၩ ဘၪဆၧခိဆၧဝီၩလၧမုလနံၩ နီၪလီၫ. အဂဲးဘဲၫယီၩ စစီလူၫဒုၭဆိၪလၩ့ၦခမျၧးအ ၥၭစံၭဝ့ၫဒၪ, ၦလၧအအၪ့ဆၧလၧမုလချႃၭဂၪလၩ့ဒံၭ ဘၪနီၪ,မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭ. ဘဲၫၥိၭယမိမၩ ဆၧၫ့ဆၧအၧၩ့လၧယဒုၪယဒၩအလီၩ့လီၫ. တၭၦထဲး",
			"25": "<sup>25</sup> ယိဆၧအၪ့နးဂၩအ့ၬ.- တၭကယဲၦခးဖိၪလ့ၩထီၩ့လၧ",
			"26": "<sup>26</sup> ၥံၪ့လဝၩ့နီၪ,န့ၫစၩ့အီၪဝ့ၫလၧဂၪ့ခိၪအဖၫ့ခိၪလီၫ.- တၭ ထီးၦခမျၧးလ့ၩနုၬလၧၥံၪ့လဝၩ့အကျၩနီၪ, ယိခွါ,န့ၫ စၩ့လၩ့ဆၩ့နီၪ, မွဲလါနၫ့ၦအီၪက့ၪအစူၪလၧအနိၭဖၧၩ့ နးဂၩအ့ၬ, အဂဲးဘဲၫယီၩ ၦခမျၧးၥၭမဲၪဆၧဆိၪလၩ့",
			"27": "<sup>27</sup> အၥၭနီၪလီၫ.- အ့ၪမွဲစစၪ့နၥၧၫ့နါဂၧၫ့အဖါဒုၭဆိၪလၩ့ ၦခမျၧးအၥၭအ့ၬ. မၩအၥၭဘဲၫနီၪတၭ ယူၬထၪ့နိၪ ထိၭဘီၩ့အခံၫလၧအအီၪလၧအစူၪဖၧၩ့တၭ, ဘၧၩ့လၩ့ ဝ့ၫလၧန့ၫအခိၪထံၫဖၧၩ့တၭ, အီၪက့ၪအစူၪလၧအနိၭ",
			"28": "<sup>28</sup> ဖၧၩ့တၭအမ့ၬဖၩ့ထၪ့လီၫ.- ၦလၧၦခမျၧးအကျၩလ ဂၩချဲၩ့ဆၧတၭ, စံၭဝ့ၫဒၪ, နဖါဒုၭဆိၪလၩ့တၡါၦခမျၧး အၥၭတၭ,စံၭဝ့ၫဒၪ, ၦလၧအအၪ့ဆၧလၧမုဆၫလနံၩ ယီၩ,မွဲအဘၪဆၧဆိၪအၧၩ့ဆံၭ. တၭၦခမျၧးလၩ့ဘဲၩ",
			"29": "<sup>29</sup> ဝ့ၫဒၪလီၫ.- တၭစစၪ့နၥၧၫ့စံၭဝ့ၫဒၪ, ယဖါမၩထံၬထၬ ယူၭထံၫၥံၪခးၥံၪလီၫ. ယမ့ၬဖၩ့ထၪ့နီၪ,ယိခွါဘီၪ,ယ",
			"30": "<sup>30</sup> ထဲးယိန့ၫစၩ့လဆံၭဖိၪနီၪလီၫ.- ၦခမျၧးအ့ၪအၪ့ဘၪ ဆၧတၭ,အၪ့ဘျဲၩအၪ့ဆၧလၧအအၪ့ဂူၬန့ လၧအဒုၪ အဒၩၥံၪမုဆၫလနံၩယီၩတၭ, မွဲအဂ့ၩဒၪဆၧဆံၭအၪ လဲၪ.အဂဲးဘဲၫယီၩ ဆၧမၩၥံၫၦဖလံၡၫဖိၪမိအီၪယူၭ ဒိၪနဲၪ့ဒံၭဖၭဒိၪမွဲအ့ၬဧၪ.",
			"31": "<sup>31</sup> တၭလၧမုလနံၩနီၪ အဝ့ၫၥံၪဖ့ၬခွံၬၦဖလံၡၫဖိၪလၧ မံၭမၭဖိးလၧအၭဇလၧၫ့လီၫ. တၭၦခမျၧး လၩ့ဘဲၩ",
			"32": "<sup>32</sup> နၭမၬလီၫ.- တၭၦခမျၧးစဲၪ့ၥၡိၫထၪ့ လၧဆၧလၧအ အၪ့ဂူၬန့ဝ့ၫတၭ,မၩန့ၥိၪၥံၪဘ့ၪၥံၪ, ဒဲချီဖၫဒဲချီဖိၪတၭ, မၩၥံၫဝ့ၫလၧဂၪ့ခိၪအလီၩ့တၭ, ၦခမျၧးနီၪအၪ့ဝ့ၫအီၪ",
			"33": "<sup>33</sup> လၧအၥွံၪလီၫ.- တၭၦလီၩဘၪစစီလူၫတၭ စံၭဝ့ၫဒၪ, ယိခွါ,ၦခမျၧးအၪ့ဆၧလၧအၥွံၪတၭ, မၩမၪဘၪယ ဟိဝၩနီၪလီၫ. တၭအဝ့ၫဒၪစံၭ, နၥံၪမၩမၪယူၭဆၧ ယူၭ,ချံးစိၩလိးဖၭဒိၪလဖျိၪ့ လၧယအီၪလၧမုဆၫလ",
			"34": "<sup>34</sup> နံၩယီၩဆံၭ.- တၭစစီလူၫစံၭဝ့ၫဒၪ, မၩလၩ့ပြံၩလၩ့ ပၩလိၬနၥံၪအၥၭ လၧၦခမျၧးအကျၩတၭ, စံၭအဝ့ၫ ၥံၪ,ဂဲၫဆိၬန့ယၧၩ ထီးယီၩလဂၩအချီဖၫလဒုၩလဂၩ အချီဖၫလဒုၩ, ဒဲလဂၩအၥိၪလဒုၩလဂၩအၥိၪလဒုၩ တၭ,မၩၥံၫဆၧထီးယီၩတၭး အၪ့ဆၧဆံၭ. အၪ့ဆၧ လၧအၥွံၪတၭမၩမၪဘၪယဟိဝၩလဂ့ၩ. တၭၦခမျၧး ထီးအလူၬဂဲၫဆိၬဝ့ၫလဂၩအချီဖၫလဒုၩ, လဂၩအချီ",
			"35": "<sup>35</sup> ဖၫလဒုၩလၧမုနၩနီၪး မၩၥံၫဝ့ၫထီးနီၪလီၫ.- စစီလူၫ မၩထၪ့ဆၧလုလးလၧယဟိဝၩအဂးတၭ, အနီၪမွဲဆၧ လုလးလၧအမၩထၪ့ဆိၫဝ့ၫ လၧယဟိဝၩအဂးလီၫ.",
			"36": "<sup>36</sup> စစီလူၫစံၭဝ့ၫဒၪ, မွဲပလီၩ့ဆီးၦဖလံၡၫဖိၪလၧမုနၩ လခီၫတၭ,မၩဂၭဂီၩ့ၡီၩ့အဝ့ၫၥံၪ ထီးဆၧဖၩ့ထၪ့ဆံၭ. မွဲပထီးဒုၭအီၪလၩ့ထးနးဂၩလဂ့ၩ, တၭအဝ့ၫၥံၪစံၭ ဝ့ၫဒၪ,မၩကယဲဆၧလၧအဂ့ၩ လၧနမ့ၬယၫဆံၭ. တၭၦ လုဆၧလဂၩစံၭဝ့ၫဒၪ, မွဲပၥုၭဘူၭၡီၩ့ပၥၭလၧယွၩအ",
			"37": "<sup>37</sup> အီၪဆံၭ.- တၭစစီလူၫအၪ့စၪ့ယွၩ, မွဲယမိလီၩ့ဆီးဘၪ ၦဖလံၡၫဖိၪနီၪဆ့ဧၪ, နမိဖ့ၪလၫ့လၧအံၫစရ့လၭအ စူၪဖၧၩ့နီၪဆ့ဧၪး တၭဆၧလၧမုလနံၩနီၪ အဝ့ၫဒၪစံၭ ဆၧၫ့ဘၪအ့ၬ.",
			"38": "<sup>38</sup> စစီလူၫစံၭဝ့ၫဒၪ, ၦခမျၧးအခိၪထီးအလူၬၥံၪဧ့,ၥုၭ ဘူၭနၥံၪအၥၭထီးယီၩတၭ, မၩဆၧနီၫလဲၪနီၫလဲၪနီၪ, လၧဆၧမၩမၪဘၪဆၧ မုလနံၩယီၩၥ့ၪယၫနၥံၪဝ့ၫတၭ,",
			"39": "<sup>39</sup> ယိဆံၭ.- အဂဲးဘဲၫယီၩ ယဟိဝၩမၧၫ့ဝ့ၫလၧဆၧမၩ ဖီၩ့မၩဖျ့ၭအံၫစရ့လၭနီၪ, မွဲလၧယဖိၪခွၫစစၪ့နၥၧၫ့ လါနၫ့တၭ,မိဘၪၥံၫတၡါလီၫ. တၭၦချဲၩ့ဆၧၫ့ဆၧလၧ",
			"40": "<sup>40</sup> ၦခမျၧးအကျၩနးဂၩအ့ၬ.- ထီးနီၪလဖၧၫ့အဝ့ၫစံၭအံၫ စရ့လၭထီးအလူၬ, အီၪနၥံၪဝ့ၫနးခီၫတၭ, ယၧၩဒဲယ ဖိၪခွၫစစၪ့နၥၧၫ့ မိအီၪနးခီၫလီၫ. တၭၦခမျၧးစံၭစစီ",
			"41": "<sup>41</sup> လူၫ,မၩဆၧထီးဒၪအဘၪနၥၭဘီၪ.- မၩအၥၭဘဲၫနီၪ တၭစစီလူၫစံၭ ယဟိဝၩအံၫစရ့လၭအယွၩ, ဖ့ၪလၫ့ လါဆၧဖၭလၧၫ့ဎွ့ၩဆံၭ. တၭဆၧမၩန့စစီလူၫဒဲစစၪ့",
			"42": "<sup>42</sup> နၥၧၫ့တၭၦခမျၧးဖီၩ့ဖျ့ၭဝ့ၫဒၪလီၫ.- တၭစစီလူၫစံၭဝ့ၫ ဒၪ,ဖၭဆၧလၧယၧၩ ဒဲယဖိၪခွၫစစၪ့နၥၧၫ့အဂးဆံၭ.",
			"43": "<sup>43</sup> တၭဆၧမၩန့စစၪ့နၥၧၫ့လီၫ.- ထီးနီၪလဖၧၫ့စစီလူၫစံၭ စစၪ့နၥၧၫ့,ဆၧလၧနမၩနီၪ, ဒုၭနဲၪယၧၩဘီၪ.တၭစစၪ့ နၥၧၫ့ဒုၭနဲၪဝ့ၫတၭ, စံၭဝ့ၫဒၪ, န့ၫယထဲးယိန့ၫစၩ့လ ဆံၭလၧနိၪထိၭဘီၩ့အခံၫထိၭ လၧအအီၪလၧယစူၪ",
			"44": "<sup>44</sup> ဖၧၩ့,ယိခွါ,ယမိဘၪၥံၫလီၫ.- တၭစစီလူၫချဲၩ့ဆၧၫ့ဝ့ၫ ဒၪ,မွဲယွၩမၩဘဲၫနီၪ, ဒဲမၩအၪနဲၪ့အနီၪဆံၭ. အဂဲးဘဲၫ",
			"45": "<sup>45</sup> ယီၩစစၪ့နၥၧၫ့ဧ့, နဘၪၥံၫတၡါလီၫ.- တၭၦခမျၧးစံၭ စစီလူၫ,မွဲစစၪ့နၥၧၫ့လၧအမၩဆၧ မၩဖီၩ့မၩဖျ့ၭဖၭဒိၪ လၧအံၫစရ့လၭအကျၩနီၪ မိၥံၫဆ့ဧၪ. မွဲဆၧထီးမၩ အၥၭဘဲၫနီၪလဂ့ၩ, ယဟိဝၩမၧၫ့ဝ့ၫနီၪ, အခိၪၥူၫလၩ့ ထ့ၬဘၪလၧဂၪ့ခိၪနးဘီၩ့အ့ၬ. အဂဲးဘဲၫယီၩအဝ့ၫမၩ ဆၧလၧယွၩအၥိၭမုလနံၩယီၩလီၫ. ၦခမျၧးမၩဖီၩ့ဖျ့ၭ",
			"46": "<sup>46</sup> စစၪ့နၥၧၫ့တၭၥံၫဝ့ၫအ့ၬ.- တၭစစီလူၫထဲၩ့ထဲၩ့ဝ့ၫလၧ အလီၩ့ဆီးၦဖလံၡၫဖိၪတၭ ၦဖလံၡၫဖိၪထဲၩ့ဝ့ၫလၧအ လးဒၪဝ့ၫနီၪလီၫ.",
			"47": "<sup>47</sup> စစီလူၫမၩန့ဘၩ့မုး လၧအံၫစရ့လၭအဖၫ့ခိၪတၭ, ဒုၭၥုၭလၧအဒုၪအဒၩအီၪဝၬဖီၩ့ဝ့ၫ ထီးအလူၬတၭ, ထၫ့ဒုၪဒၩမိအၭ, ဒဲၦအၫမၧၫ့ဖိၪ, ဒဲအံဒၧၫ့,ဒဲဇိဘၫအ စဎွၩလဖၪ,ဒဲၦဖလံၡၫဖိၪလီၫ. တၭထီးဒၪအလးလၧ အကၠၪအၥၭလၧၦၡၩအအီၪနီၪ, မွဲအမၩစၪဆၧလီၫ.",
			"48": "<sup>48</sup> မၩဆၧဆီၪ့ဆီၪ့လ့ၬတၭ, ဖ့ၬခွံၬ ၦအၫမလ့ၭဖိၪတၭ, မၩဖီၩ့မၩဖျ့ၭအံၫစရ့လၭ လၧၦလၧအမၩန့ဆီၪ့အဆၧ လဖၪအစူၪဖၧၩ့လီၫ.",
			"49": "<sup>49</sup> တၭစစီလူၫအဖိၪခွၫလဖၪနီၪ, မွဲစစၪ့နၥၧၫ့,ဒဲစအံ စုၫအဲၫ,ဒဲစမ့ၫလခရှုၫအ့ၫလီၫ. တၭအဖိၪမုၪနံၫဂၩလဖၪ နီၪ,အဝဲၡါလဂၩအမံၩ့မွဲနးမံရၭ, အဆံၭလဂၩအမံၩ့",
			"50": "<sup>50</sup> မွဲနးမဲၫခၫလၭလီၫ.- တၭစစီလူၫအမၫ စအဟံမအၭ အဖိၪမုၪအမံၩ့မွဲနးအဟံၫ့နိၫအၫ့လီၫ. တၭစစီလူၫအ မၩ့စနၧၫအဖိၪခွၫအမံၩ့ စအၭဘနၧၫ, မွဲအၥုၭမုအခိၪ",
			"51": "<sup>51</sup> လီၫ.- စစီလူၫအဖါမွဲစကံၭတၭ, စအၭဘနၧၫအဖါစနၧၫ",
			"52": "<sup>52</sup> နီၪမွဲစအဘဲၫအ့လၭအဖိၪခွၫလီၫ.- တၭဆၧဒုၭၥုၭထၫ့ ဒၩၦဖလံၡၫဖိၪနီၪအီၪဝ့ၫဆီၪ့ဆီၪ့လ့ၬ လၧစစီလူၫအ မုနံၩထီးအလူၬ အဖၧၩ့လီၫ. တၭစစီလူၫအ့ၪဒၪန့ၦ အဆီၪ့လဂၩဂၩမွဲဂ့ၩ, ၦအၥၭဒူၩလဂၩဂၩမွဲဂ့ၩ, မၩ န့ဝ့ၫလၧအဂးလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> တၭစစၫမုၫအ့လၭစံၭစစီလူၫ, ယဟိဝၩအၪ့မၧၫ့ ယဂဲၫဂုၪဝဲၩနၧၩလၧစဎွၩ, လၧအၡၩခမျၧးအဖၫ့ခိၪ, အံၫစရ့လၭအဖၫ့ခိၪနီၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဘိၩ့ နဲၪ့ယီၩခိၭနၪယဟိဝၩအဆၧချဲၩ့လဖၪ အလူနီၪဆံၭ.",
			"2": "<sup>2</sup> တၭဆၧၥုၭမုခမျၧးအယဟိဝၩ စံၭဝ့ၫဘဲၫယီၩ, ယယိ ဆီၫ့မီၪ့ယူၭဆၧလၧအၫမလ့ၭမၩအံၫစရ့လၭ, လၧအ အီၪက့ၪဆၧထၫ့ဒုၪဒၩ လၧဖၧၩ့ၥၭထီးအဝ့ၫၥံၪဂဲၫထၪ့ လၧအံဇံၭအဘိၩ့ဘၭနီၪလီၫ.",
			"3": "<sup>3</sup> ဘိၩ့နဲၪ့ယီၩလ့ၩဆၧတၭ, ဖ့ၬခွံၬအၫမလ့ၭတၭ,မၩ ဂၭဂီၩ့ကယဲဆၧလၧအအီၪ လၧအဝ့ၫၥံၪတၡါဆံၭ. လီၫ့ကီၩ့ဆၧလဂ့ၩ, မၩၥံၫလၧၦခွၫထီၩ့လၧၦမုၪ,လၧ ဖိၪၥၪနီၪထီၩ့လၧအအၪ့နူ, လၧချီဖၫထီၩ့လၧၥိၪလၧ ဘ့ၪ,လၧအကလအူၭထီၩ့လၧ အကၥ့ၪယီၩ့နီၪဆံၭ.",
			"4": "<sup>4</sup> စစီလူၫဒုၭအီၪကိၩ့အီၪကီၪ့ၦခမျၧးတၭ, ဝံထၪ့နၬ ထၪ့ဝ့ၫလၧတံလံၫ့အဖၧၩ့ ၦခၪ့ၥုၭဖိၪအီၪနံၫကုၬ, ဒဲၦယု",
			"5": "<sup>5</sup> ဒၫဖိၪလလၬလီၫ.- တၭစစီလူၫလ့ၩဝ့ၫလၧအၫမလ့ၭ အဒိၩ့လဖျိၪ့တၭ, အီၪခိၭၥူၪဝ့ၫလၧခိၪလီၩ့ဆူၭဖၧၩ့",
			"6": "<sup>6</sup> လီၫ.- တၭစစီလူၫစံၭၦကံၫ့နဲၭဖိၪ, လ့ၩဘီၪ, ဂၭထၪ့, စဲၪ့ထၪ့ခွံၬလၧအၫမလ့ၭဖိၪအကျၩဘီၪ. ဘၪလဘၪ ယမိမၩဂၭဂီၩ့ဘၪခိၬနၥံၪ လၧအဝ့ၫၥံၪအၥိၭလီၫ. အ ဂဲးဘဲၫယီၩထီးၦအံၫစရ့လၭဖိၪ ဂဲၫစဲၪ့ထၪ့ခွံၬလၧအံ ဇံၭတၭ,နၥံၪမၩဝ့ၫလၧဆၧအခိးအတၩ ထီးအလူၬ လီၫ.တၭၦကံၫ့နဲၭဖိၪ စဲၪ့ထၪ့ခွံၬ လၧၦအၫမလ့ၭဖိၪ",
			"7": "<sup>7</sup> အကျၩလီၫ.- တၭစစီလူၫဖ့ၬခွံၬ ၦအၫမလ့ၭဖိၪလၧ ဟၭဝလၫထီးနလ့ၩနုၬ လၧၡၧၫအဖၧၩ့လၧအအီၪဎၩ့",
			"8": "<sup>8</sup> လၧအံဇံၭလီၫ.- တၭအဝ့ၫဒၪဖီၪ့န့မၧၫ့ၦအၫမလ့ၭဖိၪ အစဎွၩစအၫဂၭတၭ, မၩဂၭဂီၩ့ၦခမျၧး ထီးအလူၬ",
			"9": "<sup>9</sup> ထူၬဆံၫ့ဘၩ့လၧနၭအနါလီၫ.- တၭစစီလူၫဒဲၦခမျၧး နီၪလီၫ့ကီၩ့စအၫဂၭ, ဒဲၥိၪၥံၪဘ့ၪၥံၪ, လၧအဂ့ၩထုၬ လဖၪ,ဒဲလၧချီဖၫၥံၪအကျၩ, ဒဲဆၧဖိၪဆၧဎါအဘီၪ့, ဒဲၥိၪဖိၪလဖၪ, ဒဲကယဲဆၧလၧအဂ့ၩ ထီးအလူၬနီၪ,မိ မၩဂၭဂီၩ့ဝ့ၫလူၬထူၬအ့ၬ. အ့ၪမွဲကယဲဆၧလၧအလၬ အၧၩ့,ဒဲလန့ကဲၩ့န့ကၩဘၪဆၧနီၪ မၩဂၭဂီၩ့ခွံၬဝ့ၫလူၬ ထူၬလီၫ.",
			"10": "<sup>10</sup> ထီးနီၪလဖၧၫ့ယဟိဝၩအလူ လၩ့ဘၪဝ့ၫလၧစစၫ",
			"11": "<sup>11</sup> မုၫအ့လၭတၭ,စံၭဝ့ၫဒၪ,- မွဲယအီၪက့ၪထၪ့စစီလူၫ လၧစဎွၩတၭ,ယနီၫ့ယါလၩ့ထဲၩ့ယၥၭလီၫ. အဂဲးဘဲၫ ယီၩလၧအလီၩ့ဖိၬယခဲၫ့နီၪ ထဲၩ့ထဲၩ့ယူၭဝ့ၫတၭ,ထီး န့ယဆၧမၪလူၬအ့ၬ. စစၫမုၫအ့လၭအၥၭအုၭနီၪကိၭ",
			"12": "<sup>12</sup> ထၪ့ယဟိဝၩၥၫ့နၩချီၩ့လီၫ.- ထီးစစၫမုၫအ့လၭဂဲထုၪ့ ဂီၩဂီၩဘဲၫၥိၭအမိလ့ၩဒၪလိၬအၥၭ လၧစစီလူၫနီၪ,ၦ ဒုၭနဲၪဆၧလၧစစၫမုၫအ့လၭတၭ, စံၭဝ့ၫဒၪ,စစီလူၫဂဲၫ လၧကၫမလၭတၭ,ယိခွါ, အီၪက့ၪထၪ့ဆၧမၩနဲၪ့လၧ အဂးတၭ,လ့ၩဝံၩ့ဝၩ့ခၫ့ဂၬဆၧတၭ လ့ၩလၩ့လၧဂံလ ဂၫလၭလီၫ.",
			"13": "<sup>13</sup> တၭစစၫမုၫအ့လၭ လ့ၩလၧစစီလူၫအအီၪတၭ,စ စီလူၫစံၭအဝ့ၫ, မွဲနဘၪဆၧဆိၪဂ့ၩ လၧယဟိဝၩဆံၭ. ယမၩယူၭဆၧလၧယဟိဝၩ မၪလူၬဝ့ၫလီၫ.",
			"14": "<sup>14</sup> တၭစစၫမုၫအ့လၭစံၭဝ့ၫဒၪ, ၥိၪၥံၪဘ့ၪၥံၪ ဂၪ့ကိၭ လၧယနါဖၧၩ့, ဒဲချီဖၫၥံၪဂၪ့ကိၭလၧယနါဂၧၫ့နီၪ, မွဲ",
			"15": "<sup>15</sup> ဘဲၫၥ့ၪလဲၪ.- စစီလူၫစံၭဝ့ၫဒၪ, ၦဂဲၫဆိၬဝ့ၫလၧၦအၫ မလ့ၭဖိၪအကျၩလီၫ. အဂဲးဘဲၫယီၩ ၦခမျၧးလီၫ့ကီၩ့ ဆၧအဂ့ၩလၧၥိၪၥံၪဘ့ၪၥံၪ, ဒဲချီဖၫၥံၪအကျၩဘဲၫၥိၭ အမိလုထၪ့ဆၧလၧယဟိဝၩနယွၩတၭ, ဆၧအီၪလၩ့ ထးလဖၪနီၪပမၩဂၭဂီၩ့ယူၭလူၬထူၬ ဆံၫ့ဘၩ့လီၫ.",
			"16": "<sup>16</sup> တၭစစၫမုၫအ့လၭစံၭစစီလူၫ, အီၪဒၪခလူၬတၭ,ယမိ လီၩဘၪနၧၩလၧဆၧလၧယဟိဝၩ စံၭယၧၩလၧမုလနၩ ယီၩလီၫ. တၭအဝ့ၫဒၪစံၭဝ့ၫ, ချဲၩ့ထၪ့ဘီၪ.",
			"17": "<sup>17</sup> စစၫမုၫအ့လၭစံၭဝ့ၫဒၪ, အဆၧၫ့အထီလၧနမွဲၦအ ဆံၭလၧနနၫ့ဆါအမ့ၬယၫနီၪ, နကဲၪထၪ့အံၫစရ့လၭအ ဒီၪ့လဖၪအခိၪတၭ, ယဟိဝၩဂုၪနၧၩလၧအံၫစရ့လၭ",
			"18": "<sup>18</sup> အစဎွၩမွဲအ့ၬဧၪ.- တၭယဟိဝၩ အၪ့မၧၫ့နလ့ၩဖိၬ ဖၧၩ့ၥၭလဘီၩ့တၭ,စံၭ, လ့ၩမၩဂၭဂီၩ့ခွံၬ ၦဆၧဒဲၩ ဘၭဖိၪၦအၫမလ့ၭဖိၪတၭ, ဒုၭၥုၭလၧအဝ့ၫၥံၪထီးအ",
			"19": "<sup>19</sup> လူၬခွံၬကိၭဂၩဒ့ၭဆံၭ.- နလခိၭနၪဘၪယဟိဝၩအလူ တၭ,နစဲၪ့ၥၡိၫလၧဆၧအၪ့ဂူၬန့အဖၫ့ခိၪတၭ, မၩဆၧ",
			"20": "<sup>20</sup> အၧၩ့လၧယဟိဝၩအမ့ၬယၫနီၪ, မွဲဘၪလဲၪ.- တၭစစီ လူၫစံၭစစၫမုၫအ့လၭ,မွဲယူၭ, ယခိၭနၪယူၭယဟိဝၩ အလူယူၭ, ယလ့ၩဖိၬယူၭဖၧၩ့ၥၭလၧယဟိဝၩ အၪ့ မၧၫ့ယလ့ၩယူၭ, ဒဲယဂဲၫထဲၩ့ဆိၬယူၭၦအၫမလ့ၭဖိၪ အစဎွၩအၫဂၭတၭ, ယမၩဂၭဂီၩ့ယူၭၦအၫမလ့ၭဖိၪ",
			"21": "<sup>21</sup> ထီးအလူၬယူၭ.- အ့ၪမွဲၦခမျၧးမၩန့ဆၧလၧအအၪ့ဂူၬ န့အကျၩ, ၥိၪၥံၪဘ့ၪၥံၪဒဲချီဖၫၥံၪ, ဆၧအခိၪလဖၪလၧ ဆၧလၧအကြၨၭထီၩ့ လၧဆၧဂၭဂီၩ့လူၬထူၬဝ့ၫအ ကျၩ,ဘဲၫၥိၭယမိလုထၪ့ဆၧလၧ ယဟိဝၩနယွၩလၧဂံ လဂၫလၭနီၪလီၫ.",
			"22": "<sup>22</sup> တၭစစၫမုၫအ့လၭစံၭအဝ့ၫဒၪ, မွဲအဘၪယဟိဝၩ အၥၭလၧဆၧလုမ့ၪ, ဒဲဆၧလုနီၪ, န့ၫဎီၩ့လၧအဘၪအ ၥၭလၧဆၧခိၭနၪယဟိဝၩအလူနီၪဆ့ဧၪ. ယိခွါ,ခိၭနၪ ဆၧနီၪဂ့ၩနဲၪ့လုထၪ့ဆၧ, ဒဲဒိၭအနါနီၪဂ့ၩနဲၪ့ၥိၪဖၫ",
			"23": "<sup>23</sup> အၥိၪနီၪဒံၭလီၫ.- အဂဲးဘဲၫယီၩဆၧပိၩ့ထၪ့အဆၧဒဲၩ ဘၭနီၪန့ၫဎီၩ့လၧဆၧအူၪဆၧပီၩတၭ, ဆၧအနၧၫ့ထၧၫ့ နီၪန့ၫဎီၩ့လၧဆၧဂၩ့ဆၧဖၪ့အဆၧအၧၩ့လီၫ. မွဲနခွံၬ ၡိၭယဟိဝၩအလူတၭ, ယဟိဝၩခွံၬၡိၭနၧၩ လၧစဎွၩ",
			"24": "<sup>24</sup> အလးလီၫ.- တၭစစီလူၫစံၭစစၫမုၫအ့လၭ, ယမၩမၪ ဘၪယူၭဆၧယူၭ, အဂဲးဘဲၫယီၩ ယလၨၪခၫ့ဖၬဘၪ ယဟိဝၩအဆၧမၪလူၬ, ဒဲနလူယူၭ, အဂဲးဘဲၫယီၩ, ယၥၭမဲၪၦခမျၧးတၭ, ယခိၭနၪအဝ့ၫၥံၪအလူလီၫ.",
			"25": "<sup>25</sup> တၭဘိၩ့နဲၪ့ယီၩ ဖျါခွံၬယဆၧမၪဆံၭ. ထဲၩ့ထဲၩ့လၧ ယၥိၭဘဲၫၥိၭယမိဘိၪ့ထၪ့ဘၩထၪ့ ယဟိဝၩဆံၭ.",
			"26": "<sup>26</sup> တၭစစၫမုၫအ့လၭစံၭစစီလူၫ, ယထဲၩ့ထဲၩ့လၧနၥိၭ အ့ၬ.အဂဲးဘဲၫယီၩနခွံၬၡိၭခွံၬယူၭ ယဟိဝၩအလူယူၭ တၭ,ယဟိဝၩခွံၬၡိၭခွံၬနၧၩ လၧစဎွၩအလးလၧအံၫ",
			"27": "<sup>27</sup> စရ့လၭအဖၫ့ခိၪယူၭ.- စစၫမုၫအ့လၭကၠၪအၥၭဘဲၫၥိၭ အမိစဲၪ့ထၪ့ခွံၬတၭ, အဝ့ၫဒၪဖီၪ့ထၬအဖၬဘဲၩ့အနဲၩ့",
			"28": "<sup>28</sup> ထံၭတၭ, ယၬခွံၬဝ့ၫလီၫ.- တၭစစၫမုၫအ့လၭစံၭဝ့ၫ, ယဟိဝၩၡၫ့ခွံၬအံၫစရ့လၭ အဘၩ့အမုးလၧနၧၩလၧ မုလနံၩယီၩတၭ, ဖ့ၪလၫ့ဝ့ၫလၧၦလၧနနဲၩ့ထံၭလဂၩ",
			"29": "<sup>29</sup> လၧအဂ့ၩနဲၪ့နၧၩနီၪလီၫ.- လၧနီၪအမ့ၬယၫဆၧလၧ အကဲၪအံၫစရ့လၭအဂဲးအဘၭလဂၩနီၪ ချဲၩ့ဘျံၭချဲၩ့ ဘျၪဆၧအ့ၬ. နၪ့ထၪ့နီၫ့ယါလၩ့ထဲၩ့အၥၭအ့ၬ. အဂဲး ဘဲၫယီၩအဝ့ၫဒၪမွဲၦၡၩလဂၩ, လၧအမိဘၪနၪ့ထၪ့နီၫ့",
			"30": "<sup>30</sup> ယါလၩ့ထဲၩ့အၥၭနီၪ, မွဲအ့ၬ.- တၭအဝ့ၫဒၪစံၭဝ့ၫ,ယ မၩမၪဘၪယူၭဆၧယူၭ. ဘိၩ့နဲၪ့ယီၩ ဒုၭလၩဒုၭဖၩ့ လါယၧၩလၧယၡၩခမျၧး အၥၭၡါအမ့ၬယၫ, ဒဲလၧ အံၫစရ့လၭအမ့ၬယၫတၭ, ထဲၩ့လၧယၥိၭ, ဘဲၫၥိၭယ မိဘိၪ့ထၪ့ဘၩထၪ့ယဟိဝၩနယွၩနီၪဆံၭ.",
			"31": "<sup>31</sup> အခိးမွဲစစၫမုၫအ့လၭထဲၩ့ဖိၬ စစီလူၫအခဲၫ့တၭ, စစီလူၫဘိၪ့ထၪ့ဘၩထၪ့ယဟိဝၩလီၫ.",
			"32": "<sup>32</sup> ထီးနီၪလဖၧၫ့စစၫမုၫအ့လၭစံၭဝ့ၫဒၪ, ဂဲၫဆိၬၦအၫ မလ့ၭဖိၪအစဎွၩအၫဂၭ လၧယအီၪဆံၭ. တၭစအၫ ဂၭဂဲၫဝ့ၫလၧအၥၭဎွံၫတၭ, စအၫဂၭစံၭဝ့ၫဒၪ,မွဲမၬဆၧ",
			"33": "<sup>33</sup> နၭဆၧၥံၫအဆၧနၭဆၧၡၪ့ဖီၩ့ခွံၬယူၭ.- တၭစစၫမုၫ အ့လၭစံၭဝ့ၫဒၪ, ဘဲၫနနၭဒုၭကဲၪထၪ့ယူၭ ၦမုၪလၧအ ဖိၪလအီၪဘၪအၥိၭနီၪ, နမိလဂၩနီၪဘၪကဲၪထၪ့ၦအ ဖိၪလအီၪဘၪလဂၩ လၧၦမုၪအကျၩ ဘဲၫနီၪအၥိၭဆ့ လီၫ.တၭစစၫမုၫအ့လၭ တဲၩခွံၬစအၫဂၭလၧယဟိ ဝၩအမ့ၬယၫလၧဂံလဂၫလၭ အဖၧၩ့နီၪလီၫ.",
			"34": "<sup>34</sup> စစၫမုၫအ့လၭလ့ၩထၪ့လၧရၫမၫတၭ, စစီလူၫလ့ၩ ထၪ့လၧအဂံၪ့ထီးဂံဘအၫစီလူၫနီၪလီၫ.",
			"35": "<sup>35</sup> တၭစစၫမုၫအ့လၭ လဂဲၫဒၪလၧၩ့ဘၪစစီလူၫထီၩ့ လၩ့လၧမုလနံၩ လၧအၥံၫနီၪလီၫ. မွဲလါနၫ့စစၫမုၫအ့ လၭအၥၭအုၭလၧစစီလူၫအကၠီၩ့လီၫ. တၭယဟိဝၩ နီၫ့ယါလၩ့ထဲၩ့အၥၭ လၧအအီၪက့ၪထၪ့စစီလူၫလၧ စဎွၩလၧအံၫစရ့လၭအဖၫ့ခိၪအကၠီၩ့လီၫ."
		},
		"16": {
			"1": "<sup>1</sup> တၭယဟိဝၩစံၭစစၫမုၫအ့လၭ, နၥၭမိအုၭလၧစစီ လူၫအကၠီၩ့ဆံၭယံၬလဲၪ. ယခွံၬၡိၭယူၭအဝ့ၫလၧစဎွၩ အလးလၧအံၫစရ့လၭအဖၫ့ခိၪယူၭ, မၩဎွ့ၩနဖီၩ့ဆၧ နိၩ့လၧၥိၪတၭ, လ့ၩဘီၪ. ယမိဒုၭလ့ၩနၧၩလၧၦဘ့ၭ ၥလံၫဟံၫ့ဖိၪစယ့ၭစံၫအအီၪလီၫ. အဂဲးဘဲၫယီၩယ ဒၪဘၪယူၭစဎွၩလၧယဂး လၧအဝ့ၫဒၪအဖိၪခွၫၥံၪအ",
			"2": "<sup>2</sup> ကျၩယူၭ.- စစၫမုၫအ့လၭစံၭဝ့ၫဒၪ, ယလ့ၩမိၥ့ၪဘဲၫ ၥ့ၪလဲၪ.စစီလူၫအ့ၪနါဂၧၫ့တၭ, မိမၩၥံၫယၧၩလီၫ. တၭယဟိဝၩစံၭဝ့ၫဒၪ, မၩန့ချီမိနးဒုၩ လၧနၥိၭတၭ,",
			"3": "<sup>3</sup> စံၭ,ယဂဲၫလုထၪ့ဆၧလၧယဟိဝၩလီၫ.- တၭကိၭန့ စယ့ၭစံၫလၧဆၧလုထၪ့နီၪဘီၪ. နမိဘၪမၩဘဲၫၥ့ၪလဲၪ, ဘဲၫၥ့ၪလဲၪနီၪ, ယမိဒုၭနဲၪနၧၩလီၫ. နမိဘၪဂုၪၦလၧ ယမိစံၭနၧၩလဂၩလၧယဂးလီၫ.",
			"4": "<sup>4</sup> စစၫမုၫအ့လၭမၩဆၧလၧ ယဟိဝၩချဲၩ့နီၪတၭ, ဂဲၫဝ့ၫလၧဘ့ၭၥလံၫဟံၫ့နီၪလီၫ. ဒိၩ့အၡၩၥုၪ့က့ၭၥၭၡါ ဝၭထိၬလၧအဂဲၫဆၧအကၠီၩ့တၭ, စံၭဝ့ၫဒၪ, နဂဲၫလၧ",
			"5": "<sup>5</sup> ဆၧဘၪလိၬအိၭလိၬဆ့ဧၪ.- တၭအဝ့ၫဒၪစံၭ, ယဂဲၫ လၧဆၧဘၪလိၬအိၭလိၬ ဘဲၫၥိၭယမိလုထၪ့ဆၧလၧ ယဟိဝၩအဂးလီၫ. မၩဆံၫ့ထၪ့နၥံၪအၥၭတၭ, ဂဲၫ လၧယၥိၭလၧဆၧလုထၪ့ဝ့ၫဆံၭ. တၭအဝ့ၫဒၪမၩဆံၫ့ ဎံၪစယ့ၭစံၫဒဲအဖိၪခွၫၥံၪတၭ, ကိၭအဝ့ၫၥံၪလၧဆၧလု ထၪ့ဝ့ၫနီၪလီၫ.",
			"6": "<sup>6</sup> ဆၧမၩအၥၭထီးအဝ့ၫၥံၪဂဲၫထၪ့နီၪ လၧအဝ့ၫဒၪယိ စအံၫလဲအၭတၭ,စံၭဝ့ၫဒၪ, မွဲမၬယဟိဝၩအၡၩဒိၭဂုၪ",
			"7": "<sup>7</sup> အၥၭလဂၩအီၪလၧအမ့ၬယၫလီၫ.- အ့ၪမွဲယဟိဝၩ စံၭစစၫမုၫအ့လၭ, အဝ့ၫဒၪအမ့ၬအခံးအဂၩ့, ဒဲအဂၩ့ ထီၫနီၪယိလဂ့ၩ, မွဲယခွံၬၡိၭယူၭအဂဲးလီၫ. အဂဲးဘဲၫ ယီၩယဒၪဘၪဆၧ ဘဲၫၦၡၩဒၪဘၪဆၧအၥိၭနီၪအ့ၬ. အဂဲးဘဲၫယီၩ ၦၡၩယိၦအမ့ၬ, အ့ၪမွဲယဟိဝၩယိၦ",
			"8": "<sup>8</sup> အၥၭလီၫ.- ထီးနီၪလဖၧၫ့စယ့ၭစံၫကိၭန့စအဘံနဒၭ တၭ,ဒုၭလ့ၩဖီၩ့ခွံၬဝ့ၫလၧ စစၫမုၫအ့လၭ အမ့ၬယၫ လီၫ.တၭအဝ့ၫဒၪစံၭဝ့ၫ, ယဟိဝၩရွံန့ အဝ့ၫလဂၩ",
			"9": "<sup>9</sup> ယီၩဆ့အ့ၬ.- ထီးနီၪလဖၧၫ့ စယ့ၭစံၫ ဒုၭလ့ၩဖီၩ့ခွံၬ စၡၫ့မၫလီၫ. တၭအဝ့ၫဒၪစံၭဝ့ၫ, ယဟိဝၩရွံန့ အဝ့ၫ",
			"10": "<sup>10</sup> လဂၩယီၩဆ့အ့ၬ.- တၭစယ့ၭစံၫ ဒုၭလ့ၩဖီၩ့ခွံၬအ ဖိၪခွၫနွ့ၫဂၩလၧ စစၫမုၫအ့လၭ အမ့ၬယၫလီၫ. တၭ စစၫမုၫအ့လၭ စံၭစယ့ၭစံၫ, ယဟိဝၩရွံန့အဝ့ၫၥံၪဆ့ အ့ၬ.",
			"11": "<sup>11</sup> တၭစစၫမုၫအ့လၭစံၭစယ့ၭစံၫ, အယီၩမွဲနဖိၪခွၫ လဖၪလူၬဆ့ဧၪ. အဝ့ၫဒၪစံၭဝ့ၫ, ဖိၪဒၪဘၨၩလဂၩအီၪ ဒံၭတၭး ယိခွါ, အဝ့ၫဒၪယူၬၥိၪၥံၪဘ့ၪၥံၪလီၫ. တၭစ စၫမုၫအ့လၭစံၭစယ့ၭစံၫ, အၪ့မၧၫ့ၦလ့ၩကိၭန့အဝ့ၫ ဒၪဘီၪ.အဂဲးဘဲၫယီၩ အဝ့ၫဂဲၫအ့ၪလထီၩ့ဒံၭဘၪထီး",
			"12": "<sup>12</sup> ယီၩတၭ,ပဆၧၫ့နၩ့အ့ၬ.- တၭအဝ့ၫဒၪအၪ့မၧၫ့ၦလ့ၩ မၩန့ဝ့ၫလီၫ. တၭအဝ့ၫဒၪလဂၩနီၪဝီၩဝ့ၫ, အမ့ၬမွဲအ ဎံၫအလၩတၭ, ၦယိဝ့ၫဂ့ၩမၬလီၫ. တၭယဟိဝၩစံၭ ဝ့ၫဒၪ,ဂဲထုၪ့ဂုၪအဝ့ၫဒၪဆံၭ. အဂဲးဘဲၫယီၩအယီၩမွဲ",
			"13": "<sup>13</sup> ၦလဂၩနီၪလီၫ.- တၭစစၫမုၫအ့လၭ မၩန့ဖီၩ့ဆၧနိၩ့ နီၪတၭ,ဂုၪဝ့ၫလၧအထၧၫ့ဖုဝဲအကျၩလီၫ. တၭယဟိ ဝၩအၥၭလၩ့ဘၪလၧစဒၫဝံၭအလီၩ့ လၧမုလနံၩနီၪလၧ ယၫလီၫ. တၭစစၫမုၫအ့လၭ ဂဲထုၪ့တၭ,လ့ၩထၪ့ဝ့ၫ လၧရၫမၫလီၫ.",
			"14": "<sup>14</sup> ယဟိဝၩအၥၭစဲၪ့ထၪ့ခွံၬ လၧစစီလူၫအလီၩ့တၭ, ၥၭအၧၩ့လမံၩ့လၧယဟိဝၩနီၪ မၩခိမၩဝီၩဝ့ၫလီၫ.",
			"15": "<sup>15</sup> တၭစစီလူၫအခ့ၫအၡၩစံၭဝ့ၫ, ယိခွါ,ၥၭအၧၩ့လမံၩ့",
			"16": "<sup>16</sup> လၧယွၩနီၪမၩခိမၩဝီၩနၧၩလီၫ.- မွဲပကဆါမၪလူၬန ခ့ၫနၡၩလၧနမ့ၬယၫ ဘဲၫၥိၭအမိအၪ့ဎၬန့ၦလၧအၥ့ၪ ယၫဒံၩ့နါဒံၩ့ဆံၭ. တၭထီးၥၭအၧၩ့လမံၩ့လၧယွၩနီၪ အ့ၪအီၪလၧနလီၩ့တၭ, ဆၧမိမၩအၥၭလၧအဝ့ၫဒၪလ",
			"17": "<sup>17</sup> ဂၩမိဒံၩ့ဆၧလၧအစူၪတၭ, နမိဘျၪထဲၩ့လီၫ.- တၭစစီ လူၫစံၭအခ့ၫအၡၩ, အၪ့ဎၬန့ယၧၩလၧၦလၧအဒံၩ့ဆၧ အဂ့ၩလဂၩတၭ, ဂဲၫထဲၩ့ဆိၬအဝ့ၫ ထီးယီၩဆံၭ.",
			"18": "<sup>18</sup> ထီးနီၪလဖၧၫ့အခ့ၫအၡၩလဂၩ စံၭဆၧၫ့ဆၧတၭ,စံၭ ဝ့ၫဒၪ,ယိခွါ, ယဒၪယူၭၦဘ့ၭၥလံၫဟံၫ့ဖိၪ စယ့ၭစံၫ အဖိၪခွၫလၧအဒံၩ့ဆၧၥ့ၪလဂၩတၭ, မွဲဝ့ၫလၧၦအ ဆီၪ့,ဒဲၦအၥၭဒူၩ, ဒဲၦၥုၭဖိၪ,ဒဲၦအၥုၪ့ဆၭအၥၭဆၭ ဒဲအခံးအဂၩ့ဂ့ၩတၭ, ယဟိဝၩအီၪလၧအၥိၭလီၫ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ, စစီလူၫအၪ့မၧၫ့အၥီၫ့လဖၪလ့ၩ လၧစယ့ၭစံၫအအီၪတၭစံၭဝ့ၫဒၪ, အၪ့မၧၫ့နဖိၪခွၫလၧ အအီၪလၧၥိၪၥံၪဘ့ၪၥံၪစဒၫဝံၭလဂၩ, ဂဲၫလၧယအီၪ",
			"20": "<sup>20</sup> ဘီၪ.- တၭစယ့ၭစံၫမၩန့ကၥ့ၪယီၩ့လဒုၩ အီၪလၧကိၪ, ဒဲစဘံၭထံၫလၧထိၪ့ဆၧဖံၭလဖျိၪ့, ဒဲဘ့ၪဖိၪလဒုၩ တၭ,ဖ့ၪယုဝ့ၫလၧစစီလူၫ, လၧအဖိၪခွၫစဒၫဝံၭအစူၪ",
			"21": "<sup>21</sup> ဖၧၩ့နီၪလီၫ.- စဒၫဝံၭဂဲၫဝ့ၫ လၧစစီလူၫ အအီၪတၭ, ဆၧၫ့ထုၪ့လၧအမ့ၬယၫလီၫ. တၭအဝ့ၫဒၪအဲၪဝ့ၫဒိၪ မၬလီၫ. တၭအဝ့ၫကဲၪထၪ့ လၧၦဆိၬအစူၪဝဲၩလီၫ.",
			"22": "<sup>22</sup> စစီလူၫအၪ့မၧၫ့ၦလ့ၩလၧစယ့ၭစံၫအအီၪတၭ, စံၭဝ့ၫ ဒၪ,ဒုၭဆၧၫ့ထုၪ့လါစဒၫဝံၭလၧယမ့ၬယၫဘီၪး အဂဲး",
			"23": "<sup>23</sup> ဘဲၫယီၩဘၪခိးဘၪတၩ လၧယမ့ၬယၫလီၫ.- ဆၧမၩ အၥၭထီးၥၭအၧၩ့လမံၩ့ လၧယွၩဒုၭဘၪစစီလူၫတၭ, စဒၫဝံၭမၩန့နါဒံၩ့လဖျိၪ့တၭ ဒံၩ့ဆၧလၧအစူၪနီၪ, စစီ လူၫအၥၭမုၬထၪ့ထဲၩ့တၭ, ဆၧဂ့ၩထၪ့ထဲၩ့လၧအဂး တၭ,ၥၭအၧၩ့လမံၩ့နီၪ စဲၪ့ထၪ့ခွံၬလၧအအီၪလီၫ."
		},
		"17": {
			"1": "<sup>1</sup> ၦဖလံၡၫဖိၪဒုၭအီၪကီၪ့အၡၩၥုၭမု ဘဲၫၥိၭအမိဒုၭ ဆၧနီၪအီၪကိၩ့အီၪကီၪ့ထီးၡိကိၫ လၧအဘၪဆဲၫ့လၧ ယုဒၫတၭ,ၥုၪ့အတဲၩထီးၡိကိၫ ဒဲအဇံကၫအဘိၩ့ဆၧၩ့",
			"2": "<sup>2</sup> လၧအံဖ့ၭဒၫ့မံၫ့အဖၧၩ့လီၫ.- စစီလူၫဒဲၦအံၫစရ့လၭအ ၡၩၥံၪအီၪကိၩ့အီၪကီၪ့တၭ, ၥုၪ့တဲၩလၧဆၧစီၩ့ခိၪအံ လၫတၭ,တဲၩ့ဝဲၩဆၧဒုၭၥုၭ လၧအထၫ့ဒၩၦဖလံၡၫဖိၪ",
			"3": "<sup>3</sup> လီၫ.- ၦဖလံၡၫဖိၪဆၧၫ့ထုၪ့ဝ့ၫ လၧခိၪလီၩ့ခိၪလၧအ လခီၫဒၪတၭ, ခိၪလီၩ့ဆူၭအီၪဝ့ၫလၧအဘိၩ့ဆၧၩ့လီၫ.",
			"4": "<sup>4</sup> တၭၦလဂၩဂဲၫထၪ့ လၧၦဖလံၡၫဖိၪၥုၪ့တဲၩအလး နီၪး အမံၩ့မွဲ စဂိၫလဲအၫလၧဂၭၥၫတၭ, အဂၩ့ထီၫဎူၫ",
			"5": "<sup>5</sup> ဖျါထၫလီၫ.- အဝ့ၫဒၪချႃၬခိၪလူၬၥုၭ ထီးဘၩ့လၧအ ခိၪတၭ, ၥိၭဆဲၫ့ထီးဘၩ့လၧအလယၧးဎၧၫ့ၡက့လၭ",
			"6": "<sup>6</sup> ယဲထီၫ့.- ဖျၪ့အခၪ့လၧခၪ့ဖျၪ့ထီးဘၩ့,ဒဲဖၩ့ဖိၪထီးဘၩ့",
			"7": "<sup>7</sup> အီၪဝ့ၫလၧအခိၬထံၭခိၪနီၪလီၫ.- တၭအဖၩ့ဘီၩ့မၩအ ၥၭဘဲၫထၪခိၪအၥိၭ, အဖၩ့အနါနီၪအလယၧးဎၧၫ့ထၭ ၡက့လၭဎူၫယၩလီၫ. တၭၦဆိၬထၩ့ဖံၭလဂၩလ့ၩလၧ",
			"8": "<sup>8</sup> အမ့ၬယၫလီၫ.- အဝ့ၫဒၪဆၧၫ့ထုၪ့ဝ့ၫတၭ, ကိၭထၪ့ လၧအံၫစရ့လၭအၥုၭမုတၭ, စံၭဝ့ၫ, နၥံၪဂဲၫထၪ့တဲၩ့ ဝဲၩဆၧဘဲၫၥိၭနၥံၪမိဒုၭၥုၭမွဲဘၪလဲၪ. ယဝ့ၫဒၪယီၩ ယမွဲၦဖလံၡၫဖိၪတၭ, နၥံၪမွဲစစီလူၫအခ့ၫအၡၩ,မွဲ အ့ၬဧၪ.ရွံန့ၦလဂၩလၧနၥံၪအဂးတၭ, ဒုၭဂဲၫလၩ့အ",
			"9": "<sup>9</sup> ဝ့ၫဒၪလၧယအီၪဘီၪ.- ဒုၭဆၧလၧယၧၩအ့ၪၥ့ၪ,ဒဲအ့ၪ မၩၥံၫယၧၩတၭ, ပမိကဲၪထၪ့နၥံၪအဎီးအၡၩလီၫ.အ့ၪ မွဲယအ့ၪမၩစၪအဝ့ၫဒဲမၩၥံၫဝ့ၫတၭ, နၥံၪမိကဲၪထၪ့ပ",
			"10": "<sup>10</sup> ဎီးပၡၩဒဲမၩပဆၧလီၫ.- တၭၦဖလံၡၫဖိၪလဂၩနီၪစံၭ ဝ့ၫဒၪ,ယအၪ့ထၩန့အံၫစရ့လၭ အၥုၭမုခမျၧးၥံၪလၧမု ဆၫလနံၩယီၩလီၫ. ဖ့ၪလၫ့ယၧၩလၧၦၡၩလဂၩဘဲၫ",
			"11": "<sup>11</sup> ၥိၭပမိဒုၭလိၬပၥၭဘီၪ.- ထီးစစီလူၫဒဲအံၫစရ့လၭထီး အလူၬနါဂၧၫ့ၦဖလံၡၫဖိၪအဆၧချဲၩ့နီၪတၭ, အၥုၪ့အုၭ အၥၭအုၭဒဲၥၭမဲၪဆၧဒိၪမၬလီၫ.",
			"12": "<sup>12</sup> စဒၫဝံၭအဖါနီၪမွဲၦအ့ဖၭဖိၪ လၧဘ့ၭၥလံၫဟံၫ့ယုဒၫ အဖၧၩ့တၭ, အမံၩ့မွဲစယ့ၭစံၫလီၫ. အဝ့ၫဒၪအီၪလၧအ ဖိၪခွၫဎိၭဂၩတၭ, လၧစစီလူၫအမုနံၩလဖၪနီၪမွဲၦၥၭ",
			"13": "<sup>13</sup> ၡါလၧၦၡၩအကျၩလီၫ.- တၭစယ့ၭစံၫအဖိၪခွၫလၧ အၥၭၡါထုၬၥၧၫ့ဂၩဖိၬစစီလူၫအခဲၫ့ လၧဆၧဒုၭၥုၭအ ဖၧၩ့လီၫ. တၭၦလၧအလ့ၩဝ့ၫလၧဆၧဒုၭၥုၭအဖၧၩ့ လဖၪနီၪ,အဝဲၡါအမံၩ့မွဲ စအံၫလဲအၭလဂၩ,ဒဲနံၫဂၩ",
			"14": "<sup>14</sup> လဂၩစအဘံနဒၭ,ၥၧၫ့ဂၩလဂၩစၡၫ့မၫလီၫ.- စဒၫဝံၭ မွဲၦအၥၭဘၪ့ထုၬတၭ, ၦအၥၭၡါထုၬၥၧၫ့ဂၩနီၪဖိၬစ",
			"15": "<sup>15</sup> စီလူၫအခဲၫ့လီၫ.- အ့ၪမွဲစဒၫဝံၭလ့ၩဆၧ, ထဲၩ့ခွံၬလၧစ စီလူၫအအီၪ, ဘဲၫၥိၭအမိယိအဖါအၥိၪၥံၪဘ့ၪၥံၪလၧ",
			"16": "<sup>16</sup> ဘ့ၭၥလံၫဟံၫ့အဖၧၩ့နီၪလီၫ.- ၦဖလံၡၫဖိၪလဂၩနီၪၥုၭ ဘူၭအၥၭလၧဂီၩလဘျၩ့, လၧဂၪလဘျၩ့တၭ, အီၪဒုၭ",
			"17": "<sup>17</sup> နဲၪအၥၭအနံၩလံဆံၫလီၫ.- စယ့ၭစံၫစံၭအဖိၪခွၫစဒၫ ဝံၭ,မၩန့ဘုၪဖီးဎွ့ၩထၪ့လအ့ဖၭ လၧနထၧၫ့ဖုဝဲအဂး, ဒဲကိၪဆံၫလီၪ့ယီၩတၭ, လ့ၩလၧၦၥုၪ့တဲၩအလးလၧန",
			"18": "<sup>18</sup> ထၧၫ့ဖုဝဲအအီၪဘီၪ.- ဆိၬဆၧနူထံၫ လၩ့ဒၭဆံၫလီၪ့ လၧၦလထီၫ့အခိၪနီၪ, ယိနထၧၫ့ဖုဝဲၥံၪ, မွဲအအီၪမုၬဆ့ ဧၪ,တၭမၩန့အဝ့ၫၥံၪအဆၧ ထိးအၥၭနးမံၩ့ဘီၪ.",
			"19": "<sup>19</sup> တၭစစီလူၫဒဲအဝ့ၫၥံၪနီၪ, ဒဲအံၫစရ့လၭအၡၩထီးအ လူၬအီၪဝ့ၫလၧဆၧဒၩဖၧၩ့အံလၫတၭ, ဒုၭၥုၭလၧၦဖလံ",
			"20": "<sup>20</sup> ၡၫဖိၪလီၫ.- မုဆဲၪ့ထၪ့စဒၫဝံၭဂဲထုၪ့ဂီၩဂီၩတၭ, အီၪ က့ၪလၩ့ထးၥိၪ ဒဲဘ့ၪအီၪလၧအၡၩယိဝ့ၫလဂၩတၭ, မၩန့ဆၧတၭ လ့ၩဘဲၫစယ့ၭစံၫ မၪလူၬဝ့ၫအၥိၭနီၪ, ဂဲၫထီၩ့ဝ့ၫလၧဆၧအခိၪဒၧၩ့ ထီးၦၥုၭမုလ့ၩဒုၭၥုၭ,",
			"21": "<sup>21</sup> ဒဲကိၭၡၭထၪ့ လၧဒုၭၥုၭအဘိၩ့ဘၭနီၪလီၫ.- အဂဲး ဘဲၫယီၩအံၫစရ့လၭဒဲၦဖလံၡၫဖိၪ တဲၩ့ဝဲၩယူၭလၧ",
			"22": "<sup>22</sup> ဆၧဒုၭၥုၭအဂး, ၥုၭမုခီၫၥုၭမုလီၫ.- တၭစဒၫဝံၭအီၪ က့ၪလၩ့ထးအဆၧဖိၪဆၧလံၩ လၧၦယိဆၧဖိၪဆၧလံၩ အစူၪဖၧၩ့တၭ, လ့ၩစဲၪ့ဝ့ၫလၧၦၥုၭမုအကျၩတၭ, ဂဲၫ",
			"23": "<sup>23</sup> ချဲၩ့ဒုၪ့အထၧၫ့ဖုဝဲလီၫ.- ချဲၩ့ဒုၪ့ဝ့ၫအဘိၩ့ဘၭနီၪ, ယိ ခွါ,ၦလၧနံၫခီၫအဘိၩ့ဆၧၩ့လဂၩဂဲၫထၪ့ (ၦဖလံၡၫ ဖိၪလၧဂၫၥၭနီၪအမံၩ့မွဲစဂိၫလဲအၫ) လၧၦဖလံၡၫဖိၪ အၥုၭမုအကျၩတၭ, ချဲၩ့ဆၧချဲၩ့လဖၪ ဘဲၫအလးလး",
			"24": "<sup>24</sup> လီၫ.တၭစဒၫဝံၭနါဂၧၫ့ဝ့ၫလီၫ.- ကယဲအံၫစရ့လၭအ ၡၩထီးအလူၬထီးအဒၪဘၪၦလဂၩနီၪ ၥၭမဲၪဆၧဒိၪမၬ တၭ,စဲၪ့ဖျိၭဝ့ၫလီၫ.",
			"25": "<sup>25</sup> တၭအံၫစရ့လၭအၡၩစံၭဝ့ၫဒၪ, ၦလၧအဂဲၫထၪ့လ ဂၩနီၪနၥံၪဒၪဘၪယူၭဧၪ, မွဲမၬဘဲၫၥိၭအမိအၪ့ထၩန့ အံၫစရ့လၭတၭ, ဂဲၫထၪ့ဝ့ၫလီၫ. တၭၦလၧအမၩၥံၫ ဝ့ၫလဂၩဆၧမိမၩအၥၭ လၧစဎွၩမိဒုၭကဲၪဒိၪကဲၪၡါ အီၪလၧဆၧလူဒိၪဎွ့ၩဒိၪဖၭဒိၪတၭ, မိဖ့ၪလၫ့ဝ့ၫလၧ အဖိၪမုၪဒဲမိအီၪက့ၪအဖါအၡၩဂံၪ့ဖိၪ လၧအဖျ့ၭခီၫ့ လၧအံၫစရ့လၭအကျၩလီၫ.",
			"26": "<sup>26</sup> စဒၫဝံၭချဲၩ့ဆၧလၧၦလၧအဆၧၫ့ထုၪ့ လၧအနဲၩ့ ထံၭလဖၪတၭ, စံၭဝ့ၫဒၪ, ၦလၧအမၩၥံၫၦဖလံၡၫဖိၪ လဂၩနီၪတၭ, မၩန့ခွံၬဆၧဒုၪဒွ့ၪလၧၦအံၫစရ့လၭအ လီၩ့နီၪဆၧမိမၩဝ့ၫဘဲၫၥ့ၪလဲၪ. ၦဖလံၡၫဖိၪလၧအလ ဒိၭဘၪဆၧကူၭတရံၭလဂၩ ဘဲၫၥိၭအမိအၪ့ထၩန့ယွၩ လၧအမၧၫ့ဝ့ၫလဂၩ အၥုၭမုခမျၧးနီၪ, မွဲဝ့ၫပလၫလ",
			"27": "<sup>27</sup> ဂၩလဲၪ.- တၭၦခမျၧးစံၭဆၧၫ့ဝ့ၫ, ဘဲၫဆၧချဲၩ့နီၪအၥိၭ တၭ,စံၭဝ့ၫဒၪ, ဆၧမိမၩၦလၧအမၩၥံၫအဝ့ၫဒၪဘဲၫနီၪ အၥိၭလီၫ.",
			"28": "<sup>28</sup> လၧအချဲၩ့ဆၧလၧၦၡၩနီၪ အဝဲခွၫဝဲၡါစအံၫလဲအၭ, နါဂၧၫ့ဝ့ၫတၭ, စအံၫလဲအၭအၥၭထၪ့ခဲၩထၪ့ဘၪစဒၫ ဝံၭတၭ,စံၭဝ့ၫဒၪ, နဂဲၫလၩ့ထီးယီၩမွဲဘၪလဲၪ. တၭန အီၪက့ၪလၩ့ထးၥိၪၥံၪ ဘ့ၪၥံၪၡၩခိၬဒုၩနီၪလၧမံၩ့လၬ ကျၩလၧပလၫအစူၪဖၧၩ့လဂၩလဲၪ. ယၥ့ၪယၫနၥၭ ထၪ့ထီၫဒဲဆၧအၧၩ့လၧနၥၭခံဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ",
			"29": "<sup>29</sup> နဂဲၫဘဲၫၥိၭနမိဒၪဘၪဆၧဒုၭၥုၭလီၫ.- တၭစဒၫဝံၭစံၭ ဝ့ၫဒၪ,ယမၩဘၪယူၭ ဘိၩ့နဲၪ့ယီၩဆၧနီၪလမံၩ့လဲၪ.",
			"30": "<sup>30</sup> ဘိၩ့နဲၪ့ယီၩအလးလအီၪဘၪဧၪ.- မွဲအကၠၪအၥၭလၧ ၦလဂၩဒၪအအီၪတၭ, ချဲၩ့ဆၧဘဲၫလးလးတၭ,ၦခမျၧး",
			"31": "<sup>31</sup> စံၭဆၧၫ့ဝ့ၫဘဲၫလၧအဝံခိၪအၥိၭနီၪလီၫ.- ၦနါဂၧၫ့ဆၧ လၧစဒၫဝံၭချဲၩ့ဝ့ၫတၭ, လီၩလၩ့ဝ့ၫလၧစစီလူၫအမ့ၬ ယၫတၭ အဝ့ၫဒၪကိၭန့ဝ့ၫဒၪလီၫ.",
			"32": "<sup>32</sup> တၭစဒၫဝံၭစံၭစစီလူၫ မွဲၦအၥၭထီးလၩ့ပွံၭလၧအ ဝ့ၫဒၪအကၠီၩ့နးဂၩလဂ့ၩ, နခ့ၫနၡၩမိလ့ၩဒုၭဆၧလၧၦ",
			"33": "<sup>33</sup> ဖလံၡၫဖိၪလဂၩနီၪလီၫ.- စစီလူၫစံၭစဒၫဝံၭ,နလ့ၩဒုၭ ဆၧလၧၦဖလံၡၫဖိၪနီၪနၧၩ့အ့ၬ. အဂဲးဘဲၫယီၩနမွဲဖိၪ ၥၪခွၫထၪ့ၥၫ့ဒံၭလီၫ. အ့ၪမွဲအဝ့ၫဒၪလဂၩနီၪမွဲၦၥုၭဖိၪ",
			"34": "<sup>34</sup> ခီၫလၧအဖိၪၥၪခွၫထၪ့ယူၭလီၫ.- စဒၫဝံၭစံၭစစီလူၫ,န ခ့ၫနၡၩယိအဖါအၥိၪၥံၪဘ့ၪၥံၪတၭ, ဆၬလၥၧၫ့ဒဲဖူၫ",
			"35": "<sup>35</sup> ထၫ့ဂဲၫမၩန့ၥိၪဖိၪလၧအဒီၪ့အကျၩလီၫ.- ယလီၩ့ဆီး ဝ့ၫဒဲမၩဂၭဖျ့ၭထၪ့ခွံၬလၧအနိၭဖၧၩ့တၭ, ထီးအဂဲထုၪ့ ထၫ့ဒၩယၧၩနီၪ, ယဖီၪ့န့အနိၭဆီၪ့တၭ, ဖ့ၬခွံၬဝ့ၫဒဲ",
			"36": "<sup>36</sup> မၩၥံၫဝ့ၫလီၫ.- နခ့ၫနၡၩမၩၥံၫဆၬလၥၧၫ့ ဒဲဖူၫထၪ့ တၭ,ၦဖလံၡၫဖိၪလၧအလဒိၭဘၪ ဆၧကူၭတရံၭမိ ကဲၪထၪ့ဆၧဘဲၫနီၪလဒုၩအၥိၭလီၫ. အဂဲးဘဲၫယီၩမွဲ အအၪ့ထၩန့ယူၭယွၩလၧ အမၧၫ့ဝ့ၫအၥုၭမုခမျၧးလီၫ.",
			"37": "<sup>37</sup> တၭစဒၫဝံၭစံၭဝ့ၫဒၪ, ယဟိဝၩလၧအမၩဖီၩ့ဖျ့ၭယၧၩ လၧဆၬလၥၧၫ့အစူၪ, ဒဲဖူၫထၫ့အစူၪနီၪ,မိမၩဖီၩ့ဖျ့ၭ ယၧၩလၧၦဖလံၡၫဖိၪလဂၩနီၪအစူၪဖၧၩ့လီၫ. စစီလူၫ စံၭစဒၫဝံၭလ့ၩကဒၪတၭ, မွဲယဟိဝၩအီၪ လၧနၥိၭ",
			"38": "<sup>38</sup> ဆံၭ.- တၭစစီလူၫဒုၭၥိၭစဒၫဝံၭ လၧအဆဲၫ့ဒၪဝ့ၫတၭ, အီၪက့ၪခိၪလူၬၥုၭထီးဘၩ့, လၧအခိၪဎွံၪ ဒဲဒုၭၥိၭဝ့ၫ",
			"39": "<sup>39</sup> လၧဆဲၫ့ထၭလီၫ.- တၭစဒၫဝံၭခဲးထၬအနၭလဘံၪ့လၧ ဆၧလၧအၥိၭဝ့ၫအဖၫ့ခိၪနီၪ, ကျ့ၭစၨၭဘဲၫၥိၭလၧအ မိလ့ၩဆၧလီၫ. အဂဲးဘဲၫယီၩ မၩခွါဒံၭဝ့ၫအ့ၬ. တၭ စဒၫဝံၭစံၭစစီလူၫ ယလ့ၩဆၧလၧအယီၩလဖၪၥ့ၪအ့ၬ. အဂဲးဘဲၫယီၩ ယမၩခွါဘၪဒံၭအ့ၬ. တၭစဒၫဝံၭဘဲၪ့",
			"40": "<sup>40</sup> လၩ့ခွံၬဝ့ၫလီၫ.- မၩန့အနိၪထိၭဘီၩ့ လၧအစူၪဖၧၩ့ တၭ,အၪ့ဎၬန့လိးလၧအဖျ့ၫယဲဖျိၪ့ လၧထံၫချိၬဖၧၩ့ တၭ,ဒူၭလၩ့ဝ့ၫလၧၦယိၥိၪအထိၪ့ဖၧၩ့ လၧအအီၪလၧ အၥိၭတၭ, အီၪလၧအထိၪ့, ဒဲဖလီအီၪလၧအစူၪဖၧၩ့ တၭ,ၥုၭဘူၭအၥၭလၧၦဖလံၡၫဖိၪအအီၪနီၪလီၫ.",
			"41": "<sup>41</sup> ၦဖလံၡၫဖိၪလဂၩနီၪဂဲၫဝ့ၫတၭ, ၥုၭဘူၭအၥၭလၧ စဒၫဝံၭအအီၪတၭ, ၦလၧအဆိၬ အထၩ့ဖံၭလဘံၪ့နီၪ အီၪလၧအမ့ၬယၫလီၫ.",
			"42": "<sup>42</sup> ၦဖလံၡၫဖိၪလဂၩယိဝ့ၫတၭ, ဒၪဘၪစဒၫဝံၭနီၪအီၪ က့ၪဝ့ၫလၧဆၧနးမံၩ့အ့ၬ. အဂဲးဘဲၫယီၩ မွဲဖိၪၥၪတၭ",
			"43": "<sup>43</sup> ဝီၩတၭ,အခံးအဂၩ့ဂ့ၩလီၫ.- တၭၦဖလံၡၫဖိၪနီၪစံၭ စဒၫဝံၭ,နဂဲၫလၧယအီၪ လၧနနိၪထိၭဘီၩ့နီၪယမွဲထွံၪ လဒုၩဆ့ဧၪ, ၦဖလံၡၫဖိၪနီၪ ဆိၪအၧၩ့စဒၫဝံၭလၧအ",
			"44": "<sup>44</sup> ယွၩလဖၪအမ့ၬယၫလီၫ.- တၭၦဖလံၡၫဖိၪစံၭစဒၫဝံၭ, ဂဲၫလၧယအီၪဘီၪး ယမိဖ့ၪလၫ့နဖံၭနယၪလၧထိၪၥံၪ လံၪၥံၪလၧမူၭဖိၭဖၫ့, ဒဲလၧဆၧဖိၪဆၧဎါလၧဆၧပျၩ့ ဖၧၩ့လီၫ.",
			"45": "<sup>45</sup> တၭစဒၫဝံၭစံၭ, ၦဖလံၡၫဖိၪ,နဂဲၫလၧယအီၪလၧနၭ, ဒဲလၧဖၩ့, ဒဲလၧထၩ့ဖံၭလဘံၪ့လီၫ. အ့ၪမွဲယဝ့ၫဒၪ ယီၩယဂဲၫလၧနအီၪ လၧဆၧၥုၭမုခမျၧးအယဟိဝၩအ မံၩ့,အံၫစရ့လၭအၡၩၥုၭမုခမျၧးလဖၪ အယွၩလၧ",
			"46": "<sup>46</sup> နအၪ့ထၩန့ယူၭလီၫ.- ဆၧလၧမုဆၫလနံၩယီၩယဟိ ဝၩမိဖ့ၪလၫ့နၧၩ လၧယစူၪဖၧၩ့တၭ, ယမိဖ့ၬခွံၬနၧၩ တၭ,ယမိဖ့ၬထ့ၬခွံၬနခိၪဎွံၪလၧနလီၩ့တၭ, လၧမုဆၫ လနံၩယီၩယမိဖ့ၪလၫ့ၦဖလံၡၫဖိၪ အၥုၭမုအစွၪလဖၪ လၧထိၪၥံၪလံၪၥံၪ လၧမူၭဖိၭဖၫ့, ဒဲလၧဆၧဖိၪဆၧဎါ လၧဂၪ့ခိၪချိၫ့ဘဲၫၥိၭဂၪ့ခိၪချိၫ့ထီးအလူၬ မိၥ့ၪယၫလၧ",
			"47": "<sup>47</sup> ယွၩလဂၩအီၪဝ့ၫလၧအံၫစရ့လၭအကျၩလီၫ.- ကယဲ ဆၧအီၪကီၪ့ယီၩ ထီးအလူၬမိၥ့ၪယၫလၧယဟိဝၩမၩ ဖီၩ့မၩဖျ့ၭဆၧလၧဖၩ့ၥံၪနၭၥံၪအ့ၬ. အဂဲးဘဲၫယီၩဆၧ ဒုၭၥုၭယီၩမွဲယဟိဝၩအဆၧမၩလီၫ. တၭအဝ့ၫဒၪမိ ဖ့ၪလၫ့နၥံၪလၧပစူၪဖၧၩ့လီၫ.",
			"48": "<sup>48</sup> ထီးၦဖလံၡၫဖိၪနီၪ ဂဲထုၪ့တၭဆၧမၩအၥၭလၧအ ဂဲၫၥုၭဘူၭအၥၭဘဲၫၥိၭအမိလ့ၩဆီးစဒၫဝံၭတၭ, စဒၫ ဝံၭမၩဝ့ၫချဲၫ့ချဲၫ့တၭ, စဲၪ့ဝ့ၫလၧၦၥုၭမုအအီၪ ဘဲၫၥိၭ",
			"49": "<sup>49</sup> အမိလ့ၩဆီးစိၩ ၦဖလံၡၫဖိၪလဂၩနီၪလီၫ.- စဒၫဝံၭ ဒုၭနုၬအစူၪလၧအထိၪ့ဖၧၩ့တၭ, မၩန့ထၪ့လိးလဖျိၪ့ ထီးနီၪခွံၬဝ့ၫတၭ, ဘၪၦဖလံၡၫဖိၪလဂၩနီၪလၧအမ့ၬ ထုးခိၪတၭ, လိးလဖျိၪ့နီၪလၩ့ဘၧၩ့လၧအမ့ၬထုးခိၪ",
			"50": "<sup>50</sup> အဖၧၩ့တၭ, လၩ့ထံၩဖါၡီၫ့ခိၪလီၫ.- ဘဲၫနီၪၥိၭစဒၫ ဝံၭမၩစၪၦဖလံၡၫဖိၪလၧအဖလီလဘီၩ့, ဒဲလၧလိးလ ဖျိၪ့တၭ,ဖ့ၬခွံၬၦဖလံၡၫဖိၪတၭ, မၩၥံၫဝ့ၫလီၫ. နၭအီၪ",
			"51": "<sup>51</sup> လၧစဒၫဝံၭအစူၪဖၧၩ့အ့ၬ.- အခိးမွဲစဒၫဝံၭလ့ၩစဲၪ့ဝ့ၫ ဆၧၫ့ထုၪ့လၧၦဖလံၡၫဖိၪအလီၩ့တၭ, မၩန့အဝ့ၫအ နၭနီၪ,ထုၭထၪ့ဝ့ၫလၧအကၠိၭဖၧၩ့တၭ, မၩၥံၫအဝ့ၫဒၪ တၭဖ့ၬထ့ၬခွံၬအဝ့ၫဒၪအခိၪဎွံၪလီၫ. တၭၦဖလံၡၫဖိၪ လဖၪဒၪဘၪဝ့ၫလၧအၡၩနံၫခီၫ အဘိၩ့ဆၧၩ့လဂၩၥံၫ ယူၭတၭ, အဝ့ၫၥံၪစဲၪ့ဖျိၭဝ့ၫလီၫ.",
			"52": "<sup>52</sup> အံၫစရ့လၭဒဲယုဒၫအၡၩၥံၪဂဲထုၪ့တၭ, ကိၭၡၭထၪ့ လီၩ့ဆီးၦဖလံၡၫဖိၪထီးနလ့ၩနုၬ လၧအ့ၭကြၧၫ့အခိၪ လီၩ့ဆူၭ, ဒဲအတရၫ့လဖၪနီၪတၭ, ၦဖလံၡၫဖိၪလၧအ ဘၪဆၧဆ့ၭဝ့ၫလၩ့ထံၩဖါဝ့ၫ လၧၡၫအရ့အံၫ့အဖၧၩ့",
			"53": "<sup>53</sup> ၥၭဖိးလၧဂၫၥၭဒဲအ့ၭကြၧၫ့လီၫ.- ၦအံၫစရ့လၭဖိၪလၧ အလီၩ့ဆီးၦဖလံၡၫဖိၪနီၪ ဂဲၫထဲၩ့ဝ့ၫတၭ, အၪ့ဂူၬန့",
			"54": "<sup>54</sup> ဆီၪ့အဝ့ၫၥံၪအတဲၩလဖၪလီၫ.- စဒၫဝံၭမၩန့ၦဖလံၡၫ ဖိၪလဂၩနီၪအခိၪဎွံၪတၭ, ဂဲၫထဲၩ့ဆိၬဝ့ၫလၧယရုစ လံၫ့တၭ,အ့ၪမွဲအစူၪဝဲၩနီၪ အီၪက့ၪဝ့ၫလၧအတဲၩဖၧၩ့ လီၫ.",
			"55": "<sup>55</sup> ထီးစစီလူၫဒၪဘၪ စဒၫဝံၭလ့ၩထၪ့ထၫ့ဒၩၦဖလံၡၫ ဖိၪလဂၩနီၪတၭ, မွဲအစံၭၦၥုၭမုအခိၪစအၭဘနၧၫလ ဂၩနီၪ,စအၭဘနၧၫဧ့, ဖိၪၥၪခွၫလဂၩနီၪ မွဲပလၫအ ဖိၪခွၫလဲၪ,တၭစအၭဘနၧၫစံၭဝ့ၫဒၪ, နၥၭမၧၫ့ဝ့ၫစဎွၩ",
			"56": "<sup>56</sup> ဧ့,ယၥ့ၪယၫအ့ၬ.- တၭစဎွၩစံၭဝ့ၫဒၪ, ဖိၪၥၪခွၫလဂၩ",
			"57": "<sup>57</sup> ယီၩမွဲပလၫအဖိၪလဲၪနီၪ,အၪ့စၪ့နးထံၪဘီၪ.- ထီးစဒၫ ဝံၭဂဲၫထဲၩ့ထဲၩ့ လၧအမၩၥံၫယူၭ ၦဖလံၡၫဖိၪတၭ, စအၭဘနၧၫ မၩန့အဝ့ၫတၭ, ၥိၫ့ဝ့ၫလၧစစီလူၫအမ့ၬ ယၫအီၪလၧၦဖလံၡၫဖိၪအခိၪဎွံၪ လၧအစူၪဖၧၩ့လီၫ.",
			"58": "<sup>58</sup> တၭစစီလူၫစံၭအဝ့ၫဒၪ, ဖိၪခွၫဧ့, နမွဲပလၫအဖိၪခွၫ လဲၪ.တၭစဒၫဝံၭစံၭဆၧၫ့ဝ့ၫဒၪ, ယမွဲနခ့ၫနၡၩၦဘ့ၭ ၥလံၫဟံၫ့ဖိၪ စယ့ၭစံၫအဖိၪခွၫလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> တၭထီးအချဲၩ့ဆၧလၧစစီလူၫဂီၩ့တၭ, ဆၧမၩအၥၭ လၧစစၪ့နၥၧၫ့အၥၭဘၪ ဆၧဆၭဘုၭထၬလိၬအၥၭလၧ စဒၫဝံၭအၥၭတၭ, စစၪ့နၥၧၫ့အဲၪအဝ့ၫဒၪဘဲၫအၥၭဒၪ",
			"2": "<sup>2</sup> ဝ့ၫအၥိၭနီၪလီၫ.- ဆၧလၧမုလနံၩနီၪစစီလူၫမၩန့အဝ့ၫ",
			"3": "<sup>3</sup> တၭ,ဒုၭထဲၩ့ထဲၩ့လၧၩ့အဝ့ၫလၧအဖါအဂံၪ့အ့ၬ.- ထီး နီၪလဖၧၫ့စစၪ့နၥၧၫ့အုၩ့လၩ့လိၬအၥၭ လၧစဒၫဝံၭနီၪ, အဂဲးဘဲၫယီၩ အဲၪအဝ့ၫဘဲၫအၥၭဒၪဝ့ၫအၥိၭလီၫ.",
			"4": "<sup>4</sup> စစၪ့နၥၧၫ့ဘဲၪ့လၩ့ခွံၬ အဆဲၫ့ဖၭထီၫတၭ, ဖ့ၪလၫ့ဝ့ၫ လၧစဒၫဝံၭဒဲအကီၩ့အၥိၭ ထီၩ့လၧအနၭဒၪလ့ၬ ဒဲအ ချံၪဒဲအခၧၩ့ယးဆ့လီၫ.",
			"5": "<sup>5</sup> ထီးဒၪအလး လၧစစီလူၫအၪ့မၧၫ့ အဝ့ၫနီၪစဒၫဝံၭ လ့ၩဝ့ၫတၭ, ကဲၪထၪ့ကဲၪထီၫဝ့ၫလီၫ. စစီလူၫအီၪက့ၪ အဝ့ၫလၧၦၥုၭဖိၪအခိၪတၭ, ဂ့ၩဝ့ၫလၧၦခမျၧးအမ့ၬ ယၫကိၭအဂၩဒ့ၭ, ဒဲလၧစစီလူၫအခ့ၫအၡၩအမ့ၬယၫ ဆ့လီၫ.",
			"6": "<sup>6</sup> ထီးစဒၫဝံၭဂဲၫထဲၩ့ လၧအမၩၥံၫယူၭ ၦဖလံၡၫဖိၪ နီၪတၭ,ဆၧမၩအၥၭ လၧၦလဖၪဂဲၫထဲၩ့ဝ့ၫနီၪ,ၦမုၪ လဖၪဂဲၫထၪ့လၧအံၫစရ့လၭ အဒိၩ့လဖၪထီးအလူၬအ ဖၧၩ့တၭ, ဂဲထုၪ့လံ,ၥံၫကျံၩဆၧ, ဘဲၫၥိၭအမိအၪ့ဂၬ စဎွၩစီလူၫနီၪ, အီၪဝ့ၫလၧဒိၩ့ၥံၪ, လၧဆၧၥုၪ့ထိၬၥၭ",
			"7": "<sup>7</sup> ထိၬဒဲလၧနါဒံၩ့ၥံၪလီၫ.- တၭၦမုၪၥံၪနီၪဒိၪဆၧဖိၬဆၧ အဘိၩ့ဘၭနီၪ, စံၭဝ့ၫဒၪ, စစီလူၫမၩၥံၫၦအထီၫ့ၥံၪ, စဒၫဝံၭနီၪအလၬၥံၪဖီၩၬ",
			"8": "<sup>8</sup> တၭစစီလူၫအၥၭထၪ့ခဲၩထၪ့ဒိၪမၬလီၫ. တၭဆၧ ချဲၩ့လထံၪနီၪအၧၩ့ဝ့ၫလၧအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ,အ ဝ့ၫၥံၪအီၪက့ၪဝ့ၫလၧစဒၫဝံၭ လၧအလၬၥံၪ,အီၪက့ၪဝ့ၫ လၧယၧၩလၧအထီၫ့ၥံၪနီၪလီၫ. အ့ၪလမွဲဘၪ ဘၩ့မုးနီၪ, မွဲအမိန့ဒံၭဆၧနီၪလဲၪ.",
			"9": "<sup>9</sup> ခီၫဒၪလၧမုလနံၩနီၪ စဒၫဝံၭအၧၩ့ဝ့ၫလၧစစီလူၫအ မ့ၬလီၫ.",
			"10": "<sup>10</sup> မုဆဲၪ့ထၪ့လနံၩနီၪ ဆၧမၩအၥၭလၧၥၭအၧၩ့လမံၩ့ လၧယွၩနီၪဂဲၫလၩ့ဘၪလၧ စစီလူၫအလီၩ့တၭ,ချဲၩ့ဆၧ လၧမီၪအချိၬလၧဂံၪ့အၥၭကျၩတၭ, စဒၫဝံၭဒံၩ့ဆၧ လၧအစူၪဘဲၫလၧအဝံခိၪအၥိၭနီၪတၭ, ဖၩ့ဖိၪအီၪဝ့ၫ",
			"11": "<sup>11</sup> လၧစစီလူၫအစူၪဖၧၩ့လီၫ.- စစီလူၫဆ့ၭဖၩ့ဖိၪတၭ, အဂဲးဘဲၫယီၩ စံၭဝ့ၫဒၪ, ယမိဆ့ၭဘၪစဒၫဝံၭ မၩဘုၭ ထၬလၧဆၧဒီၪ့လီၫ. တၭစဒၫဝံၭဖလ့ၬခွံၬဝ့ၫလၧအမ့ၬ ယၫနံၫဖၧၫ့လီၫ.",
			"12": "<sup>12</sup> မွဲယဟိဝၩစဲၪ့ထၪ့ခွံၬလၧစစီလူၫအအီၪနီၪ, အီၪဝ့ၫ လၧစဒၫဝံၭအၥိၭအကၠီၩ့တၭ, စစီလူၫၥၭမဲၪစဒၫဝံၭ",
			"13": "<sup>13</sup> လီၫ.-စစီလူၫဒုၭစဲၪ့ထၪ့ခွံၬအဝ့ၫဒၪ လၧအအီၪတၭ, အီၪက့ၪစဒၫဝံၭလၧၦလထီၫ့အခိၪတၭ, အဝ့ၫဒၪလ့ၩ",
			"14": "<sup>14</sup> ထၪ့,ဒဲဂဲၫနုၬလၧၦခမျၧးအမ့ၬယၫလီၫ.- စဒၫဝံၭမၩ ဝ့ၫလၧဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ လၧအဖၧၩ့ၥၭထီးအလူၬအ",
			"15": "<sup>15</sup> ဖၧၩ့တၭ,ယဟိဝၩအီၪလၧအၥိၭလီၫ.- စစီလူၫဒၪဘၪ လၧအမၩဝ့ၫလၧဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ ဒိၪဒိၪလ့ၬတၭ,",
			"16": "<sup>16</sup> ၥၭမဲၪအဝ့ၫဒၪလီၫ.- အ့ၪမွဲအံၫစရ့လၭဒဲယုဒၫထီးအ လူၬအဲၪစဒၫဝံၭလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪလ့ၩထၪ့ ဒဲဂဲၫနုၬလၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ.",
			"17": "<sup>17</sup> တၭစစီလူၫစံၭစဒၫဝံၭ,ယိခွါ, ယဖိၪမုၪအဒိၪလဂၩ နးမံရၭနီၪ, ယမိဖ့ၪလၫ့ဝ့ၫလၧနမၫအဂး အ့ၪမွဲအီၪ က့ၪနၥၭဆီၪ့ဆီၪ့လ့ၬ လၧယဂးတၭ, ဒုၭယဟိဝၩအ ဆၧဒုၭနီၪဆံၭ. (တၭစစီလူၫစံၭဝ့ၫဒၪ, မွဲယစူၪထီးအီၪ လၧအလီၩ့လဂ့ၩ, မွဲၦဖလံၡၫဖိၪအစူၪအီၪလၧအလီၩ့",
			"18": "<sup>18</sup> ဆံၭ.)- တၭစဒၫဝံၭစံၭစစီလူၫ, ဘဲၫၥိၭယမိကဲၪထၪ့ စဎွၩအမၬနီၪ,ယမွဲၦလဂၩလဲၪ. တၭယၥၭမၧၫ့မွဲဂ့ၩ, ယဖါအဂံၪ့ဒီၪ့လၧအံၫစရ့လၭအကျၩမွဲဂ့ၩ, မွဲဆၧနီၪ",
			"19": "<sup>19</sup> လမံၩ့လဲၪ.- အဆၧၫ့အထီဘၪလၧဆၧကြၨၭဖ့ၪလၫ့ စစီလူၫအဖိၪမုၪနးမံရၭလၧစဒၫဝံၭတၭ, ဆၧမၩအၥၭ လၧဆၧဖ့ၪလၫ့ဝ့ၫ လၧၦမံဟိလၭဖိၪ စအၫဒအ့လၭ လၧအမၫအဂးလီၫ.",
			"20": "<sup>20</sup> စစီလူၫအဖိၪမုၪနးမဲခၫလၭအဲၪစဒၫဝံၭနီၪ, ၦလီၩဘၪ",
			"21": "<sup>21</sup> စစီလူၫတၭ, ဆၧနီၪလမံၩ့ဘၪအဝ့ၫအၥၭလီၫ.- တၭ စစီလူၫစံၭဝ့ၫဒၪ, ယမိဖ့ၪလၫ့အဝ့ၫဒၪလၧအဝ့ၫဘဲၫၥိၭ အမိကဲၪထၪ့ဖျံၩခွၩ့လၧအဂး, ဘဲၫၥိၭၦဖလံၡၫဖိၪအ စူၪမိထၫ့ဒုၪဒၩဝ့ၫလီၫ. တၭစစီလူၫစံၭစဒၫဝံၭ, ယဖိၪ မုၪနံၫဂၩနီၪလၧမုဆၫလနံၩယီၩနမိဘၪမၩန့နဝ့ၫနးဂၩ",
			"22": "<sup>22</sup> တၭကဲၪထၪ့ယမၬလီၫ.- စစီလူၫမၪလူၬ အခ့ၫအၡၩ ချဲၩ့ဒုၪ့ၥူၪလၧစဒၫဝံၭတၭ, စံၭ,ယိခွါ, စဎွၩဘၪအၥၭ လၧနၧၩဒဲအခ့ၫအၡၩထီးအလူၬအဲၪနၧၩတၭ, ဘိၩ့",
			"23": "<sup>23</sup> နဲၪ့ယီၩကဲၪထၪ့စဎွၩအမၬဘီၪ.- တၭစစီလူၫအခ့ၫ အၡၩလဖၪလီၩဘၪဆၧချဲၩ့နီၪ လၧစဒၫဝံၭအနါဖၧၩ့ လီၫ.တၭစဒၫဝံၭစံၭဝ့ၫဒၪ, ဆၧကဲၪထၪ့စဎွၩအမၬနီၪ နၥံၪအီၪက့ၪလၧဆၧအဎွံၫဧၪ. ယမွဲၦၡၪ့ဖိၪယၬဖိၪ",
			"24": "<sup>24</sup> တၭ,ဆၧအီၪက့ၪယၧၩလၧဆၧနးမံၩ့အ့ၬ.- စစီလူၫအ ခ့ၫအၡၩဒုၭနဲၪဝ့ၫတၭ, စံၭဝ့ၫဒၪ, စဒၫဝံၭချဲၩ့ဆၧဘဲၫ",
			"25": "<sup>25</sup> ဆၧချဲၩ့လဖၪယီၩအၥိၭနီၪလီၫ.- တၭစစီလူၫစံၭဝ့ၫဒၪ, နၥံၪမိဘၪစံၭစဒၫဝံၭဘဲၫယီၩ, ဘၪစဎွၩအၥၭလၧဆၧ အဎွ့ၩအ့ၬ, အ့ၪမွဲလၧၦဖလံၡၫဖိၪအဆၧခိၪဖံၭလယၩ ဘဲၫၥိၭအမိမၩဆၧၫ့ဆၧအၧၩ့ လၧစဎွၩအဒုၪအဒၩအ လီၩ့လီၫ. စစီလူၫဆီၫ့မီၪ့လၧအမိဒုၭလၩ့ထံၩဖါစဒၫ",
			"26": "<sup>26</sup> ဝံၭလၧၦဖလံၡၫဖိၪအစူၪဖၧၩ့လီၫ.- အခ့ၫအၡၩလီၩ ဘၪစဒၫဝံၭလၧဆၧချဲၩ့လဖၪနီၪတၭ, ကဲၪထၪ့စဎွၩအ မၬနီၪ,ဘၪစဒၫဝံၭအၥၭတၭ, မုနံၩလဖၪဎွ့ၩထၪ့ဒံၭ",
			"27": "<sup>27</sup> အ့ၬ.- စဒၫဝံၭဂဲထုၪ့တၭ, လ့ၩဆၧ, အဝ့ၫဒၪဒဲအၡၩ လဖၪတၭ, ဖ့ၬခွံၬၦဖလံၡၫဖိၪနံၫယၩတၭ, စဒၫဝံၭဂဲၫ ထဲၩ့ဆိၬအဝ့ၫၥံၪအဆၧခိၪဖံၭတၭ, ဖ့ၪလၧၫ့ဖ့ၪဎွ့ၩဝ့ၫ လၧစဎွၩဘဲၫအမိကဲၪထၪ့စဎွၩအမၬအၥိၭလီၫ. တၭ စစီလူၫဖ့ၪလၫ့ဝ့ၫလၧအဖိၪမုၪ နးမဲခၫလၭလၧအမၫအ",
			"28": "<sup>28</sup> ဂးလီၫ.- တၭစစီလူၫဒၪဘၪဝ့ၫတၭ, ၥ့ၪယၫဝ့ၫလၧယ ဟိဝၩအီၪလၧစဒၫဝံၭအၥိၭလီၫ. တၭစစီလူၫအဖိၪမုၪ",
			"29": "<sup>29</sup> နးမဲခၫလၭအဲၪအဝ့ၫလီၫ.- တၭစစီလူၫၥၭမဲၪစဒၫဝံၭ အၪထၪ့လခီၫတၭ, စစီလူၫကဲၪထၪ့စဒၫဝံၭအဒုၪအဒၩ",
			"30": "<sup>30</sup> ကိၭမုနံၩမုနၩဒ့ၭလီၫ.- ၦဖလံၡၫဖိၪအၦဒိၪဖၭဒိၪလ ဖၪစဲၪ့ထၪ့ဝ့ၫတၭ, လၧအဝ့ၫၥံၪစဲၪ့ထၪ့အလးခဲၫ့နီၪဆၧ မၩအၥၭလၧစဒၫဝံၭမၩလၧ ဆၧကိၪ့ၥ့ၪကိၪ့ဘၪဒိၪနဲၪ့ စစီလူၫအခ့ၫအၡၩထီးအလူၬဒံၭတၭ, ၦအီၪက့ၪအမံၩ့ လၧဆၧလူဒိၪဎွ့ၩဒိၪဖၭဒိၪလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> တၭစစီလူၫချဲၩ့ဆၧလၧအဖိၪခွၫစစၪ့နၥၧၫ့, ဒဲအခ့ၫ အၡၩၥံၪထီးအလူၬ ဘဲၫၥိၭအမိမၩၥံၫ စဒၫဝံၭလီၫ.",
			"2": "<sup>2</sup> တၭစစီလူၫအဖိၪခွၫစစၪ့နၥၧၫ့နီၪ မုၬအၥၭလၧစဒၫဝံၭ ဒိၪဒိၪလ့ၬတၭ, စစၪ့နၥၧၫ့လီၩဘၪစဒၫဝံၭတၭ, စံၭဝ့ၫ ဒၪ,ယဖါစစီလူၫအၪ့ဎၬမၩၥံၫနၧၩလီၫ. တၭဘိၩ့နဲၪ့ ယီၩထီးလၩ့နၥၭ ထီၩ့လၧကဲဂီၩခိၬဘီၪး လ့ၩအီၪ",
			"3": "<sup>3</sup> လၧဆၧကဒုၩအလးတၭ, အီၪက့ၪၥူၪနၥၭဆံၭ.- တၭ ယမိလ့ၩဆၧၫ့ထုၪ့လၧယဖါ အနဲၩ့ထံၭ လၧဆၧပျၩ့ ဖၧၩ့ထီးနအီၪနီၪ, ယမိချဲၩ့ဆၧလၧယဖါလၧနဂဲးနကၠီၪ့ တၭ,ဆၧလၧယဒၪဘၪလဖၪနီၪ ယမိလီၩဘၪနၧၩလီၫ.",
			"4": "<sup>4</sup> စစၪ့နၥၧၫ့ချဲၩ့ဆၧလၧအဖါ လၧစဒၫဝံၭအဂဲးအကၠီၪ့ လၧအဂ့ၩတၭ,စံၭဝ့ၫ, မွဲစဎွၩထီးမၩမၪဘၪအခ့ၫအ ၡၩစဒၫဝံၭနီၪလဂ့ၩ, အဂဲးဘဲၫယီၩအဝ့ၫဒၪမၩမၪဘၪ နၧၩအ့ၬ,အဆၧမၩဘၪဆဲၫ့လၧနၧၩလဖၪနီၪ, မွဲအဂ့ၩ",
			"5": "<sup>5</sup> မၬလီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫဒၪအီၪက့ၪအၥၭမၧၫ့လၧ အစူၪဖၧၩ့တၭ, မၩၥံၫၦဖလံၡၫဖိၪလဂၩနီၪတၭ,ယဟိ ဝၩမၩဆၧမၩဖီၩ့မၩဖျ့ၭဖၭဒိၪ လၧအံၫစရ့လၭထီးအ လူၬအဂးနီၪ,နဒၪဘၪတၭ, နၥုၪ့ထိၬၥၭထိၬလီၫ. တၭ နမိမၩမၪဘၪဆၧၥွံၪ လၧဆၧဒဲၩဘၭလအီၪဘၪလၧန",
			"6": "<sup>6</sup> မိမၩၥံၫစဒၫဝံၭပျီၩပျီၩနီၪမွဲဘၪလဲၪ.- တၭစစီလူၫခိၭ နၪစစၪ့နၥၧၫ့အလူတၭ, စစီလူၫဆိၪလၩ့အၥၭ,ယဟိ",
			"7": "<sup>7</sup> ဝၩမၧၫ့ဝ့ၫနီၪ, စဒၫဝံၭမိဘၪဆၧမၩၥံၫဝ့ၫအ့ၬ.- စစၪ့န ၥၧၫ့ကိၭန့စဒၫဝံၭတၭ, စစၪ့နၥၧၫ့ဒုၭနဲၪအဝ့ၫလၧဆၧ လဖၪထီးအလူၬလီၫ. စစၪ့နၥၧၫ့ဂဲၫၥိၫ့စဒၫဝံၭလၧစစီ လူၫအအီၪတၭ, အီၪဝ့ၫလၧအမ့ၬယၫ ဘဲၫလၧမုဂၪတ ဂၪအၥိၭနီၪလီၫ.",
			"8": "<sup>8</sup> ဆၧဒုၭၥုၭအီၪထၪ့ဒီၭတၭ, စဒၫဝံၭလ့ၩထၪ့တၭ,ဒုၭ ဆၧလၧၦဖလံၡၫဖိၪတၭ, ဖ့ၬခွံၬအဝ့ၫၥံၪ လၧဆၧဖ့ၬ ခွံၬဖၭဒိၪတၭ, အဝ့ၫၥံၪစဲၪ့ဖျိၭလၧအဝ့ၫဒၪအမ့ၬယၫ လီၫ.",
			"9": "<sup>9</sup> ၥၭအၧၩ့လမံၩ့ လၧယဟိဝၩအီၪဝ့ၫလၧစစီလူၫအ လီၩ့လၧအဆၧၫ့နၩ့လၧအဂံၪ့ဖၧၩ့တၭ, အဖၩ့ဖိၪအီၪ လၧအစူၪဖၧၩ့လီၫ. တၭစဒၫဝံၭ ဒံၩ့ဆၧလၧအစူၪ",
			"10": "<sup>10</sup> လီၫ.- စစီလူၫအၪ့ဎၬဆ့ၭဘုၭထၬ စဒၫဝံၭလၧဆၧဒီၪ့ လၧဖၩ့ဖိၪတၭ, အဝ့ၫဒၪစဲၪ့ဂၭဖျ့ၭ လၧစစီလူၫအအီၪ တၭ,စစီလူၫဆ့ၭဖၩ့ဖိၪလၧဆၧဒီၪ့တၭ, စဒၫဝံၭစဲၪ့ဖျိၭ",
			"11": "<sup>11</sup> တၭ,လၧမုလနၩနီၪဂၭဖျ့ၭဝ့ၫလီၫ.- တၭစစီလူၫအၪ့ မၧၫ့အၥီၫ့လဖၪလ့ၩလၧစဒၫဝံၭအဂံၪ့ ဘဲၫၥိၭအမိခိၭ ဒဲမၩၥံၫအဝ့ၫလၧဂီၩလခီၫလီၫ. တၭစဒၫဝံၭအမၫနး မဲခၫလၭလီၩဘၪအဝ့ၫတၭ, စံၭဝ့ၫဒၪ,နအ့ၪလမၩဖီၩ့ မၩဖျ့ၭဘၪနၥၭလၧမုလနၩယီၩတၭ, ကဲဂီၩခိၬနီၪန",
			"12": "<sup>12</sup> မိဘၪဆၧမၩၥံၫနၧၩလီၫ.- နးမဲခၫလၭဆဲၩလၩ့စဒၫဝံၭ လၧတရၫ့လံၩအဖၧၩ့တၭ, အဝ့ၫစဲၪ့ခွံၬ, လ့ၩဆၧတၭ,",
			"13": "<sup>13</sup> ဂၭဖျ့ၭဝ့ၫလီၫ.- နးမဲခၫလၭမၩန့ဆၧဂၩ့ တ့ရဖံၫ့တၭ အီၪက့ၪလၩ့ဝ့ၫလၧလးမံၫဖၧၩ့တၭ, ခိၪခုၪ့ဘ့ၪအဆီၪ့ နီၪဒိၭထၬဝ့ၫလၧအခိၪဎွံၪလခီၫတၭ, ချႃၬဘံၭဝ့ၫလၧ",
			"14": "<sup>14</sup> ဖၬဘဲၩ့လုၬလီၫ.- စစီလူၫအၪ့မၧၫ့အၥီၫ့လဖၪလ့ၩမၩ",
			"15": "<sup>15</sup> န့စဒၫဝံၭတၭ, အမၫစံၭဝ့ၫဒၪ အီၪဆီၪ့အ့ၬ.- စစီလူၫ အၪ့မၧၫ့လၩ့ဒီၭအၥီၫ့လဖၪ လ့ၩယိဒီၭစဒၫဝံၭတၭ,စံၭ ဝ့ၫဒၪ,ဂဲၫထဲၩ့ဆိၬအဝ့ၫဒၪလၧအလးမံၫဖၧၩ့, ဘဲၫၥိၭ",
			"16": "<sup>16</sup> ယမိမၩၥံၫအဝ့ၫဆံၭ.- ထီးၦအၥီၫ့လဖၪလ့ၩနုၬတၭ, ယိခွါ,ဆၧဂၩ့တ့ရဖံၫ့အီၪဝ့ၫလၧ လးမံၫဖၧၩ့လၧခိၪခုၪ့",
			"17": "<sup>17</sup> ဘ့ၪအဆီၪ့ဒိၭထၬဝ့ၫလၧ အခိၪဎွံၪလခီၫနီၪလီၫ.- တၭ စစီလူၫစံၭနးမဲခၫလၭ, နအၪ့လီၫန့ယၧၩဘဲၫယီၩတၭ, ဖျါခွံၬယဒုၪယဒၩတၭ, အဝ့ၫဒၪဂၭဖျ့ၭယူၭနီၪ,မွဲဘၪ လဲၪ.တၭနးမဲခၫလၭ စံၭဆၧၫ့စစီလူၫ, အဝ့ၫဒၪစံၭ ယၧၩ,ဖျါခွံၬယၧၩဘီၪး ယမိမၩၥံၫနၧၩမွဲဘၪလဲၪ.",
			"18": "<sup>18</sup> စဒၫဝံၭစဲၪ့ဖျိၭ, ဂၭဖျ့ၭဝ့ၫတၭ, လ့ၩဝ့ၫလၧစစၫမုၫ အ့လၭအအီၪ,လၧရၫမၫတၭ, လီၩဘၪအဝ့ၫလၧကယဲ စစီလူၫမၩဝ့ၫထီးအလူၬတၭ, အဝ့ၫဒၪ, ဒဲစစၫမုၫအ့",
			"19": "<sup>19</sup> လၭလ့ၩအီၪလၧန့ၫအီၭအဖၧၩ့လီၫ.- ၦလီၩဘၪစစီ လူၫတၭ,စံၭဝ့ၫဒၪ, ယိခွါ,စဒၫဝံၭအီၪလၧန့ၫအီၭလၧ",
			"20": "<sup>20</sup> ရၫမၫအဖၧၩ့လီၫ.- စစီလူၫအၪ့မၧၫ့အၥီၫ့လဖၪလ့ၩမၩ န့စဒၫဝံၭတၭ, ထီးအဝ့ၫၥံၪဒၪဘၪမီၪလဒီၪ့နီၪချဲၩ့ဆၧ လၧမီၪအချိၬ, ဒဲစစၫမုၫအ့လၭဆၧၫ့ထုၪ့အီၪဝ့ၫလၧအ ဘၪကဲၪအဝ့ၫၥံၪအခိၪတၭ, ယွၩအၥၭအီၪထၪ့လၧစစီ လူၫအၥီၫ့လဖၪအလီၩ့တၭ, အဝ့ၫၥံၪချဲၩ့ဆၧလၧမီၪအ",
			"21": "<sup>21</sup> ချိၬဆ့လီၫ.- ထီးၦလီၩဘၪစစီလူၫတၭ,အဝ့ၫအၪ့မၧၫ့ လၩ့အၥီၫ့အဂူၫဂၩလဖၪတၭ, အဝ့ၫၥံၪချဲၩ့ဆၧလၧမီၪအ ချိၬဆ့လီၫ. တၭစစီလူၫအၪ့မၧၫ့လၩ့ အၥီၫ့လဖၪၥၧၫ့ ဘျၩ့လဘျၩ့တၭ, အဝ့ၫၥံၪချဲၩ့ဆၧ လၧမီၪအချိၬဆ့",
			"22": "<sup>22</sup> လီၫ.- ထီးနီၪလဖၧၫ့အနၫ့ဆါဒၪဝ့ၫ လ့ၩလၩ့လၧရၫမၫ တၭ,လ့ၩထီၩ့လၧထံၫဖၧၩ့ဖၭဒိၪ လၧအအီၪဝ့ၫလၧစံ ခုၫနီၪ,အၪ့စၪ့ဆၧတၭ, စံၭဝ့ၫဒၪ,စစၫမုၫအ့လၭဒဲစဒၫ ဝံၭနီၪအီၪခီၫခီၫလဲၪ. တၭၦလဂၩစံၭ,ယိခွါ, အီၪဝ့ၫ",
			"23": "<sup>23</sup> လၧန့ၫအီၭလၧရၫမၫအဖၧၩ့လီၫ.- တၭအဝ့ၫဒၪလ့ၩ စိၩထီးန့ၫအီၭလၧရၫမၫအဖၧၩ့တၭ, ယွၩအၥၭအီၪ ထၪ့ဆ့လၧအဝ့ၫဒၪအလီၩ့နီၪ လ့ၩဆၧတၭ, ချဲၩ့ဆၧ လၧမီၪအချိၬတၭ, လ့ၩထီၩ့လၧန့ၫအီၭ လၧရၫမၫအ",
			"24": "<sup>24</sup> ဖၧၩ့လီၫ.- အဝ့ၫဒၪဘဲၪ့လၩ့ခွံၬအကီၩ့အၥိၭတၭ, ချဲၩ့ ဆၧလၧမီၪအချိၬလၧစစၫမုၫအ့လၭအမ့ၬယၫတၭ, မံၫ နၩ့အီၪဘိၪ့ဝ့ၫၥံၫ့နံၩချီၩ့ဒဲၥၫ့နၩချီၩ့လီၫ. မၩအၥၭဘဲၫ နီၪ,ၦစံၭဝ့ၫဒၪ, မွဲစစီလူၫအီၪလၧမီၪလဖၪအကျၩနီၪ ဆ့ဧၪ."
		},
		"20": {
			"1": "<sup>1</sup> စဒၫဝံၭစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧန့ၫအီၭလၧရၫမၫအဖၧၩ့ တၭ,ဂဲၫတၭ, စံၭဆၧလၧစစၪ့နၥၧၫ့အမ့ၬယၫ မွဲယမၩ ယူၭဆၧနီၪလမံၩ့လဲၪ. တၭယဆၧအၧၩ့ မွဲဆၧနီၪလ မံၩ့လဲၪ.တၭယဆၧဒဲၩဘၭလၧနဖါအမ့ၬယၫ လၧအ",
			"2": "<sup>2</sup> အၪ့ဎၬန့ယၥၭမၧၫ့နီၪ, မွဲဆၧနီၪလမံၩ့လဲၪ.- တၭအ ဝ့ၫဒၪစံၭဝ့ၫ, မွဲဆၧထီးမၩအၥၭဘဲၫနီၪလဂ့ၩး နၥံၫဘၪ အ့ၬ,ယိခွါ, ဆၧအဒိၪမွဲဂ့ၩအဆံၭမွဲဂ့ၩ, ယဖါလလီၩ ဘၪယၧၩတၭ, မၩဝ့ၫနးမံၩ့အ့ၬ. ယဖါမိအီၪက့ၪၥူၪ ဆၧယီၩလမံၩ့လၧယၧၩ, မွဲဘၪလဲၪ. ဆၧယီၩလမံၩ့မွဲ",
			"3": "<sup>3</sup> ဆၧအ့ၬ.- စဒၫဝံၭဆိၪလၩ့အၥၭတၭ, စံၭဝ့ၫဒၪ,နဖါၥ့ၪ ယၫတၡါလၧယဘၪခိးဘၪတၩလၧနမ့ၬယၫတၭ, စံၭ ဝ့ၫဒၪ,မွဲစစၪ့နၥၧၫ့ထီးၥ့ၪယၫဆၧလမံၩ့ယီၩလဂ့ၩ,မိ ၥုၪ့အုၭၥၭအုၭဘၪခိၬလီၫ. အ့ၪမွဲယဟိဝၩမၧၫ့ဝ့ၫ, ဒဲ နၥၭမၧၫ့ဝ့ၫနီၪ, လၧယၧၩဒဲဆၧၥံၫအဘိၩ့ဆၧၩ့အီၪဝ့ၫ",
			"4": "<sup>4</sup> န့ၫလခၫလီၫ.- တၭစစၪ့နၥၧၫ့စံၭစဒၫဝံၭ, ထီးဒၪနၥၭ ဆိၫ့ဆၧလမံၩ့လါလါနီၪ, ယမိမၩလၧနဂးလီၫ.",
			"5": "<sup>5</sup> စဒၫဝံၭစံၭဆၧလၧစစၪ့နၥၧၫ့, ယိခွါ, ကဲဂီၩလနံၩမွဲ လၩၥံၫအနံၩတၭ, ယလဆၧၫ့နၩ့ဘၪလၧစဎွၩ အစပွဲ ထံၭနီၪကြၨၭအ့ၬ. မွဲလါနၫ့ဘိၩ, ဘဲၫၥိၭယမိအီၪက့ၪ ၥူၪယၥၭလၧဆၧပျၩ့ဖၧၩ့ ထီးအဎွ့ၩထၪ့ၥၧၫ့နံၩလနံၩ ထီးမုအ့ၪဂၪလၩ့နီၪ ဖျါခွံၬဒၪခလူၬယၧၩဘီၪ.",
			"6": "<sup>6</sup> တၭနဖါအ့ၪဒၪလၧယလအီၪဘၪနီၪ, စံၭ,စဒၫဝံၭ အၪ့ကံၩ့ယၧၩတၡါၡါဘဲၫၥိၭ အမိလ့ၩစဲၪ့လၧဘ့ၭၥ လံၫဟံၫ့အဒိၩ့ဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩဆၧမၩဘိၪ့လ နံၪ့လဖၧၫ့အီၪဝ့ၫထီးနီၪ လၧအဂံၪ့ဒီၪ့ဖိၪထီးအလူၬအ",
			"7": "<sup>7</sup> ဂးလီၫ.- တၭအဝ့ၫဒၪအ့ၪစံၭဘဲၫယီၩ, ဂ့ၩယူၭနီၪတၭ, နခ့ၫနၡၩမိအီၪမုၬလီၫ. အ့ၪမွဲအဝ့ၫဒၪအၥၭအ့ၪထၪ့ ဆီၪ့တၭ,ၥ့ၪယၫတၡါလၧအကိၪ့မၩအၧၩ့ယၧၩဆံၭ.",
			"8": "<sup>8</sup> တၭမၩဆၧအခိးအတၩလၧနခ့ၫနၡၩဆံၭ. အဂဲးဘဲၫ ယီၩနအုၩ့လၩ့ဆၧလၧနခ့ၫနၡၩ ဘၪဆဲၫ့လၧယဟိဝၩ လီၫ.မွဲလါနၫ့ဘိၩ ဆၧအၧၩ့အ့ၪအီၪလၧယဖၧၩ့တၭ, မၩၥံၫယၧၩလၧနနၫ့ဆါဒၪနဝ့ၫဘီၪ. အဂဲးဘဲၫယီၩနမိ ၥိၫ့ယၧၩလၧနဖါအအီၪမွဲဘၪလဲၪ.",
			"9": "<sup>9</sup> တၭစစၪ့နၥၧၫ့စံၭဝ့ၫဒၪ, မွဲအထီးဘၪနၧၩလဂ့ၩ.အ ဂဲးဘဲၫယီၩယအ့ၪၥ့ၪယၫတၡါလၧယဖါကိၪ့ဆၧအၧၩ့ ဘဲၫၥိၭအမိဘၪနၧၩတၭ, ယမိလီၩဘၪနၧၩ,မွဲအ့ၬဧၪ.",
			"10": "<sup>10</sup> တၭစဒၫဝံၭစံၭစစၪ့နၥၧၫ့, မွဲပလၫမိလီၩဘၪယၧၩ လဂၩလဲၪ. နဖါအ့ၪချဲၩ့ဆၧၫ့နၧၩဆီၪ့ဆီၪ့လ့ၬတၭ,ပ",
			"11": "<sup>11</sup> မိမၩဘဲၫၥ့ၪလဲၪ.- တၭစစၪ့နၥၧၫ့စံၭစဒၫဝံၭ,ဂဲၫဘီၪ,မွဲ ပလ့ၩၡီၩ့လၧဆၧပျၩ့ဖၧၩ့ဆံၭ. တၭအဝ့ၫၥံၪလ့ၩဆၧ နံၫဂၩလူၬလၧဆၧပျၩ့ဖၧၩ့လီၫ.- တၭစစၪ့နၥၧၫ့စံၭ",
			"12": "<sup>12</sup> စဒၫဝံၭ, ယဟိဝၩအံၫစရ့လၭအယွၩဧ့, ကဲဂီၩမွဲဂ့ၩ, ကဲတဂီၩမွဲဂ့ၩ, ထီးယအၪ့ဎၬယိဘၪယူၭယဖါတၭ, ယိခွါ,ဆၧဂ့ၩအီၪလၧစဒၫဝံၭအဂးတၭ, ထီးနီၪလဖၧၫ့ အ့ၪလအၪ့မၧၫ့ဘၪဆၧလၧနအီၪ, ဒဲလလီၩဘၪနၧၩ",
			"13": "<sup>13</sup> တၭ,- မွဲယဟိဝၩမၩဘဲၫနီၪ ဒဲအၪနဲၪ့အနီၪ လၧစစၪ့ နၥၧၫ့ဆံၭ. အ့ၪဘၪယဖါအၥၭ လၧအမိမၩနၧၩလၧ ဆၧအၧၩ့တၭ, ယမိလီၩဘၪနၧၩ, ဒဲဖျါခွံၬနၧၩဘဲၫၥိၭ နမိစဲၪ့ထၪ့ခွံၬမုၬမုၬလီၫ. တၭမွဲယဟိဝၩအီၪလၧနၥိၭ",
			"14": "<sup>14</sup> ဘဲၫအအီၪယူၭလၧယဖါအၥိၭနီၪဆံၭ.- တၭနမိဘၪ ဒုၭနဲၪယၧၩလၧယဟိဝၩအခိးအတၩ န့ၫလၧယမၧၫ့",
			"15": "<sup>15</sup> ဒံၭလၧယထီးၥံၫလဂ့ၩနီၪကၭအ့ၬး- အ့ၪမွဲထီးဒၪလ့ၬ ယဟိဝၩဖ့ၬထ့ၬခွံၬစဒၫဝံၭအဒုၪအဒၩ လၧဂၪ့ခိၪချိၫ့ ကိၭဂၩဒ့ၭတၭ, ထီးဖ့ၬထ့ၬနခိးနတၩလၧယဂံၪ့ဖိၪလၩ့ ဆိၩလၩ့ကၠၪလဂ့ၩ.",
			"16": "<sup>16</sup> စစၪ့နၥၧၫ့အုၩ့လၩ့ ဆၧလၧစဒၫဝံၭအၡၩဂံၪ့ဖိၪၥံၪ တၭ,စံၭဝ့ၫဒၪ, မွဲယဟိဝၩအၪ့ဎၬဆၧလၧစဒၫဝံၭအဒုၪ",
			"17": "<sup>17</sup> အဒၩအစူၪဖၧၩ့ဆံၭ.- တၭစစၪ့နၥၧၫ့ဒုၭဆိၪလၩ့ဒီၭ အၥၭလၧအအဲၪဝ့ၫအကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩမွဲအ အဲၪအဝ့ၫဘဲၫအအဲၪလၩ့အၥၭဒၪဝ့ၫအၥိၭလီၫ.",
			"18": "<sup>18</sup> ထီးနီၪလဖၧၫ့စစၪ့နၥၧၫ့စံၭစဒၫဝံၭ, ကဲဂီၩလနံၩမွဲ လၩၥံၫအနံၩတၭ ၦမိဒၪဘၪဝ့ၫလၧနလအီၪဘၪနီၪအ",
			"19": "<sup>19</sup> ဂဲးဘဲၫယီၩနလးဆၧၫ့နၩ့မိအီၪပျီၩပျီၩလီၫ.- နအီၪထီး အဘၪၥၧၫ့နံၩလနံၩနီၪတၭ, လ့ၩလၩ့ချဲၫ့ချဲၫ့တၭ,လ့ၩ ထီၩ့ဆၧအလးထီးနအီၪက့ၪၥူၪနၥၭ လၧမၩဆၧအမု လနံၩနီၪတၭ, နမိဘၪအီၪလၧလိးအံဇ့ၫလၭအနဲၩ့",
			"20": "<sup>20</sup> ထံၭနီၪလီၫ.- တၭယမိခၭဖျါၥၧၫ့ဘံၪ့လၧအနဲၩ့ထံၭ,",
			"21": "<sup>21</sup> ဘဲၫယခၭဆၧမၩနဲၪ့အၥိၭနီၪလီၫ.- တၭယိခွါ,ယမိ အၪ့မၧၫ့လၩ့ဖိၪၥၪအခွၫလဂၩတၭ, စံၭ,လ့ၩအၪ့ဎၬန့ ဖျါဘီၪးယအ့ၪစံၭၦဖိၪၥၪအခွၫနီၪ, ယိခွါ, ဖျါလဖၪ အီၪဝ့ၫလၧနနဲၩ့ထံၭအယီၩလခီၫနီၪ, မၩန့ဝ့ၫဘီၪ,ထီး နီၪလဖၧၫ့ဂဲၫထၪ့နဝ့ၫ,ဧီၪ, အဂဲးဘဲၫယီၩဆၧအမုၬအီၪ လၧနဂးတၭ, ဆၧအၧၩ့အီၪအ့ၬ, ယဟိဝၩမၧၫ့ဝ့ၫလီၫ.",
			"22": "<sup>22</sup> အ့ၪမွဲယအ့ၪစံၭ ဖိၪၥၪအခွၫနီၪ, ယိခွါ, ဖျါလဖၪအီၪ လၧယၫလီၫ. တၭလ့ၩနဝ့ၫဘီၪး အဂဲးဘဲၫယီၩ မွဲယ",
			"23": "<sup>23</sup> ဟိဝၩဖျါခွံၬနၧၩလီၫ.- တၭဆၧလၧနၧၩဒဲယၧၩ ချဲၩ့ ဆၧအဂဲးအကၠီၪ့ယီၩ, ယိခွါ, မွဲယဟိဝၩအီၪလၧနၧၩ ဒဲယၧၩအဘိၩ့ဆၧၩ့နီၪ အဆိၩဆိၩအကၠၪကၠၪဆံၭ.",
			"24": "<sup>24</sup> စဒၫဝံၭအီၪက့ၪၥူၪအၥၭ လၧဆၧပျၩ့ဖၧၩ့နီၪး ထီး လၩၥံၫတၭ, စဎွၩဆၧၫ့နၩ့ ဘဲၫၥိၭ အမိအၪ့ဆၧလီၫ.",
			"25": "<sup>25</sup> တၭစဎွၩဆၧၫ့နၩ့ လၧလးဆၧၫ့နၩ့ဘဲၫလးလး, လၧအ လးဆၧၫ့နၩ့လၧဆၧဒီၪ့အနဲၩ့, စစၪ့နၥၧၫ့ဆၧၫ့ထုၪ့တၭ, စအၭဘနၧၫအီၪဝ့ၫလၧစစီလူၫအနဲၩ့ထံၭတၭ, စဒၫဝံၭ",
			"26": "<sup>26</sup> အလးအီၪပျီၩပျီၩလီၫ.- မွဲလါနၫ့ဆၧလၧမုလနံၩနီၪ စစီလူၫချဲၩ့ဆၧအ့ၬ. အဂဲးဘဲၫယီၩ ဆီၫ့မီၪ့လၧအဝ့ၫ ဘၪဆၧလမံၩ့မံၩ့တၭ, ဆံၫ့အ့ၬ, မွဲမၬလဆံၫ့ဘၪလီၫ.",
			"27": "<sup>27</sup> တၭဆၧမၩအၥၭလၧမုဆဲၪ့ထၪ့လနံၩ လၩထၪ့နံၫနံၩ လနံၩနီၪစဒၫဝံၭအလးအီၪပျီၩပျီၩတၭ, စစီလူၫစံၭအ ဖိၪခွၫစစၪ့နၥၧၫ့လၧမုဂၪလနံၩမွဲဂ့ၩ, အယီၩလနံၩယီၩ မွဲဂ့ၩ,စယ့ၭစံၫအဖိၪခွၫလဂဲၫအၪ့ဘၪဆၧ, မွဲဘၪလဲၪ.",
			"28": "<sup>28</sup> စစၪ့နၥၧၫ့စံၭဆၧၫ့စစီလူၫ, စဒၫဝံၭအၪ့ကံၩ့ယၧၩတၡါ",
			"29": "<sup>29</sup> ၡါဘဲၫၥိၭအမိလ့ၩဆၧလၧဘ့ၭၥလံၫဟံၫ့,- တၭစံၭဝ့ၫ ဒၪ,ဖျါခွံၬလါယၧၩဆံၭ. အဂဲးဘဲၫယီၩ မွဲပဂံၪ့ဒီၪ့ဖိၪ မၩဘိၪ့ဆၧလၧဒိၩ့ဖၧၩ့တၭ, ယထၧၫ့ဖုဝဲမၪလူၬယၧၩ တၭ,ယအ့ၪဘၪခိးဘၪတၩ လၧနမ့ၬယၫ, ဖျါခွံၬလါ ယၧၩဘဲၫၥိၭယမိဒၪဘၪယထၧၫ့ဖုဝဲလဖၪနီၪဆံၭ. မၩ အၥၭဘဲၫနီၪတၭဂဲၫဝ့ၫလၧ စဎွၩအစပွဲထံၭအ့ၬ.",
			"30": "<sup>30</sup> စစီလူၫအၥၭထၪ့ဘၪစစၪ့နၥၧၫ့တၭ, စံၭဝ့ၫဒၪ,ၦ အနါကဲၪ့,ဒဲဆၧပိၩ့ထၪ့အဖိၪဧ့, နရွံန့စယ့ၭစံၫအဖိၪခွၫ လၧနမ့ၬမဲဒၪနဝ့ၫအဂး, ဒဲလၧနမိအဆၧအီၪဘိၪ့အမ့ၬ",
			"31": "<sup>31</sup> မဲအဂးနီၪ,မွဲယၥ့ၪယၫအ့ၬဧၪ.- အဂဲးဘဲၫယီၩမုနံၩလဖၪ လၧစယ့ၭစံၫအဖိၪခွၫမၧၫ့ဝ့ၫ လၧဂၪ့ခိၪချိၫ့ထီးအလူၬ နီၪ,နဝ့ၫဒၪမွဲဂ့ၩ, နဘၩ့နမုးမွဲဂ့ၩ, မိအီၪဂုးခၧၫ့အ့ၬ. ဘိၩ့နဲၪ့ယီၩအၪ့မၧၫ့လၩ့ဆၧတၭ, ဂဲၫထဲၩ့ဆိၬ အဝ့ၫ လၧယအီၪယီၩဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪမိဘၪၥံၫ",
			"32": "<sup>32</sup> တၡါလီၫ.- တၭစစၪ့နၥၧၫ့စံၭဆၧၫ့အဖါ စစီလူၫတၭ, စံၭဝ့ၫ,မွဲအမိဘၪဆၧမၩၥံၫအဂဲးဘဲၫၥ့ၪလဲၪ. မွဲအမၩ",
			"33": "<sup>33</sup> ဆၧနီၪလမံၩ့လဲၪ.- တၭစစီလူၫဆ့ၭဖၩ့ဖိၪ လဘံၪ့ဘဲၫ ၥိၭအမိဘၪအဝ့ၫလီၫ. အခိးမွဲစစၪ့နၥၧၫ့ၥ့ၪယၫလၧအ",
			"34": "<sup>34</sup> ဖါကိၪ့ဝဲၩလၧအမိမၩၥံၫစဒၫဝံၭလီၫ.- စစၪ့နၥၧၫ့အ ၥၭထၪ့တၭ, ဂဲထုၪ့လၧစပွဲထံၭတၭ, လၩထၪ့နံၫနံၩလ နံၩနီၪအၪ့ဆၧအ့ၬ. အဂဲးဘဲၫယီၩ အၥၭဆၫလၧစဒၫ ဝံၭအကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩ အဖါဒုၭမ့ၬမဲဝ့ၫလီၫ.",
			"35": "<sup>35</sup> တၭမုဆဲၪ့ထၪ့နီၪ ဆၧမၩအၥၭလၧအဆၧၫ့အထီ လၧအဖၭဝဲၩစဒၫဝံၭနီၪ, စစၪ့နၥၧၫ့လ့ၩထၪ့လၧဆၧပျၩ့ ဖၧၩ့တၭ, ဖိၪၥၪအခွၫဖိၪလဂၩ အီၪလၧအၥိၭလီၫ.",
			"36": "<sup>36</sup> တၭစံၭအဖိၪၥၪလဂၩနီၪ, စဲၪ့,အၪ့ဎၬဖျါလဖၪလၧယမိ ခၭဘီၪ, ဖိၪၥၪနီၪစဲၪ့အဘိၩ့ဘၭတၭ, အဝ့ၫဒၪခၭဖျါလ",
			"37": "<sup>37</sup> ဘံၪ့လၧအမ့ၬယၫလီၫ.- ထီးဖိၪၥၪနီၪလ့ၩထီၩ့လၧဖျါ လၧစစၪ့နၥၧၫ့ခၭဝ့ၫအလးတၭ, စစၪ့နၥၧၫ့ကိၭထွ့ၫဖိၪ ၥၪနီၪတၭ,စံၭဝ့ၫဒၪ, ဖျါအီၪလၧနမ့ၬယၫ, မွဲအ့ၬဧၪ.",
			"38": "<sup>38</sup> တၭစစၪ့နၥၧၫ့ကိၭထၪ့ဖိၪၥၪနီၪ, မၩချဲၫ့ချဲၫ့,စဲၪ့, အီၪဒၪ ခလူၬလဂ့ၩး တၭစစၪ့နၥၧၫ့ အဖိၪၥၪနီၪအၪ့ထုၫ့ထၪ့",
			"39": "<sup>39</sup> ဖျါလဖၪတၭ, ဂဲၫထဲၩ့လၧအကဆါအအီၪလီၫ.- တၭ ဖိၪၥၪနီၪၥ့ၪယၫဆၧနးမံၩ့အ့ၬ. ၦၥ့ၪယၫဆၧအဂဲးနီၪ",
			"40": "<sup>40</sup> မွဲန့ၫစစၪ့နၥၧၫ့ ဒဲစဒၫဝံၭလီၫ.- တၭစစၪ့နၥၧၫ့ဖ့ၪလၫ့အ စူၪဝဲၩလၧအဖိၪၥၪနီၪ, စံၭဝ့ၫ,ထဲၩ့ဆိၬလၧဒိၩ့ဖၧၩ့ဘီၪ.",
			"41": "<sup>41</sup> ဖိၪၥၪနီၪစဲၪ့ထၪ့ခွံၬဂီၩ့တၭ, စဒၫဝံၭဂဲထုၪ့လၧအလး လၧမုခံၫ့လခီၫတၭ, ထွံၩလၩ့အၥၭတၭ, ၡီၫ့လၩ့အခိၪ ၥၧၫ့ဖၧၫ့တၭ,အဝ့ၫၥံၪအဲၪဂါလိၬအၥၭတၭ, လဂၩဒဲလ ဂၩအမ့ၬထံၫလၩ့တၭ, စဒၫဝံၭမၩအၪဒၪ အဆၧဒံၭ",
			"42": "<sup>42</sup> လီၫ.- စစၪ့နၥၧၫ့စံၭစဒၫဝံၭ, လ့ၩဆၧမုၬမုၬဆံၭ, အဂဲး ဘဲၫယီၩပဆိၪလၩ့ပၥၭနံၫဂၩလူၬ လၧယဟိဝၩအမံၩ့ တၭ,စံၭ,မွဲယဟိဝၩအီၪလၧ ယၧၩဒဲနၧၩအဘိၩ့ဆၧၩ့, ဒဲလၧယချံၫယၥၪဒဲနချံၫနၥၪ အဘိၩ့ဆၧၩ့လၩ့ဆိၩလၩ့ ကၠၪဆံၭ. တၭစဒၫဝံၭဂဲထုၪ့စဲၪ့ဝ့ၫတၭ, စစၪ့နၥၧၫ့ထဲၩ့ ထဲၩ့ဝ့ၫလၧဒိၩ့ဖၧၩ့လီၫ."
		},
		"21": {
			"1": "<sup>1</sup> တၭစဒၫဝံၭဂဲၫဝ့ၫလၧနီဘၭအဖၧၩ့, လၧၦလုဆၧစ အဟံမလ့ၭအအီၪလီၫ. စအဟံမလ့ၭဘၪခီၩ့လၧစဒၫ ဝံၭနီၪၥၭမဲၪဝ့ၫတၭ, စံၭအဝ့ၫ, နအီၪလဂၩဎးတၭ,ၦ လအီၪဘၪလၧနၥိၭနးဂၩနီၪ, မွဲဘၪလဲၪ.",
			"2": "<sup>2</sup> စဒၫဝံၭစံၭၦလုဆၧစအဟံမလ့ၭ, စဎွၩမၪလူၬယၧၩ လၧဆၧလမံၩ့တၭ, စံၭယၧၩ, ဒုၭၥ့ၪယၫၦၡၩလၧယ အၪ့မၧၫ့နမၩဆၧအဂဲးအကၠီၪ့, ဒဲဆၧလၧယမၪလူၬ နၧၩနီၪနးဂၩလဂ့ၩ, တၭယမိအီၪက့ၪလၩ့ယခ့ၫယၡၩ",
			"3": "<sup>3</sup> ထီးအံၩထီးအိၩလီၫ.- တၭဘိၩ့နဲၪ့ယီၩဆၧအီၪလၧ နစူၪအဖၫ့လၬနီၪ, မွဲဆၧနီၪလမံၩ့လဲၪး ဖ့ၪလၫ့ယၧၩ လၧကိၪယဲလီၪ့ လၧယစူၪဖၧၩ့ဘီၪ. အ့ၪလမွဲဘၪဘဲၫ",
			"4": "<sup>4</sup> နီၪတၭ,ဆၧလၧအအီၪဝ့ၫလမံၩ့မံၩ့နီၪဆံၭ.- ၦလုဆၧ လဂၩစံၭဆၧၫ့စဒၫဝံၭတၭ, စံၭအဝ့ၫ, ကိၪအလဆံၫ့ ဘၪနီၪအီၪလၧယစူၪအဖၫ့လၬအ့ၬ. အ့ၪမွဲၦဖိၪၥၪခွၫ လဖၪနီၪအ့ၪဂၭဎ့ၭၦမုၪတၭ, ကိၪဆံၫ့ဎံၪအီၪဝ့ၫလီၫ.",
			"5": "<sup>5</sup> စဒၫဝံၭစံၭဆၧၫ့ ၦလုဆၧလဂၩနီၪတၭ, စံၭအဝ့ၫ,လၧ ယစဲၪ့ထၪ့နီၪ ၦမုၪလအီၪဘၪလၧပကျၩ ဘူၭကၪၥၧၫ့ နံၩတၭ,ၦဖိၪၥၪခွၫအထွ့ၫလဖၪနီၪ ဆံၫ့ဝ့ၫတၭ,ကိၪနီၪ မၩအၥၭဘဲၫအလဆံၫ့လဎံၪဘၪအၥိၭလီၫ. အဂဲးဘဲၫ ယီၩအဂူၫဂၩလဖၪ ဘၪဆၧအီၪက့ၪဆံၫ့ဎံၪလၧထွ့ၫ",
			"6": "<sup>6</sup> ဖၧၩ့လၧမုဆၫလနံၩယီၩလီၫ.- တၭၦလုဆၧနီၪဖ့ၪလၫ့ အဝ့ၫလၧဆၧအဆံၫ့အဎံၪလီၫ. အဂဲးဘဲၫယီၩကိၪလ အီၪဘၪထီးနီၪတၭ, အီၪန့ၫဆၧမ့ၬယၫအကိၪလၧဆၧ မၩန့ဝ့ၫလၧယဟိဝၩ အမ့ၬယၫဘဲၫၥိၭအမိအီၪက့ၪ",
			"7": "<sup>7</sup> ကိၪအၥၫ့လၧမုလနံၩ လၧအမၩန့ခွံၬဝ့ၫနီၪလီၫ.- ဆၧ လၧမုလနံၩနီၪၦလၧစစီလူၫအခ့ၫအၡၩလဖၪအကျၩ လဂၩ,ဆၧပဒၩ့အလ့ၩဆၧတၭ, အီၪဝ့ၫထီးနီၪလၧယ ဟိဝၩအမ့ၬယၫတၭ, အမံၩ့မွဲစဒိအ့ၭ ၦအံဒၧၫ့ဖိၪ,စစီ",
			"8": "<sup>8</sup> လူၫအၡၩယိချီၥံၪအခိၪလီၫ.- တၭစဒၫဝံၭစံၭစအဟံ မလ့ၭ,ဖၩ့မွဲဂ့ၩ,နၭမွဲဂ့ၩ လအီၪဘၪလၧနစူၪအဖၫ့လၬ ဘၪဧၪ.အဂဲးဘဲၫယီၩ ယနၭမွဲဂ့ၩ, ယစူၪဝဲၩမွဲဂ့ၩ,ယ ဂဲၫဆိၬအ့ၬ. အဂဲးဘဲၫယီၩစဎွၩအဆၧနီၪ, ဆၧဘၪမၩ",
			"9": "<sup>9</sup> ဝ့ၫချဲၫ့ချဲၫ့လီၫ.- တၭၦလုဆၧနီၪစံၭဝ့ၫဒၪ, ၦဖလံၡၫဖိၪ စဂိၫလဲအၫလၧနမၩၥံၫဝ့ၫ လၧအံလၫအခိၪလီၩ့ဆူၭလ ဂၩအနၭနီၪ, ယိခွါ, အီၪဝ့ၫဘီၪ့ထၪ့အၥၭလၧဆၧကဲၩ့ ယၬအဖၧၩ့ လၧအ့ဖိၭအချိၫ့နီၪလီၫ. အ့ၪဘၪနၥၭလၧ နမိမၩန့အဝ့ၫနီၪတၭမၩန့ဘီၪး အဂဲးဘဲၫယီၩ လၧအ ဝ့ၫဒၪလဘံၪ့အမ့ၬယၫနီၪ အဂူၫဂၩအီၪထီးယီၩအ့ၬ. တၭစဒၫဝံၭစံၭဝ့ၫဒၪ, ဆၧဘဲၫအဝ့ၫလဘံၪ့အၥိၭနီၪ အီၪအ့ၬ,ဖ့ၪလၫ့ယၧၩဆံၭ.",
			"10": "<sup>10</sup> စဒၫဝံၭဂဲထုၪ့တၭ, လၧမုလနံၩနီၪစဲၪ့ဖျိၭလၧအၥၭ မဲၪစစီလူၫအကၠီၩ့တၭ, လ့ၩဝ့ၫလၧဂၫၥၭအစဎွၩအၫ",
			"11": "<sup>11</sup> ခ့ၭအအီၪလီၫ.- တၭစအၫခ့ၭအခ့ၫအၡၩစံၭအဝ့ၫ, ၦ လဂၩယီၩမွဲထံၫၥံၪခးၥံၪအစဎွၩဒၫဝံၭ, မွဲအ့ၬဧၪ. ၦ လီၩဆၧၫ့လိၬအၥၭ လၧဂဲထုၪ့လံအဖၧၩ့နီၪ, စစီလူၫမၩၥံၫယူၭၦအထီၫ့လဖၪ, စဒၫဝံၭနီၪၦအလၬလဖၪနီၪ,",
			"12": "<sup>12</sup> မွဲအ့ၬဧၪ.- စဒၫဝံၭအီၪက့ၪဆၧချဲၩ့လဖၪနီၪ လၧအ ၥၭခံဖၧၩ့တၭ, ၥၭမဲၪဂၫၥၭအစဎွၩအၫခ့ၭဒိၪမၬလီၫ.",
			"13": "<sup>13</sup> တၭအဝ့ၫဒၪမၩလၩ့မဲၩအၥၭ လၧအဝ့ၫၥံၪအမ့ၬယၫ တၭ,မၩဖျႃထၪ့အၥၭလၧအဝ့ၫၥံၪအစူၪဖၧၩ့တၭ, ကွ့ၭ ဆၧပျီၩပျီၩလၧတရၫ့အထုၪ့လီၩ့တၭ, အထိၪဖျံၭလၩ့",
			"14": "<sup>14</sup> ယွၩလၧအနိၭဆီၪ့လီၩ့လီၫ.- ထီးနီၪလဖၧၫ့စအၫခ့ၭစံၭ အခ့ၫအၡၩ,ယိခွါ, ၦလဂၩယီၩမွဲၦအဖျႃလီၫ. နၥံၪ",
			"15": "<sup>15</sup> ဂဲၫဆိၬလၧယအီၪမွဲဘၪလဲၪ.- ယမၩဆၧလၧၦအဖျႃ အလးအီၪတၭ, နၥံၪဂဲၫဆိၬၦလဂၩယီၩ ဘဲၫၥိၭအမိ မၩၦအဖျႃအဆၧလၧယမ့ၬယၫဧၪ. ၦလဂၩယီၩမိဂဲၫ နုၬဘၪလၧယဂံၪ့ဖၧၩ့ဆ့ဧၪ."
		},
		"22": {
			"1": "<sup>1</sup> အခိးမွဲစဒၫဝံၭစဲၪ့ထၪ့ခွံၬထီးနီၪတၭ, ဂၭဖျ့ၭဝ့ၫဖိး လၧအဒၧလၫ့ အဆၧအိၩဖၧၩ့တၭ, ထီးအထၧၫ့ဖုဝဲဒဲ အဖါအၡၩဂံၪ့ဖိၪထီးအလူၬနါဂၧၫ့ဝ့ၫတၭ, လ့ၩလၩ့ဝ့ၫ",
			"2": "<sup>2</sup> လၧအအီၪလီၫ.- တၭကယဲၦလၧအဘၪဆၧၡၪ့ဆၧ နၭ,ဒဲကယဲၦလၧအဒ့ၪအမါအီၪ, ဒဲကယဲၦလၧအၥၭ လမံၫ့ဘၪလဂၩလါလါနီၪ, အီၪကိၩ့အီၪကီၪ့ဝ့ၫလၧအ အီၪတၭ,အဝ့ၫဒၪကဲၪထၪ့အခိၪလၧ အဖၫ့ခိၪတၭ,ၦလံ ယၩကၪယူၭအီၪဝ့ၫလၧအၥိၭလီၫ.",
			"3": "<sup>3</sup> စဒၫဝံၭစဲၪ့ထၪ့ခွံၬထီးနီၪဖိးလၧမံဇပၫ လၧမိအၭအ ဖၧၩ့တၭ,စံၭမိအၭအစဎွၩ, ဒုၭဂဲၫထၪ့လါယမိယဖါ တၭ,အီၪလၧနၥံၪအၥိၭ ထီးယၥ့ၪယၫဆၧလၧယွၩမိ",
			"4": "<sup>4</sup> မၩလၧယဂးဆံၭ.- မွဲအဂဲၫဆိၬအဝ့ၫၥံၪ လၧမိအၭအ စဎွၩအအီၪတၭ, ကယဲမုနံၩလၧစဒၫဝံၭ အီၪဝ့ၫလၧ ထိၬဖၧၩ့ထီးအလူၬနီၪ, အဝ့ၫၥံၪအီၪလၧစဎွၩနီၪအၥိၭ",
			"5": "<sup>5</sup> လီၫ.- တၭမီၪလဂၩစဂၭနီၪ,စံၭစဒၫဝံၭ, အီၪလၧထိၬ ဖၧၩ့နီၪလဂ့ၩ. စဲၪ့ထၪ့တၭလ့ၩလၧခးယုဒၫအဖၧၩ့နီၪ ဆံၭးတၭစဒၫဝံၭစဲၪ့ထၪ့ခွံၬဝ့ၫတၭ, လ့ၩဝ့ၫလၧမံၩ့လၬ ကျၩဟၫရ့ၭလီၫ.",
			"6": "<sup>6</sup> ထီးစစီလူၫနါဂၧၫ့ဝ့ၫလၧ ၦဒၪန့စဒၫဝံၭဒဲၦအီၪလၧ အၥိၭ,စစီလူၫအီၪဝ့ၫလၧဂံၭဘအၫအဖၧၩ့, လၧၥံၪ့လ ထံၭအဖၫ့လၬအီၪလၧရၫမၫအဖၧၩ့တၭ, ဖၩ့လဘံၪ့အီၪ လၧအစူၪဖၧၩ့, ဒဲအခ့ၫအၡၩဆၧၫ့ထုၪ့လၧအနဲၩ့ထံၭ",
			"7": "<sup>7</sup> အီၪဝၬဖီၩ့ဝ့ၫလီၫ.- တၭစစီလူၫစံၭ အခ့ၫအၡၩလၧအ ဆၧၫ့ထုၪ့လၧအနဲၩ့ထံၭ, ခိၭနၪလါၦဘံၪ့ယမံၫ့ဖိၪၥံၪ ဧ့,စယ့ၭစံၫအဖိၪခွၫ မိဖ့ၪလၫ့နၥံၪ ထီးအလူၬလၧဆံၬ ၥံၪနၩၥံၪဒဲဆၧၥၪအလးၥံၪ, ဒဲအီၪက့ၪနၥံၪ လၧၦအ",
			"8": "<sup>8</sup> ထီၫ့အခိၪ,ဒဲၦအယၩအခိၪ အကၠီၩ့နီၪး- လၧနၥံၪဝ့ၫ ကိၭဂၩဒ့ၭအုၩ့လၩ့ယူၭဆၧထၫ့ဒုၪဒၩယၧၩဧၪ, ဒဲယ ဖိၪခွၫအုၩ့လၩ့လိၬအၥၭ လၧစယ့ၭစံၫအဖိၪခွၫနီၪ, ၦ ဒုၭနဲၪယၧၩနးဂၩအ့ၬဧၪး ဒဲလၧနၥံၪအကျၩၦလၧအ မိယၫ့ၥၭယၧၩတၭ, ၦလၧအစံၭလၧယနါဖၧၩ့လၧယ ဖိၪခွၫထိၪဂဲၩယခ့ၫယၡၩထၫ့ဒုၪဒၩယၧၩ, ဘဲၫၥိၭအ မိခိၭဆၧအီၪၥူၪ, ဘဲၫလၧမုလနံၩယီၩအၥိၭနီၪအီၪနး ဂၩအ့ၬဧၪ.",
			"9": "<sup>9</sup> ထီးနီၪလဖၧၫ့ၦအံဒၧၫ့ဖိၪစဒိအ့ၭ လၧအအီၪလၧ စစီလူၫအခ့ၫအၡၩအၥိၭနီၪ စံၭဆၧၫ့ဆၧတၭ,စံၭဝ့ၫ, ယဒၪဘၪစယ့ၭစံၫအဖိၪခွၫ ဂဲၫလၩ့လၧနီဘၭလၧစ",
			"10": "<sup>10</sup> ဟံၭတၧၭအဖိၪခွၫ စအဟံမလ့ၭအအီၪလီၫ.- အဝ့ၫ အၪ့စၪ့ဆၧလၧယဟိဝၩလၧအဂးတၭ, ဖ့ၪလၫ့ဝ့ၫလၧ အဆၧအၪ့ဆၧအီၩ, ဒဲဖ့ၪလၫ့အဝ့ၫ လၧၦဖလံၡၫဖိၪစ ဂိၫလဲအၫအနၭလဘံၪ့လီၫ.",
			"11": "<sup>11</sup> တၭစဎွၩအၪ့မၧၫ့ ၦလ့ၩကိၭန့ ၦလုဆၧစအဟံၭ တၧၭအဖိၪခွၫ စအဟံမလ့ၭ, ဒဲအဖါအၡၩဂံၪ့ဖိၪထီး အလူၬ,ၦလုဆၧလဖၪ လၧအအီၪဝ့ၫလၧနီဘၭအဖၧၩ့ တၭ,အဝ့ၫၥံၪဂဲၫဝ့ၫလၧစဎွၩအအီၪ ထီးအလူၬလီၫ.",
			"12": "<sup>12</sup> တၭစစီလူၫစံၭဝ့ၫဒၪ, စအဟံၭတၧၭအဖိၪခွၫဧ့, ခိၭနၪ လါဆံၭ, တၭအဝ့ၫဒၪချဲၩ့ဆၧၫ့ဝ့ၫ, ယိခွါ, ယၧၩလီၫ.",
			"13": "<sup>13</sup> ကဆါဧ့,- တၭစစီလူၫစံၭအဝ့ၫဒၪ, နၥံၪအုၩ့လၩ့ဆၧ ထၫ့ဒုၪဒၩယၧၩ, နဝ့ၫဒၪဒဲစယ့ၭစံၫအဖိၪခွၫ, လၧနဖ့ၪ လၫ့အဝ့ၫလၧကိၪ, ဒဲနၭလဘံၪ့,ဒဲအၪ့စၪ့ယွၩလၧအဂး ဘဲၫၥိၭအမိဂဲထုၪ့ထၫ့ဒၩယၧၩ, ဘဲၫၥိၭအမိခိၭဆၧအီၪ",
			"14": "<sup>14</sup> ၥူၪဘဲၫလၧမုဆၫလနံၩယီၩအၥိၭနီၪမွဲဘၪလဲၪ.- စအ ဟံမလ့ၭစံၭဆၧၫ့စဎွၩတၭ, စံၭဝ့ၫဒၪ,မွဲၦလၧအလူတီၩ လၧနခ့ၫနၡၩအကျၩ န့ၫဎီၩ့လၧစဒၫဝံၭလၧအမွဲစဎွၩ အမၬတၭ, လ့ၩဝ့ၫထီးဒၪနအၪ့မၧၫ့တၭ, အီၪလၧအ",
			"15": "<sup>15</sup> လၩအဖၩ့လၧနဂံၪ့ဖၧၩ့နီၪလဂၩလဲၪ.- ဆၧလၧမုလနံၩ နီၪမွဲယအၪ့စၪ့ၥၫ့ဆၧ လၧယွၩလၧအဝ့ၫဒၪ အဂးနီၪ ဆ့ဧၪ.မွဲအထီး မၩအၥၭဘဲၫနီၪလဂ့ၩ, မွဲစဎွၩထီး အီၪက့ၪဆၧမၪလၧအခ့ၫအၡၩအလီၩ့, ဒဲလၧယဖါအ ၡၩဂံၪ့ဖိၪထီးအလူၬ အလီၩ့နးမံၩ့လဂ့ၩ. အဂဲးဘဲၫ ယီၩအဆံၭမွဲဂ့ၩ, အဒိၪမွဲဂ့ၩ, နခ့ၫနၡၩၥ့ၪယၫဆၧလၧ ဆၧထီးအလူၬယီၩအဖၧၩ့နးမံၩ့အ့ၬ.",
			"16": "<sup>16</sup> တၭစဎွၩစံၭဝ့ၫဒၪ, စအဟံမလ့ၭဧ့, နဝ့ၫဒၪယီၩန ဘၪၥံၫတၡါ, နဝ့ၫဒၪ,ဒဲနဖါအဂံၪ့ဖိၪထီးအလူၬလီၫ.",
			"17": "<sup>17</sup> စဎွၩစံၭအၡၩလဖၪဘၪဆဲၫ့ လၧၦဆၧၫ့ထုၪ့လၧအနဲၩ့ ထံၭနီၪ,ကၠၪနၥံၪအၥၭတၭ, မၩၥံၫယဟိဝၩအၡၩလု ဆၧလဖၪဆံၭ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪအစူၪအီၪဝ့ၫဆ့ လၧစဒၫဝံၭအၥိၭတၭ, မွဲလၧအဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬနီၪၥ့ၪ ယၫဝ့ၫလါနၫ့, ဂဲၫလီၩဘၪယၧၩအ့ၬ. အ့ၪမွဲစဎွၩအခ့ၫ အၡၩယၩ့ထၪ့အစူၪဘဲၫၥိၭအမိမၩၥံၫ ယဟိဝၩအၡၩ",
			"18": "<sup>18</sup> လုဆၧလဖၪအ့ၬ.- တၭစဎွၩစံၭစဒိအ့ၭ, နဝ့ၫဒၪကၠၪန ၥၭတၭ ဖ့ၬခွံၬၦလုဆၧလဖၪနီၪဆံၭ, တၭၦအံဒၧၫ့ဖိၪ စဒိအ့ၭကၠၪစိၩအၥၭတၭ, ဖ့ၬခွံၬၦလုဆၧလဖၪတၭ, ဆၧလၧမုလနံၩနီၪ မၩၥံၫၦလၧအၥိၭအ့ဖိၭ ဆၧဘွၩ",
			"19": "<sup>19</sup> ဖျ့ၫလံၬကံၭဎိၭဆံၫယဲဂၩလီၫ.- တၭၦလုဆၧအဒိၩ့နီ ဘၭနီၪ,မွဲအဖ့ၬခွံၬဝ့ၫလၧနၭအနါ, ၦမုၪမွဲဂ့ၩ,ၦခွၫမွဲ ဂ့ၩ,ဖိၪဒံၩဖိၥၪ ဒဲဆၧအၪ့နူလဖၪ, ဒဲချီဖၫၥံၪဒဲကၥ့ၪ ယီၩ့ၥံၪဒဲၥိၪၥံၪဘ့ၪၥံၪ, ဖ့ၬခွံၬဝ့ၫလၧနၭအနါလီၫ.",
			"20": "<sup>20</sup> စအဟံၭတၧၭအဖိၪခွၫ စအဟံမလ့ၭ အဖိၪခွၫ လဂၩအမံၩ့စအဘဲအၥၫနီၪဂၭဖျ့ၭဝ့ၫတၭ, လီၩ့ဖိၬစဒၫ",
			"21": "<sup>21</sup> ဝံၭအခဲၫ့လီၫ.- တၭစအဘဲအၥၫနီၪဒုၭနဲၪစဒၫဝံၭလၧ စစီလူၫမၩၥံၫယူၭ ယဟိဝၩ အၡၩလုဆၧလဖၪနီၪ",
			"22": "<sup>22</sup> လီၫ.- တၭစဒၫဝံၭစံၭ စအဘဲအၥၫ, ဆၧလၧမုလနံၩ လၧအံဒၧၫ့ဖိၪ စဒိအ့ၭအီၪထီးနီၪယၥ့ၪယၫ လၧအမိ လီၩဘၪစစီလူၫတၡါလီၫ. ဆၧမၩၥံၫနဖါအၡၩဂံၪ့ဖိၪ",
			"23": "<sup>23</sup> ထီးအလူၬလၧယကၠီၩ့လီၫ.- အီၪနဝ့ၫလၧယၥိၭ,ဧီၪ, ထီးၥၭမဲၪလဂ့ၩ, အဂဲးဘဲၫယီၩၦလၧအအၪ့ဎၬယၥၭ မၧၫ့နီၪအၪ့ဎၬနၥၭမၧၫ့ဆ့လီၫ. အ့ၪမွဲနအ့ၪအီၪလၧ ယၥိၭယီၩဆၧယိထဲၩ့ခွါထဲၩ့နၧၩ အီၪဝ့ၫလီၫ."
		},
		"23": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ၦဒုၭနဲၪစဒၫဝံၭတၭ, စံၭဝ့ၫ,ယိခွါ,ၦ ဖလံၡၫဖိၪဒုၭဆၧလၧကဲလၫတၭ, မၩန့ဆီၪ့ဆၧအီၪလၧ",
			"2": "<sup>2</sup> ခရဲးလဖၪအဖၧၩ့လီၫ.- အခိးမွဲစဒၫဝံၭအၪ့စၪ့ဆၧလၧ ယဟိဝၩတၭ,စံၭဝ့ၫဒၪ, ယမိဘၪလ့ၩဖ့ၬခွံၬၦဖလံၡၫ ဖိၪနီၪဆ့ဧၪ. တၭယဟိဝၩစံၭစဒၫဝံၭ, လ့ၩဖ့ၬခွံၬၦဖ",
			"3": "<sup>3</sup> လံၡၫဖိၪၥံၪ, ဒဲမၩဖီၩ့မၩဖျ့ၭကဲလၫနီၪဆံၭ.- တၭစဒၫ ဝံၭအခ့ၫအၡၩစံၭအဝ့ၫ,ယိခွါ, ပအီၪထီးယုဒၫအဖၧၩ့ ယီၩပအၪ့ယိၪဆၧလီၫ. ၦအ့ၪလ့ၩဆၧလၧကဲလၫထၫ့ ဒုၪဒၩၦဖလံၡၫဖိၪအၥုၭမုနီၪ, မွဲအမိအၪနဲၪ့ဒံၭဆံၭအၪ",
			"4": "<sup>4</sup> လဲၪ.- ထီးနီၪလဖၧၫ့စဒၫဝံၭအၪ့စၪ့ဒီၭ ဆၧလၧယဟိ ဝၩလီၫ. ယဟိဝၩစံၭဆၧၫ့တၭ, စံၭဝ့ၫ,ဂဲထုၪ့လ့ၩလၩ့ လၧကဲလၫဆံၭ. အဂဲးဘဲၫယီၩယမိဖ့ၪလၫ့ၦဖလံၡၫ",
			"5": "<sup>5</sup> ဖိၪၥံၪလၧနစူၪဖၧၩ့လီၫ.- အခိးမွဲစဒၫဝံၭ, ဒဲအၡၩၥံၪ လ့ၩဖိးလၧကဲလၫတၭ, ဒုၭဆၧလၧၦဖလံၡၫဖိၪတၭ,ဂဲၫ ထဲၩ့ဆိၬအဆၧဖိၪဆၧဎါအဒိၩ့, ဒဲဖ့ၬခွံၬဝ့ၫလၧဆၧဖ့ၬ ခွံၬဖၭဒိၪတၭ, စဒၫဝံၭမၩဖီၩ့မၩဖျ့ၭ ၦကဲလၫဖိၪလီၫ.",
			"6": "<sup>6</sup> တၭထီးစအဟံမလ့ၭအဖိၪခွၫ စအဘဲအၥၫနီၪစဲၪ့ ဝ့ၫလၧစဒၫဝံၭအအီၪလၧကဲလၫနီၪတၭ, ဆၧမၩအၥၭ လၧအဂဲၫလၩ့ဝ့ၫလၧအ့ဖိၭလဘံၪ့ အီၪလၧအစူၪဖၧၩ့ လီၫ.",
			"7": "<sup>7</sup> တၭၦလီၩဘၪစစီလူၫလၧစဒၫဝံၭ ဂဲၫထီၩ့လၧကဲလၫ အဖၧၩ့လီၫ. တၭစစီလူၫစံၭဝ့ၫဒၪ, ယွၩဖ့ၪလၫ့ခွံၬယူၭ အဝ့ၫလၧယစူၪဖၧၩ့ယူၭ. အဂဲးဘဲၫယီၩ မွဲအလ့ၩနုၬ လၧဒိၩ့လဒိၩ့လၧအအီၪ လၧတရၫ့အဖၧၩ့,ဒဲတရၫ့အ နိၪဘီၩ့လဖၪတၭ, ဆၧကၭဘံၭထၬယူၭ အလးခဲၫ့",
			"8": "<sup>8</sup> ယူၭ.- တၭစစီလူၫဒုၭအီၪကိၩ့အီၪကီၪ့ ၦခမျၧးထီးအ လူၬလၧအဒုၭၥုၭ, ဘဲၫၥိၭအမိလ့ၩလၩ့ လၧကဲလၫ တၭ,ဝၩ့ထၬစဒၫဝံၭဒဲအၡၩလဖၪလီၫ.",
			"9": "<sup>9</sup> စဒၫဝံၭၥ့ၪယၫဝ့ၫလၧ စစီလူၫကိၪ့ၥူၪဆၧအၧၩ့ထၫ့ဒုၪ ဒၩဝ့ၫတၭ, စံၭၦလုဆၧစအဘဲအၥၫ, ဂဲၫဆိၬအ့ဖိၭလ",
			"10": "<sup>10</sup> ဘံၪ့နီၪလၧယီၩဆံၭ.- တၭစဒၫဝံၭစံၭဝ့ၫဒၪ, ယဟိဝၩ အံၫစရ့လၭအယွၩဧ့, နခ့ၫနၡၩနါဂၧၫ့တၡါလၧစစီလူၫ အၪ့ဎၬဂဲၫလၧကဲလၫ ဘဲၫၥိၭအမိမၩဂၭဂီၩ့ဒိၩ့နီၪလၧ",
			"11": "<sup>11</sup> ယကၠီၩ့ယူၭ.- မွဲၦကဲလၫဖိၪမိဖ့ၪလၫ့ခွံၬယၧၩ လၧအ စူၪဖၧၩ့ဧၪ. ဘဲၫနခ့ၫနၡၩနါဂၧၫ့ဆၧအၥိၭနီၪ, မွဲစစီ လူၫမိဂဲၫလၩ့ဆ့ဧၪ. ယဟိဝၩ အံၫစရ့လၭ အယွၩဧ့, လီၩဘၪလါနခ့ၫနၡၩဆံၭ. တၭယဟိဝၩစံၭဝ့ၫ, အဝ့ၫ",
			"12": "<sup>12</sup> ဒၪမိဂဲၫလၩ့လီၫ.- ထီးနီၪလဖၧၫ့စဒၫဝံၭစံၭဝ့ၫဒၪ, မွဲၦ ကဲလၫဖိၪၥံၪမိဖ့ၪလၫ့ခွံၬယၧၩ ဒဲယၡၩၥံၪယီၩလၧစစီ လူၫအစူၪဖၧၩ့ဆ့ဧၪ. တၭယဟိဝၩစံၭဝ့ၫဒၪ, အဝ့ၫၥံၪ မိဖ့ၪလၫ့ခွံၬဝ့ၫလီၫ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့စဒၫဝံၭ ဒဲအၡၩဎူၫယၩလဖၪဂဲထုၪ့စဲၪ့ ထၪ့ခွံၬလၧကဲလၫတၭ, လ့ၩဝ့ၫထီးဒၪအလ့ၩဆၧၥ့ၪ လစီၪ့စီၪ့လီၫ. တၭၦလီၩဘၪစစီလူၫလၧစဒၫဝံၭစဲၪ့ဖီၩ့ ဖျ့ၭယူၭလၧကဲလၫနီၪတၭ, အဝ့ၫဒၪလ့ၩထၪ့ဝ့ၫအ့ၬ.",
			"14": "<sup>14</sup> စဒၫဝံၭအီၪဝ့ၫလၧမံၩ့လၬကျၩ လၧလိးၥံၪလဲၫ့ၥံၪအ ဖၧၩ့တၭ, အီၪဝ့ၫလၧခိၪလီၩ့လဖျိၪ့အလီၩ့လၧမံၩ့လၬ ကျၩဇံဖၭအဖၧၩ့တၭ, စစီလူၫအၪ့ဎၬဝ့ၫကိၭမုနံၩမု နၩဒ့ၭလါနၫ့ယွၩဖ့ၪလၫ့ခွံၬဝ့ၫ လၧအစူၪဖၧၩ့အ့ၬ.",
			"15": "<sup>15</sup> စဒၫဝံၭဒၪဘၪလၧစစီလူၫ ဂဲၫထၪ့အၪ့ဎၬအၥၭမၧၫ့ တၭ,စဒၫဝံၭအီၪဝ့ၫလၧမံၩ့လၬကျၩဇံဖၭ လၧၥံၪ့လဝၩ့",
			"16": "<sup>16</sup> အကျၩလီၫ.- စစီလူၫအဖိၪခွၫစစၪ့နၥၧၫ့ဂဲထုၪ့တၭ, လ့ၩဝ့ၫလၧစဒၫဝံၭအအီၪ လၧၥံၪ့လဝၩ့အကျၩတၭ,",
			"17": "<sup>17</sup> ဒုၭဆီၪ့ထၪ့အစူၪလၧယွၩအဖၧၩ့လီၫ.- တၭစံၭအဝ့ၫ ဒၪၥၭမဲၪဆၧလဂ့ၩ, အဂဲးဘဲၫယီၩယဖါစစီလူၫအစူၪ မိဒၪန့နၧၩအ့ၬး တၭနမိကဲၪထၪ့စဎွၩ လၧအံၫစရ့လၭ အဖၫ့ခိၪတၭ, ယဝ့ၫဒၪယမိကဲၪထၪ့ၦနံၫဂၩလဂၩနီၪ",
			"18": "<sup>18</sup> တၭ,ယဖါစစီလူၫၥ့ၪယၫဆၧဘဲၫနီၪလီၫ.- တၭအဝ့ၫ ၥံၪနံၫဂၩနီၪ အုၩ့လၩ့ဆၧလၧယဟိဝၩ အမ့ၬယၫဆ့ လီၫ. စဒၫဝံၭအီၪလၧၥံၪ့လဝၩ့အကျၩတၭ, စစၪ့နၥၧၫ့ ထဲၩ့ထဲၩ့ဝ့ၫလၧအဂံၪ့လီၫ.",
			"19": "<sup>19</sup> ထီးနီၪလဖၧၫ့ၦဇံဖၭဖိၪၥံၪ ဂဲၫထီၩ့လၧစစီလူၫအ အီၪလၧဂံၭဘအၫတၭ, စံၭဝ့ၫဒၪ, စဒၫဝံၭအီၪက့ၪၥူၪ အၥၭလၧပကျၩလၧလိးၥံၪအဖၧၩ့. လၧၥံၪ့အဝၩ့လၧ ခိၪလီၩ့ဟၭခဲၫလၫအလီၩ့လၧအအီၪ လၧမံၩ့လၬကျၩ",
			"20": "<sup>20</sup> လၧမုခံၫ့လခီၫနီၪ,မွဲအ့ၬဧၪ.- တၭဘိၩ့နဲၪ့ယီၩ,စဎွၩ ဧ့,ဂဲၫလၩ့ဘဲၫနၥၭထၧၫ့ဖျိၪ့ယၫ ဆိၫ့ဂဲၫလၩ့အၥိၭနီၪ ဆံၭ,ပဝ့ၫဒၪလခီၫပမိဖ့ၪလၫ့ခွံၬအဝ့ၫ လၧစဎွၩအစူၪ",
			"21": "<sup>21</sup> ဖၧၩ့လီၫ.- တၭစစီလူၫစံၭဝ့ၫဒၪ, မွဲနၥံၪဘၪဆၧဆိၪဂ့ၩ လၧယဟိဝၩဆံၭ, အဂဲးဘဲၫယီၩနၥံၪအၥၭအီၪယၧၩ",
			"22": "<sup>22</sup> လီၫ.- ထဲၩ့ထဲၩ့ဘီၪ, တၭတဲၩ့ဝဲၩဒံၭဆၧတၭ, ၥ့ၪယၫ ဒဲယိဆၧအလး ထီးအခၪ့အီၪဝ့ၫနီၪတၭ, မွဲပလၫဒၪ ဘၪဝ့ၫနီၪလဂၩလဲၪ,ဧီၪ. အဂဲးဘဲၫယီၩၦလီၩဘၪယၧၩ",
			"23": "<sup>23</sup> လၧအမၩဆၧလၧအကိၪ့ဆၧၥ့ၪလီၫ.- တၭယိဘၪဒဲၥ့ၪ ယၫကယဲအအီၪက့ၪၥူၪအလး ထီးအအီၪက့ၪၥူၪအၥၭ ထီးအလူၬတၭ, ဂဲၫထဲၩ့ဒီၭလၧယအီၪ လၧဆၧၥ့ၪယၫ လၩ့ထံးလၩ့ဆ့ၭတၭ, ယမိလ့ၩလၧနၥံၪအၥိၭလီၫ. အဝ့ၫဒၪအ့ၪအီၪဝ့ၫ လၧခးဖၧၩ့တၭ, ဆၧမိမၩအၥၭ လၧယမိအၪ့ဎၬန့ဝ့ၫ လၧယုဒၫအၡၩ အထီၫ့လဖၪအ",
			"24": "<sup>24</sup> ကျၩထၧၫ့ခးယၫလီၫ.- အဝ့ၫၥံၪနီၪဂဲထုၪ့တၭ, လ့ၩဝ့ၫ လၧဇံဖၭလၧစစီလူၫအမ့ၬယၫလီၫ. အ့ၪမွဲစဒၫဝံၭဒဲအ ၡၩလဖၪအီၪဝ့ၫလၧမံၩ့လၬကျၩ မၫအၧၫ့လၧဆၧပျၩ့ ဖၧၩ့လၧယ့ၭၡမၧၫ့ လၧမုခံၫ့လခီၫလီၫ.",
			"25": "<sup>25</sup> စစီလူၫဒဲအၡၩလဖၪ လ့ၩအၪ့ဎၬဆၧလီၫ. တၭၦ လဖၪနီၪလီၩဘၪစဒၫဝံၭတၭ, အဝ့ၫဒၪဂဲၫလၩ့ဝ့ၫလၧ လဲၫ့ဖၧၩ့တၭ, အီၪဝ့ၫလၧမံၩ့လၬကျၩ မၫအၧၫ့လီၫ. စစီလူၫနါဂၧၫ့ဝ့ၫတၭ, လီၩ့ဆီးစဒၫဝံၭလၧမံၩ့လၬကျၩ",
			"26": "<sup>26</sup> မၫအၧၫ့နီၪလီၫ.- စစီလူၫလ့ၩဝ့ၫလၧခိၪလီၩ့အယီၩလ ခီၫတၭ, စဒၫဝံၭဒဲအၡၩ လၧခိၪလီၩ့ဝါလခီၫနီၪတၭ, စဒၫဝံၭမၩဝ့ၫချဲၫ့ချဲၫ့ ဘဲၫၥိၭအမိဖီၩ့ဖျ့ၭလၧဆၧၥၭမဲၪ စစီလူၫအကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩ စစီလူၫဒဲအၡၩၥံၪ ဝၩ့ထၬစဒၫဝံၭဒဲအၡၩလဖၪ ဘဲၫၥိၭအမိမၩန့ဝ့ၫလီၫ.",
			"27": "<sup>27</sup> အၥီၫ့လဂၩဂဲၫလၧစစီလူၫအအီၪတၭ, စံၭဝ့ၫဒၪ,မၩ ချဲၫ့ချဲၫ့တၭ,ဂဲၫဘီၪ. အဂဲးဘဲၫယီၩၦဖလံၡၫဖိၪဂဲၫနုၬ လၧထံၫၥံၪခးၥံၪအဖၧၩ့လီၫ.",
			"28": "<sup>28</sup> စစီလူၫလီၩ့ဆီးစဒၫဝံၭနီၪ, ဂဲၫထဲၩ့ထဲၩ့တၭ, လ့ၩ ထၫ့ဒၩၦဖလံၡၫဖိၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ၦကိၭ ဆၧအလးနီၪလၧစံလၫဟၫမၫလံကီၭလီၫ.",
			"29": "<sup>29</sup> တၭစဒၫဝံၭစဲၪ့ထၪ့ခွံၬဝ့ၫထီးနီၪဂီၩ့တၭ, အီၪဝ့ၫလၧ အထိၬလဖၪအဖၧၩ့ ထီးအံၪ့ဂံၫဒဲၫနီၪလီၫ."
		},
		"24": {
			"1": "<sup>1</sup> စစီလူၫလီၩ့ဆီးၦဖလံၡၫဖိၪနီၪ, ထီးအဂဲၫထဲၩ့ ထဲၩ့တၭ,ဆၧမၩအၥၭလၧၦဒုၭနဲၪအဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ယိခွါစဒၫဝံၭအီၪလၧမံၩ့လၬကျၩ အံၪ့ဂံၫဒဲၫနီၪလီၫ.",
			"2": "<sup>2</sup> ထီးနီၪလဖၧၫ့စစီလူၫမၩန့ ၦလၧဆၧရွံန့ဝ့ၫလၧအံၫစရ့ လၭထီးအလူၬအကျၩ ၥၧၫ့ထီၫ့တၭ, လ့ၩအၪ့ဎၬစဒၫ",
			"3": "<sup>3</sup> ဝံၭဒဲအၡၩလဖၪလၧဘ့ၪမံၩ့အလဲၫ့လီၩ့လီၫ.- လ့ၩထီၩ့ ဝ့ၫလၧၥိၪအဖီၩ့လဖၪအီၪဝ့ၫ လၧဖၧၩ့ၥၭ,ထီးဆၧအိၩ ဖၧၩ့အီၪဝ့ၫတၭ, စစီလူၫလ့ၩနုၬဝ့ၫဘဲၫၥိၭအမိလုၬဘံၭ အခၪ့တၭ, စဒၫဝံၭဒဲအၡၩလဖၪ အီၪဝ့ၫလၧဆၧအိၩ",
			"4": "<sup>4</sup> ဖၧၩ့အခိၪထိၭလီၫ.- တၭစဒၫဝံၭအၡၩလဖၪစံၭအဝ့ၫ, ယိခွါ,မုလနံၩလၧယဟိဝၩစံၭနၧၩ, ယိခွါ, ယမိဖ့ၪ လၫ့ခွံၬနဒုၪနဒၩ လၧနစူၪဖၧၩ့ ဘဲၫၥိၭနမိမၩဝ့ၫထီးဒၪ အဂ့ၩလၧနမ့ၬယၫလီၫ. တၭစဒၫဝံၭဂဲထုၪ့တၭ, ကူၭ",
			"5": "<sup>5</sup> ထ့ၬၥူၪစစီလူၫ အဝိၬလိၫ့အခၪ့ထံၭလီၫ.- လၧခဲၫ့ထဲၩ့ တၭဆၧမၩအၥၭ လၧစဒၫဝံၭအၥၭအုၭထၪ့ဝ့ၫလၧအ",
			"6": "<sup>6</sup> ကူၭထ့ၬစစီလူၫအဝိၬလိၫ့ အခၪ့ထံၭအကၠီၩ့လီၫ.- တၭ စံၭအၡၩၥံၪ, မွဲယဟိဝၩထီးဒုၭမၩယၧၩ လၧဆၧလ မံၩ့ယီၩလၧယကဆါ, ယဟိဝၩအခ့ၫအၡၩဒိၭဂုၪအ ၥၭလၧယမိယၩ့ထၪ့ယစူၪ ထၫ့ဒုၪဒၩဝ့ၫနီၪလဂ့ၩ. အ",
			"7": "<sup>7</sup> ဂဲးဘဲၫယီၩမွဲယဟိဝၩ အၡၩဒိၭဂုၪအၥၭလီၫ.- စဒၫဝံၭ ပဒၩ့ထၬအၡၩ လၧဆၧချဲၩ့လဖၪနီၪတၭ, ဖ့ၪလၫ့အဂဲ ထုၪ့ထၫ့ဒုၪဒၩစစီလူၫအ့ၬ. စစီလူၫဂဲထုၪ့တၭ, စဲၪ့ထၪ့ ခွံၬလၧဆၧအိၩဖၧၩ့နီၪ, လ့ၩဖိၬအဖၧၩ့ၥၭလီၫ.",
			"8": "<sup>8</sup> လၧခဲၫ့ထဲၩ့စဒၫဝံၭဂဲထုၪ့ဆ့တၭ, စဲၪ့ထၪ့ခွံၬလၧဆၧ အိၩဖၧၩ့တၭ, ကိၭထွ့ၫစစီလူၫတၭ, စံၭဝ့ၫဒၪ, ယက ဆါစဎွၩဧ့း ထီးစစီလူၫယိထဲၩ့အလးခဲၫ့နီၪတၭ, စဒၫ",
			"9": "<sup>9</sup> ဝံၭၡီၫ့လၩ့အခိၪလၧဂၪ့ခိၪတၭထွံၩလၩ့ဝ့ၫလီၫ.- တၭ စဒၫဝံၭစံၭစစီလူၫ, နခိၭနၪၦၡၩအလူလၧအစံၭ,ယိခွါ,",
			"10": "<sup>10</sup> စဒၫဝံၭအၪ့ဎၬမၩအၧၩ့နၧၩနီၪ, မွဲဘၪလဲၪ.- ယိခွါ,ဆၧ လၧမုဆၫလနံၩယီၩ နမ့ၬၥၪဒၪဘၪလၧယဟိဝၩဖ့ၪလၫ့ ခွံၬနၧၩလၧယစူၪဖၧၩ့ လၧဆၧအိၩဖၧၩ့တၭ, ၦၡၩစံၭ, မၩၥံၫနၧၩ, မွဲလါနၫ့ယလီၫ့ကီၩ့နၧၩတၭ, ယစံၭယ ယၩ့ထၪ့ယစူၪထၫ့ဒုၪဒၩ ယကဆါအ့ၬ. အဂဲးဘဲၫ",
			"11": "<sup>11</sup> ယီၩမွဲယဟိဝၩအၡၩဒိၭဂုၪအၥၭလီၫ.- တၭ,ယဖါဧ့, ယိ,တၭယိခွါဘီၪ, နဝိၬလိၫ့အခၪ့ထံၭနီၪအီၪဝ့ၫလၧ ယစူၪဖၧၩ့လီၫ. မွဲယကူၭထ့ၬနဝိၬလိၫ့အခၪ့ထံၭတၭ, ယလမၩၥံၫဘၪနၧၩတၭ, ဆၧအၧၩ့, ဒဲဆၧမၪလအီၪ ဘၪလၧယစူၪဖၧၩ့, ဒဲယလမၩမၪဘၪနၧၩနီၪယိၥ့ၪယၫ နဝ့ၫဆံၭ. မွဲလါနၫ့ဘိၩ, နလီၩ့ယၥၭမၧၫ့ဘဲၫၥိၭနမိမၩ",
			"12": "<sup>12</sup> န့ဝ့ၫလီၫ.- မွဲယဟိဝၩစ့ၩရၫ့ဆၧလၧနၧၩဒဲယၧၩအဘိၩ့ ဆၧၩ့တၭ, ယဟိဝၩမၩဆၧၫ့နၧၩ လၧဆၧအၧၩ့လၧ",
			"13": "<sup>13</sup> ယဂးဆံၭ. အ့ၪမွဲယစူၪမိအီၪလၧနလီၩ့အ့ၬ.- ဘဲၫၦ မွံၩၦၡါအဆၧချဲၩ့ဒီၩ့စံၭဝ့ၫအၥိၭနီၪ, ဆၧအၧၩ့ဂဲၫထၪ့ လၧၦအၧၩ့ဖိၪလီၫ. အ့ၪမွဲယစူၪမိအီၪဘၪ လၧနလီၩ့",
			"14": "<sup>14</sup> အ့ၬ.- အံၫစရ့လၭအစဎွၩအၪ့ဎၬ ပလၫလဂၩလဲၪ. န လီၩ့ဆီးပလၫလဂၩလဲၪး မွဲထွံၪ ၥံၫလဒုၩဧၪး မွဲထွံၪ",
			"15": "<sup>15</sup> ချႃၫဧၪ.- အခိးမွဲဘဲၫနီၪတၭ, မွဲယဟိဝၩကဲၪထၪ့ၦ စ့ၩရၫ့ဆၧလၧယၧၩဒဲနၧၩအဘိၩ့ဆၧၩ့တၭ, ယိဆၧဒဲ ချဲၩ့န့ယခွးတၭ, မၩဖီၩ့မၩဖျ့ၭယၧၩလၧနစူၪဖၧၩ့နီၪဆံၭ.",
			"16": "<sup>16</sup> တၭစဒၫဝံၭချဲၩ့ဆၧချဲၩ့လဖၪနီၪ လၧစစီလူၫဂီၩ့တၭ, ဆၧမၩအၥၭလၧစစီလူၫစံၭဝ့ၫဒၪ, ယဖိၪခွၫစဒၫဝံၭဧ့,",
			"17": "<sup>17</sup> မွဲနလူဧၪ. စစီလူၫဒုၭၥီၫထၪ့အလူတၭဂၪ့ဝ့ၫလီၫ.- တၭ စံၭစဒၫဝံၭ, နတီၩနဲၪ့လီၩ့နဲၪ့ယၧၩဒံၭလီၫ. အဂဲးဘဲၫ ယီၩနဖ့ၪလၫ့ယၧၩလၧဆၧဂ့ၩ, အ့ၪမွဲယၧၩယီၩယဖ့ၪ",
			"18": "<sup>18</sup> လၫ့နၧၩလၧဆၧအၧၩ့လီၫ.- ဆၧလၧမုဆၫလနံၩယီၩ နဒုၭနဲၪလၧနမၩဂ့ၩယူၭယၧၩလီၫ. အဂဲးဘဲၫယီၩလၧ ယဟိဝၩဖ့ၪလၫ့ခွံၬယူၭယၧၩလၧနစူၪဖၧၩ့နီၪ နမၩၥံၫ",
			"19": "<sup>19</sup> ယၧၩအ့ၬ.- အဂဲးဘဲၫယီၩ ၦအ့ၪဒၪန့အဒုၪအဒၩတၭ, မိဖျါခွံၬဝ့ၫမုၬမုၬဆ့ဧၪ. တၭမွဲယဟိဝၩဖ့ၪလၫ့ကၪနၧၩ လၧဆၧဂ့ၩလၧဆၧလၧနမၩယၧၩ လၧမုဆၫလနံၩယီၩ",
			"20": "<sup>20</sup> အကၠီၩ့ဆံၭ.- တၭဘိၩ့နဲၪ့ယီၩ, ယိခွါ, ယၥ့ၪယၫလၩ့ ထံးလၩ့ဆ့ၭလၧနမိကဲၪစဎွၩတၭ, အံၫစရ့လၭအဘၩ့",
			"21": "<sup>21</sup> အမုးမိအီၪဂုးအီၪခၧၫ့လၧနစူၪဖၧၩ့လီၫ.- မၩအၥၭဘဲၫ နီၪတၭ, ဘိၩ့နဲၪ့ယီၩဆိၪလၩ့နၥၭလၧယၧၩလၧယဟိ ဝၩအမ့ၬယၫလၧနလဒၪ့ထ့ၬဘၪ ယချံၫယၥၪလၧယ လးခဲၫ့,ဒဲလၧနလမၩဂၭဂီၩ့ဘၪယမံၩ့ လၧယဖါအဂံၪ့ ဖၧၩ့ဘီၪ.",
			"22": "<sup>22</sup> တၭစဒၫဝံၭဆိၪလၩ့အၥၭလၧစစီလူၫလီၫ. တၭစစီ လူၫထဲၩ့ထဲၩ့ဝ့ၫလၧအဂံၪ့တၭ, စဒၫဝံၭဒဲအၡၩလဖၪ လ့ၩထၪ့ဝ့ၫလၧထိၬဖၧၩ့နီၪလီၫ."
		},
		"25": {
			"1": "<sup>1</sup> စစၫမုၫအ့လၭၥံၫဝ့ၫတၭ, ၦအံၫစရ့လၭဖိၪအီၪကိၩ့ အီၪကီၪ့တၭ, ဂၪ့ဝ့ၫလၧအကၠီၩ့တၭ, ခုၪ့လၩ့ဘၧၩ့ခွံၬ ဝ့ၫလၧအဂံၪ့အီၪလၧရၫမၫအဖၧၩ့နီၪလီၫ. တၭစဒၫဝံၭ ဂဲထုၪ့တၭ, လ့ၩလၩ့လၧၡါမုနၧၫ့ဖၫပၫရၫ့နီၪလီၫ.",
			"2": "<sup>2</sup> ၦလဂၩအီၪဝ့ၫလၧမၫအၧၫ့ လၧအစူၪလးအခၪ့ခိၪ အီၪထီးကၫမလၭအဖၧၩ့တၭ, ၦလဂၩနီၪမွဲၦအလၩဒိၪ အဖၩ့ဒိၪတၭ,အီၪလၧၥိၪလဖၪၥၧၫ့ထီၫ့, ဒဲဘ့ၪလဖၪလ ထီၫ့တၭ,မွဲအထံၬအၥိၪအဆီၪ့ လၧကၫမလၭအဖၧၩ့",
			"3": "<sup>3</sup> နီၪလီၫ.- တၭၦလဂၩနီၪအမံၩ့မွဲစနၫဘလၭတၭ,အမၫ အမံၩ့မွဲနးအၭဘဂၫလၭလီၫ. မွဲၦမုၪလၧအၥၭဆၭဂ့ၩ တၭ,အမ့ၬအခံးအဂၩ့ဎံၫလၩဝ့ၫလီၫ. အ့ၪမွဲၦခွၫလ ဂၩနီၪမွဲၦအကၪ, ဒဲမၩဆၧအၧၩ့တၭ, မွဲစကၫလ့ၭအ",
			"4": "<sup>4</sup> ၡၩဂံၪ့ဖိၪလီၫ.- တၭစဒၫဝံၭနါဂၧၫ့ဝ့ၫ လၧၡါမုနၧၫ့ဖၫ",
			"5": "<sup>5</sup> လၧစနၫဘလၭထံၬအၥိၪအဆီၪ့လီၫ.- စဒၫဝံၭအၪ့မၧၫ့ လၩ့ၦဖိၪၥၪခွၫဆံၫဂၩတၭ, စံၭၦဖိၪၥၪခွၫလဖၪနီၪ, လ့ၩထၪ့လၧကၫမလၭတၭ, လ့ၩလၧစနၫဘလၭအအီၪ",
			"6": "<sup>6</sup> ချဲၩ့ဒုၪ့အဝ့ၫလၧယမံၩ့ဆံၭ.- တၭနၥံၪမိဘၪစံၭၦလၧ အမၧၫ့နီၪဘဲၫယီၩ, မွဲဆၧဘၪလိၬအိၭလိၬအီၪလၧနၧၩ, ဒဲဆၧဘၪလိၬအိၭလိၬအီၪလၧနၡၩဂံၪ့ဖိၪ, ဒဲဆၧဘၪ",
			"7": "<sup>7</sup> လိၬအိၭလိၬအီၪလၧကယဲဆၧအီၪလၧနၧၩဆံၭ.- တၭ ဘိၩ့နဲၪ့ယီၩ ယနါဂၧၫ့လၧနအီၪ လၧၦထံၬၥိၪအဆီၪ့ လဖၪလီၫ. တၭဘိၩ့နဲၪ့ယီၩနၡၩယိၥိၪၥံၪလၧအအီၪ လၧပၥိၭနီၪ, ၦမၩအၧၩ့အဝ့ၫၥံၪအ့ၬ. တၭမုနံၩလၧ အအီၪဝ့ၫလၧကၫမလၭအလီၩ့ထီးအလူၬနီၪ, အဆၧ လၩ့မါဘၪနးမံၩ့အ့ၬ. အၪ့စၪ့နၡၩဖိၪၥၪခွၫလဖၪဘီၪ,",
			"8": "<sup>8</sup> တၭအဝ့ၫၥံၪမိဒုၭနဲၪနၧၩလီၫ.- တၭမွဲၦဖိၪၥၪခွၫလဖၪ ဘၪခိးဘၪတၩလၧနမ့ၬယၫဆံၭ. အဂဲးဘဲၫယီၩ ပဂဲၫ လၧမုအဂ့ၩလနံၩလီၫ. ဆၧလၧနစူၪဒၪန့ဘၪလဖၪနီၪ ဖ့ၪလၫ့လါနခ့ၫနၡၩ ဒဲနဖိၪခွၫစဒၫဝံၭနီၪဆံၭ.",
			"9": "<sup>9</sup> ထီးစဒၫဝံၭအၡၩဖိၪၥၪခွၫလဖၪ လ့ၩထီၩ့တၭ,လီၩ ဘၪစနၫဘလၭဘဲၫကယဲဆၧချဲၩ့ ထီးအလူၬအၥိၭနီၪ",
			"10": "<sup>10</sup> လၧစဒၫဝံၭအမံၩ့တၭ, အီၪထီဝ့ၫလီၫ.- စနၫဘလၭစံၭ ဆၧၫ့စဒၫဝံၭအခ့ၫအၡၩတၭ,စံၭဝ့ၫဒၪ, စဒၫဝံၭနီၪမွဲပ လၫလဂၩလဲၪ. စယ့ၭစံၫအဖိၪခွၫနီၪ မွဲပလၫလဂၩလဲၪ. လၧမုနံၩလဖၪယီၩ ဆၧအဎီးအၡၩ လၧအစဲၪ့ထၪ့ခွံၬ ဝ့ၫလၧအကဆါအအီၪနီၪ အီၪဝ့ၫအၪဂၩဆုၬဆုၬလီၫ.",
			"11": "<sup>11</sup> ၦလၧအဂဲၫခီၫခီၫလဲၪ, ခီၫခီၫလဲၪနီၪ, ယလၥ့ၪယၫဘၪ တၭ,ယမိမၩန့ယကိၪဒဲယထံၫ, ဒဲယဆၧယၪလၧယ မၩၥံၫဝ့ၫလၧယၡၩထံၬၥိၪအဆီၪ့အဂးနီၪတၭ, ဖ့ၪလၫ့",
			"12": "<sup>12</sup> အဝ့ၫၥံၪနီၪ, မွဲအကြၨၭဆ့ဧၪ.- တၭစဒၫဝံၭအၡၩဖိၪ ၥၪခွၫနီၪကၠၪထဲၩ့အၥၭ လၧအဖၧၩ့ၥၭတၭ, ထဲၩ့ထဲၩ့ ဝ့ၫတၭ,လီၩဘၪအဝ့ၫ လၧကယဲဆၧချဲၩ့ လဖၪနီၪ",
			"13": "<sup>13</sup> လီၫ.- တၭစဒၫဝံၭစံၭ အၡၩလဖၪ, ခဲးထၬနၥံၪအနၭ ကိၭအဂၩဒ့ၭဆံၭ. အဝ့ၫၥံၪ ခဲးထၬအနၭ ကိၭအဂၩ ဒ့ၭတၭ,စဒၫဝံၭခဲးထၬအနၭဆ့တၭ, ၦလ့ၩထၪ့ဖိၬစဒၫ ဝံၭအခဲၫ့ဖိၭဘိၭလံယၩတၭ, ၦနံၫယၩအီၪဝ့ၫလၧဆၧ ဖိၪဆၧလံၩလီၫ.",
			"14": "<sup>14</sup> တၭဖိၪၥၪခွၫလဂၩစံၭစနၫဘလၭအမၫ နးအၭဘဂၫ လၭ,ယိခွါ, စဒၫဝံၭအၪ့မၧၫ့လၩ့အၥီၫ့လဖၪ ဂဲၫလၩ့ လၧၡါမုနၧၫ့ဖၫနီၪ, ဘဲၫၥိၭအမိချဲၩ့ဒုၪ့ပကဆါတၭ,အ",
			"15": "<sup>15</sup> ဝ့ၫဒၪဒုၪဒွ့ၪဆၧလီၫ.- တၭၦၡၩလဖၪနီၪ မၩဂ့ၩပၧၩ ဒိၪမၬလီၫ.တၭကယဲမုနံၩ လၧအအီၪလၧပၥိၭထီးအ လူၬလၧပအီၪလၧမံၩ့လၬကျၩနီၪ, ပဒၪဘၪဆၧအၧၩ့",
			"16": "<sup>16</sup> အ့ၬ.- ဒဲပဆၧလၩ့မါနးမံၩ့ဆ့အ့ၬး အဝ့ၫၥံၪကဲၪထၪ့ ဆၧအဒီၪ့လၧပဂး, လၧမုဆၫဆၫမုနၩနၩကိၭမုနၩဒ့ၭ,",
			"17": "<sup>17</sup> လၧပယူၬၥိၪလၧအဝ့ၫၥံၪအၥိၭလီၫ.- ဘိၩ့နဲၪ့ယီၩယ ၥ့ၪယၫတၭ, ယိဆီၫ့မီၪ့လၧနမိမၩဘဲၫၥ့ၪလဲၪ,ဘဲၫၥ့ၪ လဲၪနီၪဆံၭ. အဂဲးဘဲၫယီၩ ဆၧကိၪ့ဆၧအၧၩ့ထၫ့ဒၩ ပကဆါ,ဒဲအၡၩဂံၪ့ဖိၪထီးအလူၬလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫမွဲၦဘၫအလၭဖိၪလဂၩ ထီးၦချဲၩ့ဒုၪ့ဘၪအဝ့ၫ ၥ့ၪအ့ၬ.",
			"18": "<sup>18</sup> ထီးနီၪလဖၧၫ့ နးအၭဘဂၫလၭမၩဆၧချဲၫ့ချဲၫ့တၭ, မၩန့ကိၪအလီၪ့နံၫယၩ, ဒဲစဘံၭထံၫဎွ့ၩထိၪ့ဆၧဖံၭနံၫ ဖျိၪ့,ဒဲၥိၪတဲၩ့ဝဲၩအၥၭယဲဒုၩ, ဒဲဘုၪဖီးယဲနၬ, ဒဲစဘံၭ ၥၪဎဲၫ့အဆူၭလယၩ, ဒဲချိၪ့ဒိၩ့ၥၪအလီၪ့ပၪပဲၪနံၫယၩ တၭ,အီၪက့ၪဝ့ၫ လၧကၥ့ၪယီၩ့လဖၪ အဖၫ့ခိၪလီၫ.",
			"19": "<sup>19</sup> တၭစံၭအခ့ၫအၡၩနီၪ လ့ၩလၧယမ့ၬယၫဆံၭ. တၭယိ ခွါ,ယဂဲၫလၧနၥံၪအလးခဲၫ့လီၫ. တၭဒုၭနဲၪအဝၩစနၫ",
			"20": "<sup>20</sup> ဘလၭအ့ၬ.- ထူၬကၥ့ၪယီၩ့တၭ, ဆၧမၩအၥၭလၧအ လ့ၩလၩ့လၧအလးကဒုၩလၧခိၪလီၩ့တၭ, ယိခွါ,စဒၫ ဝံၭဒဲအၡၩလဖၪနီၪဂဲၫထၫ့ဒၩဝ့ၫတၭ, ၦမုၪနီၪဘၪခီၩ့ အဝ့ၫၥံၪလီၫ.",
			"21": "<sup>21</sup> စဒၫဝံၭစံၭယူၭ,မွဲမၬ, ယယိကယဲၦလဂၩယီၩအ ဆၧဖိၪဆၧလံၩ လၧမံၩ့လၬကျၩထီးအဆၧလလၩ့မါ ဘၪနးမံၩ့ပျီၩပျီၩလီၫ. တၭအဝ့ၫ ဖ့ၪလၫ့ယၧၩဆၧ",
			"22": "<sup>22</sup> အၧၩ့လၧဆၧဂ့ၩအဂးလီၫ.- လၧကယဲဆၧလၧအဘၪ ဆဲၫ့လၧအဝ့ၫအကျၩနီၪ, ထီးဆၧဖၩ့ထၪ့တၭ, ယအ့ၪ အီၪက့ၪလၩ့ထးၦအခွၫလဂၩဂၩနီၪ, မွဲယွၩမၩစဒၫဝံၭ အဒုၪအဒၩလဖၪဘဲၫနီၪ, ဒဲအၪနဲၪ့အနီၪဆံၭ.",
			"23": "<sup>23</sup> ထီးနးအၭဘဂၫလၭ ဒၪဘၪစဒၫဝံၭတၭ, မၩဝ့ၫချဲၫ့ ချဲၫ့တၭ,စဲၪ့လၩ့လၧကၥ့ၪယီၩ့အလီၩ့ ၡီၫ့လၩ့အၥၭ",
			"24": "<sup>24</sup> လၧစဒၫဝံၭအမ့ၬယၫတၭ, ထွံၩလၩ့,- တၭၡီၫ့လၩ့အ ၥၭလၧအခၪ့ထံၭတၭ,စံၭဝ့ၫဒၪ, မွဲဆၧအၧၩ့လမံၩ့ယီၩ ဘၪယၧၩဆံၭး ကဆါဧ့, ဒုၭချဲၩ့လါနဎီးမုၪ လၧနနါ",
			"25": "<sup>25</sup> ဖၧၩ့တၭ,ခိၭနၪနဎီးမုၪအဆၧချဲၩ့နးထံၪဘီၪ.- မွဲယက ဆါထီးထီးနဲၪ့ၦဘၫအလၭဖိၪ စနၫဘလၭလဂၩနီၪလ ဂ့ၩ.အဂဲးဘဲၫယီၩ ဘဲၫအမံၩ့အၥိၭ, အနၫ့ဆါမွဲဘဲၫ နီၪၥိၭလီၫ.အမံၩ့မွဲနၫဘလၭတၭ, ဆၧဂီၩ့အီၪလၧအ ဝ့ၫဒၪလီၫ. အ့ၪမွဲနဎီးမုၪယဝ့ၫဒၪယီၩ,ယကဆါအၡၩ",
			"26": "<sup>26</sup> ဖိၪၥၪခွၫလၧနအၪ့မၧၫ့လၩ့ဝ့ၫနီၪယဒၪဘၪအ့ၬ.- တၭ ဘိၩ့နဲၪ့ယီၩယကဆါဧ့, ယဟိဝၩမၧၫ့ဝ့ၫ, ဒဲနၥၭမၧၫ့ ဝ့ၫ,ဒဲယဟိဝၩပဒၩ့ထၬယူၭနၧၩ, ဘဲၫၥိၭနထီးဂဲၫလၧ ဆၧၥွံၪလဂ့ၩ ဒဲဆၧကိၪ့မၩအၧၩ့နၧၩနီၪ, နထီးမၩဆၧၫ့ လၧနစူၪဒၪနဝ့ၫလဂ့ၩတၭ, ဘိၩ့နဲၪ့ယီၩနဒုၪနဒၩ,ဒဲၦ လၧအအၪ့ဎၬဆၧအၧၩ့ လၧယကဆါအဂးလဖၪနီၪ,",
			"27": "<sup>27</sup> မွဲအမၩအၥၭဘဲၫစနၫဘလၭအၥိၭနီၪဆံၭ.- တၭဘိၩ့ နဲၪ့ယီၩဆၧဆိၪဂ့ၩလၧနဎီးမုၪ ဂဲၫဆိၬလၧယကဆါ အအီၪယီၩ,ဒုၭမၩန့လၧၦဖိၪၥၪခွၫ လၧအဖိၬယကဆါ",
			"28": "<sup>28</sup> အခဲၫ့လဖၪနီၪအဂးဆံၭ.- ဖျါခွံၬလါနဎီးမုၪအဆၧမၪ ဆံၭ.အဂဲးဘဲၫယီၩ, ယဟိဝၩမၩယကဆါအဂံၪ့ခၧၫ့ အဎၫ့ခၧၫ့တၡါလီၫ. အဂဲးဘဲၫယီၩယကဆါဒုၭယဟိ ဝၩအဆၧဒုၭလဖၪတၭ, ဆၧဒၪန့ဆၧအၧၩ့ လၧနစူၪ",
			"29": "<sup>29</sup> ဖၧၩ့လၧနနံၩနၥၫ့အဖၧၩ့အ့ၬ.- မွဲလါနၫ့ၦလဂၩဂဲထုၪ့ တၭ,လီၩ့ဆီးနၧၩနီၪ, အၪ့ဎၬနၥၭမၧၫ့လီၫ. မွဲလါနၫ့ ယကဆါအၥၭမၧၫ့မိအီၪဘီၪ့ထၬအၥၭ လၧဆၧမၧၫ့အ ဆၧဘီၪ့ဖၧၩ့အီၪလၧယဟိဝၩနယွၩအၥိၭလီၫ. အ့ၪမွဲ နဒုၪနဒၩအၥၭမၧၫ့လဖၪနီၪ, မိခွံၬထၪ့ခွံၬဝ့ၫဘဲၫလၧဖ",
			"30": "<sup>30</sup> လီအၥၭခံဖၧၩ့အၥိၭနီၪလီၫ.- တၭထီးယဟိဝၩမၩယ ကဆါဘဲၫကယဲဆၧဂ့ၩ လၧအချဲၩ့ဆၧလၧနဂဲးနကၠီၪ့ အၥိၭနီၪ,ဒဲအီၪက့ၪထၪ့ယူၭနၧၩ ၦပၧၩ့အံၫစရ့လၭဂီၩ့",
			"31": "<sup>31</sup> တၭ,- ဆၧမိမၩအၥၭလၧအလးလအီၪဘၪတၭ, နလ ဂါလၩ့ဘၪဆၧၥွံၪမွဲဂ့ၩ, ယကဆါလမၩဆၧၫ့ဘၪဆၧ အၧၩ့လၧအနၫ့ဆါဒၪဝ့ၫမွဲဂ့ၩ, ဆၧယီၩလကဲၪထၪ့ဘၪ ဆၧဘၪထၧၩ့ဘၪထံၭအလးမွဲဂ့ၩ, ဆၧၥုၪ့ခိၥၭဝီၩအ လးမွဲဂ့ၩလၧယကဆါအဂးနီၪ, အ့ၪမွဲထီးယဟိဝၩ အ့ၪမၩဂ့ၩယကဆါအထီနီၪတၭ, ထီးနီၪလဖၧၫ့နၪ့ ထၪ့ထဲၩ့နကဆါအဎီးမုၪဆံၭ.",
			"32": "<sup>32</sup> တၭစဒၫဝံၭစံၭနးအၭဘဂၫလၭ, မွဲယဟိဝၩအံၫစရ့ လၭအယွၩလၧအအၪ့မၧၫ့နဂဲၫဆီးယၧၩ လၧမုဆၫလ နံၩယီၩဘၪဆၧစံၭထၪ့အၪ့အူၭဝ့ၫဆံၭ.-",
			"33": "<sup>33</sup> နဆၧကိၪ့နီၪ မွဲအဘၪဆၧဆိၪဂ့ၩဆံၭ. ၦပဒၩ့ထၬယဂဲၫလၧဆၧၥွံၪ, ဒဲယနၫ့ဆါမၩဆၧၫ့ဆၧအၧၩ့ လၧယစူၪဒၪယဝ့ၫလၧမု ဆၫလနံၩယီၩ,နဝ့ၫဒၪလဂၩ, မွဲနဘၪဆၧဆိၪဂ့ၩဆံၭ.",
			"34": "<sup>34</sup> တၭယဟိဝၩအံၫစရ့လၭအယွၩ မၧၫ့ဝ့ၫလၧအပဒၩ့ယ မၩအၧၩ့နၧၩနီၪ, မွဲတၡါလၩ့ထံးလၩ့ဆ့ၭနအ့ၪလဂဲၫ ဆီးဘၪယၧၩချဲၫ့ချဲၫ့တၭ, မွဲမၬထီးဆၧဖၩ့ထၪ့နီၪ,ဆၧ ဘၪဆဲၫ့လၧစနၫဘလၭၦအခွၫၥံၪ လၧအအီၪဖျဲၪလၧ",
			"35": "<sup>35</sup> အဂးနီၪ,အီၪလၩ့ထးဘၪနးဂၩအ့ၬ.- စဒၫဝံၭမၩန့ဆၧ လၧအဝ့ၫနီၪဂဲၫဆိၬ လၧအစူၪဖၧၩ့တၭ,စံၭဝ့ၫထဲၩ့ထဲၩ့ လၧနဂံၪ့မုၬမုၬဆံၭ. ယိခွါ,ယခိၭနၪယူၭနလူ, ဒဲယထိး ဆၧၫ့ယူၭနနၫ့ဆါယူၭ.",
			"36": "<sup>36</sup> နးအၭဘဂၫလၭ ထဲၩ့ထဲၩ့လၧစနၫဘလၭ အအီၪ တၭ,ယိခွါ, အဝ့ၫမၩဆၧအၪ့ဆၧအီၩလၧအဂံၪ့ဖၧၩ့, ဘဲၫစဎွၩအဆၧအၪ့ဆၧအီၩအၥိၭနီၪတၭ, စနၫဘလၭ ၥၭဎွံၫလၧအဖၧၩ့နီၪး အဂဲးဘဲၫယီၩ အီၩမၧၩ့အၥၭဒိၪ မၬလီၫ.အခိးမွဲဆၧအဆံၭမွဲဂ့ၩ, ဆၧအဒိၪမွဲဂ့ၩ, မု လချႃၭဆဲၪ့ထၪ့ဒံၭဘၪနီၪ လီၩဘၪအဝ့ၫ လၧဆၧနး မံၩ့အ့ၬ.",
			"37": "<sup>37</sup> အ့ၪမွဲထီးမုဆဲၪ့ထၪ့နီၪ ထီးစဘံၭထံၫစဲၪ့ထၪ့ခွံၬလၧ စနၫဘလၭအဖၧၩ့တၭ, ဆၧမၩအၥၭ လၧအမၫလီၩ ဘၪဝ့ၫလၧဆၧလဖၪနီၪ ထီးအလူၬတၭ, အၥၭၥံၫဝ့ၫ လၧအဖၧၩ့တၭ, ကဲၪထၪ့ဝ့ၫဘဲၫလိးအၥိၭနီၪလီၫ.",
			"38": "<sup>38</sup> လၧခဲၫ့ဖိၭဘိၭဆံၫနံၩနီၪ, ဆၧမၩအၥၭ လၧယဟိ",
			"39": "<sup>39</sup> ဝၩကျီၪ့စနၫဘလၭတၭ, ၥံၫဝ့ၫဒၪလီၫ.- ထီးစဒၫဝံၭနါ ဂၧၫ့လၧစနၫဘလၭၥံၫဝ့ၫတၭ, စံၭဝ့ၫဒၪ,ယဟိဝၩလၧ အချဲၩ့ခွးဘၪဆဲၫ့ လၧဆၧဒုၪဒွ့ၪယၧၩ လၧစနၫဘလၭ အစူၪဖၧၩ့,ဒဲပဒၩ့အခ့ၫအၡၩ မၩဆၧအၧၩ့လဂၩနီၪ,မွဲ အဘၪဆၧစံၭထၪ့အၪ့အူၭဝ့ၫဆံၭ. အဂဲးဘဲၫယီၩယ ဟိဝၩဒုၭဘၪထဲၩ့ယူၭစနၫဘလၭ အဆၧအၧၩ့လၧအ ခိၪဒၪဝ့ၫအလီၩ့လီၫ. တၭစဒၫဝံၭအၪ့မၧၫ့ ၦလ့ၩချဲၩ့ ဆၧလၧနးအၭဘဂၫလၭ လၧအမိမၩန့ဝ့ၫလၧအမၫအ ဂဲးအကၠီၪ့လီၫ.",
			"40": "<sup>40</sup> ထီးစဒၫဝံၭအခ့ၫအၡၩ ဂဲၫလၧနးအၭဘဂၫလၭအ အီၪလၧကၫမလၭအဖၧၩ့တၭ, ချဲၩ့ဆၧလၧအဝ့ၫတၭ, စံၭဝ့ၫဒၪ, စဒၫဝံၭအၪ့မၧၫ့ပဂဲၫ လၧနအီၪဘဲၫၥိၭဆၧမိ",
			"41": "<sup>41</sup> မၩနၧၩလၧအဝ့ၫဒၪအမၫအဂးလီၫ.- ၦမုၪနီၪဂဲထုၪ့ ၡီၫ့လၩ့အမ့ၬထီၩ့လၧဂၪ့ခိၪတၭ, စံၭဝ့ၫဒၪ, ယိခွါ,အီၪ က့ၪနဎီးမုၪ လၧၦၥူၫဝၭယကဆါအခ့ၫအၡၩၥံၪအခၪ့",
			"42": "<sup>42</sup> နီၪဘီၪ.- နးအၭဘဂၫလၭဂဲထုၪ့ချဲၫ့ချဲၫ့တၭ, ထူၬကၥ့ၪ ယီၩ့,အီၪလၧအဖိၪၥၪမုၪယဲဂၩ လၧအဖိၬအခဲၫ့တၭ, ထဲၩ့ဖိၬစဒၫဝံၭအၥီၫ့ၥံၪအခဲၫ့တၭ, ကဲၪထၪ့ဝ့ၫလၧအ",
			"43": "<sup>43</sup> မၫလီၫ.- တၭစဒၫဝံၭမၩန့ၦယ့ၭစရ့လၭဖိၪ နးအဟံၫ့ နိၫအၫ့တၭ, အဝ့ၫၥံၪကဲၪထၪ့အမၫနံၫဂၩလူၬလီၫ.",
			"44": "<sup>44</sup> အ့ၪမွဲစစီလူၫဖ့ၪလၫ့ယူၭအဖိၪမုၪနးမဲခၫလၭ, စဒၫဝံၭ အမၫ,လၧၦဂၫလံၫ့ဖိၪစလၫအံၭအဖိၪခွၫ စဖၫလတဲၫ နီၪလီၫ."
		},
		"26": {
			"1": "<sup>1</sup> ၦဇံဖၭဖိၪဂဲၫဝ့ၫလၧစစီလူၫအအီၪ လၧဂံၭဘအၫ အဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, စဒၫဝံၭအီၪက့ၪၥူၪအၥၭလၧခိၪ လီၩ့ဟၭခဲၫလၫအလီၩ့ လၧအအီၪလၧယ့ၭၡမၧၫ့အ",
			"2": "<sup>2</sup> မ့ၬယၫမွဲအ့ၬဧၪ.- ထီးနီၪလဖၧၫ့ စစီလူၫဂဲထုၪ့တၭ, လ့ၩလၩ့လၧၡါမုနၧၫ့ဖၫဇံဖၭအီၪဝ့ၫ လၧၦဘၪဆၧရွံန့ ဝ့ၫလၧအံၫစရ့လၭအကျၩၥၧၫ့ထီၫ့, ဘဲၫၥိၭအမိအၪ့ဎၬ",
			"3": "<sup>3</sup> စဒၫဝံၭလၧၡါမုနၧၫ့ဖၫဇံဖၭလီၫ.- တၭစစီလူၫၥုၪ့တဲၩ လၧခိၪလီၩ့ဟၭခဲၫလၫအလီၩ့ လၧအအီၪလၧယ့ၭၡ မၧၫ့အမ့ၬယၫလၧဖၧၩ့ၥၭလီၫ. အ့ၪမွဲစဒၫဝံၭအီၪလၧ မံၩ့လၬကျၩတၭ, ဒၪဘၪဝ့ၫလၧစစီလူၫဂဲၫလီၩ့ဆီးဝ့ၫ",
			"4": "<sup>4</sup> လၧမံၩ့လၬကျၩနီၪလီၫ.- တၭစဒၫဝံၭအၪ့မၧၫ့လၩ့ၦ လ့ၩယိၥူၪဆၧတၭ, ၥ့ၪယၫဝ့ၫလၧစစီလူၫဂဲၫတၡါလီၫ.",
			"5": "<sup>5</sup> စဒၫဝံၭဂဲထုၪ့တၭ, ဂဲၫထီၩ့ဆၧအလးလၧစစီလူၫ ၥုၪ့တဲၩတၭ,စဒၫဝံၭဒၪဘၪဆၧအလးထီးစစီလူၫ, ဒဲၦ ၥုၭမုအခိၪစနၧၫအဖိၪခွၫစအၭဘနၧၫမံၫဝ့ၫတၭ, စစီလူၫ မံၫလၧအဝၩ့ဖၧၩ့တၭ, ၦခမျၧးၥုၪ့တဲၩဝၬဖီၩ့ဝ့ၫလီၫ.",
			"6": "<sup>6</sup> ထီးနီၪလဖၧၫ့စဒၫဝံၭချဲၩ့ဆၧတၭ, စံၭၦဟံၥၭဖိၪစအ ဟံမလ့ၭ,ဒဲနးဇ့ၫရုၫအဲအၫအဖိၪခွၫ စယိအၭအထၧၫ့ ဖုဝဲစအၭဘၡဲၫတၭ, စံၭဝ့ၫဒၪ,မွဲပလၫမိလ့ၩလၧယၥိၭ လၧစစီလူၫအအီၪလၧၦၥုၪ့တဲၩ အလးဖၧၩ့နီၪလဂၩ လဲၪ.တၭစအၭဘၡဲၫစံၭဝ့ၫဒၪ, ယမိလ့ၩယဝ့ၫလၧန ၥိၭလီၫ.",
			"7": "<sup>7</sup> အခိးမွဲစဒၫဝံၭ ဒဲစအၭဘၡဲၫဂဲၫလၧၦခမျၧးအအီၪ လၧမုနၩလခီၫတၭ,ယိခွါ, စစီလူၫမံၫမၪလၧအဝၩ့ဖၧၩ့ တၭ,အဖၩ့လဘံၪ့ဆ့ၭလၩ့အၥၭလၧ ဂၪ့ခိၪဖၧၩ့လၧအ ခိၪခုၪ့အနဲၩ့တၭ, စအၭဘနၧၫဒဲၦခမျၧးမံၫဝၬဖီၩ့ဝ့ၫ",
			"8": "<sup>8</sup> လီၫ.- ထီးနီၪလဖၧၫ့စအၭဘၡဲၫစံၭစဒၫဝံၭ ဆၧလၧမု လနံၩယီၩယွၩဖ့ၪလၫ့ခွံၬ နဒုၪနဒၩ လၧနစူၪဖၧၩ့လီၫ. တၭဘိၩ့နဲၪ့ယီၩယအၪ့ယၫနၧၩ ဒုၭဆ့ၭလါယၧၩလၧ အဝ့ၫလၧဖၩ့ထီးအဘုၭထၬလၧဂၪ့ခိၪ လထံၪဎးဆံၭး",
			"9": "<sup>9</sup> တၭယမိဆ့ၭထဲၩ့ဝ့ၫနံၫထံၪလထံၪအ့ၬ.- တၭစဒၫဝံၭ စံၭစအၭဘၡဲၫ, ထီးမၩဂၭဂီၩ့အဝ့ၫလဂ့ၩ, အဂဲးဘဲၫ ယီၩၦလၧအယၩ့ထၪ့အစူၪ လၧၦလၧအဒိၭဂုၪအၥၭ လဂၩနီၪအဖၫ့ခိၪတၭ, အဆၧဒဲၩဘၭလအီၪဘၪနီၪမွဲ",
			"10": "<sup>10</sup> ပလၫလဂၩလဲၪ.- တၭစဒၫဝံၭစံၭဒံၭ, ယဟိဝၩမၧၫ့ဝ့ၫ, ယဟိဝၩမိဖ့ၬခွံၬဝ့ၫလီၫ. မုနံၩလၧအၥံၫမိဘၪဝ့ၫနီၪ, အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, မိလ့ၩလၩ့လၧဆၧဒုၭၥုၭအ",
			"11": "<sup>11</sup> ကျၩတၭ,မိဂၭဂီၩ့ဂၭစၪလီၫ.- ယယၩ့ထၪ့ယစူၪထၫ့ ဒုၪဒၩယဟိဝၩအၡၩဒိၭဂုၪအၥၭလဂၩနီၪ, မွဲယဟိဝၩ ပဒၩ့ထၬဆံၭ. အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ မၩန့လါဖၩ့နီၪလ ဘံၪ့လၧအအီၪလၧအခိၪခုၪ့အနဲၩ့ထံၭ ဒဲထံၫပလၫ့လ",
			"12": "<sup>12</sup> ဖျိၪ့နီၪတၭ,ပမိထဲၩ့ထဲၩ့ၡီၩ့ဘီၪ.- အခိးမွဲစဒၫဝံၭမၩန့ ဖၩ့လဘံၪ့, ဒဲထံၫပလၫ့လဖျိၪ့လၧစစီလူၫအခိၪခုၪ့နဲၩ့ တၭ,ထဲၩ့ထဲၩ့ဝ့ၫနီၪၦဒၪဘၪဝ့ၫမွဲဂ့ၩ, ၥ့ၪယၫဝ့ၫမွဲဂ့ၩ, နၪ့အၥၭမွဲဂ့ၩ, နးဂၩအ့ၬး အဂဲးဘဲၫယီၩအဝ့ၫၥံၪမံၫ မၪဝ့ၫကိၭဂၩဒ့ၭလီၫ. အဂဲးဘဲၫယီၩ ဆၧမံၫမၪယိၬ လၧယဟိဝၩနီၪ ဂဲၫလၩ့ဘၪအဝ့ၫၥံၪလီၫ.",
			"13": "<sup>13</sup> စဒၫဝံၭလ့ၩထၪ့ဝ့ၫလၧဝါလခီၫတၭ, ဆၧၫ့ထုၪ့လၧ ခိၪလီၩ့ဒၩ့ခိၪအီၪဝ့ၫယဲၩ့ယိၬး အလးဖၭလဲအီၪဝ့ၫလၧ",
			"14": "<sup>14</sup> အဝ့ၫၥံၪအဘိၩ့ဆၧၩ့နီၪလီၫ.- စဒၫဝံၭကိၭထၪ့ၦခမျၧး, ဒဲၦၥုၭမုအခိၪစနၧၫအဖိၪခွၫ စအၭဘနၧၫတၭ, စံၭဝ့ၫ ဒၪ,စအၭဘနၧၫဧ့, နစံၭဆၧၫ့အ့ၬဧၪ. ထီးနီၪလဖၧၫ့ စအၭဘနၧၫစံၭဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, ၦလၧအကိၭ",
			"15": "<sup>15</sup> ထၪ့စဎွၩနဝ့ၫဒၪယီၩနမွဲပလၫလဂၩလဲၪ.- တၭစဒၫဝံၭ စံၭစအၭဘနၧၫ, နမွဲၦခွၫလမွဲဘၪဧၪ. တၭလၧအံၫစရ့ လၭအဆၨၩကျၩနီၪ မွဲပလၫလၩ့ဂၬဘဲၫနၧၩအၥိၭလ ဂၩလဲၪ.နကဆါစဎွၩနီၪ, နလအီၪခိၭဘၪ မွဲဘၪလဲၪ. အဂဲးဘဲၫယီၩ ၦလၧၦခမျၧးအကျၩလဂၩ ဂဲၫနုၬဘဲၫ",
			"16": "<sup>16</sup> ၥိၭအမိမၩဂၭဂီၩ့နကဆါစဎွၩလီၫ.- ဆၧလၧနမၩလ မံၩ့နီၪဂ့ၩအ့ၬ. ယဟိဝၩမၧၫ့ဝ့ၫနၥံၪကြၨၭၥံၫလီၫ. အ ဂဲးဘဲၫယီၩနၥံၪအီၪခိၭနၥံၪအကဆါ ယဟိဝၩအၡၩ ဒိၭဂုၪအၥၭလဂၩနီၪအ့ၬ. တၭဘိၩ့နဲၪ့ယီၩ, စဎွၩအ ဖၩ့,ဒဲထံၫပလၫ့လဖျိၪ့ လၧအအီၪဝ့ၫလၧအခိၪခုၪ့အ နဲၩ့ထံၭနီၪမွဲအအီၪခီၫခီၫလဲၪ, ယိခွါဘီၪ.",
			"17": "<sup>17</sup> စစီလူၫၥ့ၪယၫစဒၫဝံၭအလူတၭ, စံၭဝ့ၫဒၪ,အယီၩမွဲ နလူဧၪ, ယဖိၪခွၫစဒၫဝံၭဧ့း တၭစဒၫဝံၭစံၭဝ့ၫဒၪ, ယ",
			"18": "<sup>18</sup> ကဆါစဎွၩဧ့, မွဲယလူလီၫ.- တၭစံၭဝ့ၫဒၪ,ယကဆါ လီၩ့အခ့ၫအၡၩဘဲၫနီၪ မွဲဘၪလဲၪ. အဂဲးဘဲၫယီၩမွဲ ယမၩဆၧနီၪလမံၩ့လဲၪး ဒဲဆၧအၧၩ့အီၪလၧယစူၪဖၧၩ့",
			"19": "<sup>19</sup> မွဲဆၧနီၪလမံၩ့လဲၪ.- တၭဘိၩ့နဲၪ့ယီၩ မွဲစဎွၩယက ဆါခိၭနၪလါအခ့ၫအၡၩအလူဆံၭ. ယဟိဝၩအ့ၪထိၪ ဂဲၩနၧၩထၫ့ဒုၪဒၩယၧၩတၭ မွဲအထိးဆၧၫ့ဆၧမၩဘိၪ့ ဆံၭ. အ့ၪမွဲၦၡၩဖိၪခွၫတၭ, ဘၪဆၧဆိၪအၧၩ့လၧယ ဟိဝၩအမ့ၬယၫဆံၭ အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪနၫ့ထၪ့ ခွံၬယူၭယၧၩလၧမုဆၫလနံၩယီၩ လၧယဟိဝၩအဆၧ န့ၥၫအဖၧၩ့တၭ, စံၭဝ့ၫ, လ့ၩမၩယွၩအဂူၫဂၩအဆၧ",
			"20": "<sup>20</sup> ဆံၭ.-တၭဘိၩ့နဲၪ့ယီၩမွဲယၥွံၪထီးလၩ့ဘၪလၧဂၪ့ခိၪ ချိၫ့လၧယဟိဝၩအမ့ၬယၫလဂ့ၩး အဂဲးဘဲၫယီၩအံၫ စရ့လၭအစဎွၩဂဲၫအၪ့ဎၬထွံၪချႃၫလဘံၪ့ ဘဲၫၦလ့ၩ လီၩ့ထိၪဝံၪလၧခိၪလီၩ့ အလီၩ့အၥိၭနီၪလီၫ.",
			"21": "<sup>21</sup> တၭစစီလူၫစံၭဝ့ၫဒၪ, ယမၩမၪဘၪယူၭဆၧယူၭ, ထဲၩ့ထဲၩ့ဆံၭ. ယဖိၪခွၫစဒၫဝံၭဧ့, အဂဲးဘဲၫယီၩယ မၩအၧၩ့လၧၩ့နၧၩအ့ၬ. အဂဲးဘဲၫယီၩ ယၥၭမၧၫ့မွဲဆၧ လူဒိၪဎွ့ၩဒိၪ လၧနမ့ၬယၫ လၧမုဆၫလနံၩယီၩလီၫ. ယိခွါ,ယကဲၪယူၭၦဂီၩ့ဖိၪတၭ, မၩမၪဘၪဆၧဒိၪမၬ",
			"22": "<sup>22</sup> လီၫ.- စဒၫဝံၭစံၭဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ,ယိစဎွၩအဖၩ့ ဘီၪ,ဒုၭဂဲၫစိၩၦဖိၪၥၪခွၫနးဂၩ ဘဲၫၥိၭအမိဂဲၫမၩန့ဝ့ၫ",
			"23": "<sup>23</sup> ဘီၪ.- တၭမွဲယွၩဖ့ၪဆၧၫ့ၦအဆၧတီၩဆၧလီၩ့ဒဲအလူ တီၩကိၭဂၩဒ့ၭဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩဖ့ၪလၫ့ နၧၩလၧယစူၪဖၧၩ့လၧမုဆၫလနံၩယီၩလါနၫ့ဘိၩ,ယ ယၩ့ထၪ့ယစူၪလၧယဟိဝၩအၡၩ ဒိၭဂုၪအၥၭလဂၩ",
			"24": "<sup>24</sup> အလီၩ့အ့ၬ.- တၭယိခွါ, ဘဲၫဆၧအီၪက့ၪဒိၪနၥၭမၧၫ့ လၧမုဆၫလနံၩယီၩ လၧယမ့ၬယၫအၥိၭနီၪတၭ, ဘဲၫ နီၪအၥိၭမွဲဆၧအီၪက့ၪဒိၪယၥၭမၧၫ့ လၧယဟိဝၩအ မ့ၬယၫ,ဒဲမၩဖီၩ့မၩဖျ့ၭယၧၩ လၧကယဲဆၧၡၪ့ဆၧနၭ ထီးအလူၬဆံၭ.",
			"25": "<sup>25</sup> တၭစစီလူၫစံၭစဒၫဝံၭ, ယဖိၪခွၫစဒၫဝံၭဧ့,မွဲနဘၪ ဆၧဆိၪဂ့ၩဆံၭ. နမိမၩဆၧအဒိၪအယိၬတၭ, မၩစၪ ဒံၭဆၧလီၫ. တၭစဒၫဝံၭလ့ၩဆၧတၭ, စစီလူၫထဲၩ့ထဲၩ့ ဝ့ၫလၧအလးဒၪဝ့ၫနီၪလီၫ."
		},
		"27": {
			"1": "<sup>1</sup> တၭစဒၫဝံၭစံၭဝ့ၫလၧအၥၭခံဖၧၩ့, လၧမုလနံၩနံၩ နီၪယၥၭမိလူၬ လၧစစီလူၫအစူၪဖၧၩ့လီၫ. ဆၧအဂ့ၩ လၧယဂးအီၪန့ၫယစဲၪ့ဖီၩ့ဖျ့ၭဆၧချဲၫ့ချဲၫ့ ထီၩ့လၧၦဖ လံၡၫဖိၪအခးဖၧၩ့လီၫ. တၭစစီလူၫမိယိလါလၧၩ့ယ ဖၧၩ့ၥၭအ့ၬ. မွဲအအၪ့ဎၬလၧၩ့ယၧၩ လၧအံၫစရ့လၭ အခးနဲၩ့ထံၭလဖၪအ့ၬ. တၭယမိဖီၩ့ဖျ့ၭလၧအစူၪဖၧၩ့",
			"2": "<sup>2</sup> လီၫ.- စဒၫဝံၭဂဲထုၪ့တၭ, လ့ၩခၫ့ဂၬဆၧလၧၦၡၩဎူၫ ယၩလၧအအီၪ လၧအၥိၭဖိးလၧဂၫၥၭအစဎွၩစမၫ",
			"3": "<sup>3</sup> အီၭအဖိၪခွၫစအၫခ့ၭအအီၪလီၫ.- စဒၫဝံၭအီၪဝ့ၫလၧ စအၫခ့ၭလၧဂၫၥၭအဖၧၩ့, အဝ့ၫဒၪဒဲအၡၩလဖၪ, လ ဂၩလၧအၡၩဂံၪ့ဖိၪ, လဂၩလၧအၡၩဂံၪ့ဖိၪလီၫ. တၭ စဒၫဝံၭအီၪ လၧအမၫနံၫဂၩ, ၦယ့ၭစရ့လၭဖိၪ နးအ ဟံၫ့နိၫအၫ့ ဒဲၦကၫမလ့ၭဖိၪ နးအၭဘဂၫလၭ စနၫဘ",
			"4": "<sup>4</sup> လၭအမၫနီၪလီၫ.- ၦလီၩဘၪစစီလူၫလၧစဒၫဝံၭစဲၪ့ထၪ့ ဖိးလၧဂၫၥၭအဖၧၩ့တၭ, အဝ့ၫဒၪအၪ့ဎၬလၧၩ့ဝ့ၫအ့ၬ.",
			"5": "<sup>5</sup> စဒၫဝံၭစံၭစအၫခ့ၭ ယအ့ၪဘၪခိးဘၪတၩလၧနမ့ၬ ယၫတၭ, ဖ့ၪလၫ့ယလးလၧတဝၫ့ဖၧၩ့ လၧမံၩ့လၬကျၩ လစီၪ့စီၪ့, ဘဲၫၥိၭယမိအီၪဘၪထီးနီၪဆံၭ. အဂဲးဘဲၫ ယီၩနခ့ၫနၡၩမိအီၪလၧနၥိၭ လၧစဎွၩအဒိၩ့ဖၧၩ့နီၪ, မွဲ",
			"6": "<sup>6</sup> ဘၪလဲၪ.- ထီးနီၪလဖၧၫ့ စအၫခ့ၭ ဖ့ၪလၫ့ဝ့ၫလၧဇံ လၭလၧမုလနံၩနီၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဇံလၭ ဘၪဆဲၫ့လၧယုဒၫအစဎွၩလဖၪ ထီးမုဆၫလနံၩယီၩ",
			"7": "<sup>7</sup> လီၫ.- တၭမုနံၩလဖၪ လၧစဒၫဝံၭအီၪဝ့ၫလၧၦဖလံၡၫ ဖိၪအခးဖၧၩ့နီၪအီၪဝ့ၫလနံၪ့ ဒဲလၩလံဘံၪ့လီၫ.",
			"8": "<sup>8</sup> တၭစဒၫဝံၭဒဲအၡၩလ့ၩနုၬ လၧၦဂ့ၭရှုၫဖိၪအကျၩ, ဒဲၦဂံဇၧၫဖိၪအကျၩ, ဒဲၦအၫမလ့ၭဖိၪအကျၩလီၫ. အ ဂဲးဘဲၫယီၩ လၧဖျိၩ့အဝ့ၫၥံၪနီၪ မွဲၦခးဖိၪထီးနလ့ၩဖိး",
			"9": "<sup>9</sup> လၧၡၧၫ,ဒဲလၧခးအံဇံၭလီၫ.- စဒၫဝံၭဖ့ၬခွံၬ ၦခးဖိၪ နီၪတၭ,ၦမုၪမွဲဂ့ၩ, ၦခွၫမွဲဂ့ၩ, အီၪက့ၪလၩ့ထးမၧၫ့ဝ့ၫ နးဂၩအ့ၬ. တၭထဲၩ့ဆိၬခွံၬၥိၪၥံၪဘ့ၪၥံၪ, ဒဲချီဖၫၥံၪ,ဒဲ ကၥ့ၪယီၩ့ၥံၪ, ဒဲကလအူၭၥံၪ, ဒဲဆၧအကီၩ့အၥိၭတၭ,",
			"10": "<sup>10</sup> ထဲၩ့ထဲၩ့ဝ့ၫလၧစအၫခ့ၭအအီၪလီၫ.- တၭစအၫခ့ၭစံၭ စဒၫဝံၭ, နၥံၪမၩဘုၪ့ဖျီၫ့ဆၧလၧမုဆၫလနံၩယီၩခီၫခီၫ လဲၪ,တၭစဒၫဝံၭစံၭဝ့ၫဒၪ, လၧယုဒၫမုခံၫ့လခီၫ, ဒဲလၧ ၦယ့ၫရမံၫအ့လၭဖိၪလၧမုခံၫ့လခီၫ ဒဲလၧၦကံၫ့နဲၭဖိၪ",
			"11": "<sup>11</sup> လၧမုခံၫ့လခီၫလီၫ.- တၭၦမုၪမွဲဂ့ၩ, ၦခွၫမွဲဂ့ၩ,စဒၫဝံၭ ဒုၭမၧၫ့ဝ့ၫဘဲၫၥိၭအမိဂဲၫလၧ ဂၫၥၭနးဂၩအ့ၬ. စံၭဝ့ၫ ဒၪ,မိဒုၭနဲၪဘၪခိၬဆၧလၧပဂဲးပကၠီၪ့တၭ, စံၭစဒၫဝံၭ မၩဘဲၫနီၪလီၫ. တၭမိမၩဝ့ၫဘဲၫနီၪဘဲၫအထူၫအရူၫအ ၥိၭနီၪကိၭမုနံၩမုနၩဒ့ၭလၧအအီၪဝ့ၫ လၧၦဖလံၡၫဖိၪ",
			"12": "<sup>12</sup> အခးဖၧၩ့နီၪလီၫ.- စအၫခ့ၭနီၪနဲၩစဒၫဝံၭတၭ, စံၭဝ့ၫ ဒၪ,အဝ့ၫဒၪမၩယူၭ ဘဲၫအံၫစရ့လၭ အဆၨၩဒၪဝ့ၫ မိၥၭလိၪတၡါအဝ့ၫလီၫ. မၩအၥၭဘဲၫနီၪတၭ မိဘၪ ကဲၪထၪ့ဝ့ၫလၧယခ့ၫယၡၩ လၩ့ဆိၩလၩ့ကၠၪလီၫ."
		},
		"28": {
			"1": "<sup>1</sup> တၭဆၧမၩအၥၭလၧမုနံၩလဖၪနီၪ ၦဖလံၡၫဖိၪဒုၭ အီၪကိၩ့အီၪကီၪ့အၥုၭမုခမျၧး လၧဒုၭဆၧအဂး,ဘဲၫ ၥိၭအမိဒုၭၥုၭလၧအံၫစရ့လၭလီၫ. တၭစအၫခ့ၭစံၭစ ဒၫဝံၭ,ၥ့ၪယၫတၡါလၧ နမိဘၪလ့ၩထၪ့ဒုၭဆၧလၧယ",
			"2": "<sup>2</sup> ၥိၭနဝ့ၫဒၪဒဲနၡၩၥံၪလီၫ.- စဒၫဝံၭစံၭစအၫခ့ၭ, မွဲမၬ, နမိၥ့ၪယၫဆၧလၧနခ့ၫနၡၩမိမၩဘၪလီၫ. တၭစအၫ ခ့ၭစံၭစဒၫဝံၭ, မၩအၥၭဘဲၫနီၪတၭ, ယမိအီၪက့ၪနၧၩ လၧၦယိယခိၪဎွံၪကိၭမုနံၩမုနၩဒ့ၭလီၫ.",
			"3": "<sup>3</sup> စစၫမုၫအ့လၭၥံၫယူၭတၭ, အံၫစရ့လၭထီးအလူၬ ဂၪ့ဝ့ၫလၧအကၠီၩ့တၭ, ခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧရၫမၫ လၧအဒိၩ့ဒၪဝ့ၫအဖၧၩ့လီၫ. တၭၦလၧဆၧနၪအီၪလၧ အလီၩ့လဖၪ, ဒဲဆၧယူၬလဖၪနီၪ စစီလူၫၥုၭခွံၬယူၭ လၧထံၫၥံၪခးၥံၪအဖၧၩ့လီၫ.",
			"4": "<sup>4</sup> ၦဖလံၡၫဖိၪအီၪကိၩ့အီၪကီၪ့တၭ, လ့ၩၥုၪ့တဲၩလၧ ရှုနံၫ့အဖၧၩ့နီၪတၭ, စစီလူၫဒုၭအီၪကိၩ့အီၪကီၪ့အံၫ စရ့လၭထီးအလူၬတၭ, အဝ့ၫၥံၪၥုၪ့တဲၩလၧဂံၫလဘိ",
			"5": "<sup>5</sup> အၫအလီၩ့လီၫ.- ထီးစစီလူၫဒၪဘၪၦဖလံၡၫဖိၪအၥုၭ မုခမျၧးတၭ, ၥၭမဲၪၥၭဖျဲၩ့ဆၧတၭ, အၥၭဝၭထိၬဒိၪ",
			"6": "<sup>6</sup> မၬလီၫ.- တၭထီးစစီလူၫအၪ့စၪ့ဆၧလၧ ယဟိဝၩ လၧဆၧမံၫမးမွဲဂ့ၩ, လၧယုရံၫ့မွဲဂ့ၩ, လၧမီၪလဖၪမွဲဂ့ၩ,",
			"7": "<sup>7</sup> ယဟိဝၩစံၭဆၧၫ့ဝ့ၫအ့ၬ.- တၭစစီလူၫစံၭအခ့ၫအ ၡၩ,အၪ့ဎၬန့ယၧၩ လၧၦမုၪလၧဆၧနၪအီၪ လၧအ လီၩ့လဂၩ,ဘဲၫၥိၭ ယမိလ့ၩဆၧလၧအအီၪ ဒဲအၪ့စၪ့ ဆၧလၧအဝ့ၫဒၪဘီၪ. တၭအခ့ၫအၡၩစံၭအဝ့ၫ, ယိ ခွါ, ၦမုၪလၧဆၧနၪအီၪလၧအလီၩ့ အီၪဝ့ၫလၧအံၪ့ဒီၫ လဂၩလီၫ.",
			"8": "<sup>8</sup> စစီလူၫမၩလၩ့မဲၩအၥၭတၭ, ၥိၭဆၧအကီၩ့အၥိၭ အဂူၫဂၩနီၪ, လ့ၩဝ့ၫတၭ, ၦနံၫဂၩလ့ၩလၧအၥိၭတၭ, လ့ၩထီၩ့လၧၦမုၪအအီၪ လၧမုနၩလခီၫလီၫ. တၭစံၭ ဝ့ၫဒၪ,အၪ့ဖၩ့ဆၧလၧယဂး လၧဆၧနၪနီၪအကၠီၩ့တၭ, ဒုၭဂဲၫထၪ့ၦလဂၩနီၪ လၧယဂးလၧယမိလီၩဘၪနၧၩ",
			"9": "<sup>9</sup> နီၪဆံၭ.- တၭၦမုၪနီၪစံၭအဝ့ၫ,ယိခွါ, ဆၧလၧစစီလူၫ မၩယူၭလၧအဒၪ့ထ့ၬခွံၬ ၦလၧဆၧနၪအီၪလၧအလီၩ့ လဖၪ,ဒဲဆၧယူၬလဖၪ လၧထံၫၥံၪခးၥံၪအဖၧၩ့နီၪနၥ့ၪ ယၫလီၫ. မၩအၥၭဘဲၫနီၪတၭ နအီၪက့ၪဖျံၩခွၩ့လၧယ",
			"10": "<sup>10</sup> ၥၭမၧၫ့အဂးဘဲၫၥိၭယမိဘၪၥံၫနီၪ, မွဲဘၪလဲၪ.- စစီ လူၫဆိၪလၩ့အၥၭ လၧအဝ့ၫ လၧယဟိဝၩအမ့ၬယၫ တၭ,စံၭဝ့ၫဒၪ, ယဟိဝၩမၧၫ့ဝ့ၫတၭ, ဆၧဒဲၩဘၭမိဘၪ",
			"11": "<sup>11</sup> နၧၩလၧဆၧယီၩအကၠီၩ့နးမံၩ့အ့ၬ.- ထီးနီၪလဖၧၫ့ၦ မုၪနီၪစံၭဝ့ၫဒၪ, ယမိဘၪဒုၭဂဲၫထၪ့ပလၫ လၧနဂးလ ဂၩလဲၪ.တၭအဆၧစံၭဝ့ၫဒၪ, ဒုၭဂဲၫထၪ့စစၫမုၫအ့ လၭလဂၩနီၪလၧယဂးဘီၪ.",
			"12": "<sup>12</sup> ထီးၦမုၪနီၪဒၪဘၪစစၫမုၫအ့လၭတၭ, ကိၭၡၭထၪ့ လၧအလူဖၭဒိၪတၭ, ၦမုၪနီၪချဲၩ့ဆၧလၧစစီလူၫတၭ, စံၭဝ့ၫဒၪ, နအၪ့လီၫန့ယၧၩမွဲဘၪလဲၪ, နဝ့ၫဒၪနမွဲစစီ",
			"13": "<sup>13</sup> လူၫလီၫ.- တၭစဎွၩစံၭအဝ့ၫ, ၥၭမဲၪဆၧလဂ့ၩ, အဂဲး ဘဲၫယီၩနဒၪဆၧနီၪလမံၩ့လဲၪ. တၭၦမုၪနီၪစံၭစစီလူၫ,",
			"14": "<sup>14</sup> ယဒၪဘၪကဆါဂဲၫထၪ့ လၧဂၪ့ခိၪလၬလီၫ.- တၭအ ဝ့ၫဒၪစံၭအဝ့ၫအခံးအဂၩ့ဘဲၫၥ့ၪလဲၪ. တၭၦမုၪနီၪစံၭ ဝ့ၫဒၪ,ၦၥၭၡါလဂၩဂဲၫထၪ့လုၬဘံၭအၥၭ လၧဖၬဘဲၩ့ လဘံၪ့လီၫ. တၭစစီလူၫၥ့ၪယၫဝ့ၫလၧအမွဲစစၫမုၫအ့ လၭတၭ, ၡီၫ့လၩ့အခိၪထီၩ့လၧဂၪ့ခိၪတၭထွံၩလၩ့အ ၥၭလီၫ.",
			"15": "<sup>15</sup> တၭစစၫမုၫအ့လၭစံၭစစီလူၫ နမၩခိမၩဝီၩယၧၩ ဘဲၫၥိၭနမိဒုၭဂဲၫထၪ့ယၧၩမွဲဘၪလဲၪ. တၭစစီလူၫစံၭ ဆၧၫ့ဝ့ၫဒၪ,ယဘၪဆၧခိဆၧဝီၩဒိၪမၬလီၫ. အဂဲးဘဲၫ ယီၩၦဖလံၡၫဖိၪ ဒုၭဆၧလၧယၧၩတၭ, ယွၩစဲၪ့ဒၪယူၭ ယၧၩယူၭတၭ, လၧမီၪလဖၪမွဲဂ့ၩ, လၧဆၧမံၫမးမွဲဂ့ၩ, စံၭဆၧၫ့လၧၩ့ယၧၩအ့ၬ. အခိးမွဲဘဲၫနီၪတၭ, ယကိၭ ထၪ့ယူၭနၧၩဘဲၫၥိၭယမိဘၪမၩ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪ",
			"16": "<sup>16</sup> နီၪ,နမိဒုၭၥ့ၪယၫယၧၩလီၫ.- တၭစစၫမုၫအ့လၭစံၭဝ့ၫ ဒၪ,မွဲလၧယဟိဝၩစဲၪ့ဒၪယူၭနၧၩနီၪ, ကဲၪထၪ့ယူၭနဒုၪ",
			"17": "<sup>17</sup> နဒၩတၭ, နအၪ့စၪ့ယၧၩမွဲဘၪလဲၪ.- ယဟိဝၩမၩလၧ အဂး ဘဲၫအချဲၩ့ဆၧလၧယစူၪဖၧၩ့အၥိၭနီၪလီၫ. အ ဂဲးဘဲၫယီၩ ယဟိဝၩ ထုၭထၪ့ခွံၬယူၭဘၩ့ၥံၪမုးၥံၪ နီၪလၧနစူၪဖၧၩ့တၭ, ဖ့ၪလၫ့ခွံၬယူၭ လၧၦလၧနနဲၩ့",
			"18": "<sup>18</sup> ထံၭ,စဒၫဝံၭနီၪယူၭ.- အဂဲးဘဲၫယီၩ မွဲနလခိၭနၪဘၪ ယဟိဝၩအလူအထၫတၭ, လမၩဘၪဘဲၫအၥၭထၪ့ ဆီၪ့လၧအၫမလ့ၭအလီၩ့နီၪတၭ, အခိးမွဲယဟိဝၩမၩ",
			"19": "<sup>19</sup> ယူၭနၧၩလၧဆၧယီၩလၧမုလနံၩယီၩလီၫ.- တၭယဟိ ဝၩမိဖ့ၪလၫ့ခွံၬအံၫစရ့လၭဒဲနၧၩ လၧၦဖလံၡၫဖိၪအ စူၪဖၧၩ့တၭ, ကဲဂီၩခိၬနီၪနဝ့ၫဒၪ ဒဲနဖိၪခွၫလဖၪမိအီၪ လၧယၥိၭလီၫ. ယဟိဝၩမိဖ့ၪလၫ့ခွံၬဆ့ အံၫစရ့လၭ အၥုၭမုခမျၧးလၧ ၦဖလံၡၫဖိၪအစူၪဖၧၩ့လီၫ.",
			"20": "<sup>20</sup> စစီလူၫလၩ့ထံၩဖါ ထၧၫ့ဂၩယၫလၧဂၪ့ခိၪတၭ, ၥၭ မဲၪဆၧဒိၪဒိၪလ့ၬလၧစစၫမုၫအ့လၭ အဆၧချဲၩ့အကၠီၩ့ လီၫ.ဆၧအဂဲးအဘၭ လအီၪဘၪလၧအဖၧၩ့း အဂဲး ဘဲၫယီၩမုလနံၩနီၪၥံၫ့နံၩချီၩ့, ဒဲၥၫ့နၩချီၩ့နီၪအၪ့ဆၧ",
			"21": "<sup>21</sup> နးမံၩ့အ့ၬ.- ၦမုၪနီၪဂဲၫဝ့ၫလၧစစီလူၫအအီၪတၭ, ဒၪ ဘၪဝ့ၫလၧအဘၪခိဘၪဝီၩ ဒိၪဒိၪလ့ၬတၭ, စံၭအဝ့ၫ, ယိခွါ,နဎီးမုၪခိၭနၪနလူတၭ, ယအီၪက့ၪယၥၭမၧၫ့ လၧယစူၪဖၧၩ့တၭ, ယခိၭနၪယူၭဆၧချဲၩ့လၧနချဲၩ့ဆၧ",
			"22": "<sup>22</sup> လၧယၧၩယူၭ.- တၭဘိၩ့နဲၪ့ယီၩ ခိၭနၪလါနဝ့ၫလၧ နဎီးမုၪအလူတၭ, ဒုၭအီၪက့ၪယၧၩလၧကိၪလလီၪ့လၧ နမ့ၬယၫတၭ, အၪ့ဆၧဘဲၫၥိၭထီးနလ့ၩဖိၬနဖၧၩ့ၥၭနီၪ,",
			"23": "<sup>23</sup> နမိအီၪလၧနဂဲးနဘၭနီၪဆံၭ.- မွဲလါနၫ့အဝ့ၫဂဲးလိၬဝ့ၫ တၭစံၭဝ့ၫဒၪ, ယအၪ့အ့ၬ. မွဲလါနၫ့အခ့ၫအၡၩဒဲၦမုၪ နီၪမၩဆီၪ့အဝ့ၫတၭ, ခိၭနၪအဝ့ၫၥံၪအလူလီၫ. တၭဂဲ ထုၪ့ဝ့ၫလၧဂၪ့ခိၪတၭ, ဆၧၫ့နၩ့လၧလးမံၫ အဖၫ့ခိၪ",
			"24": "<sup>24</sup> လီၫ.- ၦမုၪနီၪအီၪလၧချီဖိၪအဘီၪ့လဒုၩနီၪ, မၩဝ့ၫချဲၫ့ ချဲၫ့တၭ,မၩန့ကိၪမုၬတၭ, ဘံၭဝ့ၫတၭ, အၪ့ဎိၪကိၪလ",
			"25": "<sup>25</sup> လဲၩဎုၬဘၪလၧမံၪလၧအဝ့ၫနီၪလီၫ.- ဂဲၫဆိၬအီၪက့ၪ ဝ့ၫလၧစစီလူၫအမ့ၬယၫ, ဒဲလၧအခ့ၫအၡၩအမ့ၬယၫ တၭ,အဝ့ၫၥံၪအၪ့ဝ့ၫလီၫ. ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪ,ဂဲ ထုၪ့တၭ,စဲၪ့ထၪ့ခွံၬလၧ မုလနၩနီၪလီၫ."
		},
		"29": {
			"1": "<sup>1</sup> ၦဖလံၡၫဖိၪဒုၭအီၪကိၩ့အီၪကီၪ့အၥုၭမုထီးအလူၬ လၧအၫဖ့ၭတၭ, အံၫစရ့လၭၥုၪ့တဲၩလၧထံၫထၪ့ဖျိၭ လစီၪ့အနဲၩ့လၧအအီၪ လၧယ့ၭစရ့လၭအဖၧၩ့နီၪ",
			"2": "<sup>2</sup> လီၫ.- တၭၦဖလံၡၫဖိၪအၦဒိၪ လ့ၩလၧယၫၦအယၩ လဖၪ,ဒဲအထီၫ့လဖၪလီၫ. အ့ၪမွဲစဒၫဝံၭဒဲအၡၩလဖၪ နီၪလ့ၩဝ့ၫလၧအလးခဲၫ့ လၧစအၫခ့ၭအၥိၭနီၪလီၫ.",
			"3": "<sup>3</sup> တၭၦဖလံၡၫဖိၪအခိၪလဖၪစံၭဝ့ၫဒၪ, ၦဟံဘြူၫဖိၪလ ဖၪယီၩမွဲဘဲၫၥ့ၪလဲၪ. တၭစအၫခ့ၭစံၭၦဖလံၡၫဖိၪအ ခိၪလဖၪနီၪ, ၦလဂၩယီၩမွဲအံၫစရ့လၭအစဎွၩစစီလူၫ အခ့ၫအၡၩစဒၫဝံၭလၧအအီၪလၧ ယၥိၭမုနံၩဎွ့ၩအံၩ ဎွ့ၩအိၩ,နံၪ့ဎွ့ၩအံၩဎွ့ၩအိၩတၭ, ခီၫလၧအလၩ့ဘၪ လၧယစူၪဖၧၩ့နီၪ ယလဒၪဘၪဆၧမၪလၧအလီၩ့, မွဲ",
			"4": "<sup>4</sup> အ့ၬဧၪ.- တၭၦဖလံၡၫဖိၪအခိၪလဖၪ ၥၭထၪ့ဘၪအဝ့ၫ တၭ,ၦဖလံၡၫဖိၪအခိၪလဖၪစံၭအဝ့ၫ, ဒုၭထဲၩ့ထဲၩ့ၦ လဂၩယီၩဘဲၫၥိၭ အမိထဲၩ့ထဲၩ့ထီးအလးလၧနမိအီၪ က့ၪလၩ့လၧအဂးဘီၪ. ဒုၭလ့ၩလၩ့အဝ့ၫ လၧဆၧဒုၭ ၥုၭအဖၧၩ့လၧပၥိၭလဂ့ၩ, ဘၪလဘၪမိကဲၪထၪ့ဘၪ ခိၬပဒုၪပဒၩလၧဆၧဒုၭၥုၭအဖၧၩ့လီၫ. မိမၩဘၪလိၬ အိၭလိၬထဲၩ့အၥၭလၧအကဆါ လၧဆၧနီၪလမံၩ့လဲၪ.",
			"5": "<sup>5</sup> လၧၦလဖၪယီၩအခိၪဎွံၪလဖၪအကၠီၩ့, မွဲအ့ၬဧၪ.- ၦ လဂၩယီၩမွဲစဒၫဝံၭ လၧၦဂဲထုၪ့လံစံၭဆၧၫ့လိၬအၥၭ တၭ,စံၭလၧအဂဲးအကၠီၪ့, စစီလူၫမၩၥံၫယူၭၦအထီၫ့လဖၪ, စဒၫဝံၭနီၪၦအလၬလဖၪယူၭနီၪ, မွဲအ့ၬဧၪ.",
			"6": "<sup>6</sup> ထီးနီၪလဖၧၫ့စအၫခ့ၭကိၭန့စဒၫဝံၭတၭ, စံၭဝ့ၫ,မွဲ မၬ,ယဟိဝၩမၧၫ့ဝ့ၫ, နတီၩယူၭနလီၩ့ယူၭ, နလ့ၩထၪ့ ဂဲၫနုၬလၧၦၥုၭမုခမျၧးအကျၩနီၪ ဂ့ၩလၧယမ့ၬယၫ လီၫ. အဂဲးဘဲၫယီၩ မုနံၩလနံၩလၧနဂဲၫ လၧယအီၪ ထီးမုဆၫလနံၩယီၩ ယဒၪဘၪ ဆၧအၧၩ့လၧနလီၩ့ အ့ၬ. မွဲလါနၫ့ဘဲၫနီၪတၭနဂ့ၩ လၧၦဒိၪဖၭဒိၪအမ့ၬ",
			"7": "<sup>7</sup> ယၫအ့ၬ.- အခိးမွဲဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩထဲၩ့ထဲၩ့ တၭ,လ့ၩဆၧမုၬမုၬဘဲၫၥိၭ နထီးမၩဆၧအၧၩ့လၧၦဖ",
			"8": "<sup>8</sup> လံၡၫဖိၪအၦဒိၪဖၭဒိၪအမ့ၬယၫနီၪလဂ့ၩ,ဧီၪ.- တၭ စဒၫဝံၭစံၭစအၫခ့ၭ, ယမၩဆၧနီၪလမံၩ့လဲၪ. ခီၫလၧ ယအီၪယူၭလၧနၥိၭခီးမုဆၫလနံၩယီၩ, ဘဲၫၥိၭယထီး လ့ၩဒုၭဆၧလၧယကဆါစဎွၩ အဒုၪအဒၩလဂ့ၩနီၪ,",
			"9": "<sup>9</sup> နဒၪဘၪဆၧလၧနခ့ၫနၡၩအဖၧၩ့, ဘဲၫၥ့ၪလဲၪ.- စအၫ ခ့ၭစံၭဆၧၫ့ဆၧတၭ, စံၭစဒၫဝံၭ, ယၥ့ၪယၫလၧနဂ့ၩန ဝ့ၫလၧယမ့ၬယၫဘဲၫယွၩအၥီၫ့လဂၩအၥိၭနီၪ, မွဲလါ နၫ့တၭ,ၦဖလံၡၫဖိၪအခိၪလဖၪစံၭဝ့ၫ, အဝ့ၫဒၪမိလ့ၩ",
			"10": "<sup>10</sup> ဘၪလၧပၥိၭလၧဆၧဒုၭၥုၭအဖၧၩ့အ့ၬ.- တၭဘိၩ့နဲၪ့ ယီၩဂဲထုၪ့လၧမုဆဲၪ့ထၪ့နီၪဂီၩဂီၩ, ဒဲနကဆါအခ့ၫအ ၡၩလၧအဂဲၫလၧနၥိၭတၭ, ထီးနၥံၪဂဲထုၪ့ လၧမုဆဲၪ့ ထၪ့ဂီၩဂီၩတၭ, ဆၧဖၩ့ထၪ့နီၪ, စဲၪ့ထၪ့ခွံၬဘီၪ.",
			"11": "<sup>11</sup> အခိးမွဲစဒၫဝံၭ ဒဲအၡၩၥံၪဂဲထုၪ့ဂီၩဂီၩဘဲၫၥိၭအမိ စဲၪ့ထၪ့ခွံၬလၧမုဆဲၪ့ထၪ့နီၪတၭ, ထဲၩ့ထဲၩ့ဝ့ၫလၧၦဖ လံၡၫဖိၪအထံၫအခးတၭ, ၦဖလံၡၫဖိၪၥံၪလ့ၩထၪ့ ထီၩ့လၧယ့ၭစရ့လၭလီၫ."
		},
		"30": {
			"1": "<sup>1</sup> ၥၧၫ့နံၩလနံၩနီၪ စဒၫဝံၭဒဲအၡၩၥံၪဂဲၫထီၩ့လၧဇံၭ လၭတၭ, ဆၧမၩအၥၭလၧၦအၫမလ့ၭဖိၪ ဂဲၫနုၬယူၭ လၧမုခံၫ့လခီၫ, လၧဇံလၭတၭ, ဖ့ၬခွံၬယူၭဇံလၭနီၪ,",
			"2": "<sup>2</sup> ဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪး- ဒဲဖီၪ့န့အၪ့မၧၫ့ဎီးၦမုၪလဖၪ လၧအအီၪဝ့ၫလၧအဖၧၩ့တၭ, အဒိၪမွဲဂ့ၩအဆံၭမွဲဂ့ၩ မၩၥံၫဝ့ၫနးဂၩအ့ၬ. ဆိၬန့ခွံၬဝ့ၫတၭ, လ့ၩဆၧလီၫ.",
			"3": "<sup>3</sup> စဒၫဝံၭဒဲအၡၩၥံၪဂဲၫထီၩ့ လၧဒိၩ့ဖၧၩ့တၭယိခွါ, ဆၧ ဆူၭထၪ့ယူၭလၧမ့ၪလီၫ. တၭအမၫၥံၪ, ဒဲအဖိၪခွၫၥံၪ,",
			"4": "<sup>4</sup> ဒဲအဖိၪမုၪၥံၪနီၪ, ဆၧဖီၪ့န့အၪ့မၧၫ့ဎီးဝ့ၫလီၫ.- ထီးနီၪ လဖၧၫ့စဒၫဝံၭဒဲအၡၩခမျၧး အီၪလၧအၥိၭနီၪထုၭထၪ့",
			"5": "<sup>5</sup> အလူတၭ, ဂၪ့ဝ့ၫထီးအဂၪ့လကဲၪလၧၩ့ဘၪလီၫ.- တၭ ဆၧဖီၪ့န့အၪ့မၧၫ့ဎီးစဒၫဝံၭအမၫနံၫဂၩ, ယ့ၭစရ့လၭ ဖိၪနးအဟံၫ့နိၫအၫ့, ဒဲၦကၫမလၭဖိၪစနၫဘလၭအမၫ",
			"6": "<sup>6</sup> နးအၭဘဂၫလၭလီၫ.- တၭစဒၫဝံၭဘၪ ဆၧခိဆၧဝီၩ ဒိၪမၬလီၫ. အဂဲးဘဲၫယီၩ ၦခမျၧးမိခွံၬဝ့ၫလၧလိးလီၫ. အဂဲးဘဲၫယီၩ ၦခမျၧးထီးအလူၬနီၪအၥၭမုၬအ့ၬ. လ ဂၩလၧအဖိၪခွၫလဖၪအကၠီၩ့, လဂၩလၧအဖိၪမုၪလ ဖၪအကၠီၩ့ဆုၬဆုၬလီၫ. အ့ၪမွဲစဒၫဝံၭအီၪက့ၪဆီၪ့အ ၥၭလၧယဟိဝၩယွၩအဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> တၭစဒၫဝံၭစံၭၦလုဆၧ စအဟံမလ့ၭအဖိၪခွၫစ အဘဲအၥၫ,ဂဲၫဆိၬန့ယၧၩ လၧအ့ဖိၭလဘံၪ့နီၪဆံၭ.တၭ စအဘဲအၥၫဂဲၫဆိၬအ့ဖိၭလဘံၪ့နီၪ လၧစဒၫဝံၭအအီၪ",
			"8": "<sup>8</sup> လီၫ.- စဒၫဝံၭအၪ့စၪ့ဆၧလၧယဟိဝၩတၭ, စံၭဝ့ၫဒၪ, မွဲယမိဘၪလီၩ့ဆီးၦလဒီၪ့နီၪဆ့ဧၪ. ယမိချႃၭန့ဧၪ. တၭအဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ, လီၩ့ဆီးဘီၪ, အဂဲးဘဲၫယီၩ",
			"9": "<sup>9</sup> နမိချႃၭန့ဝ့ၫတၡါ, ဒဲမၩန့ထဲၩ့ဆၧထီးအလူၬလီၫ.- အ ခိးမွဲစဒၫဝံၭလ့ၩဆၧ, အဝ့ၫဒၪ, ဒဲၦဎူၫယၩလၧအအီၪ လၧအစူၪဖၧၩ့တၭ, လ့ၩထီၩ့လၧထံၫချိၬဘံစီၫ, ထီး အလးလၧၦဘၪဆၧအီၪက့ၪလၩ့ထးဝ့ၫလဖၪ အီၪဝ့ၫ",
			"10": "<sup>10</sup> လီၫ.- စဒၫဝံၭလီၩ့ဆီးဆၧ, အဝ့ၫဒၪ,ဒဲၦလံယၩ,အဂဲး ဘဲၫယီၩ ၦလၧအဂဲးအဘၭလၩ့ဆါ ထီးအခၫ့ဂၬထံၫ ချိၬဘံစီၫလကဲၪဘၪနံၫယၩနီၪ အီၪလၩ့ထးဝ့ၫ လၧအ လးခဲၫ့လီၫ.",
			"11": "<sup>11</sup> အဝ့ၫၥံၪဒၪန့ၦအံဇံၭဖိၪလဂၩ လၧဆၧပျၩ့ဖၧၩ့တၭ, ဂဲၫၥိၫ့ဝ့ၫလၧစဒၫဝံၭအအီၪဖ့ၪလၫ့ဝ့ၫ လၧကိၪတၭ,အၪ့",
			"12": "<sup>12</sup> ဝ့ၫ,ဒဲၦဒုၭအီၩဝ့ၫလၧထံၫ,- ဒဲဖ့ၪလၫ့ဝ့ၫလၧချိၪ့ဒိၩ့ၥၪ ခိလီၪ့ပၪပဲၪလကဲၩ့, ဒဲစဘံၭၥၪဎဲၫ့နံၫဆူၭနီၪ, အၪ့ဝ့ၫ ဂီၩ့တၭ,အၥၭဂုးထၪ့ထဲၩ့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ၥၧၫ့ နံၩဒဲၥၧၫ့နၩအထးဖၧၩ့နီၪအၪ့ဘၪဆၧအ့ၬ, ဒဲအီၩဘၪ",
			"13": "<sup>13</sup> ထံၫဆ့အ့ၬ.- တၭစဒၫဝံၭစံၭအဝ့ၫ, နဘၪဆဲၫ့လၧပလၫ လဂၩလဲၪ. နဂဲၫအထံၭခီၫခီၫလဲၪ. တၭအဝ့ၫဒၪစံၭဝ့ၫ, ယမွဲၦဖိၪၥၪခွၫ,လၧအံဇံၭၦအၫမလ့ၭဖိၪလဂၩအဎီး အၡၩတၭ, လၧၥၧၫ့နံၩဖီၩ့ခွံၬယူၭနီၪ ယဆၫထၪ့အ",
			"14": "<sup>14</sup> ကၠီၩ့တၭယကဆါအီၪက့ၪထးယၧၩလီၫ.- ပလ့ၩနုၬ လၧၦခ့ရ့ၭဖိၪအကျၩလၧမုခံၫ့လခီၫ ဒဲလၧဆၧဘၪဆဲၫ့ လၧယုဒၫ, ဒဲလၧကၫလ့ၭအမုခံၫ့လခီၫတၭ, ပဆူၭထၪ့",
			"15": "<sup>15</sup> ခွံၬဇံလၭလၧမ့ၪလီၫ.- တၭစဒၫဝံၭစံၭအဝ့ၫ, နၥိၫ့ ယၧၩလၧၦလဒီၪ့နီၪ အအီၪဘၪမိၥ့ၪဧၪ. အဝ့ၫဒၪစံၭ ဝ့ၫ,ဆိၪလၩ့နၥၭလၧယၧၩ လၧယွၩအမ့ၬယၫ, လၧန လမၩၥံၫဘၪယၧၩ ဒဲနလဖ့ၪလၫ့ခွံၬဘၪယၧၩလၧယ ကဆါအစူၪဖၧၩ့နီၪဆံၭ, တၭယမိၥိၫ့နၧၩလၧၦလဒီၪ့ နီၪအအီၪလီၫ.",
			"16": "<sup>16</sup> ထီးအၥိၫ့စိၩယူၭဝ့ၫနီၪ, ယိခွါ,ၦလၩ့ပြံၩလၩ့ပၩ ဎံၩ့ဂၪ့ခိၪဖၫ့ခိၪတၭ, အၪ့ဆၧဒဲအီၩဆၧတၭ, ဂဲထုၪ့လံ လီၫ.အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအၪ့ဂူၬန့ယူၭဆၧအၪအၪ လ့ၬလၧၦဖလံၡၫဖိၪအခးဖၧၩ့ ဒဲလၧယုဒၫအခးဖၧၩ့လီၫ.",
			"17": "<sup>17</sup> လၧမုဂၪလၩ့ထီၩ့လၩ့လၧမုဆဲၪ့ထၪ့လနံၩ အဂၪ လၩ့နီၪ,စဒၫဝံၭဖ့ၬခွံၬအဝ့ၫၥံၪတၭ, အ့ၪလမွဲဘၪၦဖိၪၥၪခွၫ လၧအထူၬကလအူၭတၭ, စဲၪ့ဖျိၭဝ့ၫလံယၩနီၪၦဖီၩ့ဖျ့ၭ",
			"18": "<sup>18</sup> ဘၪဝ့ၫနးဂၩအ့ၬ.- တၭစဒၫဝံၭမၩန့ထဲၩ့ကယဲဆၧလၧ ၦအၫမလ့ၭဖိၪၥံၪဆိၬန့ခွံၬဝ့ၫ, ဒဲအၪ့မၩန့ထဲၩ့အမၫနံၫ",
			"19": "<sup>19</sup> ဂၩနီၪလီၫ.- အဆံၭမွဲဂ့ၩ,အဒိၪမွဲဂ့ၩ, ၦအဖိၪခွၫၥံၪ မွဲဂ့ၩ,ၦအဖိၪမုၪၥံၪမွဲဂ့ၩ, ဆၧဖိၪဆၧလံၩမွဲဂ့ၩ, ထီး ဒၪဆၧလမံၩ့မံၩ့လၧအဝ့ၫၥံၪမၩန့ဝ့ၫမွဲဂ့ၩ, ဆၧလၩ့မါ",
			"20": "<sup>20</sup> နးမံၩ့အ့ၬ. စဒၫဝံၭမၩန့ထဲၩ့ဆၧထီးအလူၬလီၫ.- က ယဲၥိၪၥံၪဘ့ၪၥံၪ, ဒဲချီလၧၦနၫ့ဝ့ၫလၧဆၧဖိၪဆၧဎါအဒိၩ့ လဖၪအမ့ၬယၫနီၪ စဒၫဝံၭမၩန့ဝ့ၫတၭ,စံၭဝ့ၫဒၪ,ဆၧ ယီၩမွဲစဒၫဝံၭအဆၧအၪ့ဂူၬန့လီၫ.",
			"21": "<sup>21</sup> စဒၫဝံၭထဲၩ့ထဲၩ့ လၧၦအဂဲးအဘၭလၩ့ဆါထီးအ ဖိၬစဒၫဝံၭအခဲၫ့လကဲၪဘၪနံၫယၩ လၧအဒုၭအီၪဝ့ၫ လၧထံၫချိၬ ဘံစီၫအနဲၩ့တၭ, အဝ့ၫၥံၪဂဲၫအၪ့ဂၬစဒၫ ဝံၭ,ဒဲဂဲၫအၪ့ဂၬၦအီၪလၧအစူၪဖၧၩ့တၭ, ထီးစဒၫဝံၭ ဂဲၫဘူၭလၧၦခမျၧးတၭ, အဝ့ၫဒၪချဲၩ့ဒုၪ့အဝ့ၫၥံၪလီၫ.",
			"22": "<sup>22</sup> ထီးနီၪလဖၧၫ့ၦအအၧၩ့အၥၫ့ ၦထီးအလူၬ, ဒဲၦဘၫ အလၭဖိၪလၧၦလၧအလ့ၩဖိၬ စဒၫဝံၭအခဲၫ့လဖၪအ ကျၩနီၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ,မွဲအဝ့ၫၥံၪလလ့ၩ ဘၪလၧပၥိၭတၭ, အ့ၪလမွဲဘၪအမၫ, ဒဲအဖိၪဒံၩဖိၪ ၥၪ,လဂၩလၧအဂးဒၪဝ့ၫ, လဂၩလၧအဂးဒၪဝ့ၫ ဆုၬ ဆုၬဘဲၫၥိၭအမိၥိၫ့ထၪ့တၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫနီၪပဖ့ၪလၫ့",
			"23": "<sup>23</sup> လၧဆၧအၪ့ဂူၬန့လၧပမၩန့ထဲၩ့ယီၩအ့ၬ.- ထီးနီၪလ ဖၧၫ့စဒၫဝံၭစံၭဝ့ၫဒၪ, ယထၧၫ့ဖုဝဲၥံၪဧ့, ဆၧလၧယဟိ ဝၩ,ၦလၧအယိထဲၩ့ခွါထဲၩ့ဒုၭဖီၩ့ဖျ့ၭပၧၩ, ဖ့ၪလၫ့ယူၭ ပၧၩ,ဒဲဖ့ၪလၫ့ခွံၬယူၭၦလၧအဂဲၫထၪ့ထၫ့ဒုၪဒၩပၧၩလ",
			"24": "<sup>24</sup> ဒီၪ့လၧပစူၪဖၧၩ့နီၪ, နၥံၪထီးမၩဘဲၫနီၪၥိၭလဂ့ၩ.- အ ဂဲးဘဲၫယီၩမွဲပလၫမိခိၭနၪနၥံၪအလူ လၧဆၧလမံၩ့ယီၩ အဂဲးအကၠီၪ့နီၪလဲၪ. ဘဲၫၦလၧအလ့ၩလၩ့လၧဒုၭၥုၭ အဖၧၩ့လဂၩအဂးအၥိၭနီၪ, ၦလၧအအီၪလၩ့ထးလၧ ဆၧဖိၪဆၧလံၩ အနဲၩ့လဂၩအဂးနီၪ မိမွဲဘဲၫနီၪၥိၭဆ့",
			"25": "<sup>25</sup> လီၫ.မိဘၪအၪ့နၩ့ဖၭဆၧအဆၧၫ့မီၪ့ဎီၩ့လီၫ.- တၭခီၫ ဒၪလၧမုလနံၩနီၪဆၧမၩအၥၭ လၧအအီၪက့ၪဆၧနီၪ လၧဆၧမၪလူၬ, ဒဲဆၧအထူၫအရူၫလၧအံၫစရ့လၭအ ဂးခီးမုဆၫလနံၩယီၩလီၫ.",
			"26": "<sup>26</sup> ထီးစဒၫဝံၭဂဲၫထီၩ့လၧဇံလၭတၭ, ဖ့ၪယုဆၧအၪ့ ဂူၬန့လနၩ့လၧၦယုဒၫဖိၪအၥၭၡါ, အထံၩအၥိၭလဖၪ တၭ,စံၭဝ့ၫဒၪ, ယိခွါ, လၬဆီၪ့လၧနၥံၪအဂးလၧဆၧ",
			"27": "<sup>27</sup> အၪ့ဂူၬန့လၧယဟိဝၩ အဒုၪအဒၩအကျၩနီၪလီၫ.-လၧ ၦအီၪဝ့ၫလၧဘ့ၥလၭအဖၧၩ့, ဒဲလၧၦအီၪဝ့ၫလၧရၫမီၭ အဖၧၩ့လၧမုခံၫ့လခီၫ, ဒဲလၧၦအီၪဝ့ၫလၧယၭတၧၫအ",
			"28": "<sup>28</sup> ဖၧၩ့,- ဒဲလၧၦအီၪဝ့ၫလၧအရိအၧၫအဖၧၩ့, ဒဲလၧၦ အီၪဝ့ၫလၧစံၭဖမီၭအဖၧၩ့, ဒဲလၧၦအီၪဝ့ၫလၧအ့ၭၡ",
			"29": "<sup>29</sup> တ့ၫမိအၫအဖၧၩ့,- ဒဲလၧၦအီၪဝ့ၫ လၧရၫခၫလၭအ ဖၧၩ့,ဒဲလၧၦအီၪဝ့ၫလၧ ၦယ့ၫရမံၫအ့လၭဖိၪအဒိၩ့လ ဖၪအဖၧၩ့, ဒဲလၧၦအီၪဝ့ၫလၧၦကံၫ့နဲၭဖိၪအဒိၩ့လဖၪ",
			"30": "<sup>30</sup> အဖၧၩ့,- ဒဲလၧၦအီၪဝ့ၫလၧဟီမၫအဖၧၩ့, ဒဲလၧၦအီၪ ဝ့ၫလၧခိရ့ၫၡၫ့အဖၧၩ့, ဒဲလၧၦအီၪဝ့ၫလၧအၭၥၭအ ဖၧၩ့,",
			"31": "<sup>31</sup> ဒဲလၧၦအီၪဝ့ၫလၧဟံဘြၧၫ့အဖၧၩ့, ဒဲလၧကယဲ ဆၧအီၪထးထီးစဒၫဝံၭအနၫ့ဆါဒၪဝ့ၫ, ဒဲအၡၩလဖၪ လ့ၩယုၩယါအဖၧၩ့လစီၪ့လါလါနီၪ ဖ့ၪယုဝ့ၫဒၪလီၫ."
		},
		"31": {
			"1": "<sup>1</sup> ၦဖလံၡၫဖိၪဒုၭ ဆၧလၧအံၫစရ့လၭတၭ, အံၫစရ့ လၭအၡၩစဲၪ့ဖျိၭလၧၦဖလံၡၫဖိၪအမ့ၬယၫတၭ,လၩ့",
			"2": "<sup>2</sup> ထံၩဖါၥံၫလၧခိၪလီၩ့ဂံၫလဘိအၫအလီၩ့လီၫ.- ၦဖလံ ၡၫဖိၪလီၩ့ဆီးချႃၭန့စစီလူၫဒဲအဖိၪခွၫလဖၪတၭ, ၦဖ လံၡၫဖိၪမၩၥံၫစစီလူၫအဖိၪခွၫၥံၪ, စစၪ့နၥၧၫ့,ဒဲစအဘံ",
			"3": "<sup>3</sup> နဒၭ,ဒဲစမ့ၫလခဲၫရှုၫအၫလီၫ.- ဆၧဒုၭၥုၭနီၪကဲၪထၪ့ ဆၧကၪလၧစစီလူၫအဂးတၭ, ၦခၭချံၪလဖၪခၭဘၪအ",
			"4": "<sup>4</sup> ဝ့ၫတၭ,အဆၧဆၫဒိၪမၬလီၫ.- စစီလူၫစံၭၦဆိၬအစူၪ ဝဲၩလဂၩ, ထုၭထၪ့နနၭတၭ, ဆ့ၭဖျီၫ့ယၧၩဘီၪ.ဘၪလ ဘၪၦလဒိၭဘၪဆၧကူၭတရံၭလဖၪနီၪ မိဂဲၫဆ့ၭဖျီၫ့ ဘၪခိၬယၧၩတၭ, မိမၩကြၩ့ထမးယၧၩလီၫ. မွဲလါနၫ့ ၦဆိၬအစူၪဝဲၩလဂၩနီၪမၩဝ့ၫအ့ၬ. အဂဲးဘဲၫယီၩၥၭ မဲၪဆၧဒိၪမၬလီၫ. အခိးမွဲဘဲၫနီၪတၭ, စစီလူၫမၩန့နၭ လဘံၪ့တၭ, ထိၪလၩ့ထံၩဖါအၥၭလၧအဖၫ့ခိၪလီၫ.-",
			"5": "<sup>5</sup> ထီးၦဆိၬအစူၪဝဲၩလဂၩနီၪ ဒၪဘၪဝ့ၫလၧစစီလူၫၥံၫ ယူၭတၭ, အဝ့ၫဒၪထိၪထံၩဖါလၩ့အၥၭ လၧအနၭလ ဘံၪ့အဖၫ့ခိၪဆ့တၭ, ၥံၫလၧအဝ့ၫဒၪအၥိၭလီၫ.",
			"6": "<sup>6</sup> တၭစစီလူၫၥံၫဝ့ၫ ဒဲအဖိၪခွၫၥၧၫ့ဂၩ, ဒဲၦဆိၬအစူၪ ဝဲၩလဂၩ,ဒဲအၡၩထီးအလူၬ လၧမုလနံၩဎးနီၪလီၫ.",
			"7": "<sup>7</sup> တၭထီးအံၫစရ့လၭအၡၩ လၧအအီၪလၧခိၪလီၩ့ ဆူၭဝါလခီၫ, ဒဲအီၪလၧယီၫဒၫ့ဝါလခီၫၥံၪနီၪဒၪဘၪဝ့ၫ လၧအံၫစရ့လၭ အၡၩစဲၪ့ဖျိၭဝ့ၫတၭ, စစီလူၫဒဲအဖိၪ ခွၫလဖၪၥံၫယူၭနီၪ, အဝ့ၫၥံၪစဲၪ့ဒၪခွံၬ ဒိၩ့လဖၪတၭ, စဲၪ့ဖျိၭဝ့ၫလီၫ. တၭၦဖလံၡၫဖိၪၥံၪဂဲၫအီၪဝ့ၫ လၧဒိၩ့ ၥံၪအဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> မုဆဲၪ့ထၪ့လနံၩနီၪထီးၦဖလံၡၫဖိၪၥံၪ ဂဲၫဘဲၪ့လၩ့ ခွံၬၦၥံၫအကီၩ့အၥိၭတၭ, ဆၧမၩအၥၭလၧအဒၪစစီ လူၫဒဲအဖိၪခွၫၥၧၫ့ဂၩလၩ့ထံၩဖါ လၧခိၪလီၩ့ဂံၫလဘိ",
			"9": "<sup>9</sup> အၫအလီၩ့လီၫ.- အဝ့ၫၥံၪ ဖ့ၬထ့ၬခွံၬဝ့ၫ အခိၬတၭ, ဘဲၪ့လၩ့ခွံၬဝ့ၫ အၥၭနၫပဒၩ့တၭ, အၪ့မၧၫ့ၦလ့ၩဆိၬ ဝံၩ့ဝၩ့လၧၦဖလံၡၫဖိၪ အခးဖၧၩ့ ဘဲၫၥိၭအမိလီၩလၩ့ လၬလၩ့ဆၧလၧအဆၧဂၩ့ လဖၪအဂံၪ့ဖၧၩ့, ဒဲလၧၦခ",
			"10": "<sup>10</sup> မျၧးလဖၪအကျၩလီၫ.- အီၪက့ၪဝ့ၫအဆၧၥၭနၫပဒၩ့ လၧအၭၡတြီၭအဖၧၩ့တၭ, မၩထၬအစွၪလၧဘ့ၭၥၡၫ့ အဒိၩ့ခိၪဒၧၩ့လီၫ.",
			"11": "<sup>11</sup> တၭထီးၦယၫဘ့ၭဂံလအၭဖိၪၥံၪ နါဂၧၫ့ဆၧလၧၦဖ",
			"12": "<sup>12</sup> လံၡၫဖိၪမၩစစီလူၫတၭ,- ၦၥုၭဖိၪထီးအလူၬ ဂဲထုၪ့ တၭ,လ့ၩဆၧၥၫ့နၩချီၩ့တၭ, မၩန့ခွံၬစစီလူၫအစွၪဒဲ အဖိၪခွၫလဖၪအစွၪၥံၪ လၧဘ့ၭၥၡၫ့အဒိၩ့ခိၪဒၧၩ့တၭ, ဂဲၫထဲၩ့န့ဝ့ၫလၧယၫဘ့ၭတၭ, ဎူလၩ့ခွံၬဝ့ၫထီးနီၪလီၫ.-",
			"13": "<sup>13</sup> အဝ့ၫၥံၪမၩန့ထဲၩ့အဎွံၪတၭ, ခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧၥံၪ့ လထံၭအဖၫ့လၬ ထီးယၫဘ့ၭနီၪတၭ, ဒုၪဆၧအၪ့ဆၧ အီၩနွ့ၫနံၩလီၫ."
		}
	}
};
module.exports = book;